INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawy','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\"><span style=\"margin:0px;padding:0px;\">Lista form dostawy:</span></h4>\n<p style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;background-color:#ffffff;\">Paczkomaty Inpost<br style=\"margin:0px;padding:0px;\" />Kurier Inpost</p>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\"><span style=\"margin:0px;padding:0px;\">Przesyłki zagraniczne:</span></h4>\n<p style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;background-color:#ffffff;\">Kurier DPD<br style=\"margin:0px;padding:0px;\" />Poczta Polska<br style=\"margin:0px;padding:0px;\" />Packeta<br style=\"margin:0px;padding:0px;\" />DHL</p>','dostawy'),(2,1,1,'Polityka Prywatności','','Legal notice','notice, legal, credits','<h2 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;text-align:center;\">Polityka prywatności</h2>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">1. Administrator danych i definicje</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Administratorem danych osobowych Klientów / Użytkowników Sklepu Internetowego, zwany także Sprzedawcą, jest: GNOM – Artur Szymala, telefon: +48 660 527 787, NIP: 5471832783, REGON: 072373564.</li>\n<li style=\"margin:0px;padding:0px;\">Z Administratorem danych można kontaktować się:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">pod adresem korespondencyjnym: Szkolna 15A, 43-300 Bielsko-Biała;</li>\n<li style=\"margin:0px;padding:0px;\">pod adresem poczty elektronicznej: kontakt@gnom-sklep.pl.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Użytkownik</span> - osoba fizyczna wchodząca na stronę/strony Sklepu internetowego lub korzystająca z usług lub funkcjonalności opisanych w niniejszej Polityce Prywatności i Cookies.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Klient</span> - osoba fizyczna posiadająca pełną zdolność do czynności prawnych, osoba fizyczna będąca Konsumentem, osoba prawna albo jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną, która zawiera ze Sprzedawcą Umowę sprzedaży na odległość.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Sklep Internetowy</span> - serwis internetowy prowadzony przez Sprzedawcę, dostępny pod adresami elektronicznymi (stronami): <a href=\"https://gnom-sklep.pl/\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl</a> za pośrednictwem, którego Klient/Użytkownik może uzyskać informacje o Towarze i jego dostępności oraz kupić Towar lub zlecić świadczenie usługi.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Newsletter</span> - informacje, w tym informacje handlowe w rozumieniu ustawy z dnia 18 lipca 2002r. o świadczeniu usług drogą elektroniczną (Dz. U. z 2020 r. poz. 344) pochodzące od Sprzedawcy wysyłane Klientowi/Użytkownikowi drogą elektroniczną; jego otrzymywanie jest dobrowolne i wymaga zgody Klienta/Użytkownika.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Konto</span> - zbiór danych przechowywanych w Sklepie internetowym oraz w systemie teleinformatycznym Sprzedawcy dotyczący danego Klienta/Użytkownika oraz składanych przez niego zamówień i zawieranych umów, z wykorzystaniem którego Klient/Użytkownik może składać zamówienia oraz zawierać umowy.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">RODO</span> - Rozporządzenie Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osób fizycznych w związku z przetwarzaniem danych osobowych i w sprawie swobodnego przepływu takich danych oraz uchylenia dyrektywy 95/46/WE (ogólne rozporządzenie o ochronie danych).</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">2. Cele, podstawy prawne oraz czas przetwarzania danych</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">W celu realizacji Umowy sprzedaży na odległość Sprzedawca przetwarza:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">informacje dotyczące urządzenia Użytkownika w celu zapewnienia poprawności działania usług: adres IP komputera, informacje zawarte w plikach cookies lub innych podobnych technologiach, dane dotyczące sesji, dane przeglądarki internetowej, dane dotyczące urządzenia, dane dotyczące aktywności na Stronie, w tym na poszczególnych podstronach;</li>\n<li style=\"margin:0px;padding:0px;\">informacje o geolokalizacji, jeżeli Użytkownik wyraził zgodę na dostęp usługodawcy do geolokalizacji. Informacja o geolokalizacji jest wykorzystywana w celu dostarczania bardziej dostosowanych ofert produktów i usług;</li>\n<li style=\"margin:0px;padding:0px;\">dane osobowe Użytkowników: imię, nazwisko, adres siedziby, adres korespondencyjny, adres e-mail, numer telefonu, NIP, numer konta bankowego lub inne dane osobowe, których podanie jest niezbędne do zrealizowania zakupu, a których podania w procesie zakupowym wymaga Administrator.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Informacje te nie zawierają danych dotyczących tożsamości Użytkowników, lecz w połączeniu z innymi informacjami mogą stanowić dane osobowe i w związku z tym Administrator obejmuje je pełną ochroną przysługującą na gruncie RODO.</li>\n<li style=\"margin:0px;padding:0px;\">Dane te są przetwarzane zgodnie z art. 6 ust. 1 lit. b RODO, w celu realizacji usługi, tj. umowy o świadczenie usług drogą elektroniczną zgodnie z Regulaminem oraz zgodnie z art. 6 ust. 1 lit. a RODO, w związku z wyrażeniem zgody na stosowanie określonych plików cookies lub innych podobnych technologii, wyrażonych przez odpowiednie ustawienia przeglądarki internetowej zgodnie z Prawem telekomunikacyjnym lub w związku z wyrażeniem zgody na geolokalizację. Dane są przetwarzane do czasu zakończenia korzystania przez Klienta/Użytkownika ze Sklepu internetowego.</li>\n<li style=\"margin:0px;padding:0px;\">Administrator zobowiązuje się podjąć wszelkie środki wymagane na mocy art. 32 RODO, tj, uwzględniając stan wiedzy technicznej, koszt wdrażania oraz charakter, zakres i cele przetwarzania oraz ryzyko naruszenia praw lub wolności osób fizycznych o różnym prawdopodobieństwie wystąpienia i wadze, Administrator wdraża odpowiednie środki techniczne i organizacyjne, aby zapewnić stopień bezpieczeństwa odpowiadający temu ryzyku.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">3. Działania marketingowe administratora</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Na stronie Sklepu internetowego Administrator danych może zamieszczać informacje marketingowe o swoich produktach lub usługach. Wyświetlanie tych treści jest dokonywane przez Administratora danych zgodnie z art. 6 ust.1 lit. f RODO, tj. zgodnie z prawnie uzasadnionym interesem Administratora danych polegającym na publikacji treści związanych ze świadczonymi usługami oraz treści promocyjnych akcji, w które Administrator danych jest zaangażowany. Jednocześnie działanie to nie narusza praw i wolności Klientów/Użytkowników, Klienci/Użytkownicy spodziewają się otrzymywania treści podobnej zawartości, a nawet tego oczekują lub jest to ich bezpośrednim celem wizyty na stronie/stronach Sklepu internetowego.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">4. Odbiorcy danych użytkowników</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Administrator danych ujawnia dane osobowe użytkowników wyłącznie podmiotom przetwarzającym na mocy zawartych umów powierzenia przetwarzania danych osobowych w celu realizacji usług na rzecz Administratora danych, np. hostingu i obsługi Strony, usługi IT, obsługi marketingowej i PR.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">5. Przesyłanie danych osobowych do państw trzecich</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Dane osobowe nie będą przetwarzane w państwach trzecich.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">6. Prawa osób, których dane dotyczą</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Każda osoba, której dane dotyczą, ma prawo:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">dostępu (art. 15 RODO) - uzyskania od Administratora danych potwierdzenia, czy przetwarzane są jej dane osobowe. Jeżeli dane o osobie są przetwarzane, jest ona uprawniona do uzyskania dostępu do nich oraz uzyskania następujących informacji: o celach przetwarzania, kategoriach danych osobowych, odbiorcach lub kategoriach odbiorców, którym dane zostały lub zostaną ujawnione, o okresie przechowywania danych lub o kryteriach ich ustalania, o prawie do żądania sprostowania, usunięcia lub ograniczenia przetwarzania danych osobowych przysługujących osobie, której dane dotyczą, oraz do wniesienia sprzeciwu wobec takiego przetwarzania;</li>\n<li style=\"margin:0px;padding:0px;\">do otrzymania kopii danych (art. 15 ust.3 RODO) - uzyskania kopii danych podlegających przetwarzaniu, przy czym pierwsza kopia jest bezpłatna, a za kolejne kopie Administrator danych może nałożyć opłatę w rozsądnej wysokości, wynikającą z kosztów administracyjnych;</li>\n<li style=\"margin:0px;padding:0px;\">do sprostowania (art. 16 RODO) - żądania sprostowania dotyczących jej danych osobowych, które są nieprawidłowe, lub uzupełnienia niekompletnych danych;</li>\n<li style=\"margin:0px;padding:0px;\">do usunięcia danych (art. 17 RODO) - żądania usunięcia jej danych osobowych, jeżeli Administrator danych nie ma już podstawy prawnej do ich przetwarzania lub dane nie są już niezbędne do celów przetwarzania;</li>\n<li style=\"margin:0px;padding:0px;\">do ograniczenia przetwarzania (art. 18 RODO) - żądania ograniczenia przetwarzania danych osobowych, gdy:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">osoba, której dane dotyczą, kwestionuje prawidłowość danych osobowych – na okres pozwalający Administratorowi danych sprawdzić prawidłowość tych danych,</li>\n<li style=\"margin:0px;padding:0px;\">przetwarzanie jest niezgodne z prawem, a osoba, której dane dotyczą, sprzeciwia się ich usunięciu, żądając ograniczenia ich wykorzystywania,</li>\n<li style=\"margin:0px;padding:0px;\">Administrator danych nie potrzebuje już tych danych, ale są one potrzebne osobie, której dane dotyczą, do ustalenia, dochodzenia lub obrony roszczeń,</li>\n<li style=\"margin:0px;padding:0px;\">osoba, której dane dotyczą, wniosła sprzeciw wobec przetwarzania – do czasu stwierdzenia, czy prawnie uzasadnione podstawy po stronie administratora są nadrzędne wobec podstaw sprzeciwu osoby, której dane dotyczą;</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">do przenoszenia danych (art. 20 RODO) - otrzymania w ustrukturyzowanym, powszechnie używanym formacie nadającym się do odczytu maszynowego danych osobowych jej dotyczących, które dostarczyła Administratorowi danych, oraz żądania przesłania tych danych innemu Administratorowi, jeżeli dane są przetwarzane na podstawie zgody osoby, której dane dotyczą, lub umowy z nią zawartej oraz jeżeli dane są przetwarzane w sposób zautomatyzowany;</li>\n<li style=\"margin:0px;padding:0px;\">do sprzeciwu (art. 21 RODO) - wniesienia sprzeciwu wobec przetwarzania jej danych osobowych w prawnie uzasadnionych celach administratora, z przyczyn związanych z jej szczególną sytuacją, w tym wobec profilowania. Wówczas Administrator danych dokonuje oceny istnienia ważnych prawnie uzasadnionych podstaw do przetwarzania, nadrzędnych wobec interesów, praw i wolności osób, których dane dotyczą, lub podstaw do ustalenia, dochodzenia lub obrony roszczeń. Jeżeli zgodnie z oceną interesy osoby, której dane dotyczą, będą ważniejsze od interesów administratora, Administrator danych będzie zobowiązany zaprzestać przetwarzania danych w tych celach;</li>\n<li style=\"margin:0px;padding:0px;\">do cofnięcia zgody w każdym momencie i bez podawania przyczyny, lecz przetwarzanie danych osobowych dokonane przed cofnięciem zgody nadal pozostanie zgodne z prawem. Cofnięcie zgody spowoduje zaprzestanie przetwarzania przez Administratora danych osobowych w celu, w którym zgoda ta została wyrażona.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Aby skorzystać z wyżej wymienionych praw, osoba, której dane dotyczą, powinna skontaktować się, wykorzystując podane dane kontaktowe, z Administratorem danych i poinformować go, z którego prawa i w jakim zakresie chce skorzystać.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">7. Prezes Urzędu Ochrony Danych Osobowych</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Osoba, której dane dotyczą, ma prawo wnieść skargę do organu nadzoru, którym w Polsce jest Prezes Urzędu Ochrony Danych Osobowych z siedzibą w Warszawie, ul. Stawki 2, z którym można kontaktować się w następujący sposób:</li>\n<li style=\"margin:0px;padding:0px;\">listownie: ul. Stawki 2, 00-193 Warszawa;</li>\n<li style=\"margin:0px;padding:0px;\">przez elektroniczną skrzynkę podawczą dostępną na stronie: <a href=\"https://www.uodo.gov.pl/pl/p/kontakt\" style=\"margin:0px;padding:0px;color:#333333;\">https://www.uodo.gov.pl/pl/p/kontakt</a>;</li>\n<li style=\"margin:0px;padding:0px;\">Infolinia: 606-950-000.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">8. Inspektor Ochrony Danych</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">W każdym przypadku osoba, której dane dotyczą, może również skontaktować się bezpośrednio z inspektorem ochrony danych Administratora za pomocą wiadomości e-mail lub pisemnie na adres Administratora danych, podany w dziale 1 punkcie 2 niniejszej Polityki Prywatności i Cookies.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">9. Zmiany Polityki Prywatności</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Polityka prywatności i cookies może być uzupełniana lub uaktualniana zgodnie z bieżącymi potrzebami Administratora w celu zapewnienia aktualnej i rzetelnej informacji Klientom/Użytkownikom.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">10. Cookies</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Sklep internetowy realizuje funkcje pozyskiwania informacji o Klientach, Użytkownikach i ich zachowaniu w następujący sposób:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">poprzez dobrowolnie wprowadzone w formularzach informacje w celach wynikających z funkcji konkretnego formularza;</li>\n<li style=\"margin:0px;padding:0px;\">poprzez zapisywanie w urządzeniach końcowych pliki cookies (tzw. „ciasteczka”);</li>\n<li style=\"margin:0px;padding:0px;\">poprzez gromadzenie logów serwera www przez operatora hostingowego Sklepu internetowego (konieczne do poprawnego działania serwisu).</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Pliki cookies stanowią dane informatyczne, w szczególności pliki tekstowe, które są przechowywane w urządzeniu końcowym Klienta / Użytkownika i przeznaczone są do korzystania ze strony Sklepu internetowego. Cookies zazwyczaj zawierają nazwę strony internetowej, z której pochodzą, czas przechowywania ich na urządzeniu końcowym oraz unikalny numer.</li>\n<li style=\"margin:0px;padding:0px;\">Sklep internetowy korzysta z plików cookies wyłącznie po wyrażeniu przez Klienta/Użytkownika Sklepu uprzedniej zgody w tym zakresie. Wyrażenie zgody na korzystanie przez Sklep internetowy z wszystkich plików cookies następuje poprzez kliknięcie przycisku: „Zamknij” podczas wyświetlania się komunikatu o korzystaniu z plików cookies przez Sklep internetowy albo poprzez zamknięcie tego komunikatu.</li>\n<li style=\"margin:0px;padding:0px;\">Jeżeli Klient/Użytkownik Sklepu internetowego nie wyraża zgody na korzystanie przez Sklep internetowy z plików cookies, może skorzystać z opcji: „Nie wyrażam zgody”, dostępnej również w komunikacie o korzystaniu z plików cookies przez Sklep internetowy bądź dokonać zmian w ustawieniach przeglądarki internetowej, z której aktualnie korzysta (może to jednak spowodować niepoprawne działanie strony Sklepu internetowego).</li>\n<li style=\"margin:0px;padding:0px;\">W celu zarządzania ustawieniami cookies, należy wybrać z listy przeglądarkę internetową/system i postępować zgodnie z instrukcjami: Internet Explorer, Chrome, Safari, Firefox, Opera, Android, Safari (iOS), Windows Phone.</li>\n<li style=\"margin:0px;padding:0px;\">Podstawą prawną przetwarzania danych osobowych pochodzących z plików cookies są prawnie uzasadnione interesy Administratora danych, polegające na zapewnianiu wysokiej jakości usług, zapewnianiu bezpieczeństwa usług.</li>\n<li style=\"margin:0px;padding:0px;\">W ramach Sklepu internetowego stosowane są dwa zasadnicze rodzaje plików cookies: „sesyjne” (session cookies) oraz „stałe” (persistent cookies). Cookies „sesyjne” są plikami tymczasowymi, które przechowywane są w urządzeniu końcowym Użytkownika do czasu wylogowania, opuszczenia Sklepu internetowego lub wyłączenia oprogramowania (przeglądarki internetowej). „Stałe” pliki cookies przechowywane są w urządzeniu końcowym Klienta/Użytkownika przez czas określony w parametrach plików cookies lub do czasu ich usunięcia przez Klienta/Użytkownika.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">Funkcjonalne pliki cookie (wymagane)</h4>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;\">\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">gnom-sklep.pl</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">monit_token</span>: 365 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Identyfikuje klienta sklepu.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">shop_monit_token</span>: 30 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Identyfikuje klienta sklepu.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">client</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Identyfikuje zalogowanego klienta / koszyk klienta niezalogowanego.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">affiliate</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o identyfikatorze partnera, od którego nastąpiło wejście do sklepu.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">ordersDocuments</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o statusie wydruku dokumentu.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__idsui</span>: 1095 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Plik niezbędny do funkcjonowania tzw. lekkiego zalogowania na stronie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__idsual</span>: 1095 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Plik niezbędny do funkcjonowania tzw. lekkiego zalogowania na stronie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__IAI_SRC</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje tylko źródło, z którego nastąpiło wejście na stronę.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">login</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o tym, czy użytkownik zalogował się na stronie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">CPA</span>: 28 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Zawiera informacje na temat zmiennych dla programów CPA / CPS, w których udział bierze strona.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__IAIRSABTVARIANT__</span>: 30 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Identyfikator wariantu dla testu A/B i konfiguracji silnika IdoSell RS.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">basket_id</span>: 365 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Identyfikator koszyka użytkownika strony, nadawany na czas trwającej sesji.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">page_counter</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Licznik odwiedzonych stron.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">LANGID</span>: 180 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o języku wybranym przez użytkownika strony.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">REGID</span>: 180 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o regionie użytkownika strony.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">CURRID</span>: 180 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o walucie wybranej przez użytkownika strony.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__IAIABT__</span>: 30 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje identyfikator testów A/B, na potrzeby testowania i poprawiania funkcjonalności sklepu.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__IAIABTSHOP__</span>: 30 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje identyfikator sklepu biorącego udział w teście A/B.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__IAIABTVARIANT__</span>: 30 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje identyfikator wariantu wylosowanego w ramach trwającego testu A/B.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">toplayerwidgetcounter[]</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje ilość wyświetleń komunikatu typu pop up.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">samedayZipcode</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o kodzie pocztowym użytkownika strony, który jest konieczny do oferowania przesyłki kurierskiej w usłudze SameDay.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">applePayAvailability</span>: 30 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o tym, czy dla użytkownika jest dostępna forma płatności ApplePay.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">paypalMerchant</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Identyfikator konta PayPal.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">toplayerNextShowTime_</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o czasie, w którym ma nastąpić kolejne wyświetlenie komunikatu pop up. </p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">rabateCode_clicked</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o zamknięciu paska informującego o aktywnym rabacie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">freeeshipping_clicked</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o zamknięciu paska informującego o darmowej dostawie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">redirection</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o zamknięciu komunikatu pop-up informującego o sugerowanym języku dla sklepu.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">filterHidden</span>: 365 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Po kliknięciu opcji zwinięcia filtra dla towarów zapisuje informację, który filtr ma być zwinięty po odświeżeniu listy towarów.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">toplayerwidgetcounterclosedX_</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o zamknięciu komunikatu typu pop-up.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">cpa_currency</span>: 60 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Zawiera informacje na temat waluty dla programów CPA / CPS, w których udział bierze strona.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">basket_products_count</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informacje na temat liczby towarów w koszyku.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">wishes_products_count</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informacje na temat liczby towarów na liście ulubionych.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">remembered_mfa</span>: 365 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informacje o zapamiętanym użytkowniku na potrzeby uwierzytelniania wieloskładnikowego (MFA)</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">IAI S.A.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">iai_accounts_toplayer</span>: 30 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Zapewnia poprawne wyświetlanie się komunikatu pop up informującego o usłudze logowania IdoAccounts (https://www.idosell.com/pl/tysiace-gotowych-do-uzycia-funkcji/logowanie-do-sklepu-z-konta-w-innym-serwisie/).</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">IdoSell</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">platform_id</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o tym, czy strona wyświetlana jest w aplikacji mobilnej.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">paypalAvailability_</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o tym, czy dla użytkownika jest dostępna forma płatności PayPal.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">ck_cook</span>: 3 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o tym, czy użytkownik strony wyraził zgodę na pliki cookies.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">IdoAccounts</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">accounts_terms</span>: 365 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informację o tym, czy użytkownik zaakceptował zgodę na skorzystanie z usługi IdoAccounts.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">express_checkout_login</span>: 365 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />CookieNameExpressCheckoutLogin</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">Google</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">NID</span>: 180 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Te pliki cookie (NID, ENID) służą do zapamiętywania preferencji użytkownika i innych informacji, takich jak preferowany język, liczba wyników wyświetlanych na stronie wyników wyszukiwania (na przykład 10 lub 20) oraz to, czy użytkownik chce mieć włączony filtr Google SafeSearch. Plik ten również jest konieczny do oferowania usługi płatności Google Pay.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">Google reCAPTCHA</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_GRECAPTCHA</span>: 1095 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest ustawiany przez Google reCAPTCHA, który chroni naszą stronę przed zapytaniami spamowymi w formularzach kontaktowych.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">PayPal</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">ts</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest zazwyczaj dostarczany przez firmę PayPal i obsługuje usługi płatnicze w witrynie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">ts_c</span>: 1095 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest zazwyczaj dostarczany przez PayPal i służy do zapobiegania oszustwom.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">x-pp-s</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest zazwyczaj dostarczany przez firmę PayPal i obsługuje usługi płatnicze w witrynie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">enforce_policy</span>: 365 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest zazwyczaj dostarczany przez firmę PayPal i obsługuje usługi płatnicze w witrynie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">tsrce</span>: 3 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest zazwyczaj dostarczany przez firmę PayPal i obsługuje usługi płatnicze w witrynie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">l7_az</span>: 60 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest niezbędny do funkcji logowania PayPal na stronie internetowej.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">LANG</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest zazwyczaj dostarczany przez firmę PayPal i obsługuje usługi płatnicze w witrynie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">nsid</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Używane w kontekście transakcji na Stronie internetowej. Plik cookie jest wymagany dla bezpiecznych transakcji.</p>\n</div>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">Analityczne pliki cookie</h4>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;\">\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">IAI S.A.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__IAI_AC2</span>: 45 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Identyfikator śledzenia konwersji (Activity Tracking) na potrzeby zbierania historii źródeł poprzedzających złożenie zamówienia, a także źródła, dzięki któremu złożono zamówienie zgodnie z modelem atrybucji last click.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">Google Ads</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">*-*</span>: 14 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje informacje o tym, czy został już wyświetlony popup „Google Shopping Opinie konsumenckie” z prośbą o zgodę na przesłanie ankiety na temat zamówienia.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">Google Analytics</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_ga_</span>: 730 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane przez Google Analytics do zbierania danych o liczbie odwiedzin strony przez użytkownika, a także dat pierwszej i ostatniej wizyty.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_ga</span>: 730 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Rejestruje unikalny identyfikator, który jest wykorzystywany do generowania danych statystycznych dotyczących sposobu korzystania z witryny przez odwiedzającego.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_gid</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Plik cookie _gid rejestruje unikalny identyfikator, który jest wykorzystywany do generowania danych statystycznych dotyczących sposobu korzystania z witryny przez odwiedzającego.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_gat</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane do dławienia szybkości żądań. Analytics anonimizuje adres IP.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_dc_gtm_UA-#</span>: 730 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używany przez Google Tag Manager do kontroli ładowania tagu skryptu Google Analytics. Analytics anonimizuje adres IP.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">FPLC</span>: 1200 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Wersja ciasteczka Non-HttpOnly o nazwie FPLC o wartości hashowanej z wartości FPID.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_gat[_]</span>: 1 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Używany do dławienia szybkości żądań. Jeśli Google Analytics jest wdrażany za pośrednictwem Google Tag Manager, ten plik cookie będzie miał nazwę _dc_gtm_.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_gat_gtag</span>: 1 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane do analizy nawyków przeglądania przez odwiedzających, przepływu, źródła i innych informacji.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__utma</span>: 730 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane do rozróżniania użytkowników i sesji. Plik cookie jest tworzony w momencie wykonania biblioteki javascript i nie istnieje żaden istniejący plik cookie __utma. Plik cookie jest aktualizowany za każdym razem, gdy dane są wysyłane do Google Analytics.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__utmb</span>: 30 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane do określenia nowych sesji / wizyt. Plik cookie jest tworzony, gdy biblioteka javascript wykonuje się i nie istnieje żaden istniejący plik cookie __utmb. Plik cookie jest aktualizowany za każdym razem, gdy dane są wysyłane do Google Analytics.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__utmc</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Nie używany w ga.js. Ustawione dla interoperacyjności z urchin.js. Historycznie, ten plik cookie działał w połączeniu z plikiem cookie __utmb, aby określić, czy użytkownik był w nowej sesji / wizycie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__utmt</span>: 10 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Służy do ograniczenia liczby żądań.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__utmz</span>: 180 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje źródło ruchu lub kampanię, która wyjaśnia, jak użytkownik dotarł do Twojej witryny. Plik cookie jest tworzony podczas wykonywania biblioteki javascript i jest aktualizowany za każdym razem, gdy dane są wysyłane do Google Analytics.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__utmv</span>: 730 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Służy do przechowywania danych zmiennych własnych na poziomie odwiedzającego. Ten plik cookie jest tworzony, gdy programista używa metody _setCustomVar ze zmienną niestandardową na poziomie odwiedzającego. Ten plik cookie był również używany dla przestarzałej metody _setVar. Plik cookie jest aktualizowany za każdym razem, gdy dane są wysyłane do Google Analytics.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">AMP_TOKEN</span>: 365 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Zawiera token, który może być użyty do pobrania ID klienta z serwisu AMP Client ID. Inne możliwe wartości wskazują opt-out, inflight request lub błąd pobierania Client ID z serwisu AMP Client ID.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">FPID</span>: 730 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie domyślnie nosi nazwę FPID (First Party Identifier). Wartość zapisana w FPID zostanie wykorzystana do ustawienia identyfikatora klienta w żądaniu skierowanym do serwerów Google.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_gaexp</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane do określenia włączenia użytkownika do eksperymentu oraz wygaśnięcia eksperymentów, w których użytkownik został włączony.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_opt_awcid</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane dla kampanii zmapowanych na identyfikatory klientów Google Ads.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_opt_awmid</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane dla kampanii zmapowanych do Google Ads Campaign ID.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_opt_awgid</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane dla kampanii zmapowanych do identyfikatorów grup reklam Google Ads</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_opt_awkid</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używane dla kampanii zmapowanych do identyfikatorów kryteriów Google Ads</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_opt_utmc</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Przechowuje ostatni parametr zapytania utm_campaign.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_opt_expid</span>: 0.2 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Zapisuje ostatni parametr zapytania utm_campaign.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Google Analytics pixel</span>: 999 dni, pixel śledzący<br style=\"margin:0px;padding:0px;\" />Piksel mierzy wizyty, kliknięcia i inne zachowania cyfrowe. Dzięki temu pozwala dostosować strategię marketingową.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__utmli</span>: 60 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Plik cookie jest częścią funkcji Enhanced Link Attribution, która (próbuje) rozróżniać kliknięcia w linki do tego samego miejsca docelowego w analizach stronicowych. Zawiera id (jeśli istnieje) klikniętego linku (lub jego rodzica) do odczytania na następnej stronie, dzięki czemu analizy wewnątrzstronicowe mogą określić, gdzie na stronie znajdował się kliknięty link.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">Google Maps</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">SID</span>: 3650 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Zawierają cyfrowo podpisane i zaszyfrowane zapisy identyfikatora konta Google użytkownika i ostatniego czasu logowania. Połączenie tych plików cookie (SID, HSID) pozwala Google zablokować wiele rodzajów ataków, takich jak próby kradzieży treści formularzy przesyłanych w usługach Google.</p>\n</div>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">Reklamowe pliki cookie</h4>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;\">\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">Meta (Facebook)</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">fbsr_</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Zawiera podpisane żądanie dla użytkownika aplikacji Facebook App.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">fbss_</span>: 365 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Sesja współdzielona Facebook.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">fbs_</span>: 30 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Sesja na portalu Facebook.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Meta Pixel</span>: 999 dni, pixel śledzący<br style=\"margin:0px;padding:0px;\" />Meta Pixel to kawałek kodu, który pozwala mierzyć skuteczność reklamy poprzez zrozumienie działań podejmowanych przez użytkowników strony i pozwala upewnić się, że reklamy sklepu są wyświetlane właściwym osobom.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_fbp</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Cookie wykorzystywane do profilowania użytkowników oraz jak najdokładniejszemu dopasowywaniu reklamy do profilu użytkownika.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">fr</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Cookie wykorzystywane do profilowania użytkowników oraz jak najdokładniejszemu dopasowywaniu reklamy do profilu użytkownika.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_fbc</span>: 730 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ostatnia wizyta w sklepie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">tr</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Cookie wykorzystywane do profilowania użytkowników oraz jak najdokładniejszemu dopasowywaniu reklamy do profilu użytkownika.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">sb</span>: 402 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie pomaga zidentyfikować i zastosować dodatkowe środki bezpieczeństwa, w przypadku gdy ktoś spróbuje uzyskać dostęp do konta na Facebooku bez autoryzacji, na przykład wpisując losowo wybrane hasła. Wykorzystywany jest również do zapisywania informacji, które pozwolą Facebook na odzyskanie konta użytkownika, jeśli zapomni on hasła, lub na dodatkowe uwierzytelnienie, gdy podejrzewa, że ktoś włamał się na jego konto. Zaliczają się do tego np. pliki cookie „sb” oraz „dbln”, dzięki którym możliwe jest bezpieczne zidentyfikowanie przeglądarki użytkownika.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">usida</span>: plik cookie<br style=\"margin:0px;padding:0px;\" />Zbiera kombinację przeglądarki użytkownika i unikalnego identyfikatora, wykorzystywaną do dopasowania reklam do użytkowników.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">wd</span>: 9 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie pomaga w kierowaniu ruchem między serwerami i analizowaniu szybkości wczytywania Produktów firmy Meta u różnych użytkowników. Dzięki plikom cookie Meta może również rejestrować proporcje i wymiary ekranu oraz okien użytkownika i wie, czy ma on włączony tryb wysokiego kontrastu, dzięki czemu może prawidłowo prezentować swoje witryny i aplikacje. Może na przykład wykorzystywać pliki „dpr” oraz „wd”, między innymi do zapewniania użytkownikowi optymalnych parametrów ekranu urządzenia.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">locale</span>: 9 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie zawiera lokalizację ostatnio zalogowanego użytkownika w tej przeglądarce.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">datr</span>: 7 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Celem pliku cookie datr jest identyfikacja przeglądarki internetowej używanej do łączenia się z Facebookiem niezależnie od zalogowanego użytkownika. Ten plik cookie odgrywa kluczową rolę w funkcjach bezpieczeństwa i integralności strony Facebooka.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">gnom-sklep.pl</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">RSSID</span>: 180 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Identyfikator użytkownika IdoSell RS, wykorzystywany na potrzeby wyświetlania dopasowanych rekomendacji produktów na stronie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__IAIRSUSER__</span>: 60 minut, plik cookie<br style=\"margin:0px;padding:0px;\" />Identyfikator użytkownika IdoSell RS, wykorzystywany na potrzeby wyświetlania dopasowanych rekomendacji produktów na stronie.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">Google Ads</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_gcl_au </span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Używany przez Google AdSense do eksperymentowania z wydajnością reklam w witrynach korzystających z ich usług.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">FPAU</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Plik cookie, w którym gromadzone są informacje o użytkownikach i ich aktywności w serwisie poprzez wbudowane elementy w celach analitycznych i raportowania.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">FPGCLAW</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Zawiera informacje o użytkowniku związane z kampanią.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">FPGCLGB</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Zawiera informacje o użytkowniku związane z kampanią.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_gcl_gb</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Zawiera informacje o użytkowniku związane z kampanią.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_gac_gb_&lt;&gt;</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Zawiera informacje o użytkowniku związane z kampanią.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">_gcl_aw</span>: 90 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Zawiera informacje o użytkowniku związane z kampanią.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">IDE</span>: 730 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie służy do wyświetlania reklam Google w witrynach innych niż Google.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">1P_JAR</span>: 30 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie służy do zbierania statystyk witryny i śledzenia współczynników konwersji. Ustawia unikalny identyfikator, aby zapamiętać Twoje preferencje i inne informacje, takie jak statystyki witryny i śledzenie współczynników konwersji.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">test_cookie</span>: 1 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Służy do badania, czy uprawnienia do ustawiania plików cookies w przeglądarce użytkownika są włączone.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">AEC</span>: 138 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Te pliki cookie zapobiegają działaniu złośliwych stron w imieniu użytkownika bez jego wiedzy.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">APISID</span>: 193 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest przechowywany na komputerze, aby pozostać połączonym z kontem Google, podczas ponownego odwiedzania ich usług. Podczas pozostawania w tej aktywnej sesji i korzystania z dodatków na innych stronach internetowych, takich jak nasza, Google będzie korzystać z tych plików cookie, aby poprawić wrażenia użytkownika.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">CONSENT</span>: 559 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest przechowywany na komputerze, aby pozostać połączonym z kontem Google, podczas ponownego odwiedzania ich usług. Podczas pozostawania w tej aktywnej sesji i korzystania z dodatków na innych stronach internetowych, takich jak nasza, Google będzie korzystać z tych plików cookie, aby poprawić wrażenia użytkownika.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">DSID</span>: 10 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Plik cookie \'DSID\' służy do identyfikacji zalogowanego użytkownika w witrynach innych niż Google oraz do zapamiętania, czy użytkownik wyraził zgodę na personalizację reklam.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">OTZ</span>: 23 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie służy do zapamiętywania preferencji użytkownika i innych informacji, takich jak preferowany język, liczba wyników wyświetlanych na stronie wyników wyszukiwania (na przykład 10 lub 20) oraz to, czy użytkownik chce mieć włączony filtr Google SafeSearch.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">SAPISID</span>: 28 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest przechowywany na komputerze, aby pozostać połączonym z kontem Google, podczas ponownego odwiedzania ich usług. Podczas pozostawania w tej aktywnej sesji i korzystania z dodatków na innych stronach internetowych, takich jak nasza, Google będzie korzystać z tych plików cookie, aby poprawić wrażenia użytkownika.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">SEARCH_SAMESITE</span>: 176 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Umożliwia serwerom zmniejszenie ryzyka ataków CSRF i wycieku informacji poprzez zapewnienie, że dany plik cookie powinien być wysyłany tylko z żądaniami zainicjowanymi z tej samej zarejestrowanej domeny.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">SIDCC</span>: 393 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Pobiera pewne narzędzia z Google i zapisuje preferencje, na przykład liczbę wyników wyszukiwania na arkusz lub aktywację filtra SafeSearch. Dostosowuje reklamy pojawiające się w wyszukiwarce google.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">SSID</span>: 393 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Ten plik cookie jest przechowywany na komputerze, aby pozostać połączonym z kontem Google, podczas ponownego odwiedzania ich usług. Podczas pozostawania w tej aktywnej sesji i korzystania z dodatków na innych stronach internetowych, takich jak nasza, Google będzie korzystać z tych plików cookie, aby poprawić wrażenia użytkownika.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__Secure-*</span>: 730 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Te pliki cookie są wykorzystywane do dostarczania bardziej dopasowanych reklam do użytkownika i jego zainteresowań.</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">Google Analytics</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">__gads</span>: 395 dni, plik cookie<br style=\"margin:0px;padding:0px;\" />Aby zapewnić dostarczanie reklam lub retargeting.</p>\n</div>\n<p style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;\"></p>\n<ol start=\"8\" style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Pliki cookies wykorzystywane są w następujących celach:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">tworzenia statystyk, które pomagają zrozumieć, w jaki sposób Klienci/Użytkownicy Sklepu internetowego korzystają ze stron internetowych, co umożliwia ulepszanie ich struktury i zawartości;</li>\n<li style=\"margin:0px;padding:0px;\">utrzymania sesji Klienta/Użytkownika (po zalogowaniu), dzięki której Klient/Użytkownik nie musi na każdej podstronie Sklepu internetowego ponownie wpisywać od nowa loginu i hasła;</li>\n<li style=\"margin:0px;padding:0px;\">określania profilu Klienta/Użytkownika w celu wyświetlania mu rekomendacji produktowych i dopasowanych materiałów w sieciach reklamowych, w szczególności sieci Google.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Oprogramowanie do przeglądania stron internetowych (przeglądarka internetowa) zazwyczaj domyślnie dopuszcza przechowywanie plików cookies w urządzeniu końcowym Klienta/Użytkownika. Klienci/Użytkownicy mogą dokonać zmiany ustawień w tym zakresie. Przeglądarka internetowa umożliwia usunięcie plików cookies. Możliwe jest także automatyczne blokowanie plików cookies.</li>\n<li style=\"margin:0px;padding:0px;\">Ograniczenia stosowania plików cookies mogą wpłynąć na niektóre funkcjonalności dostępne na stronach internetowych Sklepu internetowego.</li>\n<li style=\"margin:0px;padding:0px;\">Pliki cookies zamieszczane w urządzeniu końcowym Klienta/Użytkownika i wykorzystywane mogą być również przez współpracujących ze Sklepem internetowym reklamodawców oraz partnerów Sklepu internetowego.</li>\n<li style=\"margin:0px;padding:0px;\">Pliki cookie mogą być wykorzystane przez sieć Google, do wyświetlenia reklam dopasowanych do sposobu, w jaki Klient/ Użytkownik korzysta z Sklepu internetowego. W tym celu mogą zachować informację o ścieżce nawigacji użytkownika lub czasie pozostawania na danej stronie: <a href=\"https://policies.google.com/technologies/partner-sites\" style=\"margin:0px;padding:0px;color:#333333;\">https://policies.google.com/technologies/partner-sites</a>.</li>\n<li style=\"margin:0px;padding:0px;\">Zalecamy przeczytanie Klientowi/Użytkownikowi polityki ochrony prywatności tych firm, aby poznać zasady korzystania z plików cookies wykorzystywane w statystykach: Polityka ochrony prywatności Google Analytics.</li>\n<li style=\"margin:0px;padding:0px;\">W zakresie informacji o preferencjach Klienta/ Użytkownika gromadzonych przez sieć reklamową Google, Klient/Użytkownik może przeglądać i edytować informacje wynikające z plików cookies przy pomocy narzędzia: <a href=\"https://www.google.com/ads/preferences/\" style=\"margin:0px;padding:0px;color:#333333;\">https://www.google.com/ads/preferences/</a>.</li>\n<li style=\"margin:0px;padding:0px;\">Na stronie Sklepu internetowego są umieszczone wtyczki, które mogą przekazywać dane Klientów/Użytkowników do Administratorów takich jak, np.: Google Maps, Google Analytics, Meta (Facebook), Google Ads, PayPal, Google reCAPTCHA, IdoAccounts, IdoSell, IAI S.A., Google.</li>\n<li style=\"margin:0px;padding:0px;\">W celu poprawnej realizacji Umowy sprzedaży na odległość Administrator danych może udostępniać dane Klientów/Użytkowników podmiotom kurierskim. Aktualnie dostępne sposoby dostawy w Sklepie Internetowym dostępne są pd adresem: <a href=\"https://gnom-sklep.pl/pl/delivery.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/delivery.html</a>.</li>\n<li style=\"margin:0px;padding:0px;\">W celu poprawnej realizacji Umowy sprzedaży na odległość Administrator może udostępniać dane Klientów/Użytkowników systemom płatności internetowych. Aktualnie dostępne sposoby płatności w formie przedpłat w Sklepie internetowym dostępne są pod adresem: <a href=\"https://gnom-sklep.pl/pl/payments.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/payments.html</a>.</li>\n<li style=\"margin:0px;padding:0px;\">Więcej informacji na temat warunków i prywatności można znaleźć także na stronie <a href=\"https://business.safety.google/privacy/\" style=\"margin:0px;padding:0px;color:#333333;\">Prywatność i warunki Google</a>.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">11. Newsletter</h4>\n<ol style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Klient może wyrazić zgodę na otrzymywanie informacji handlowych drogą elektroniczną, poprzez zaznaczenie odpowiedniej opcji w formularzu rejestracyjnym lub w terminie późniejszym w odpowiedniej zakładce. W przypadku wyrażenia takiej zgody, Klient/Użytkownik otrzymywać będzie na podany przez siebie adres email informację (Newsletter) Sklepu internetowego, a także inne informacje handlowe wysyłane przez Sprzedawcę.</li>\n<li style=\"margin:0px;padding:0px;\">Klient może w dowolnym momencie zrezygnować z otrzymywania Newslettera samodzielnie, poprzez odznaczenie stosownego pola na stronie swojego Konta lub udając się na formularz <a href=\"https://gnom-sklep.pl/pl/newsletter.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/newsletter.html</a>, kliknięcie stosownego linku znajdującego się w treści każdego Newslettera lub za pośrednictwem Biura Obsługi Klienta.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;\">12. Konto</h4>\n<ol>\n<li>Klient/Użytkownik nie może umieszczać w Sklepie internetowym ani dostarczać do Sprzedawcy treści, w tym opinii i innych danych o charakterze bezprawnym.</li>\n<li>Klient/Użytkownik uzyskuje dostęp do Konta po dokonaniu rejestracji.</li>\n<li>W ramach rejestracji Klient / Użytkownik podaje typ konta lub płeć, imię, nazwisko, nazwę firmy, NIP, dane do wystawienia dokumentu sprzedaży, dane do wysyłki, adres e-mail oraz wybiera hasło. Klient/Użytkownik zapewnia, że dane podane przez niego/nią w formularzu rejestracyjnym, są zgodne z prawdą. Rejestracja wymaga dokładnego zapoznania się z Regulaminem oraz zaznaczenia na formularzu rejestracyjnym, że Klient/Użytkownik zapoznał się z Regulaminem i w pełni akceptuje wszystkie jego postanowienia.</li>\n<li>W chwili nadania Klientowi/Użytkownik dostępu do Konta pomiędzy Sprzedawcą, a Klientem zostaje zawarta na czas nieokreślony umowa o świadczenie usług drogą elektroniczną dotycząca Konta. Konsument może od tej umowy odstąpić na zasadach określonych Regulaminie.</li>\n<li>Rejestracja Konta na jednej ze stron Sklepu internetowego oznacza równocześnie rejestrację umożliwiającą dostęp do pozostałych stron, pod którymi dostępny jest Sklep internetowy.</li>\n<li>Klient/Użytkownik może wypowiedzieć umowę o świadczenie usługi drogą elektroniczną w każdym czasie ze skutkiem natychmiastowym, informując o tym Sprzedawcę za pomocą wiadomości e-mail lub pisemnie na adres Administratora danych, podany w dziale 1 punkcie 2 niniejszej Polityki Prywatności i Cookies.</li>\n<li>Sprzedawca ma prawo rozwiązać umowę o świadczenie usług dotyczącą Konta w przypadku zaprzestania świadczenia lub przeniesienia usługi Sklepu internetowego na osobę trzecią, naruszenia przez Klienta/Użytkownika prawa lub postanowień Regulaminu, a także w przypadku braku aktywności Klienta/Użytkownika przez okres 6 miesięcy. Rozwiązanie umowy następuje z zachowaniem siedmiodniowego okresu wypowiedzenia. Sprzedawca może zastrzec, że ponowna rejestracja Konta będzie wymagać zezwolenia Sprzedawcy.</li>\n</ol>','polityka-prywatnosci'),(3,1,1,'Regulamin','','Our terms and conditions of use','conditions, terms, use, sell','<h2 class=\"text_menu__label headline\" style=\"margin:0px 0px 1rem;padding:10px 0px;font-size:2.5rem;font-weight:400;color:#333333;font-family:\'headline_custom\', Arial, sans-serif;line-height:1;text-align:center;background-color:#ffffff;\">Regulamin</h2>\n<div class=\"text_menu__txt\" style=\"margin:0px;padding:0px;color:#333333;font-family:\'main_custom\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">\n<div class=\"text_menu__txt_sub pb-4 cm\" style=\"margin:0px 0px 20px;font-size:13px;line-height:1.3;max-width:100%;padding:0px 0px 2rem 0px;\">\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 1. Definicje</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Regulamin</span> - niniejszy Regulamin, określający zasady zawierania umów sprzedaży na odległość za pośrednictwem Sklepu Internetowego, zasady wykonywania tych umów, prawa i obowiązki stron Umowy sprzedaży na odległość oraz zasady postępowania reklamacyjnego. W zakresie usług świadczonych drogą elektroniczną Regulamin jest odpowiednio regulaminem, o którym mowa w art. 8 Ustawy o świadczeniu usług drogą elektroniczną.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Klient</span> - osoba fizyczna posiadająca pełną zdolność do czynności prawnych, osoba prawna albo jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną, która zawiera ze Sprzedawcą Umowę sprzedaży na odległość.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Konsument</span> - osoba fizyczna dokonującą z przedsiębiorcą czynności prawnej niezwiązanej bezpośrednio z jej działalnością gospodarczą lub zawodową.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Przedsiębiorca indywidualny</span> - osoba fizyczna zawierająca Umowę sprzedaży na odległość bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści tej umowy wynika, że nie posiada ona dla tej osoby charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej przez nią działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Przedsiębiorca</span> - osoba fizyczna, osoba prawna lub jednostka organizacyjna niebędąca osobom prawną, której ustawa przyznaje zdolność prawną, prowadząca we własnym imieniu działalność gospodarczą lub zawodową.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Sprzedawca:</span><br style=\"margin:0px;padding:0px;\" />GNOM – Artur Szymala,<br style=\"margin:0px;padding:0px;\" />tel. +48 660 527 787,<br style=\"margin:0px;padding:0px;\" />kontakt@gnom-sklep.pl,<br style=\"margin:0px;padding:0px;\" />NIP 5471832783,<br style=\"margin:0px;padding:0px;\" />REGON 072373564.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Adres siedziby Sprzedającego:</span><br style=\"margin:0px;padding:0px;\" />Szkolna 15A,<br style=\"margin:0px;padding:0px;\" />43-300 Bielsko-Biała.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Sklep Internetowy</span> - serwis internetowy prowadzony przez Sprzedawcę, dostępny pod adresami elektronicznymi: <a href=\"https://gnom-sklep.pl/\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl</a> za pośrednictwem, którego Klient może uzyskać informacje o Towarze i jego dostępności oraz kupić Towar lub zlecić świadczenie usługi.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Umowa sprzedaży na odległość</span> - umowa sprzedaży Towaru/umowa dostarczenia Usługi cyfrowej lub Treści cyfrowej (o ile ma zastosowanie), zawierana za pośrednictwem Sklepu Internetowego.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Towar</span> - rzecz ruchoma, którą Klient może nabyć w Sklepie Internetowym.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Usługa cyfrowa</span> - usługa pozwalająca Konsumentowi na:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">wytwarzanie, przetwarzanie, przechowywanie lub dostęp do danych w postaci cyfrowej;</li>\n<li style=\"margin:0px;padding:0px;\">wspólne korzystanie z danych w postaci cyfrowej, które zostały przesłane lub wytworzone przez Konsumenta lub innych użytkowników tej usługi;</li>\n<li style=\"margin:0px;padding:0px;\">inne formy interakcji za pomocą danych.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Treść cyfrowa</span> - dane wytworzone i dostarczone w postaci cyfrowej.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Polityka prywatności i cookies Sklepu Internetowego</span> - dokument określający szczegółowe zasady przetwarzania danych osobowych oraz stosowania cookies. Polityka prywatności i cookies stanowi Załącznik nr 3 do Regulaminu i jest dostępna na stronie <a href=\"https://gnom-sklep.pl/pl/privacy-and-cookie-notice.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/privacy-and-cookie-notice.html</a>.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Trwały nośnik</span> - oznacza materiał lub narzędzie umożliwiające Klientowi lub Sprzedawcy przechowywanie informacji kierowanych osobiście do niego, w sposób umożliwiający dostęp do informacji w przyszłości przez czas odpowiedni do celów, jakim te informacje służą i które pozwalają na odtworzenie przechowywanych informacji w niezmienionej postaci, w szczególności poczta elektroniczna.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Elektroniczny formularz zamówienia</span> - udostępniania przez Sprzedawcę dla Kupującego elektroniczna procedura dokonywania zamówienia.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Elektroniczny formularz zwrotu</span> - udostępniana przez Sprzedawcę dla Kupującego elektroniczna procedura dokonywania zwrotów; dostępny pod adresem <a href=\"https://gnom-sklep.pl/pl/returns-open.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/returns-open.html</a>.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Elektroniczny formularz reklamacji</span> - udostępniana przez Sprzedawcę dla Kupującego elektroniczna procedura składania reklamacji; dostępny pod adresem <a href=\"https://gnom-sklep.pl/pl/rma-open.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/rma-open.html</a>.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Wysłanie zamówienia</span> - zatwierdzenie zamówienia poprzez kliknięcie przez Klienta przycisku \"Zamawiam i płacę\" traktowane jako złożenie przez Klienta wiążącego oświadczenia woli zawarcia ze Sprzedającym Umowy sprzedaży na odległość.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Konto</span> - zbiór danych przechowywanych w Sklepie Internetowym oraz w systemie teleinformatycznym Sprzedawcy dotyczący danego Klienta oraz składanych przez niego zamówień i zawieranych Umów sprzedaży na odległość, z wykorzystaniem którego Klient może składać zamówienia, a także w odpowiednim czasie - anulować lub edytować oraz zawierać Umowy Sprzedaży na odległość.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Opinia obsługi zamówienia lub opinia poszczególnych Towarów</span> - subiektywne wypowiedzi i oceny przyznawane w formie gwiazdek od 1 do 5.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Zamówienie subskrypcyjne</span> - zamówienie utworzone automatycznie w ramach Subskrypcji.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Subskrypcja</span> - usługa elektroniczna pozwalająca na automatyczne tworzenie Zamówień subskrypcyjnych określonych Towarów, zgodnie z wybraną przez Klienta powtarzalnością, bez konieczności składania odrębnych zamówień aż do zakończenia Subskrypcji.</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Płatności cykliczne</span> - to płatności obsługiwane w ramach usługi płatniczej IdoPay świadczonej przez Operatora i realizowane w sposób automatyczny, w określonych cyklach, stosowane do opłacania Zamówień subskrypcyjnych na podstawie zgody, która została udzielona przez Kupującego podczas rozpoczęcia Subskrypcji (stałe zlecenie posiadacza Karty).</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Operator</span> - IdoPayments sp. z o.o. z siedzibą al. Piastów 30, 71-064 Szczecin, wpisaną do rejestru przedsiębiorców prowadzonego przez Sąd Rejonowy Szczecin-Centrum w Szczecinie, XIII Wydział Gospodarczy KRS pod nr 0000859711, NIP: 8522666251, REGON: 387039893, o kapitale zakładowym: 800 000,00 złotych. Adres do doręczeń: al. Piastów 30, 71-064 Szczecin, określany także jako: „IdoPayments” będąca krajową instytucją płatniczą w rozumieniu art. 2 pkt 16 ustawy z dnia 19 sierpnia 2011 r. o usługach płatniczych (Dz.U. z 2020 r. poz. 794 ze zm.)[dalej: „UUP”].</li>\n<li style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-weight:bold;\">Karta</span> – karta płatnicza wydana w ramach systemów Visa lub International lub Mastercard International, dopuszczona do regulacjami tychże systemów do realizacji transakcji bez fizycznej obecności.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 2. Postanowienia ogólne</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Rodzaje i zakres usług świadczonych drogą elektroniczną:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">zawieranie Umów sprzedaży online - w zakresie Towarów sprzedawanych w Sklepie Internetowym,</li>\n<li style=\"margin:0px;padding:0px;\">zasady dokonywania rejestracji i korzystania z Konta w ramach Sklepu Internetowego,</li>\n<li style=\"margin:0px;padding:0px;\">dodawanie opinii, komentarzy i ocen - Klient może dodać opinię lub komentarz do swojego zamówienia,</li>\n<li style=\"margin:0px;padding:0px;\">przesyłanie wiadomości e-mail, w których Sprzedawca potwierdza otrzymanie zamówienia, ewentualne otrzymanie płatności, przyjęcie zamówienia do realizacji.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Korzystanie ze Sklepu Internetowego możliwe jest pod warunkiem spełniania przez system informatyczny, z którego korzysta Klient następujących minimalnych wymagań technicznych:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">przeglądarki internetowe w aktualnej wersji np.:\n<ul style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Firefox</li>\n<li style=\"margin:0px;padding:0px;\">Chrome</li>\n<li style=\"margin:0px;padding:0px;\">Microsoft Edge</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;\">dowolny program od przeglądania plików w formacie PDF.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Zamieszczone na stronach Sklepu Internetowego treści, w tym opisy Towarów i ceny stanowią zaproszenie do zawarcia umowy w rozumieniu art. 71 kodeksu cywilnego.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca udostępnia niniejszy Regulamin wraz z Załącznikami za pośrednictwem odsyłacza zamieszonego na stronie głównej przed zawarciem Umowy sprzedaży na odległość, w jej trakcie oraz po zakończeniu. Kupujący może go pobrać i sporządzić jego wydruk.</li>\n<li style=\"margin:0px;padding:0px;\">W celu zapewnienia bezpieczeństwa przekazu komunikatów i danych w związku ze świadczonymi usługami, Sklep Internetowy podejmuje środki techniczne i organizacyjne odpowiednie do stopnia bezpieczeństwa świadczonych usług, w szczególności środki służące zapobieganiu pozyskiwania i modyfikacji przez osoby nieupoważnione danych osobowych przesyłanych w Internecie.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 3. Zamówienia</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Złożenia zamówienia w Sklepie Internetowym można dokonać za pośrednictwem Konta albo wybrać opcję zakupu bez rejestracji, w którym to przypadku tworzone jest wewnętrzne konto, na którego bazie Klient może utworzyć Konto. Wewnętrzne konto jest utrzymywane do momentu usunięcia danych z systemu lub blokady Konta.</li>\n<li style=\"margin:0px;padding:0px;\">Zakupu dokonuje się poprzez wypełnienie Elektronicznego formularza zamówienia dostępnego na stronach Sklepu Internetowego. Wybór zamawianych Towarów jest dokonywany poprzez ich dodanie do koszyka. Elektroniczny formularz zamówienia określa m.in. jakie Towary, po jakiej cenie i w jakich ilościach Klient chce zamówić do wskazanej przez siebie lokalizacji. Klient podejmuje odpowiednie kroki techniczne w oparciu o wyświetlane komunikaty.</li>\n<li style=\"margin:0px;padding:0px;\">Po podaniu przez Klienta wszystkich niezbędnych danych, wyświetlone zostanie podsumowanie złożonego zamówienia. Podsumowanie zamówienia będzie zawierać informacje dotyczące: danych identyfikujących Sprzedawcę, przedmiotu zamówienia, jednostkowej oraz łącznej ceny zamawianych Towarów, w tym kosztów dostawy oraz innych jeżeli występują, wybranej metody płatności, wybranego sposobu dostawy, czasu i kosztów dostawy.</li>\n<li style=\"margin:0px;padding:0px;\">Jeżeli przedmiotem umowy jest dostarczanie Treści cyfrowych lub Usług cyfrowych, które nie są zapisane na nośniku materialnym lub usług realizowanych drogą elektroniczną lub na odległość - Konsument w dodatkowym checkboxie, wymaganym do złożenia zamówienia i znajdującym się na Elektronicznym formularzu zamówienia wyraża następującą zgodę: \"Wyrażam zgodę na dostarczenie treści cyfrowych, które nie są zapisane na nośniku materialnym lub na rozpoczęcie świadczenia usługi przed upływem 14 dni od dnia zawarcia umowy i przyjmuję do wiadomości utratę prawa do odstąpienia od umowy\". Sprzedawca potwierdzi otrzymanie ww. zgody mailowo.</li>\n<li style=\"margin:0px;padding:0px;\">W celu złożenia Zamówienia konieczne jest podanie w Elektronicznym formularzu zamówienia danych osobowych oznaczonych jako obowiązkowe, dokonanie akceptacji treści Regulaminu, wysłanie zamówienia poprzez naciśnięcie przycisku \"Zamawiam i płacę\".\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Wysłanie przez Klienta Elektronicznego formularza zamówienia stanowi wiążące oświadczenie woli zawarcia Umowy sprzedaży zawartej na odległość, zgodnie z treścią niniejszego Regulaminu.</li>\n<li style=\"margin:0px;padding:0px;\">Umowę sprzedaży na odległość traktuje się jako zawartą w chwili przyjęcia przez Sprzedającego Elektronicznego formularza zamówienia, czego potwierdzeniem jest wyświetlenie Kupującemu komunikatu potwierdzającego przyjęcie zamówienia i podanie jego numeru.</li>\n<li style=\"margin:0px;padding:0px;\">Po zawarciu Umowy sprzedaży na odległość, Klient otrzymuje w formie wiadomości e-mail potwierdzenie złożonego zamówienia zawierające: potwierdzenie przyjęcia zamówienia i ostateczne potwierdzenie wszystkich istotnych elementów Zamówienia oraz ogólnych warunków zawartej Umowy sprzedaży na odległość (Regulamin Sklepu Internetowego wraz z Załącznikami Nr 1 i 2), dane Sprzedawcy, odpowiedzialności Sprzedawcy za jakość świadczenia, o usługach świadczonych przez Sprzedawcę po sprzedaży oraz o sposobie i skutkach odstąpienia od umowy. Pouczenie co do sposobu i o skutkach odstąpienia od umowy zawarte jest w Załączniku nr 1.</li>\n<li style=\"margin:0px;padding:0px;\">Do czasu rozpoczęcia przez Sprzedającego realizacji zamówienia:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Klient może zmienić swoje zamówienie przy pomocy rozwiązania technicznego dostępnego na stronie Elektronicznego formularza zamówienia i przechodząc ponownie całą ścieżkę składania zamówienia. Zmiana zamówienia następuje poprzez złożenie nowego, które wchodzi w miejsce dotychczas złożonego. Ewentualnie, dokonana przez Klienta płatność rozliczana jest na poczet nowego zamówienia, a w przypadku nadpłaty jest ona zwracana na rachunek bankowy, z którego dokonywana była płatność.</li>\n<li style=\"margin:0px;padding:0px;\">Klient może anulować swoje zamówienie wybierając opcję „anuluj zamówienie” dostępną na stronie Elektronicznego formularza zamówienia.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">W przypadku dokonania przez Klienta anulowania zamówienia Sprzedawca dokonuje zwrotu otrzymanej płatności w terminie 3 dni roboczych. Zwrot płatności zostanie dokonany przy użyciu takiego samego sposobu zapłaty, jakiego użył Klient.</li>\n<li style=\"margin:0px;padding:0px;\">Czas realizacji Zamówienia wynosi od 1 do 10 dni roboczych licząc od dnia zawarcia umowy.</li>\n</ol>\n</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 4. Płatność</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Sklep Internetowy oferuje możliwość dokonania płatności w formie przedpłat, za pobraniem (z płatnością na konto po dostawie). Opcja płatności z odroczonym terminem płatności jest możliwa w sytuacjach indywidualnie uzgodnionych ze Sprzedawcą.</li>\n<li style=\"margin:0px;padding:0px;\">Płatności za towar można dokonać w sposób wybrany w momencie składania zamówienia na Elektronicznym formularzu zamówienia.</li>\n<li style=\"margin:0px;padding:0px;\">Aktualnie dostępne sposoby płatności w formie przedpłat w Sklepie Internetowym dostępne są pod adresem <a href=\"https://gnom-sklep.pl/pl/payments.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/payments.html</a>.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 5. Dostawa</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Na Elektronicznym formularzu zamówienia Klient dokonuje wyboru sposobu dostawy poprzez zaznaczenie dokonanego wyboru.</li>\n<li style=\"margin:0px;padding:0px;\">W przypadku, gdy nie dojdzie do odbioru Towaru przez Klienta, czego efektem będzie zwrot Towaru do Sprzedawcy - Sprzedawca może odstąpić od umowy sprzedaży, po uprzednim wezwaniu Klienta w wiadomości e-mail podanej w procesie zakupowym do wykonania umowy. Odstąpienie od umowy następuje poprzez złożenie Klientowi oświadczenia w postaci wiadomości e-mail.</li>\n<li style=\"margin:0px;padding:0px;\">W sytuacji wskazanej w pkt 2, Sprzedawca zobowiązany jest niezwłocznie zwrócić Klientowi otrzymaną płatność za zakupiony przez Klienta Towar.</li>\n<li style=\"margin:0px;padding:0px;\">Aktualnie dostępne sposoby dostawy w Sklepie Internetowym dostępne są pod adresem <a href=\"https://gnom-sklep.pl/pl/delivery.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/delivery.html</a>.</li>\n<li style=\"margin:0px;padding:0px;\">Informacja na temat czasu dostaw produktów \'\'Dostępne na zamówienie\'\':<br style=\"margin:0px;padding:0px;\" />Zawsze staramy się zapewnić Państwu jak najbardziej rzetelne i dokładne informacje odnośnie dostępności towarów, jednakże w przypadku produktów dostępnych na zamówienie, czas dostawy jest przybliżony i ostatecznie może ulec zmianie w zależności od dostępności danego produktu u producenta.<br style=\"margin:0px;padding:0px;\" />Dokładamy wszelkich możliwych starań, aby nasza oferta była stale aktualna i odzwierciedlała rzeczywisty stan magazynowy naszych dostawców. Niemniej jednak, istnieje szansa, że pewne produkty mogą czasami być chwilowo niedostępne u producenta, co może wpłynąć na opóźnienie czasu dostawy.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 6. Odstąpienie od umowy - elektroniczny formularz zwrotu</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Konsument, który zawarł Umowę sprzedaży na odległość może w terminie 14 dni odstąpić od niej bez podawania przyczyny. W przypadku odstąpienia od Umowy sprzedaży zawartej na odległość - umowę uważa się za niezawartą.</li>\n<li style=\"margin:0px;padding:0px;\">Prawo do odstąpienia od umowy na zasadach określonych w paragrafach 6 i 7 niniejszego Regulaminu przysługuje także Przedsiębiorcy indywidualnemu. O ile mowa w paragrafach 6 i 7 niniejszego Regulaminu o Konsumencie, rozumie się przez to również Przedsiębiorcę indywidualnego.</li>\n<li style=\"margin:0px;padding:0px;\">W przypadku odstąpienia od umowy - Konsument ponosi tylko bezpośrednie koszty zwrotu Towaru.</li>\n<li style=\"margin:0px;padding:0px;\">Oświadczenie Konsumenta musi jednoznacznie wyrażać jego wolę odstąpienia od umowy, w szczególności Konsument może:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">skorzystać z elektronicznego formularza zwrotu dostępnego na stronie Sklepu Internetowego: <a href=\"https://gnom-sklep.pl/pl/returns-open.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/returns-open.html</a>.</li>\n<li style=\"margin:0px;padding:0px;\">odstąpić od umowy wykorzystując formularz odstąpienia od umowy, będący Załącznikiem nr 2 - wysyłając go na adres siedziby Sprzedającego.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca niezwłocznie potwierdzi na Trwałym nośniku fakt otrzymania oświadczenia o odstąpieniu od umowy złożonego w sposób wskazany w ppkt 1 i 2.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem.</li>\n<li style=\"margin:0px;padding:0px;\">Bieg terminu do odstąpienia od umowy rozpoczyna się:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">dla umowy w wykonaniu, której Sprzedający wydaje rzecz, będąc zobowiązany do przeniesienia jej własności - od objęcia w posiadanie Towaru przez Konsumenta lub wskazaną przez niego osobę trzecią inną niż przewoźnik, a w przypadku umowy, która:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">obejmuje wiele rzeczy, które są dostarczane osobno, partiami lub w częściach - od objęcia w posiadanie ostatniej rzeczy, partii lub części;</li>\n<li style=\"margin:0px;padding:0px;\">polega na regularnym dostarczaniu rzeczy przez czas oznaczony - od objęcia w posiadanie pierwszej z rzeczy;</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">dla pozostałych umów - od dnia zawarcia umowy.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Formularz oświadczenia o odstąpieniu od umowy (Załącznik Nr 2 do niniejszego Regulaminu) oraz informacja dotycząca korzystania z prawa odstąpienia od umowy (Załącznik Nr 1 do niniejszego Regulaminu) są przekazywane w formie elektronicznej.</li>\n<li style=\"margin:0px;padding:0px;\">W przypadku odstąpienia od umowy o dostarczanie Treści cyfrowej lub Usługi cyfrowej Sprzedawca może uniemożliwić Konsumentowi dalsze korzystanie z Treści cyfrowych lub Usługi cyfrowej, w szczególności poprzez uniemożliwienie Konsumentowi dostępu do Treści cyfrowych lub Usługi cyfrowej.</li>\n<li style=\"margin:0px;padding:0px;\">W przypadku odstąpienia od Umowy o dostarczanie Treści cyfrowej lub Usługi cyfrowej Konsument zobowiązany jest zaprzestać korzystania z tej Treści cyfrowej lub Usługi cyfrowej i udostępniania ich osobom trzecim.</li>\n<li style=\"margin:0px;padding:0px;\">Prawo odstąpienia od Umowy sprzedaży zawartej na odległość nie przysługuje w odniesieniu do umów wskazanych w art. 38 ustawy z dnia 30.05.2014 r. (Dz.U. z 2019 r. poz. 134) o prawach konsumenta, m.in. Umów:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">o świadczenie usług, za które Konsument jest zobowiązany do zapłaty ceny, jeżeli Sprzedawca wykonał w pełni usługę za wyraźną i uprzednią zgodą Konsumenta, który został poinformowany przed rozpoczęciem świadczenia, że po spełnieniu świadczenia przez Sprzedającego utraci prawo do odstąpienia od umowy i przyjął to do wiadomości.</li>\n<li style=\"margin:0px;padding:0px;\">w której cena lub wynagrodzenie zależy od wahań na ryku finansowym, nad którymi przedsiębiorca nie sprawuje kontroli, i które mogą wystąpić przed upływem terminu do odstąpienia od umowy;</li>\n<li style=\"margin:0px;padding:0px;\">których przedmiotem świadczenia jest rzecz nieprefabrykowana, wyprodukowana według specyfikacji Konsumenta lub służąca zaspokojeniu jego zindywidualizowanych potrzeb;</li>\n<li style=\"margin:0px;padding:0px;\">których przedmiotem świadczenia jest rzecz dostarczana w zapieczętowanym opakowaniu, której po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych, jeżeli opakowanie zostało otwarte po dostarczeniu;</li>\n<li style=\"margin:0px;padding:0px;\">których przedmiotem świadczenia są nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu, jeżeli opakowanie zostało otwarte po dostarczeniu;</li>\n<li style=\"margin:0px;padding:0px;\">o dostarczanie Treści cyfrowych niedostarczanych na nośniku materialnym, za które Konsument jest zobowiązany do zapłaty ceny, jeżeli Sprzedawca rozpoczął świadczenie za wyraźną i uprzednią zgodą Konsumenta, który został poinformowany przed rozpoczęciem świadczenia, że po spełnieniu świadczenia przez Sprzedawcę utraci prawo do odstąpienia od umowy i przyjął to do wiadomości;</li>\n<li style=\"margin:0px;padding:0px;\">których przedmiotem jest rzecz ulegająca szybkiemu zepsuciu lub mająca krótki termin przydatności do użycia, oraz w której przedmiotem świadczenia są rzeczy, które po dostarczeniu, ze względu na swój charakter, zostają nierozłącznie połączone z innymi rzeczami;</li>\n<li style=\"margin:0px;padding:0px;\">o dostarczanie dzienników, periodyków lub czasopism, z wyjątkiem umowy o prenumeratę;</li>\n<li style=\"margin:0px;padding:0px;\">zawartej w drodze aukcji publicznej;</li>\n<li style=\"margin:0px;padding:0px;\">o świadczenie usług w zakresie zakwaterowania, innych niż do celów mieszkalnych, przewozu rzeczy, najmu samochodów, gastronomii, usług związanych z wypoczynkiem, wydarzeniami rozrywkowymi, sportowymi lub kulturalnymi, jeżeli w umowie oznaczono dzień lub okres świadczenia usługi;</li>\n<li style=\"margin:0px;padding:0px;\">w której przedmiotem świadczenia są napoje alkoholowe, których cena została uzgodniona przy zawarciu umowy sprzedaży, a których dostarczenie może nastąpić dopiero po upływie 30 dni i których wartość zależy od wahań na rynku, nad którymi przedsiębiorca nie ma kontroli;</li>\n</ol>\n</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 7. Skutki odstąpienia od umowy</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Sprzedawca w ciągu 14 dni od dnia otrzymania oświadczenia o odstąpieniu od Umowy sprzedaży rzeczy, zwróci Konsumentowi wszystkie dokonane przez niego płatności, w tym koszty dostawy, odpowiadające najtańszemu oferowanemu przez Sprzedawcę sposobowi dostarczenia.\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Zwrot płatności zostanie dokonany przy użyciu takiego samego sposobu zapłaty, jakiego użył Konsument.</li>\n<li style=\"margin:0px;padding:0px;\">Jeżeli Konsument celem realizacji prawa do odstąpienia - skorzysta z Elektronicznego formularza zwrotu - środki będą zwrócone wybranym sposobem i na podany przez Konsumenta rachunek bankowy.</li>\n<li style=\"margin:0px;padding:0px;\">Jeżeli Sprzedawca nie zaproponował, że sam odbierze Towar od Konsumenta, może wstrzymać się ze zwrotem płatności otrzymanych od Konsumenta do chwili otrzymania Towaru z powrotem lub dostarczenia przez Konsumenta dowodu jego odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca może zaproponować Konsumentowi, że sam odbierze od niego rzecz. Jeżeli jednak Sprzedawca nie złożył takiej propozycji - Konsument powinien zwrócić rzecz Sprzedawcy (lub osobie upoważnionej przez Sprzedawcę do odbioru) niezwłocznie, jednak nie później niż 14 dni od dnia, w którym odstąpił od umowy. Do zachowania terminu wystarczy odesłanie rzeczy przed jego upływem. Towar, który Konsument zwraca powinien wysyłać go na adres siedziby Sprzedawcy.</li>\n<li style=\"margin:0px;padding:0px;\">Konsument jest odpowiedzialny za zmniejszenie wartości Towaru będące wynikiem korzystania z niego w sposób wykraczający poza konieczny do stwierdzenia charakteru, cech i funkcjonowania Towaru.</li>\n<li style=\"margin:0px;padding:0px;\">Konsument nie może odstąpić od umowy, jeżeli Treść cyfrowa lub Usługa cyfrowa są dostarczane w zamian za zapłatę ceny, a brak zgodności Treści cyfrowej lub Usługi cyfrowej z umową jest nieistotny.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca może żądać zwrotu nośnika materialnego, na którym dostarczył Treść cyfrową, w terminie 14 dni od dnia otrzymania oświadczenia Konsumenta o odstąpieniu od umowy. Konsument zwraca nośnik niezwłocznie i na koszt Sprzedającego.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca jest zobowiązany do zwrotu ceny jedynie w części odpowiadającej Treści lub Usłudze cyfrowej niezgodnej z umową oraz Treści cyfrowej lub Usłudze cyfrowej, których obowiązek dostarczenia odpadł wskutek odstąpienia od umowy.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 8. Reklamacja</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Reklamację z tytułu wady Towaru albo niezgodności Towaru z zawartą Umową sprzedaży na odległość można złożyć:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">za pośrednictwem Elektronicznego formularza reklamacyjnego;</li>\n<li style=\"margin:0px;padding:0px;\">w formie pisemnej na adres siedziby Sprzedającego lub poprzez e-mail na adres kontakt@gnom-sklep.pl.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">W zgłoszeniu należy określić wadę, jaką zdaniem Kupującego Towar posiada, żądania wobec Sprzedającego oraz jeżeli jest to możliwe – udokumentować rzeczoną wadę oraz przedstawić dowód zakupu Towaru w Sklepie Internetowym. Sprzedawca obowiązany jest udzielić odpowiedzi na reklamację w terminie 14 dni od dnia jej otrzymania. Jeżeli nie udzielił odpowiedzi w ww terminie uważa się, że uznał reklamację. Odpowiedź na reklamację Sprzedawca przekazuje Kupującemu na piśmie lub Trwałym Nośniku.</li>\n<li style=\"margin:0px;padding:0px;\">Kroki jakie musi podjąć Kupujący celem złożenia reklamacji, w tym sposób doręczenia Sprzedawcy reklamowanego Towaru wskazane są w na poszczególnych etapach w Elektronicznym formularzu reklamacyjnym.</li>\n<li style=\"margin:0px;padding:0px;\">W przypadku uznania przez Sprzedawcę reklamacji za uzasadnioną: koszty wymiany, naprawy, w tym koszt przesyłki związanej z reklamacją Towaru ponosi Sprzedający.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca jest odpowiedzialny wobec Konsumenta, a także Przedsiębiorcy indywidualnego za brak zgodności Towaru z Umową sprzedaży na odległość na zasadach, które wynikają z ustawy z dnia 30.05.2014 r. o prawach konsumenta.\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Sprzedawca ponosi odpowiedzialności za brak zgodności Towaru z Umową sprzedaży zawartą na odległość istniejący w chwili jego dostarczenia i ujawniony w ciągu dwóch lat od tej chwili, chyba, że termin przydatności Towaru do użycia, określony przez Sprzedawcę jest dłuższy.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca dokonuje naprawy lub wymiany Towaru w terminie 14 dni od dnia uznania reklamacji. Koszty naprawy lub wymiany, w tym w szczególności koszty opłat pocztowych, przewozu, robocizny i materiałów, ponosi Sprzedający.</li>\n<li style=\"margin:0px;padding:0px;\">Konsument udostępnia Sprzedawcy Towar podlegający naprawie lub wymianie. Sprzedawca odbiera Towar na swój koszt.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca jest zobowiązany dostarczyć Towary wolne od wad i jest odpowiedzialny względem Przedsiębiorcy za wady zakupionego Towaru na zasadach określonych w kodeksie cywilnym.</li>\n<li style=\"margin:0px;padding:0px;\">Dostarczanie Konsumentowi lub Przedsiębiorcy indywidualnemu Treści cyfrowej lub Usługi cyfrowej odbywa się na zasadach, które wynikają z ustawy z dnia 30.05.2014 r. o prawach konsumenta.\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Treść cyfrową uważa się za dostarczoną w chwili, gdy Treść cyfrowa lub środek, który pozwala na uzyskanie dostępu do Treści cyfrowej lub pobranie Treści cyfrowej, zostały udostępnione Konsumentowi lub fizycznemu lub wirtualnemu urządzeniu, które Konsument wybrał samodzielnie w tym celu, lub gdy Konsument lub takie urządzenie, uzyskali do niej dostęp.</li>\n<li style=\"margin:0px;padding:0px;\">Usługę cyfrową uważa się za dostarczoną w chwili, gdy Konsument lub fizyczne lub wirtualne urządzenie, które Konsument wybrał samodzielnie w tym celu, uzyskali do niej dostęp.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca doprowadza Treść cyfrową lub Usługę cyfrową do zgodności z umową w terminie 21 dni od chwili, w której Sprzedawca został poinformowany przez Konsumenta o braku zgodności z umową, i bez nadmiernych niedogodności dla Konsumenta, uwzględniając ich charakter oraz cel, w jakim są wykorzystywane. Koszty doprowadzenia Treści cyfrowej lub Usługi cyfrowej do zgodności z Umową ponosi Sprzedający.</li>\n</ol>\n</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 9. Opinie</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Opinię dotyczącą obsługi zamówienia lub opinię dotyczącą Towaru można umieścić podczas wizyty w Sklepie Internetowym poprzez kliknięcie w interfejs umieszczony przy Towarze albo poprzez kliknięcie w link umieszczony w wiadomości e-mail. Dodanie Opinii jest dobrowolne i nieodpłatne. W ramach jednego zamówienia - Klient ma możliwość wyłącznie jednokrotnego dodania ww Opinii.</li>\n<li style=\"margin:0px;padding:0px;\">W ramach ww. Opinii Klient może przyznać ocenę w formie gwiazdek od 1 do 5 oraz dodać wypowiedź słowną limitowaną do 65535 znaków słownych.</li>\n<li style=\"margin:0px;padding:0px;\">Oceny są przechowywane i prezentowane publicznie na stronie Sklepu Internetowego, a także na stronach internetowych <a href=\"https://zaufaneopinie.idosell.com/\" style=\"margin:0px;padding:0px;color:#333333;\">https://zaufaneopinie.idosell.com</a> oraz <a href=\"https://trustedreviews.idosell.com/\" style=\"margin:0px;padding:0px;color:#333333;\">https://trustedreviews.idosell.com</a>.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca weryfikuje Opinie za pomocą adresu e-mail, który został użyty w procesie zakupowym danego Towaru. Opinia, która umieszcza jest przez osobę posługującą się e-mailem, który został użyty w procesie zakupowym - oznacza jest na stronie Sklepu komentarzem \"opinia potwierdzona zakupem\". Każda inna Opinia oznaczana jest jako \"opinia niepotwierdzona zakupem\".</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedający może publikować Opinie dotyczące danego Towaru z innych swoich Sklepów internetowych.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedający nie zmienia Opinii w zakresie treści ani przyznanych gwiazdek.</li>\n<li style=\"margin:0px;padding:0px;\">Kupujący wyłącznie i samodzielnie ponosi odpowiedzialność za wypowiedź poczynioną w ramach Opinii. Sprzedawca jest uprawniony do usunięcia Opinii na zasadach wynikających z przepisów prawa i niniejszego Regulaminu.</li>\n<li style=\"margin:0px;padding:0px;\">Niedopuszczalne jest zamieszczanie treści zawierających informacje nieprawdziwe, wprowadzające w błąd, wulgarne, agresywne, o charakterze obraźliwym lub będące w oczywisty sposób uznane za niezgodne z dobrymi obyczajami. Niedopuszczalne też jest umieszczanie treści o charakterze bezprawnym, naruszających prawa osób trzecich, czy stanowiących czyn nieuczciwej konkurencji.</li>\n<li style=\"margin:0px;padding:0px;\">Klient zobowiązuje się nie umieszczać treści, które zawierają linki do zewnętrznych serwisów internetowych, mających charakter promocyjny lub reklamowy lub zawierających dane osobowe osób trzecich.</li>\n<li style=\"margin:0px;padding:0px;\">Na wyraźną prośbę Klienta treść Opinii może zostać ukryta dla innych użytkowników Sklepu, ale przyznana ocena w formie gwiazdek wliczana jest w ogólną ocenę Sklepu i Towaru.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 10. Własność intelektualna</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Klient oświadcza, że nie przysługują mu jakiekolwiek prawa, w tym prawa autorskie bądź pokrewne do Ocen i wypowiedzi przez niego zamieszczonych, poza uprawnieniem do korzystania z Sklepu Internetowego w sposób określony w Regulaminie. Klient nie jest uprawniony do jakiegokolwiek utrwalania, zwielokrotniania, udostępniania, upubliczniania bądź rozpowszechniania treści, chyba, że takie uprawnienie wynika z przepisów prawa lub Regulaminu.</li>\n<li style=\"margin:0px;padding:0px;\">Klient nie jest uprawniony do jakiejkolwiek ingerencji w treści, w szczególności nie jest uprawniony do ingerowania w treść, strukturę, formę, grafikę, mechanizm działania, ani inne elementy Sklepu Internetowego.</li>\n<li style=\"margin:0px;padding:0px;\">Klient zamieszczając w Sklepie internetowym Opinie, które stanowią utwory w rozumieniu ustawy z dnia 4.2.1994 r. o prawie autorskim i prawach pokrewnych - udziela Sprzedającemu niewyłącznej i nieodpłatnej i nieograniczonej czasowo oraz terytorialnie licencji do korzystania przez Sprzedającego z tych utworów, wraz z prawem do udzielenia sublicencji, która obejmuje publiczne udostępnianie utworu w taki sposób, aby każdy mógł mieć do niego dostęp w miejscu i w czasie przez siebie wybranym (Internet). Licencja zostaje udzielona w odniesieniu do wszystkich pól eksploatacyjnych znanych w chwili jej udzielania, w szczególności do następujących pól eksploatacji:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">w zakresie utrwalania i zwielokrotniania utworu dowolną techniką - w szczególności techniką drukarską, reprograficzną, zapisu magnetycznego, cyfrową tj. przy użyciu jakichkolwiek technik na jakimkolwiek nośniku audiowizualnym lub wizualnym, w szczególności na dyskach audiowizualnych, płytach CD, dysku komputerowym, w sieci multimedialnej, w tym internetowych oraz powiązanych serwisach on-line oraz zwielokrotniania, utrwalania, wykorzystania w Internecie, reklamie, zwielokrotniania zapisu w formie elektronicznej w pamięci komputera oraz w sieciach wewnętrznych, jak i zewnętrznych,</li>\n<li style=\"margin:0px;padding:0px;\">wykorzystywanie całości lub fragmentów bądź dowolnych elementów utworu z możliwością dokonania modyfikacji wynikającej z istoty danego medium internetowego - we wszystkich wydawnictwach, w szczególności internetowych, cyfrowych, w biuletynach i informacjach, samodzielnie bądź w połączeniu z innymi utworami bądź fragmentami utworów; wykorzystywanie w całości lub fragmencie w celu promocji i reklamy, w szczególności w formie reklamy audiowizualnych, audio, medialnych.</li>\n<li style=\"margin:0px;padding:0px;\">w zakresie obrotu oryginałem albo egzemplarzami, na których utwór utrwalono - wprowadzenie do obrotu, użyczenie, najem oryginału albo egzemplarzy,</li>\n<li style=\"margin:0px;padding:0px;\">w zakresie rozpowszechnia utworu w sposób inny niż określony powyżej - publiczne wykonanie, wystawienie, wyświetlenie, odtworzenie oraz nadawanie i reemitowanie, a także publiczne udostępnianie utworu w taki sposób, aby każdy mógł mieć do niego dostęp w miejscu i w czasie przez siebie wybranym,</li>\n<li style=\"margin:0px;padding:0px;\">wykorzystanie utworów dla celów promocyjnych i marketingowych;</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Usunięcie Konta przez Klienta lub Opinii w myśl rozdziału 9 pkt 8 nie ma wpływu na obowiązywanie powyższej licencji.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 11. Zasady sprzedaży w modelu subskrypcji</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Usługa elektroniczna w postaci Subskrypcji może być świadczona przez Sprzedawcę na rzecz Kupującego.</li>\n<li style=\"margin:0px;padding:0px;\">Korzystanie z Subskrypcji umożliwia cykliczną dostawę wybranych Towarów, we wskazanych przez Klienta odstępach czasu, bez konieczności składania kolejnych zamówień aż do zakończenia Subskrypcji. Płatność za Subskrypcję dokonywana jest wyłącznie przy wykorzystaniu mechanizmu Płatności cyklicznych i tylko za pośrednictwem jednej Karty.</li>\n<li style=\"margin:0px;padding:0px;\">Odpięcie Karty z Subskrypcji powoduje zakończenie Subskrypcji.</li>\n<li style=\"margin:0px;padding:0px;\">Transakcje w ramach Płatności cyklicznych będą realizowane tylko i wyłącznie po wcześniejszym dokonaniu rejestracji posiadacza Karty w serwisie Operatora (lub podmiotu, za pośrednictwem którego Operator obsługuje Transakcje). Rejestracja będzie miała na celu uwiarygodnienie, że Klient zlecający Płatność cykliczną jest uprawnionym posiadaczem Karty, która będzie obciążana. Przed dokonaniem rejestracji Karty na stronie transakcyjnej, Klient zobowiązany jest udzielić zgody na regularne pobieranie opłat poprzez uruchomienie usługi Płatności cyklicznych. Zgoda jest przechowywana w serwisie Operatora.</li>\n<li style=\"margin:0px;padding:0px;\">Kupujący tworzy Subskrypcję poprzez zaznaczenie tej formy zakupu w Elektronicznym formularzu zamówienia. Potwierdzenie utworzenia Subskrypcji wysyłane jest niezwłocznie na adres e-mailowy Kupującego, wskazany przy dokonywaniu pierwszego Zamówienia subskrypcyjnego.</li>\n<li style=\"margin:0px;padding:0px;\">Klient zarządza Subskrypcją poprzez Konto według dostępnych opcji.</li>\n<li style=\"margin:0px;padding:0px;\">Subskrypcja dokonywana jest na czas nieokreślony.</li>\n<li style=\"margin:0px;padding:0px;\">Klient możne zakończyć Subskrypcję w każdym czasie. Zakończenie Subskrypcji przez Klienta jest równoznaczne z cofnięciem zgody na kolejne obciążenia w ramach Płatności cyklicznych. W tej sytuacji kolejne Zamówienie subskrypcyjne nie zostanie utworzone. Jeżeli zakończenie Subskrypcji nastąpi po upływie daty wskazanej w e-mailu, o którym mowa w pkt 11 to bieżące Zamówienie subskrypcyjne zostanie zrealizowane jako ostatnie.<br style=\"margin:0px;padding:0px;\" />a). Zakończenie Subskrypcji następuje poprzez wybranie przez Kupującego opcji „Zakończ subskrypcję” w ustawieniach danej Subskrypcji, które są dostępne po zalogowaniu Klienta z poziomu jego Konta.<br style=\"margin:0px;padding:0px;\" />b). Kupujący może również zakończyć Subskrypcję przez e-mailowy kontakt z obsługą sklepu kontakt@gnom-sklep.pl.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca ma prawo zakończyć Subskrypcję, o czym poinformuje Kupującego w formie e-mail lub przez kontakt telefoniczny z minimum 7 dniowym wyprzedzeniem. W ten sytuacji środki z Karty nie zostaną pobrane oraz nie będą tworzone kolejne Zamówienia subskrypcyjne.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca jest uprawniony do zmian cen Towarów w trakcie trwania Subskrypcji, o czym Kupujący jest informowany w korespondencji e-mailowej, o której mowa w pkt. 11.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedający wysyła do Kupującego wiadomość e-mailową o utworzeniu Zamówienia subskrypcyjnego z podaniem jego przedmiotu, ilości, ceny (w tym o zmianie ceny jeżeli miała ona miejsce), terminie realizacji oraz o dacie planowego pobrania środków z Karty - nie później niż na 3 dni przed pobraniem środków z Karty. Ponadto, Sprzedający informuje Kupującego o możliwości zakończenia Subskrypcji załączając link prowadzący do ustawień umożliwiających zakończenie danej Subskrypcji z poziomu Konta Klienta i datę, do której będzie to skuteczne. W przypadku zakończenia Subskrypcji po dacie wskazanej w mailu - zakończenie będzie miało skutek do kolejnych Zamówień subskrypcyjnych. Oznacza to, że Subskrypcja zostanie zakończona, ale jako ostatnie zostanie zrealizowane bieżące Zamówienie subskrypcyjne.</li>\n<li style=\"margin:0px;padding:0px;\">Jeżeli próba obciążenia Karty nie powiedzie się, Klient e-mailem zostanie poinformowany o braku możliwości pobrania płatności. Możliwe powody braku pobrania płatności to: brak środków na Karcie, utrata ważności Karty lub problemy techniczne.</li>\n<li style=\"margin:0px;padding:0px;\">Utrata ważności Karty powiązanej z Subskrypcją lub brak możliwości autoryzacji zlecenia płatniczego z innych powodów powoduje zakończenie Subskrypcji.</li>\n<li style=\"margin:0px;padding:0px;\">Zamówienie subskrypcyjne zostanie zrealizowane wyłącznie po skutecznym pobraniu środków z Karty.</li>\n<li style=\"margin:0px;padding:0px;\">Zakończenie Subskrypcji pociąga za sobą natychmiastowe rozwiązanie umowy sprzedaży Towaru.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 12. Postanowienia końcowe</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Niniejsze Warunki korzystania obowiązują od dnia 2023.06.14.</li>\n<li style=\"margin:0px;padding:0px;\">W razie zmiany lub unieważnienia któregokolwiek z postanowień niniejszego Regulaminu decyzją kompetentnego organu lub sądu, pozostałe jego postanowienia pozostają w mocy i wiążą Sprzedawcę oraz Klienta.</li>\n<li style=\"margin:0px;padding:0px;\">Sprzedawca zastrzega prawo zmiany niniejszego regulaminu. Wszelkie umowy zawarte przed dniem wejścia w życie nowego regulaminu, realizowane są na podstawie regulaminu, który obowiązywał w dniu zawarcia umowy.</li>\n<li style=\"margin:0px;padding:0px;\">Prawem właściwym dla rozstrzygania wszelkich sporów związanych z Regulaminem jest prawo polskie. Spory te będą rozstrzygane przez właściwy miejscowo sąd powszechny. Klient będący Konsumentem może również skorzystać z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń. Wszelkie informacje dotyczące pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń można uzyskać na stronie internetowej Urzędu Ochrony Konkurencji i Konsumentów pod adresem: www.uokik.gov.pl. Jednocześnie informujemy, że wskazane postępowania mają charakter dobrowolny i obie strony muszą wyrazić na nie zgodę.</li>\n<li style=\"margin:0px;padding:0px;\">Na podstawie Rozporządzenie Parlamentu Europejskiego i Rady (UE) nr 524/2013 z dnia 21 maja 2013 r. informujemy, iż pod adresem <a href=\"http://ec.europa.eu/consumers/odr\" style=\"margin:0px;padding:0px;color:#333333;\">http://ec.europa.eu/consumers/odr</a> dostępna jest platforma internetowego systemu rozstrzygania sporów pomiędzy konsumentami i przedsiębiorcami na szczeblu unijnym (platforma ODR). Platforma ODR stanowi stronę internetową z punktem kompleksowej obsługi dla konsumentów i przedsiębiorców dążących do pozasądowego rozstrzygnięcia sporu dotyczącego zobowiązań umownych wynikających z internetowej umowy sprzedaży lub umowy o świadczenie usług.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 13. Załącznik 1 - Informacje dotyczące korzystania z prawa odstąpienia od umowy</h4>\n<ol style=\"margin:15px 0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">Prawo do odstąpienia od umowy na poniższych zasadach przysługuje Konsumentowi i Przedsiębiorcy indywidualnemu.<br style=\"margin:0px;padding:0px;\" />Mają Państwo prawo odstąpić od niniejszej umowy w terminie 14 dni bez podania jakiejkolwiek przyczyny. Termin do odstąpienia od umowy wygasa po upływie 14 dni:\n<ol style=\"margin:0px;padding:0px 0px 0px 30px;color:inherit;line-height:normal;\">\n<li style=\"margin:0px;padding:0px;\">w przypadku umowy sprzedaży od dnia, w którym weszli Państwo w posiadanie rzeczy lub w którym osoba trzecia inna niż przewoźnik i wskazana przez Państwa weszła w posiadanie rzeczy;</li>\n<li style=\"margin:0px;padding:0px;\">w przypadku umowy zobowiązującej do przeniesienia własności wielu rzeczy, które dostarczane są osobno od dnia, w którym weszli Państwo w posiadanie ostatniej z rzeczy lub w którym osoba trzecia inna niż przewoźnik i wskazana przez Państwa weszła w posiadanie ostatniej z rzeczy;</li>\n<li style=\"margin:0px;padding:0px;\">w przypadku umowy zobowiązującej do przeniesienia własności rzeczy dostarczanych partiami lub w częściach od dnia w którym weszli Państwo w posiadanie ostatniej partii lub części lub w którym osoba trzecia inna niż przewoźnik i wskazana przez Państwa weszła w posiadanie ostatniej partii lub części;</li>\n<li style=\"margin:0px;padding:0px;\">w przypadku umów o regularne dostarczanie rzeczy przez czas oznaczony od dnia, w którym weszli Państwo w posiadanie pierwszej z rzeczy lub w którym osoba trzecia inna niż przewoźnik i wskazana przez Państwa weszła w posiadanie pierwszej z rzeczy;</li>\n<li style=\"margin:0px;padding:0px;\">w przypadku umów, której przedmiotem jest dostarczanie usług lub treści cyfrowych, które nie są dostarczane na nośniku materialnym - od dnia zawarcia umowy.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;\">Aby skorzystać z prawa odstąpienia od umowy, muszą Państwo poinformować nas, tj.: GNOM – Artur Szymala, Szkolna 15A, 43-300 Bielsko-Biała, tel. +48 660 527 787, kontakt@gnom-sklep.pl o swojej decyzji o odstąpieniu od niniejszej umowy w drodze jednoznacznego oświadczenia (na przykład pismo wysłane pocztą, faksem lub pocztą elektroniczną).</li>\n<li style=\"margin:0px;padding:0px;\">Mogą Państwo skorzystać z wzoru formularza odstąpienia od umowy, jednak nie jest to obowiązkowe.</li>\n<li style=\"margin:0px;padding:0px;\">Mogą Państwo również wypełnić Elektroniczny formularz zwrotu dostępny na stronie Sklepu Internetowego: <a href=\"https://gnom-sklep.pl/pl/returns-open.html\" style=\"margin:0px;padding:0px;color:#333333;\">https://gnom-sklep.pl/pl/returns-open.html</a>. Jeżeli skorzystają Państwo z tej możliwości, prześlemy Państwu niezwłocznie potwierdzenie otrzymania informacji o odstąpieniu od umowy na trwałym nośniku.</li>\n<li style=\"margin:0px;padding:0px;\">Aby zachować termin do odstąpienia od umowy, wystarczy, aby wysłali Państwo informację dotyczącą wykonania przysługującego Państwu prawa odstąpienia od umowy przed upływem terminu do odstąpienia od umowy.</li>\n<li style=\"margin:0px;padding:0px;\">W przypadku odstąpienia od niniejszej umowy zwracamy Państwu wszystkie otrzymane od Państwa płatności, w tym koszty dostarczenia rzeczy (z wyjątkiem dodatkowych kosztów wynikających z wybranego przez Państwa sposobu dostarczenia innego niż najtańszy zwykły sposób dostarczenia oferowany przez nas), niezwłocznie, a w każdym przypadku nie później niż 14 dni od dnia, w którym zostaliśmy poinformowani o Państwa decyzji o wykonaniu prawa odstąpienia od niniejszej umowy. Zwrotu płatności dokonamy przy użyciu takich samych sposobów płatności, jakie zostały przez Państwa użyte w pierwotnej transakcji, chyba że wyraźnie zgodziliście się Państwo na inne rozwiązanie.</li>\n<li style=\"margin:0px;padding:0px;\">W przypadku umów zobowiązujących do przeniesienia własności rzeczy, w których nie zaproponowaliśmy odbioru Towaru w przypadku odstąpienia od umowy - mamy wstrzymać się ze zwrotem płatności do czasu otrzymania rzeczy lub do czasu dostarczenia nam dowodu jej odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</li>\n<li style=\"margin:0px;padding:0px;\">Zwracaną rzecz proszę odesłać na adres: GNOM – Artur Szymala, Szkolna 15A, 43-300 Bielsko-Biała niezwłocznie, a w każdym razie nie później niż 14 dni od dnia, w którym poinformowali nas Państwo o odstąpieniu od niniejszej umowy. Termin jest zachowany, jeżeli odeślą Państwo rzecz przed upływem terminu 14 dni. Będą Państwo musieli ponieść bezpośrednie koszty zwrotu rzeczy.</li>\n<li style=\"margin:0px;padding:0px;\">Ze względu na wagę i gabaryty Towaru, w przypadku odstąpienia od umowy - odesłanie Towaru może wiązać się z wyższymi kosztami niż zwykła przesyłka pocztą. W przypadku chęci skorzystania z usług firm kurierskich konieczne może się okazać nadanie przesyłki na palecie, która jest droższa niż zwykła przesyłka pocztowa.</li>\n</ol>\n<h4 style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;font-size:1.17em;\">§ 14. <a href=\"https://gnom-sklep.pl/regulation.php?file=att2\" style=\"margin:0px;padding:0px;color:#333333;\">Załącznik 2 - Wzór formularza odstąpienia od umowy</a></h4>\n</div>\n</div>','regulamin'),(4,1,1,'o nas','','Learn more about us','about us, informations','<h2 style=\"text-align:center;\">o nas</h2>\n<p style=\"margin:16px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:14px;font-weight:400;background-color:#ffffff;\">Sklep Gnom powstał w październiku 2000 roku. Działa przede wszystkim jako sklep stacjonarny oraz klub hobbystyczny.<br style=\"margin:0px;padding:0px;\" />Jest prowadzony przez hobbystów i dla hobbystów.</p>\n<p style=\"margin:16px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:14px;font-weight:400;background-color:#ffffff;\">Dzięki zaangażowaniu pracowników otrzymaliśmy status Premium przyznawany przez firmę Games Workshop. Tytuł ten zapewnia o doskonałej obsłudze klienta, pełnym asortymencie oraz wykwalifikowanych pracownikach.<br style=\"margin:0px;padding:0px;\" />Również firma Wizards of the Coast - wydawca m.in. gry Magic: the Gathering - doceniła pracę sklepu przyznając mu status lokacji Advanced.</p>\n<p style=\"margin:16px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:14px;font-weight:400;background-color:#ffffff;\">Organizujemy turnieje gier bitewnych (Warhammer Fantasy Battles, Warhammer 40.000, Lord of the Rings, Infinity the Game, Neuroshima Tactics), kolekcjonerskich gier karcianych (Magic: the Gathering, World of Warcraft, Legend of the Five Rings) oraz gier planszowych (np. Munchkin, Wsiąść do Pociągu).</p>\n<p style=\"margin:16px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:14px;font-weight:400;background-color:#ffffff;\">W naszym sklepie można wziąć udział w zajęciach modelarskich, w trakcie których udostępniamy potrzebne materiały oraz uczymy zarówno podstawowych, jak i zaawansowanych technik modelarskich.<br style=\"margin:0px;padding:0px;\" />Odbywają się również cykliczne imprezy, takie, jak noce z grami planszowymi, Halloween itp.</p>\n<p style=\"margin:16px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:14px;font-weight:400;background-color:#ffffff;\">Naszymi głównymi przedsięwzięciami co roku są: Gnomicon oraz Mistrzostwa Podbeskidzia.</p>\n<p style=\"margin:16px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:14px;font-weight:400;background-color:#ffffff;\">Współpracujemy z domami kultury, szkołami, uczelniami, akademikami, organizując pokazy, spotkania z grami planszowymi dostosowując się do indywidualnych potrzeb klientów.</p>\n<p style=\"margin:16px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:14px;font-weight:400;background-color:#ffffff;\">Nasz sklep stacjonarny znajduje się w Bielsku-Białej, przy ulicy Szkolnej 15A.</p>\n<p style=\"margin:16px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:14px;font-weight:400;background-color:#ffffff;\">Godziny otwarcia sklepu stacjonarnego:<br style=\"margin:0px;padding:0px;\" />Poniedziałek - Piątek 10:00-19:00<br style=\"margin:0px;padding:0px;\" />Sobota 10:00-16:00<br style=\"margin:0px;padding:0px;\" /><br style=\"margin:0px;padding:0px;\" />Telefony kontaktowe:<br style=\"margin:0px;padding:0px;\" />Sklep stacjonarny:<span style=\"margin:0px;padding:0px;\"> </span><span style=\"margin:0px;padding:0px;\">660 527 787</span><br style=\"margin:0px;padding:0px;\" />Właściciel Artur Szymała: 604229042<br style=\"margin:0px;padding:0px;\" /><br style=\"margin:0px;padding:0px;\" />Nasz adres e-mail:<br style=\"margin:0px;padding:0px;\" />sklep.gnom@gmail.com</p>','o-nas'),(5,1,1,'Sposoby płatności i prowizje','','Our secure payment mean','secure payment, ssl, visa, mastercard, paypal','<h2 style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-size:1.17em;font-family:\'main_custom\', Arial, sans-serif;background-color:#ffffff;text-align:center;\">Sposoby płatności i prowizje</h2>\n<h4>Płatności ekspresowe PayByLink</h4>\n<ul style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'main_custom\', Arial, sans-serif;font-size:13px;font-weight:400;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Alior Bank S.A.</li>\n<li style=\"margin:0px;padding:0px;\">Bank Polskiej Spółdzielczości</li>\n<li style=\"margin:0px;padding:0px;\">Bank Millennium</li>\n<li style=\"margin:0px;padding:0px;\">Bank Millennium Firmy</l