, sans-serif;line-height:1;text-align:center;\">Właściciel sklepu</h2>\n<div class=\"contact_address_sub\" style=\"margin:0px;padding:10px 0px 0px;line-height:1.6em;\">\n<div style=\"margin:0px 0px 20px;padding:0px;\">\n<div class=\"contact_address_data\" style=\"margin:0px;padding:0px;\">\n<p style=\"margin:0px;padding:0px;font-size:1em;\">GNOM – Artur Szymala</p>\n<div class=\"contact_data_address\" style=\"margin:0px;padding:0px;\">\n<div class=\"contact_data_address_sub\" style=\"margin:0px;padding:0px;\">\n<p id=\"contact_address_street\" style=\"margin:0px;padding:0px;\">Szkolna 15A, 43-300 Bielsko-Biała (POLSKA)</p>\n</div>\n</div>\n</div>\n</div>\n<div style=\"margin:0px 0px 20px;padding:0px;\">\n<p style=\"margin:0px;padding:0px;\"><span style=\"margin:0px 10px 0px 0px;padding:0px;font-weight:bold;width:199.5px;\">NIP:</span><span style=\"margin:0px;padding:0px;\">5471832783</span></p>\n<p style=\"margin:0px;padding:0px;\"><span style=\"margin:0px 10px 0px 0px;padding:0px;font-weight:bold;width:199.5px;\">REGON:</span><span style=\"margin:0px;padding:0px;\">072373564</span></p>\n<p style=\"margin:0px;padding:0px;\"><span style=\"margin:0px 10px 0px 0px;padding:0px;font-weight:bold;width:199.5px;\">Numer konta do wpłat:</span><span style=\"margin:0px;padding:0px;\">PL67 1140 2004 0000 3602 5246 0278</span></p>\n<p style=\"margin:0px;padding:0px;\"><span style=\"margin:0px 10px 0px 0px;padding:0px;font-weight:bold;width:199.5px;\">SWIFT:</span><span style=\"margin:0px;padding:0px;\">BREXPLPWMBK</span></p>\n<p style=\"margin:0px;padding:0px;\"><span style=\"margin:0px 10px 0px 0px;padding:0px;font-weight:bold;width:199.5px;\">Nasz bank:</span><span style=\"margin:0px;padding:0px;\">mBank</span></p>\n</div>\n</div>\n</div>','kontakt'),(7,1,1,'Odstąpienie od umowy','','','','<h1 style=\"text-align:center;\">Odstąpienie od umowy</h1>\n<h2 style=\"padding:0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;background-color:#ffffff;margin:0px 0px 20px;\">Kupione u nas towary zwrócisz łatwo i tanio w każdym Paczkomacie InPost</h2>\n<p style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">W naszym sklepie nie musisz się martwić o to, że wybrany rozmiar nie będzie pasował lub w jakikolwiek inny sposób nie spełni Twoich oczekiwań. Dzięki integracji naszego sklepu z tanimi zwrotami Paczkomatami InPost kupujesz bez stresu i obaw, że zwrot zakupionego towaru będzie drogą przez mękę.</p>\n<p style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">Zgodnie z obowiązującym prawem masz 14 dni na odstąpienie od umowy zawartej na odległość bez podawania przyczyny. Jeśli więc towar nie spełnia Twoich oczekiwań możesz go do nas odesłać w ciągu 14 dni od dnia odstąpienia od umowy. Wszystkie zwroty w naszym sklepie obsługiwane są przez bardzo prosty kreator zwrotów, który daje możliwość odesłania do nas paczki zwrotnej Paczkomatem InPost.</p>\n<p style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">Wybraliśmy InPost, jako naszego zaufanego partnera dla przesyłek zwrotnych, ze względu na:</p>\n<ul style=\"margin:15px 0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;padding:0px 0px 0px 30px;\">\n<li style=\"margin:0px;padding:0px;\">Prostą obsługę odsyłania towaru do naszego sklepu - wybierasz towar do zwrotu lub który chcesz zareklamować, generujesz i drukujesz etykietę na paczkę, którą nadajesz w dowolnym Paczkomacie w Polsce (należy przy tym pamiętać że wygenerowana etykieta jest ważna przez 30 dni);</li>\n<li style=\"margin:0px;padding:0px;\">Komfortowe położenie ponad 4000 Paczkomatów w całym kraju, których stale przybywa;</li>\n<li style=\"margin:0px;padding:0px;\">Wygodną i szybką wysyłkę towaru bez kolejek 24 godziny na dobę, 7 dni w tygodniu.</li>\n</ul>\n<p style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\"></p>\n<p style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">Dzięki naszej współpracy nie musisz więc czekać na kuriera. Wystarczy, że wydrukujesz automatycznie wygenerowane dokumenty i np. w drodze do pracy zostawisz przesyłkę w dogodnym dla Ciebie Paczkomacie.</p>\n<h2 style=\"padding:0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;background-color:#ffffff;margin:0px 0px 20px;\">Korzyści jakie odnosisz dzięki narzędziu do zwrotów w naszym sklepie.</h2>\n<h3 style=\"padding:0px;font-size:1.33em;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;background-color:#ffffff;margin:0px 0px 6px;\">Łatwo</h3>\n<p><span style=\"color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">Dodawanie zwrotu zostało sprowadzone do sześciu prostych kroków stanowiących kreator zwrotu. Kreator automatycznie wygeneruje dla Ciebie etykietę, którą musisz jedynie wydrukować. Dzięki temu nie tracisz czasu na ręczne wypełnianie żadnych dokumentów!</span></p>\n<h3 style=\"padding:0px;font-size:1.33em;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;background-color:#ffffff;margin:0px 0px 6px;\">Szybko i bezproblemowo</h3>\n<p><span style=\"color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">Dzięki automatyzacji procesu oszczędzasz czas i nerwy, nie musisz nigdzie dzwonić, ani z nikim negocjować warunków zwrotu.</span><span style=\"color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\"></span></p>\n<h3 style=\"padding:0px;font-size:1.33em;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;background-color:#ffffff;margin:0px 0px 6px;\">Wygodnie</h3>\n<p><span style=\"color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">Dokument zwrotu wraz z etykietami na paczkę wygenerujesz w kreatorze zwrotów. Po przygotowaniu paczki nie musisz czekać na kuriera. Zabierasz ją ze sobą w drodze do pracy lub szkoły i zostawiasz w dowolnym Paczkomacie.<br /></span><span style=\"color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\"></span></p>\n<h3 style=\"padding:0px;font-size:1.33em;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;background-color:#ffffff;margin:0px 0px 6px;\">Tanio</h3>\n<p><span style=\"color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">Opłata za dokonanie zwrotu to tylko 9,83 zł przy czym nie musisz jej opłacić w momencie dodawania zwrotu, czy generowania etykiety - zostanie ona odliczona od kwoty, którą zwrócimy Tobie za odesłany towar. Zależy nam na Twojej pełnej satysfakcji.<br /></span><span style=\"color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\"></span></p>\n<h3 style=\"padding:0px;font-size:1.33em;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;background-color:#ffffff;margin:0px 0px 6px;\">Bezpiecznie</h3>\n<p><span style=\"color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">Wszystkie zwracane przesyłki są ubezpieczone do wartości 200 zł.</span><span style=\"color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\"></span></p>\n<h2 style=\"padding:0px;color:inherit;line-height:normal;margin:0px 0px 20px;\">Dokonaj zwrotu w <span style=\"margin:0px;padding:0px;\">3 prostych</span> krokach!</h2>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\">W naszym sklepie nie musisz się martwić o to, że wybrany rozmiar nie będzie pasował lub w jakikolwiek inny sposób nie spełni Twoich oczekiwań. Dzięki integracji naszego sklepu z <span style=\"margin:0px;padding:0px;font-weight:bold;\">tanimi</span> zwrotami Paczkomatem kupujesz bez stresu i obaw!</p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"></p>\n<p style=\"margin:15px 0px;padding:0px;color:inherit;line-height:normal;\"><img src=\"https://localhost:8443/img/cms/gnom-odstopienie-cms.png\" alt=\"\" width=\"1171\" height=\"288\" /></p>\n<h2 style=\"padding:0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;background-color:#ffffff;margin:0px 0px 20px;\">Szczegóły dotyczące kroków przekazania zwrotu:</h2>\n<ul>\n<li style=\"color:inherit;line-height:normal;\">Zaloguj się na swoje konto, a następnie w panelu zwrotów wybierz towar, który chciałbyś zwrócić;</li>\n<li style=\"color:inherit;line-height:normal;\">W kolejnych krokach wybierz zwrot klikając na opcję „Skorzystam z przesyłek sklepu” oraz wybierając formę w jakiej chcesz otrzymać zwracane pieniądze;</li>\n<li style=\"color:inherit;line-height:normal;\">Wygeneruj dokumenty zwrotu wraz z etykietami adresowymi, następnie wydrukuj je i koniecznie podpisz dokument zwrotu;</li>\n<li style=\"color:inherit;line-height:normal;\">Włóż zapakowany towar wraz z dokumentem zwrotu do kartonu przeznaczonego do wysyłki i dobrze go zaklej. Możesz wykorzystać karton, w którym otrzymałeś zamówione towary. Udaj się do dowolnego Paczkomatu InPost, gdzie nadasz przesyłkę szybko i wygodnie, 24h/7. Pamiętaj, że gabaryty paczki nie mogą przekroczyć wymiarów 41 X 38 X 64 cm oraz wagi 25 kg.</li>\n<li style=\"color:inherit;line-height:normal;\">Zwrotu pieniędzy, w formie wybranej w kreatorze zwrotu, dokonamy w ciągu 14 dni od dnia, w którym zostaliśmy poinformowani o Państwa decyzji o odstąpieniu od umowy. Z reguły trwa to jednak krócej. Możemy wstrzymać się ze zwrotem płatności do czasu otrzymania rzeczy lub do czasu dostarczenia przez Państwa dowodu jej odesłania.</li>\n</ul>\n<p style=\"margin:15px 0px;padding:0px;color:#333333;line-height:normal;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">Powyższa procedura nie jest warunkiem skorzystania z ustawowego prawa odstąpienia od umowy oraz w żaden sposób go nie ogranicza.</p>\n<div class=\"row\" style=\"margin:0px -15px;padding:0px;\">\n<div class=\"col-md-4 col-xs-12 step one\" style=\"margin:0px;padding:0px 15px;width:399.984px;max-width:33.3333%;\"><span class=\"next_step hidden-phone\" style=\"margin:0px;padding:0px;width:17px;height:64px;background:#ffffff url(&quot;/data/include/cms/cms_graphics/zwroty/next_step.png&quot;) no-repeat 0px 0px;color:#333333;font-family:\'Open sans\', Arial, sans-serif;font-size:14px;\"></span></div>\n</div>','odstapienie-od-umowy');
