INSERT INTO `ps_product_lang` VALUES (1,1,1,'Herosi vs Horrory - wersja Demo','','herosi-vs-horrory---wersja-demo','','','','Herosi vs Horrory - wersja demo','','','',''),(2,1,1,'W antologii przygód Obłędne wizje, zebranych zostało pięć niesamowitych scenariuszy, inspirowanych wizjami istotnie przyprawiającymi o obłęd. \nZmierz się ze śmiertelnie niebezpiecznymi zagrożeniami, staw czoła potężnym przeciwnikom i uratuj świat od zagłady! \nPełny kolor, A4, twarda oprawa, 96 stron.\n\nOpisy przygód:\n- Scarlet Seer. Próbując uratować zakładników z rąk oszalałego superzłoczyńcy, Herosi zmuszeni są do zmierzenia się z demonami z przeszłości.\n- Kanał burzowy. Podążając za zbiegłą abominacją, Herosi przemierzają labirynt ohydnych kanałów, rozciągających się pod metropolią w trakcie odbudowy. \n- Klucz do sfer. Poszukując skradzionego reliktu, członkowie Legionu Ultima odkrywają straszliwą motywację osób odpowiedzialnych za rabunek.\n- Bohaterowie i maszyny. Incydent w dokach z udziałem potworności, okazuje się preludium do dużo większego zagrożenia.\n- Olimpia w ogniu. Herosi wyruszają na poszukiwania dawnego znajomego do słonecznej Grecji, która skrywa jednak bardzo mroczne sekrety.','','herosi-vs-horrory-obdne-wizje---rozszerzenie','','','','Herosi vs Horrory: Obłędne Wizje - Rozszerzenie','','','',''),(3,1,1,'Herosi vs Horrory - narzędzia mistrza gry; Zestaw ten zawiera akcesoria, które ułatwią życie zarówno MG podczas prowadzenia gry, jak i graczom podczas tworzenia postaci w grze Herosi vs Horrory. Po pierwsze - solidny, 3-panelowy ekran MG z przepiękną grafiką po zewnętrznej stronie i niezbędnymi zasadami po wewnętrznej. Po drugie - generator historii Herosa, czyli zbiór tabel z których gracze (ale i MG) mogą wylosować kompletną genezę superbohatera, oczywiście z miejscami na dodanie swoich własnych pomysłów.\n','','herosi-vs-horrory---narzdzia-mistrza-gry','','','','Herosi vs Horrory - narzędzia mistrza gry','','','',''),(4,1,1,'Talia kart Herosów; Talia zawierająca 56 kart do wykorzystania w trakcie rozgrywki w uniwersum gry Herosi vs Horrory, przydatna zarówno dla graczy, jak i MG. W jej skład wchodzą karty znacznie ułatwiające śledzenie dostępnych uczestnikom zasobów -akcji superbohaterskich, Koncentracji, Potencjału, Przesunięć, jak również kart rozmaitych stanów.','','herosi-vs-horrory---talia-kart-herosw','','','','Herosi vs Horrory - Talia Kart Herosów','','','',''),(5,1,1,'Zestaw kości do gry Herosi vs Horrory; Zestaw 6 kości (2 × k20, 2 × k10, 2 × k6) zaprojektowanych specjalnie na potrzeby gry Herosi vs Horrory. Zawiera on wszystkie kości potrzebne do gry w dwóch kolorach, aby łatwiej było rozróżniać ich typ. Dodatkowo, utrzymano je w komiksowej stylistyce, co pozwala na podtrzymanie charakteru rozgrywki przy stole.','','herosi-vs-horrory---zestaw-koci','','','','Herosi vs Horrory - Zestaw Kości','','','',''),(6,1,1,'<p>W grze Herosi vs Horrory wcielasz się w Herosa – postać obdarzoną supermocami, należącą do Legionu Ultima. Organizacja ta walczy z Horrorami, czyli ohydnymi istotami spoza naszego świata, stworzonymi przez Kreatorów – pozaziemskich najeźdźców, pragnących zniszczyć ludzkość. Ziemia, którą znasz, przestała istnieć. Hordy abominacji wylewają się przez międzywymiarowe Wyrwy. Nastała nowa era, w której tylko Ty możesz pomóc ludzkości się odrodzić. Pokaż, na co Cię stać – cały świat liczy właśnie na Ciebie! Co znajdziesz w tym podręczniku? Obszerny opis świata gry Herosi vs Horrory Kompletne zasady gry 12 archetypów postaci Atuty i magiczne moce pozwalające na wykreowanie wymarzonego Herosa Porady dla Mistrza lub Mistrzyni Gry Bestiariusz wypełniony niesamowitymi przeciwnikami Gotowy do rozegrania scenariusz Pełny kolor, A4, twarda oprawa, 352 strony</p>','','herosi-vs-horrory---podrcznik-gwny-edycja-limitowana','','','','Herosi vs Horrory - Podręcznik Główny (Edycja limitowana)','','','',''),(7,1,1,'MidGuard to gra fabularna, która w niekonwencjonalny sposób łączy gatunek \n sci-fi z bogatą i pełną heroizmu mitologią nordycką. Zostań weteranem Straży \n Midgardu - wciel się w postać, której nieobce są zarówno cybernetyczne \nimplanty,  jak i mistyczne zaklęcia. Bądź bohaterem swojej własnej, \nfuturystycznej sagi, w  której mieszkańcy Dziewięciu Układów toczą nieustającą \nwojnę. Zmierz się z  trollami, smokami i kosmicznymi krakenami. Podłącz się do \nzakazanej sieci  Yggdrasil i zagraj na nosie samemu Odynowi. Przygotuj się do \nnadchodzącej,  ostatecznej bitwy, zwanej Ragnarokiem. To Twoja historia - spraw, \nby była  epicka.','','podrcznik-midguard-gra-fabularna','','','','Podręcznik MidGuard Gra Fabularna','','','',''),(8,1,1,'\n\n\n\nCzteropanelowy ekran mistrza gry  \n','','ekran-mistrza-gry-midguard','','','','Ekran Mistrza Gry MidGuard','','','',''),(9,1,1,'Znaczniki do Midguard RPG.','','znaczniki-midguard','','','','Znaczniki MidGuard','','','',''),(10,1,1,'MidGuard: Archiwa. Jotuni','','midguard-archiwa-jotuni','','','','Midguard: Archiwa. Jotuni','','','',''),(11,1,1,'MidGuard: Archiwa. Jotuni\n\nMidGuard: Archiwum. Jotuni to pierwszy dodatek do MidGuard: Gra Fabularna rozszerzający wiedzę o Jotunach - nieobliczalnych mieszkańcach układu Jotunheim, noszących w sobie Dziedzictwo Ymira. \n\nW środku znajdują się:\nOpis kultury Jotunów pozwalający na lepsze rozumienie ich motywacji i światopoglądu\n\nPrzewodnik po największych metropoliach Jotunheim oraz organizacjach wywodzących się z tej planety\n\n\nOkładka twarda\n98 stron','','midguard-archiwa---jotuni-pdf','','','','MidGuard: Archiwa - Jotuni PDF','','','',''),(12,1,1,'Sigrunn is a member of an elite marine corps called V.I.K.I.N.G.S. She is a cold-blooded professional who participates in special operations on alien, hostile planets. Oh, did we forget to mention her near 100% effectiveness?','','sigrunn-the-viking-75mm-scale','','','','Sigrunn The Viking 75mm scale','','','',''),(13,1,1,'Einar is a berserker towering above his fellow Midgardians due to his heritage - one of his ancestors was one of the Jotunns, commonly known as the ice giants. Einar is visibly taller and more muscular but at the same time - he doesn’t resemble a giant and well - he got lucky with that.','','einar-the-berserker-110-bust','','','','Einar The Berserker 1:10 Bust','','','',''),(14,1,1,'Sigrunn from V.I.K.I.N.G.S','','sigrunn-the-viking-110-bust','','','','Sigrunn The Viking 1:10 Bust','','','',''),(15,1,1,'Behold Astrid, a powerful volva from Uppsala! On planet Midgard, volva is a kind of seeress whose job is connecting to the Yggdrasil, a Forbidden Network, looking for the visions of what the future can bring to anyone willing to pay a hefty sum for this knowledge. This includes private corporations, military leaders, or the mighty rulers of Midgard.','','astrid-the-volva-75mm-scale','','','','Astrid The Volva 75mm scale','','','',''),(16,1,1,'Behold Astrid, a powerful volva from Uppsala! On planet Midgard, volva is a kind of seeress whose job is connecting to the Yggdrasil, a Forbidden Network, looking for the visions of what the future can bring to anyone willing to pay a hefty sum for this knowledge. This includes private corporations, military leaders, or the mighty rulers of Midgard.','','astrid-the-volva-110-bust','','','','Astrid The Volva 1:10 Bust','','','',''),(17,1,1,'Collectible bust from Midguard universe. Limited to 200 copies, each box contains a miniature and authentication certificate with the number of the copy.','','freya-the-skald','','','','Freya the Skald','','','',''),(18,1,1,'Collectible bust from Midguard universe. Limited to 200 copies, each box contains a miniature and authentication certificate with the number of the copy.','','thyra-the-keeper-of-the-library','','','','Thyra the Keeper of the Library','','','',''),(19,1,1,'Gunnar the Einher was once a brave and loyal warrior who paid the ultimate price while defending a retreat from the hostile planet of Jotunheim. Against the odds and facing the fearsome Jotun, he stood his ground, vowing not to leave until the last of his comrades was safe. Tragically, this heroic act led to his death, but his courageous spirit didn\'t go unnoticed.','','gunnar-the-einher','','','','Gunnar the Einher','','','',''),(20,1,1,'Thori the Huskarl is a living legend in the realm of Midgard, an enduring symbol of bravery and excellence. Her remarkable journey continues to inspire countless generations of warriors.','','thori-the-huskarl','','','','Thori the Huskarl','','','',''),(21,1,1,'Enshrouded in mystery and bordering on the mythic, Ingrid the Jaeger\'s origins are veiled in the deepest shadows. Whispered legends tell of her rearing among the icy wolves of Midgard, lending a wild and ancient aura to her formidable presence.','','ingrid-the-jeager','','','','Ingrid the Jeager','','','',''),(22,1,1,'<p>Torvi the Priestess, in her deep devotion to god Tyr, has not only emulated his sacrifice by offering her own hand but also serves as a bridge between the divine and the technological advancements of AdvanTyr corp. As a priestess, she has exclusive access to the latest, often prototype, cybernetic implants, enhancing her capabilities and connection to the divine. Her sacrifice, mirroring Tyr\'s ordeal with Fenris, the monstrous wolf, symbolizes a profound commitment to her faith and role, intertwining her destiny with the lore and power of her deity. Through her enhanced abilities and spiritual connection, Torvi stands as a beacon of strength, resilience, and innovation, embodying the fusion of ancient traditions and futuristic technology.</p>','','torvi-the-priestess','','','','Torvi the Priestess','','','',''),(23,1,1,'Thori the Huskarl is a living legend in the realm of Midgard, an enduring symbol of bravery and excellence. Her remarkable journey continues to inspire countless generations of warriors.','','thori-the-huskarl-110-bust','','','','Thori the Huskarl 1:10 Bust','','','',''),(24,1,1,'Livia the Cosplayer','','livia-the-cosplayer-110-bust','','','','Livia the Cosplayer 1:10 Bust','','','',''),(25,1,1,'Livia the Cosplayer','','livia-the-cosplayer','','','','Livia the Cosplayer','','','',''),(26,1,1,'Frida the Cultist','','frida-the-cultist-110-bust','','','','Frida the Cultist 1:10 Bust','','','',''),(27,1,1,'Frida the Cultist','','frida-the-cultist-diorama','','','','Frida the Cultist Diorama','','','',''),(28,1,1,'Freya the Skald, a well-known persona in the world of Midguard, stands out as an exceptional figure, choosing to captivate audiences with her raw, unenhanced voice. While many performers rely on vocal implants and stimulants to entertain, Freya\'s natural talent and expressiveness set her apart from the crowd.\n\nHer concerts are legendary, filled with wild performances that sweep the audience off their feet. Her music resonates with the very soul of Midguard, combining ancient melodies with a fresh, invigorating style. On stage, Freya is a force of nature, her passionate performances creating an electrifying atmosphere that leaves the audience begging for more.\n\nYet, Freya is more than just a singer. Behind the scenes, she is a cunning celebrity with immense influence. She handles the fame that precedes her with grace and cleverness, using her status not just for personal gain but also to navigate the intricate web of Midguard\'s society.\n\nHowever, there\'s a layer of mystery surrounding Freya\'s past. Rumors circulate that before she rose to stardom, she was a spy for the Odin Corporation. These whispers add an enigmatic dimension to her persona, making her an even more fascinating character.\n\nThrough her music, Freya the Skald continues to charm and inspire, her life\'s journey serving as an intriguing narrative that continues to unfold. And as she continues to make her mark in the world of Midguard, one thing is clear - Freya is a true icon, a beacon of authenticity and inspiration in a world dominated by technology.\n\nCollectible Miniature\nFrom the Midguard universe, this collectible miniature is limited to 200 copies. Each box contains a miniature and authentication certificate with the number of the copy.\n\nScale: full scale miniature 75mm\n\nMaterial: resin\n\nThe miniature is sold unpainted and unassembled.\n\nProject\nMarcin Grzegorzek &amp; Bartosz Guzy\n\nConcept:\nBartosz Guzy\n\n3D sculpt:\nEduard Pérez Delgado','','freya-the-skald-75mm','','','','Freya the Skald 75mm','','','',''),(29,1,1,'Gullweig the Reborn is a legendary figure in the galaxy, known for her mastery of hekseri and her pivotal role in the catastrophic war between the Aesir and Vanir. Once a powerful volva from Vanaheim, she was sent to Asgard as an ambassador but was accused of espionage and sentenced to death. In a shocking display of her hekseri abilities, Gullweig survived execution by fire, rising from the flames three times before escaping through a portal, triggering a devastating conflict between the two civilizations.\n\nCenturies later, Gullweig’s legacy endures through her corporation, Gullweig Inc., which operates with influence and secrecy across the galaxy. Though it remains unclear if Gullweig herself still lives, her name symbolizes resilience, mystery, and the dangerous consequences of unchecked power, as her actions continue to shape the fate of civilizations.\n\nCollectible Miniature\nFrom the Midguard universe, this collectible miniature is limited to 200 copies. Each box contains a miniature and authentication certificate with the number of the copy.\n\nScale: full scale miniature 75mm\n\nMaterial: resin\n\nThe miniature is sold unpainted and unassembled.\n\nProject\nMarcin Grzegorzek &amp; Bartosz Guzy\n\nConcept:\nBartosz Guzy\n\n3D sculpt:\nVictor Aguilar','','gullveig-the-reborn','','','','Gullveig the Reborn','','','',''),(30,1,1,'Adela the Valkyrie is a stunning and formidable warrior, created by Asgardian bioengineers through a series of genetic modifications on carefully selected Midgardian women. After rigorous genetic screenings, Adela was chosen and transported to the planet Valhalla, where she underwent transformation into a breathtakingly beautiful yet lethal machine of war. Her body was altered to halt the aging process, preserving her appearance and vitality indefinitely. With wings enabling her to fly or the ability to fuse with a spacecraft as if it were a living extension of herself, Adela embodies the perfect synthesis of beauty and battle prowess.\n\nAdela\'s reputation as a fierce and independent Valkyrie is known across Midguard, where she chose the path of freedom over serving in Asgardian elite strike forces. Her legend is spread through tales of her heroic deeds in distant star systems. However, her most enduring conflict is with her sworn enemy, Thurs the Troll. Their rivalry, forged through countless brutal encounters, highlights the clash between Adela’s graceful precision and Thurs’s raw, untamed strength. Together, they represent an ongoing battle between the forces of order and chaos in the world of Midguard.\n\nCollectible Miniature\nFrom the Midguard universe, this collectible miniature is limited to 200 copies. Each box contains a miniature and authentication certificate with the number of the copy.\n\nScale: full scale miniature 75mm\n\nMaterial: resin\n\nThe miniature is sold unpainted and unassembled with backdrop plint included.\n\nProject\nMarcin Grzegorzek \n\nConcept:\nPaulina Opak\n\n3D sculpt:\nStivens Trujillo Sanchez','','adela-the-valkyrie','','','','Adela the Valkyrie','','','',''),(31,1,1,'Thurs the Troll is a fearsome creation of Jotunheim’s genetic engineering, known for his immense strength and resilience. As a winter troll, Thurs is covered in thick fur, resembling a massive, bear-like creature built to survive in the harshest conditions. While lacking in intelligence, he more than makes up for it with brute force and remarkable endurance, traits that make him a formidable opponent. His humanoid form features exaggerated proportions, with a large head filled with massive teeth and long, powerful arms.\n\nThurs is the eternal rival of Valkyrie Adela, clashing with her in numerous fierce battles. His raw strength contrasts sharply with Adela’s precision and skill, and their rivalry has become legendary. Thurs’s unrelenting pursuit of vengeance against Adela fuels his every encounter, making him a symbol of untamed power and the relentless spirit of the Jotunheim trolls.\n\n\n\nCollectible Miniature\nFrom the Midguard universe, this collectible miniature is limited to 200 copies. Each box contains a miniature and authentication certificate with the number of the copy.\n\nScale: full scale miniature 75mm\n\nMaterial: resin\n\nThe miniature is sold unpainted and unassembled.\n\nProject\nMarcin Grzegorzek \n\nConcept:\nPaulina Opak\n\n3D sculpt:\nStivens Trujillo Sanchez','','thurs-the-troll-75mm','','','','Thurs the Troll 75mm','','','',''),(32,1,1,'None','','dragon-shield-classic-tangerine-100-szt','','','','Dragon Shield Classic Tangerine 100 szt','','','',''),(33,1,1,'None','','dragon-shield-classic-night-blue-100-szt','','','','Dragon Shield Classic Night Blue 100 szt','','','',''),(34,1,1,'None','','dragon-shield-matte-emerald-100-szt','','','','Dragon Shield Matte Emerald 100 szt','','','',''),(35,1,1,'None','','dragon-shield-matte-night-blue-100-szt','','','','Dragon Shield Matte Night Blue 100 szt','','','',''),(36,1,1,'None','','dragon-shield-matte-clear-red-100-szt','','','','Dragon Shield Matte Clear Red 100 szt','','','',''),(37,1,1,'None','','dragon-shield-matte-lime-100-szt','','','','Dragon Shield Matte Lime 100 szt','','','',''),(38,1,1,'None','','dragon-shield-matte-olive-100-szt','','','','Dragon Shield Matte Olive 100 szt','','','',''),(39,1,1,'None','','dragon-shield-classic-clear-100-szt','','','','Dragon Shield Classic Clear 100 szt','','','',''),(40,1,1,'Non-Glare front &amp; Matte Black back. Pitch black, no reflection.The ultimate tournament sleeve. Our popular textured matte back in combination with a smooth and clear non-reflective front, make these sleeves exceptional for streaming, feature matches or video content. The combination of materials maintains superior handling while optimizing play in bright conditions. A perfect mix of visibility and shuffle-ability.The sturdy cardboard box fits 75+ single sleeved cards or 65+ double sleeved cards. Every box has a label at the top of the box for personalization.','','dragon-shield-matte---non-glare---black-amina','','','','Dragon Shield Matte - Non-glare - Black Amina','','','',''),(41,1,1,'\n\n\n\nClear \nfront &amp; Clear back. Straight forward and un-obtrusive.Add \nPerfect Fit Side-Loading sleeves for maximum card protection. Perfect Fit \nSideloader sleeves protect the tops and bottoms of your cards for maximum card \nsecurity, and fit snugly inside all Standard Size Dragon Shields.100 \ninner sleeves per bag.For \ncards measuring up to 63×88 mm (2½”x3½”).PVC-free \npolypropylene sleeves, no acid. Archival safe.60 \nμm quality thickness.\n','','dragon-shield-perfect-fit-sideloading---clear','','','','Dragon Shield Perfect Fit Sideloading - Clear','','','',''),(42,1,1,'\n\n\n\n\n','','dragon-shield-classic-black-100-szt','','','','Dragon Shield Classic Black 100 szt','','','',''),(43,1,1,'None','','dragon-shield-classic-blue-100-szt','','','','Dragon Shield Classic Blue 100 szt','','','',''),(44,1,1,'\n\n\n\nex\n','','dragon-shield-classic-green-100-szt','','','','Dragon Shield Classic Green 100 szt','','','',''),(45,1,1,' ','','dragon-shield-classic-white-100-szt','','','','Dragon Shield Classic White 100 szt','','','',''),(46,1,1,'None','','dragon-shield-classic-gold-100-szt','','','','Dragon Shield Classic Gold 100 szt','','','',''),(47,1,1,'None','','dragon-shield-classic-red-100-szt','','','','Dragon Shield Classic Red 100 szt','','','',''),(48,1,1,'None','','dragon-shield-classic-silver-100-szt','','','','Dragon Shield Classic Silver 100 szt','','','',''),(49,1,1,'\n\n\n\n\n','','dragon-shield-classic-purple-100-szt','','','','