'','Pędzel Kozłowski Toray 4','','','',''),(183,1,1,'None','','pdzel-kozowski-toray-5','','','','Pędzel Kozłowski Toray 5','','','',''),(184,1,1,'None','','pdzel-kozowski-czerwona-kuna-4','','','','Pędzel Kozłowski Czerwona Kuna 4','','','',''),(185,1,1,'Gamers Grass Tuft to innowacyjny produkt, który wzbogaca Twoje modele, plansze do gier, czy dioramy, nadając im autentyczny wygląd i naturalne piękno. Te trawy i mchy są dostępne w różnych rozmiarach, kształtach i kolorach, zapewniając szeroki zakres możliwości, które spełnią Twoje potrzeby w tworzeniu miniaturowego świata.  Główne cechy produktu Gamers Grass Tuft:  Realistyczny wygląd: Te trawy i mchy są starannie wykonane, aby odwzorować naturalne tekstury i kolory, co nadaje Twoim modelom i planszom niezrównaną autentyczność. Dzięki nim Twoje dzieła nabierają życia.  Bogata paleta kolorów: Gamers Grass Tuft jest dostępny w różnych odcieniach zieleni, brązu, żółci i innych naturalnych kolorów. Możesz łatwo dostosować go do konkretnej scenerii lub projektu, co pozwala na niemal nieograniczone możliwości kreacyjne.  Łatwość użycia: Produkty Gamers Grass Tuft są niezwykle łatwe w aplikacji. Można je nakładać przy użyciu kleju lub opcjonalnego aplikatora, co zapewnia wygodne i precyzyjne umieszczenie traw na dowolnej powierzchni.  Trwałość: Trawy i mchy Gamers Grass Tuft są odporne na uszkodzenia i starzenie się, dzięki czemu zachowują swoją jakość przez długi czas. Twój miniaturowy świat będzie cieszyć oczy przez wiele lat.  Wszechstronność: Ten produkt jest idealny do stosowania w różnych rodzajach projektów, w tym w grach planszowych, modelarstwie, czy w tworzeniu dioram. Możesz go również używać zarówno na powierzchniach płaskich, jak i trudniej dostępnych miejscach.  Gamers Grass Tuft to niezbędne narzędzie dla każdego, kto dąży do uzyskania maksymalnej autentyczności i estetyki w swoich projektach modelarskich. Dzięki jego realistycznemu wyglądowi, szerokiej palecie kolorów i trwałości, Gamers Grass Tuft pomaga w tworzeniu niezapomnianych miniaturowych światów, które zachwycą zarówno graczy, jak i miłośników modelarstwa. Niezależnie od tego, czy tworzysz pejzaże fantasy, historyczne bitwy, czy scenerie science fiction, Gamers Grass Tuft doda im wyjątkowego uroku i realizmu.','','gamers-grass-special-tufts---12-mm---spikey-brown-wild','','','','Gamers Grass: Special tufts - 12 mm - Spikey Brown (Wild)','','','',''),(186,1,1,'Gamers Grass Tuft to innowacyjny produkt, który wzbogaca Twoje modele, plansze do gier, czy dioramy, nadając im autentyczny wygląd i naturalne piękno. Te trawy i mchy są dostępne w różnych rozmiarach, kształtach i kolorach, zapewniając szeroki zakres możliwości, które spełnią Twoje potrzeby w tworzeniu miniaturowego świata.  Główne cechy produktu Gamers Grass Tuft:  Realistyczny wygląd: Te trawy i mchy są starannie wykonane, aby odwzorować naturalne tekstury i kolory, co nadaje Twoim modelom i planszom niezrównaną autentyczność. Dzięki nim Twoje dzieła nabierają życia.  Bogata paleta kolorów: Gamers Grass Tuft jest dostępny w różnych odcieniach zieleni, brązu, żółci i innych naturalnych kolorów. Możesz łatwo dostosować go do konkretnej scenerii lub projektu, co pozwala na niemal nieograniczone możliwości kreacyjne.  Łatwość użycia: Produkty Gamers Grass Tuft są niezwykle łatwe w aplikacji. Można je nakładać przy użyciu kleju lub opcjonalnego aplikatora, co zapewnia wygodne i precyzyjne umieszczenie traw na dowolnej powierzchni.  Trwałość: Trawy i mchy Gamers Grass Tuft są odporne na uszkodzenia i starzenie się, dzięki czemu zachowują swoją jakość przez długi czas. Twój miniaturowy świat będzie cieszyć oczy przez wiele lat.  Wszechstronność: Ten produkt jest idealny do stosowania w różnych rodzajach projektów, w tym w grach planszowych, modelarstwie, czy w tworzeniu dioram. Możesz go również używać zarówno na powierzchniach płaskich, jak i trudniej dostępnych miejscach.  Gamers Grass Tuft to niezbędne narzędzie dla każdego, kto dąży do uzyskania maksymal