--white','','','','Gamegenic: Casual Album 24-Pocket - White','','','',''),(261,1,1,'Wysokiej jakości album, który pomieści do 480 kart. Doświadczeni gracze z pewnością pokochają jego wytrzymałe i wysokiej jakości strony, które pozwalają wygodnie przechowywać karty. Warta docenienia jest również odporna na zniszczenia okładka zamykana na gumkę, która doskonale utrzymuje zawartość albumu w ryzach.','','gamegenic-casual-album-24-pocket---green','','','','Gamegenic: Casual Album 24-Pocket - Green','','','',''),(262,1,1,'Wysokiej jakości czarne koszulki do segregatorów, które pomieszczą do 24 kart. Doświadczeni gracze z pewnością pokochają te wytrzymałe i wysokiej jakości strony, które pozwalają wygodnie przechowywać karty oraz zabezpieczają je przed zniszczeniami i zabrudzeniami.','','gamegenic-24-pocket-pages-sideloading---black-10-szt','','','','Gamegenic: 24-Pocket Pages Sideloading - Black (10 szt)','','','',''),(263,1,1,'Wysokiej jakości zielone koszulki do segregatorów, które pomieszczą do 18 kart. Doświadczeni gracze z pewnością pokochają te wytrzymałe i wysokiej jakości strony, które pozwalają wygodnie przechowywać karty oraz zabezpieczają je przed zniszczeniami i zabrudzeniami.','','gamegenic-18-pocket-pages-sideloading---green-10-szt','','','','Gamegenic: 18-Pocket Pages Sideloading - Green (10 szt)','','','',''),(264,1,1,'The 9-Pocket Cobalt Collectors Portfolio features a hot stamped collectors themed foil on a cobalt blue cover. Each portfolio holds up to 90 standard size collectible cards single-loaded and 180 double-loaded in 10 top-loading pages. Archival-safe, acid-free pages offer premium protection for your most prized cards.\n9-pocket portfolio for storing standard size collectible cards\nHolds up to 90 cards single-loaded and 180 double-loaded\n10 top-loading pages in a cobalt blue cover\nClear pages display card backs when single-loaded\nPages are made with archival-safe, non-PVC, acid-free materials','','up---9-pocket-cobalt-collectors-portfolio','','','','UP - 9-POCKET COBALT COLLECTORS PORTFOLIO','','','',''),(265,1,1,'Witaj w Czasie Czerwieni, Choomba!Przez \n dziesięciolecia megakorporacje niszczyły wszystko, co się dało, a po ich \n ostatniej Wojnie każdy musi liczyć tylko na siebie.','','cyberpunk-red','','','','Cyberpunk RED','','','',''),(266,1,1,'Opis wydawcy:','','cyberpunk-interface-red-volume-1','','','','Cyberpunk Interface Red Volume 1','','','',''),(267,1,1,'Opowieści Czerwieni to pełny nowych misji dodatek do Cyberpunk RED, najnowszej edycji legendarnej gry fabularnej opowiadającej o mrocznej przyszłości. W środku znajdziesz dziewięć zupełnie nowych scenariuszy, które możesz rozegrać ze swoją ekipą.','','cyberpunk-red-opowieci-czerwieni','','','','Cyberpunk RED: Opowieści Czerwieni','','','',''),(268,1,1,'Dark heresy 2 \nNastało 41 millenium. A ludzkość powoli zaczyna wchodzić w kulminacyjny moment swojej historii. Starzy wrogowie przygotowują się, na ostateczne starcie z imperium człowieka. Dark Heresy 2 to gra fabularna z uniwersum warhammera 40000. Gracze tworzą własne postacie od podstaw. Kreują swój wygląd, wybierają cechy i talenty, oraz frakcje do której należą. W Dark Heresy gracze wcielić się mogą w żołnierza gwardii imperialnej, który walczy na pierwszej linii frontu z wrogami imperium. W członka jednego z odłamów inkwizycji, broniącego imperium nie tylko przed światem materialnym. Kapłana kultu maszyny, zbierającego dawno zatraconą technologie. Oraz wielu innych. Świat przedstawiony w podręczniku jest brutalny i niebezpieczny. Czy gracze podołają, i zostaną wiernymi sługami imperatora ? Czy może zatracą się w objęciach mocy chaosu ? Historie czeka, abyście ją napisali przy pomocy stworzonych przez was bohaterów.   \nTen 448-stronicowy, kolorowy podręcznik podstawowy Dark Heresy II edycja zawiera wszystko, czego Ty i Twoi przyjaciele będziecie potrzebowali, by służyć Imperatorowi w Sektorze Askellon. Zasady tworzenia postaci Graczy i ich przeciwników oraz walki pozwolą Mistrzowi Gry ożywić potworną rzeczywistość Sektora Askellon. Podręcznik podstawowy Dark Heresy II może być używany zarówno do pojedynczych przygód, jak i do długich kampanii w ponurej przyszłości 41-ego milenium.  \n\nPodstawowe Informacje \nPodręcznik w twardej okładce, 448 strony \nWaga: 2kg','','dark-heresy-2-ed','','','','Dark Heresy 2 ed','','','',''),(269,1,1,'Imperium nie tylko posiada wrogów na liniach frontu swoich granic, ale także na własnym terenie. Liczni kultyści mocy chaosu, mutanci, wynaturzenia i sam imperator co jeszcze, czeka tylko, aby siać terror i smierć wśród ludu imperium. Wy, jako Inkwizytorzy Ordo Hereticus i ich wierni słudzy staje ramię w ramię, aby bronić imperium na jego ziemi, i oczyścić je z plugastwa i herezji. \nPodstawowe informacje  \nPodręcznik w twardej oprawie, 144 strony \nWaga: 853g','','dark-heresy-2-ed---wrg-wewntrzny','','','','Dark Heresy 2 ed - Wróg Wewnętrzny','','','',''),(270,1,1,'None','','dark-heresy-2-ed---wrg-spoza-rzeczywistoci','','','','Dark Heresy 2 ed - Wróg Spoza Rzeczywistości','','','',''),(271,1,1,'ARRAKIS. \nDUNE. DESERT PLANET.The \nDune: Adventures in the Imperium roleplaying game takes you into a far future \nbeyond anything you have imagined, where fear is the mind killer so be sure to \nkeep your wits about you. The Imperium is a place of deadly duels, feudal \npolitics, and mysterious abilities, noble Houses politic constantly for power, \ninfluence, and vengeance in a universe where a blade can change the fortunes of \nmillions. Build your House, carve your place in the universe or rebuild an \nancient lineage and fight for the Imperial throne.Take \nyour characters on a journey through the storied worlds of Frank Herbert\'s \nsci-fi masterpiece, inhabit elite agents working for noble Houses where Mentats, \nSwordmasters, Spies, Bene Gesserit Sisters, Devious Advisors, or even desert \nFremen join together to follow your banner.Whoever \nyou choose to be, remember that those that control the spice control the \nuniverse.The \nDune: Adventures in the Imperium core rulebook contains:• \nEverything you need to create your own stories of intrigue and adventure on the \nsands of Arrakis as agents of a powerful noble House.• \nA brand new version of the 2d20 System adapted specially for the Dune \nUniverse.• \nAn extensive look at the Imperium, its society, factions, history, technology, \nculture, faith and more.• \nGuidelines for novice and experienced gamemasters on how to run Dune-themed \nadventures and campaigns of intrigue and adventure for the elite agents of a \nnoble House.• \nRules for creating a noble House of your own, from House Minor to Major House, \ndetailing its holdings, areas of expertise and agenda.• \nSystems for architect play, where you become the puppet masters, moving agents \nto your designs to serve your House.• \nAn introductory adventure designed to quickly get you and your fellow players \ninvolved in the byzantine plots of the Imperium on \nArrakis.','','duneadventures-in-the-imperium-core-rulebook-en','','','','Dune:Adventures in the Imperium Core Rulebook EN','','','',''),(272,1,1,'\"Ludzie opowiadają o tobie dziwne historie, Paul. Mówią, że masz wszystkie moce legendy - nic nie może się przed tobą ukryć, że widzisz tam, gdzie inni nie widzą.\" \nImperium jest miejscem pełnym tajemnic i tylko Shai-Hulud naprawdę rozumie zmieniające się fale pustynnego piasku. Chroń swoje sekrety z oficjalną grą Dune: Adventures in the Imperium Gamemaster\'s Screen, wysokiej jakości wielopanelowego ekranu w formacie portretowym, który zawiera mnóstwo treści pozwalających kontrolować największą potęgę we wszechświecie.\nTen czteropanelowy zdobiony ekran zawiera 32-stronicową książeczkę oferującą wszelkiego rodzaju wsparcie dla gamemastera. Idealny sposób na zbudowanie swojej historii, a może nawet dziedzictwa na wydmach Arrakis. \nThe Gamemaster\'s Toolkit zawiera: \n- Piękne grafiki, które owijają się wokół zewnętrznych, licujących paneli ekranu. \n- Tabele referencyjne i kluczowe zasady \n- 32-stronicową książeczkę Gamemastera zawierającą narzędzia i porady dotyczące tworzenia i prowadzenia kampanii Dune: Adventures in the Imperium. \n','','duneadventures-in-the-imperium-gamemasters-toolkit','','','','Dune:Adventures in the Imperium Gamemaster\'s toolkit','','','',''),(273,1,1,'Diuna: Przygody w Imperium to gra fabularna, która zabierze cię w daleką przyszłość, poza wszystko co jesteś sobie w stanie wyobrazić.  \n\nImperium – skomplikowana maszyneria oparta na feudalnej polityce, powiązana systemem wzajemnych powiązań, nierozwiązanych waśni i niezapomnianych krzywd. Wielkie rody prowadzą ciągnące się latami intrygi by powiększać swoje wpływy, a ostrze wbite w plecy może zmienić los milionów. Stwórz swój ród, znajdź swoje miejsce we wszechświecie, lub odbuduj starożytne dziedzictwo i walcz o tron imperialny.  \n\nZabierz swoich bohaterów w podróż przez świat opisany przez Franka Herberta i jego arcydzieło literatury SF. Zjednocz pod swoim sztandarem niesławnych mentatów, Mistrzów Miecza z Ginaza, szpiegów, przebiegłych doradców, siostry Bene Gesserit lub zamieszkujących niegościnną pustynie Fremenów, wszystko dla chwały rodu.  \n\nKimkolwiek zdecydujesz się zostać pamiętaj, że ten kto kontroluje przyprawę, kontroluje wszechświat.   \n\n\n\n\nDiuna: Przygody w Imperium – podręcznik główny zawiera kompletne zasady do gry fabularnej: \n Wszystko co potrzebujesz do stworzenia własnych opowieści o agentach rodów na pustynnej Arrakis.  \nNowy, poprawiony system 2D20, zaadoptowany na potrzeby uniwersum Diuny, zawiera zasady tworzenia nowych rodów i tryb stratega pozwalający na zarządzanie siatką agentów.  \nBogaty opis Imperium i zamieszkujących je społeczeństw i frakcji. W co wierzą mieszkańcy znanego wszechświata, ich technologia, historia i kultura.  \nPrzewodnik dla poczatkujących i doświadczonych mistrzów gry, jak prowadzić sesję w klimacie Diuny, jak tworzyć kampanie skupione na intrygach i przygodach dla grup elitarnych agentów rodowych.  \nPrzygoda Żniwiarze Diuny szybko wprowadzi was w realia Arrakis. \n Podręcznik główny Diuna: Przygody w Imperium to ponad 330 bogato ilustrowanych stron w formacie A4, w twardej oprawie. Zawiera kompletny zestaw zasad do gry w realiach napisanych przez Franka Herberta Kronikach Diuny.\n','','diuna-rpg--podrczik-gwny-pl','','','','Diuna RPG- Podręczik Główny PL','','','',''),(274,1,1,'Diuna RPG podręcznik główny edycja Harkonen - limitowana - dostępna tylko w sklepach stacjonarnych i inernetowych, poza AlisGames.pl. \nDiuna: Przygody w Imperium to gra fabularna, która zabierze cię w daleką przyszłość, poza wszystko co jesteś sobie w stanie wyobrazić.   \n\n\n\n Podręcznik główny Diuna: Przygody w Imperium to ponad 330 bogato ilustrowanych stron w formacie A4, w twardej oprawie. Zawiera kompletny zestaw zasad do gry w realiach napisanych przez Franka Herberta Kronikach Diuny.\n','','diuna-rpg--podrcznik-gwny-harkonnen-pl','','','','Diuna RPG- Podręcznik Główny Harkonnen PL','','','',''),(275,1,1,'','','diuna-rpg--narzdzia-mistrza-gry','','','','Diuna RPG- narzędzia Mistrza Gry','','','',''),(276,1,1,'KOŚCI HARKONNEN','','diuna-rpg--zestaw-koci-harkonnen','','','','Diuna RPG- Zestaw kości Harkonnen','','','',''),(277,1,1,'KOŚCI ARRAKIS','','diuna-rpg--zestaw-koci-arrakis','','','','Diuna RPG- Zestaw kości Arrakis','','','',''),(278,1,1,'Even as this thought flicked through her mind, she was bending to seek out the hidden message. It had to be there. The visible note contained the code phrase every Bene Gesserit not bound by a School Injunction was required to give another Bene Gesserit when conditions demanded it: \"On that path lies danger.\"\n\nSecrets are the most powerful weapons in the Imperium. Codes and messages are hidden among the most innocuous glance or most casual sentence. The secrets you learn might save your life, or your House, so they are best kept careful track of.\n\nAn elegantly designed 160-page journal to record your adventures on Arrakis\nIncludes character and house record sheets with each repeating 32-page folio\nContains lined, square, and blank paper beautifully rendered in matching graphics\n\nFinal product may vary.\n\nDune © Legendary. Dune: Adventures in the Imperium is an officially sub-licensed property from Gale Force Nine, a Battlefront Group Company','','dune-players-journal---en','','','','DUNE PLAYER\'S JOURNAL - EN','','','',''),(279,1,1,'Genesys to uniwersalna gra fabularna. Oznacza to, że jej zasady umożliwiają rozgrywanie sesji w dowolnie wybranym lub wymyślonym uniwersum. Sercem tej gry jest Kostkowy System Narracyjny. Choć właściwie każda gra fabularna ma mechanikę pozwalającą ustalić, czy postaci udało się wykonać określone zadanie, to ten system wyznaczył w tej kwestii nową jakość. Jeden rzut kostkami nie tylko pozwala określić sukces bądź porażkę, lecz także tworzy szansę, by waszym postaciom przydarzyły się rzeczy – dobre albo złe. ','','genesys-rpg-zestaw-koci-narracyjnych','','','','Genesys RPG: Zestaw Kości Narracyjnych','','','',''),(280,1,1,'Zestaw zawiera pięć dwudziestościennych kości o zielonkawym kolorze (marbled) i złotej numeracji.\n\nKażda z kości zawiera symbol Atrydów na jednej ze ścianek.','','diuna-koci-atrydw','','','','Diuna kości Atrydów','','','',''),(281,1,1,'Tales from the Yawning Portal provides D&amp;D fans with adventures, magic items, and deadly monsters—all of which have been updated to the fifth edition rules.','','dungeons--dragons-tales-from-the-yawning-portal','','','','Dungeons & Dragons: Tales From the Yawning Portal','','','',''),(282,1,1,'WELCOME TO THE SWORD COAST—a region of Faerûn that comprises shining paragons of civilization and culture, perilous locales fraught with dread and evil, and encompassing them all, a wilderness that offers every explorer vast opportunity and simultaneously promises great danger.','','dungeons--dragons-sword-coast-adventurers-guide','','','','Dungeons & Dragons: Sword Coast Adventurer\'s Guide','','','',''),(283,1,1,'None','','dungeons--dragons-tomb-of-annihilation','','','','Dungeons & Dragons: Tomb of Annihilation','','','',''),(284,1,1,'Master the game with this indispensable tool for the world’s greatest roleplaying game.Lost is the poor soul borne aloft in the grip of the ancient red dragon featured in a spectacular panoramic vision by Tyler Jacobson on this durable, four-panel Dungeon Master’s Screen. The interior rules content on this new screen has been revisited and refreshed as a direct result of feedback received from D&amp;D fans everywhere.The screen’s landscape orientation allows the Dungeon Master to easily see beyond the screen and reach over, even as it keeps die rolls and notes hidden from players.','','dungeon-masters-screen-reincarnated','','','','Dungeon Master\'s Screen Reincarnated','','','',''),(285,1,1,'\n\n\n\nMordenkainen hails from the City of Greyhawk, but over the eons he has \nexpanded his mastery of the major conflicts in the multiverse. Similar to 2016\'s \nVolo\'s Guide to Monsters, Mordenkainen\'s Tome of Foes not only contains \neverything you need to run challenging new monsters at the table with your \nfriends but also provides tons of storytelling information on some of the most \ncontentious relationships in the multiverse. You\'ll learn more about the schism \nbetween drow and other elves, githyanki and githzerai, and dwarves and duergar, \nin addition to reading about the incessant Blood War between demons and \ndevils.Players will love to delve into Mordenkainen\'s Tome of Foes to search \nfor story hooks to use with their characters, as well as try out some of the \nplayer options for races like tieflings and elves, or maybe an otherworldly \ngithyanki or githzerai. Dungeon Masters looking for inspiration and greater \nchallenges for players who have reached higher levels of play will find much to \nexplore in Tome of Foes.\n','','dungeons--dragons-mordenkainens-tome-of-foes','','','','Dungeons & Dragons: Mordenkainen\'s Tome of Foes','','','',''),(286,1,1,'A fantastic treasure trove is yours for the taking in this adventure for the \nworld\'s greatest roleplaying game.','','dungeons--dragons-waterdeep-dragon-heist','','','','Dungeons & Dragons: Waterdeep: Dragon Heist','','','',''),(287,1,1,'Explore the mega-dungeon of Undermountain in this adventure for the world’s greatest roleplaying game.','','dungeons--dragons-waterdeep-dungeon-of-the-mad-mage','','','','Dungeons & Dragons: Waterdeep: Dungeon of the Mad Mage','','','',''),(288,1,1,'Explore a worldwide cityscape filled to the brim with adventure and intrigue in this campaign setting for the world’s greatest roleplaying game.','','dungeons--dragons-guildmasters-guide-to-ravnica','','','','Dungeons & Dragons: Guildmasters\' Guide to Ravnica','','','',''),(289,1,1,'This accessory contains resources that Dungeon Masters can use to enhance the experience of running a campaign in the sprawling city of Ravnica, using Guildmasters\' Guide to Ravnica, a separately sold Dungeons &amp; Dragons campaign sourcebook.','','dungeons--dragons-guildmasters-guide-to-ravnica---maps-and-miscellany','','','','Dungeons & Dragons: Guildmasters\' Guide to Ravnica - Maps and Miscellany','','','',''),(290,1,1,'Explore the waves above and the fathoms below in these watery adventures for \nthe world’s greatest roleplaying game.Nestled on the coast of the Azure Sea \nis Saltmarsh, a sleepy fishing village that sits on the precipice of \ndestruction. Smugglers guide their ships to hidden coves, willing to slit the \nthroat of anyone foolhardy enough to cross their path. Cruel sahuagin gather \nbeneath the waves, plotting to sweep away coastal cities. Drowned sailors stir \nto unnatural life, animated by dark magic and sent forth in search of revenge. \nThe cult of a forbidden god extends its reach outward from a decaying port, \nhungry for fresh victims and willing recruits. While Saltmarsh slumbers, the \nevils that seek to plunder it grow stronger. Heroes must arise to keep the waves \nsafe!','','dungeons--dragons-ghosts-of-saltmarsh','','','','Dungeons & Dragons: Ghosts of Saltmarsh','','','',''),(291,1,1,'Diabolical dangers await in this adventure for the world’s greatest roleplaying game.','','dungeons--dragons-baldurs-gate-descent-into-avernus','','','','Dungeons & Dragons: Baldur\'s Gate: Descent Into Avernus','','','',''),(292,1,1,'Bring your Dungeons &amp; Dragons game to life with this collection of twenty beautifully rendered, full-color, tactical poster maps.','','dungeons--dragons-tactical-maps---reincarnated','','','','Dungeons & Dragons: Tactical Maps - Reincarnated','','','',''),(293,1,1,'Everything you need to create characters and play the new adventures in this \nintroduction to the world’s greatest roleplaying game.','','dungeons--dragons-essentials-kit---en','','','','Dungeons & Dragons: Essentials Kit - EN','','','',''),(294,1,1,'Challenge \nthe Gods','','dungeons--dragons-mythic-odysseys-of-theros','','','','Dungeons & Dragons: Mythic Odysseys of Theros','','','',''),(295,1,1,'The wizard Tasha, whose great works include the spell Tasha’s hideous laughter, has gathered bits and bobs of precious lore during her illustrious career as an adventurer. Her enemies wouldn’t want these treasured secrets scattered across the multiverse, so in defiance, she has collected and codified these tidbits for the enrichment of all.','','dungeons--dragons-tashas-cauldron-of-everything','','','','Dungeons & Dragons: Tasha\'s Cauldron of Everything','','','',''),(296,1,1,'Unearth the terror of Ravenloft in this boxed adventure for the world’s greatest roleplaying game.Under raging storm clouds, the vampire Count Strahd von Zarovich stands silhouetted against the ancient walls of Castle Ravenloft. Rumbling thunder pounds the castle spires. The wind’s howling increases as he turns his gaze down toward the village of Barovia.Far below, yet not beyond his keen eyesight, a party of adventurers has just entered his domain. Strahd’s face forms the barest hint of a smile as his dark plan unfolds. He knew they were coming, and he knows why they came—all according to his plan.A lightning flash rips through the darkness, but Strahd is gone. Only the howling of the wind fills the midnight air. The master of Castle Ravenloft is having guests for dinner. And you are invited.Curse of Strahd, one of the most popular Dungeons &amp; Dragons roleplaying game products of all time, split into three parts: a 224-page perfect-bound adventure for characters of levels 1–10, a 20-page Creatures of Horror booklet of new monsters that appear in the adventure, and an 8-page Tarokka Deck booklet.A cover sheet with Strahd von Zarovich’s image on one side and Strahd’s monster stat block on the other.A sturdy, four-panel Dungeon Master’s screen designed for use with the adventure.A double-sided poster map showing the domain of Barovia on one side and Castle Ravenloft on the other.54 foil-stamped Tarokka cards, which help determine the heroes’ path through the adventure.A tuck box to hold the Tarokka deck.12 postcards (3 copies each of 4 different cards), which you can use to invite friends to your game.','','dungeons--dragons-curse-of-strahd-revamped-edition','','','','Dungeons & Dragons: Curse of Strahd (revamped edition)','','','',''),(297,1,1,'Embark \non a journey with the rival wizards Tasha and Mordenkainen and the crime lord \nXanathar. Learn new secrets and discover magical new ways to play the world’s \ngreatest roleplaying game.','','dungeons--dragons-rules-expansion-gift-set---hard-cover','','','','Dungeons & Dragons: Rules Expansion Gift Set - Hard Cover','','','',''),(298,1,1,'Welcome to Acquisitions \nIncorporated!','','dungeons--dragons-acquisitions-incorporated','','','','Dungeons & Dragons: Acquisitions Incorporated','','','',''),(299,1,1,'Terror stalks the nightmare realms of Ravenloft. No one knows this better than monster scholar Rudolph Van Richten. To arm a new generation against the creatures of the night, Van Richten has compiled his correspondence and case files into this tome of eerie tales and chilling truths.','','dungeons--dragons-van-richtens-guide-to-ravenloft','','','','Dungeons & Dragons: Van Richten\'s Guide to Ravenloft','','','',''),(300,1,1,'\n\n\n\nCreate \nyour own Critical Role campaigns with this sourcebook for the world\'s greatest \nroleplaying game!Explorer’s \nGuide to Wildemount provides everything you need to play Dungeons &amp; Dragons \non the continent of Wildemount (set within the world of Exandria)—a land of war, \nbetrayal, and swashbuckling adventure.Comprised \nof four regions, Wildemount provides endless potential for adventure in a land \nof brewing conflict and incredible magic. Rising tensions boil over into all-out \nwar between the politically dubious Dwendalian Empire and the light-worshiping \nwastefolk of Xhorhas, supplying a vibrant backdrop for any D&amp;D campaign to \nexplore.Uncover \na trove of new options usable in any D&amp;D game, featuring subclasses, spells, \nmagic items, monsters, and more, rooted in the adventures of Critical Role—such \nas Vestiges of Divergence and the possibility manipulating magic of \ndunamancy.Start \na campaign in any of Wildemount’s regions using a variety of introductory \nadventures, dozens of regional plot seeds, and the heroic chronicle system—a way \nto create character backstories rooted in Wildemount.Explore \nevery corner of Wildemount and discover mysteries revealed for the first time by \nCritical Role Dungeon Master, Matthew Mercer.This \nbook’s contents include the following:An \nexpansive Wildemount gazetteer.Descriptions \nof the major factions of Wildemount.Player \noptions that include new subclasses, new spells, and a tool to help players \ndeeply integrate their characters into the setting.New \nmagic items, including weapons that become more powerful to match their \nwielders.New \ncreatures native to Wildemount.Four \nintroductory adventures—one for each unique region of Wildemount.Largely \nwritten and helmed by Matthew Mercer, the Dungeon Master of Critical Role and \ncreator of the world of Exandria, this 304-page book features work by talented \ndesigners, writers, and artists from the D&amp;D and Critical Role \ncommunities.Explorer\'s \nGuide to Wildemount is an expansive, vivid campaign setting anyone can enjoy \nregardless of their familiarity with Critical Role, and an open invitation to \nmake the mysteries and dangers of Wildemount your own.\n','','explorers-guide-to-wildemount','','','','Explorer\'s Guide to Wildemount','','','',''),(301,1,1,'Otaczający \n nas świat jest iluzją, niewielką wyspą położoną na oceanie kłamstw, kolorowym  \nmuralem na obdrapanej i gnijącej ścianie. Ludzkość jednak tego nie dostrzega, a  \njej zmysły są otulone przez całun kłamstw. Nie dostrzegamy otaczającego nas  \nzewsząd zła i zepsucia.','','kult-podrcznik-gwny','','','','Kult Podręcznik Główny','','','',''),(302,1,1,'Ekran \nMistrza Gry składający się z 4 paneli z piękną panoramą wieżowców z jednej \nstrony, i z wszystkimi użytecznymi dla MG tabelami z drugiej (ruchy, tworzenie \nBN itd. itp.)','','kult-ekran-mistrza-gry','','','','Kult Ekran Mistrza Gry','','','',''),(303,1,1,'Zestaw Kart Tarota - 68 kart, specjalnie zaprojektowanych na potrzeby \"Kult: Boskość utracona\".','','kult---zestaw-tarota','','','','Kult - Zestaw Tarota','','','',''),(304,1,1,'KULT:','','kult-bosko-utracona-edycja-biblijna','','','','Kult: Boskość utracona Edycja Biblijna','','','',''),(305,1,1,'„Czarna Madonna” to kampania pierwotnie wydana tylko w Szwecji i Francji. Jej \nsześć oddzielnych epizodów poprowadzi graczy przez niepokojącą przygodę związaną \nz Aniołem Śmierci Chaigidielem oraz Archontką Biną i ich sługami. Aby rozegrać \n\"Czarną Madonnę\", potrzebujesz podręcznika do gry \"Kult: Boskość utracona\".','','kult---czarna-madonna','','','','Kult - Czarna Madonna','','','',''),(306,1,1,'\"Taroticum i inne opowieści\" to siedem samodzielnych scenariuszy do gry \n\"Kult: Boskość utracona\". Osadzone w różnych miejscach i lokacjach scenariusze, \nopowiadają o wielu odmiennych aspektach mitologii Kultu. Zaprojektowano je by \nbyły łatwe i szybkie do opanowania i rozegrania. Aby rozegrać scenariusze z tej \nksiążki, potrzebujesz podręcznika do gry \"Kult: Boskość utracona\".','','kult---taroticum-i-inne-opowieci','','','','Kult - Taroticum i inne opowieści','','','',''),(307,1,1,'\n\n\n\nNiech ludzie wiedzą, że słoneczne Miami, \n...... \ntakie, jakie widzi się na przedwojennych wideoklipach czy pocztówkach, nie \nistnieje już dawno. Niech nie pędzą tu na łeb na szyję w poszukiwaniu mitycznej \nkrainy wiecznej zabawy – niech już lepiej pędzą zwykłe życie w szarych \nzapylonych ruinach, gdzie nie ma wody, lekarstw i nadziei, a jedynym sąsiadem \njest banda mutków. Tak będzie dla nich lepiej.Bo \nMiami, cóż. Jakby to ująć. Miami stało się prawdziwym \npiekłem.\n','','neuroshima-miami','','','','Neuroshima Miami','','','',''),(308,1,1,'\n\n\n\nOpinia \ngraczy jest zgodna – ten dodatek miał wyjść jako pierwszy.W \nśrodku dużo dobrego i sporo niezbędnego: 4 dodatkowe pochodzenia z miejsc \nbardziej niepozornych, niż taki Nowy Jork czy Teksas, plus otwarte drzwiczki do \ntworzenia innych „mniejszych” pochodzeń. Księga Szczura, reguły walki w ruinach, \nreguły wydobywania wiedzy z przedwojennych książek, filmów itp., artykuł o \nrozpadaniu się świata po upadku cywilizacji, rozdział o zagrożeniach podczas \neksploracji ruin. I w rolach głównych – GLIZDA, czyli wielki i bardzo sprytny \nsilnik reguł, generatorów, katalogów i opisów, który zamienia bezbarwne szare po \nprostu ruiny w konkretne cuda wianki., w dodatku pełne gambli. Samograj dla \ngraczy, pomocnik MG – dwa w jednym. Do tego detykowana profesja Przepatrywacza i \njeszcze więcej dobrego. Stron 128,, choć ostatnie rozdziały lecą, już czcionką \nmini.\n','','neuroshima-ruiny','','','','Neuroshima Ruiny','','','',''),(309,1,1,'...Hegemonia \n nie byłaby w stanie ruszyć dupska i narzucić swojej woli całemu kontynentowi. \n Gdyby ruszyli naprzód zatrzymaliby się dopiero na Molochu albo na mocnych \n państwach ze wschodniego wybrzeża. Otóż powiem ci, że południowcy mają  \npotencjał, ale nie mają ambicji. Potrzebny im po prostu charyzmatyczny \n przywódca. Ktoś na miarę Esteveza. Módl się, żeby drugi taki sukinkot nie \n przyszedł na świat.”Ten, \n kto wygłosił powyższe zdanie, krakał w niewłaściwą godzinę. No i \n wykrakał.Jeśli \n grasz w Neuroshimę raz na tydzień...... \n to pomysłów zawartych w tym zbiorze wystarczy ci na cały rok! W dodatku \nznajduje  się również dokładnie opisana storylinia NS, czyli najważniejsze \nwydarzenia,  które mają aktualnie miejsce w świecie gry. Dowiecie się o zmianach \nw Hegemoni,  ofensywie Molocha oraz walce NJ z Tornado. Sama storylinia ma \nkilkanaście stron  i dokładnie, miesiąc po miesiącu pokazuje, co dzieje się w \npowojennych  Stanach. ','','neuroshima-krew-i-rdza','','','','Neuroshima Krew i Rdza','','','',''),(310,1,1,'Neuroshima \nRPG to limitowana edycja podręcznika RPG wydanego przez Portal Games z okazji \nRoku Molocha 2020. To zupełnie nowe wydanie – w kolorze, formacie A4, druk \nna papierze kredowym ze znakowaniem UV z numerem egzemplarza. Neuroshima to \npostapokaliptyczna gra fabularna. Nastał koniec cywilizacji człowieka. Moloch, \nsamoświadomy program komputerowy wywołał III Wojnę Światową, która wybiła \nwiększość ludzkości. Autorzy: Ignacy Trzewiczek, Marcin Blacha, Michał Oracz, \nMarcin Baryłka. Książka wydana w limitowanej edycji jedynie 2020 \negzemplarzy.','','neuroshima-rpg-rok-molocha','','','','Neuroshima RPG: Rok Molocha','','','',''),(311,1,1,'None','','neuroshima-bohater-3','','','','Neuroshima Bohater ^3','','','',''),(312,1,1,'Zasada \nmówi: cokolwiek się dzieje, procenty lecą w górę, a wraz z nimi sunie Poziom \nTrudności testu Prowadzenie Pojazdu.','','neuroshima-wycig','','','','Neuroshima: Wyścig','','','',''),(313,1,1,'Bohater Maxx to paliwo dla wyobraźni graczy, by stworzyli postać, jakiej jeszcze nie mieli. Nawet, jeśli grają naprawdę regularnie, a cmentarzysko ich postaci jest rozległe i pełne najróżniejszych pochodzeń i profesji. Przykład? Dzięki poprzednim tomom możesz stworzyć Europejczyka, Hibernatusa albo Mistrza Sztuk Walki. Teraz stworzysz też postać Wyznawcy Molocha, Stalowego Policjanta albo prawdziwą kanalię w ramach przestępczej specjalizacji klasycznej profesji.To także pakiet narzędzi, które zwiększają szanse wyjścia obronną ręką ze wszystkiego, czym przywali na sesji Mistrz Gry. Swoje rozwinięcia dostali kiedyś Monterzy, Treserzy Bestii, Gangerzy i inni. Teraz pora na Szamanów i tych, którzy chcą brać się za handel znalezionymi gamblami, wzbogacić dietę o upolowane żarcie albo lubią otaczać się sojusznikami.A przede wszystkim jest to dodatek dla graczy, graczy i jeszcze raz graczy! Mistrzowie mogą co najwyżej zazdrośnie zerkać i próbować uszczknąć coś dla siebie. Albo czerpać inspirację do tworzenia przygód. Ale nie o nich tu chodzi – oni mają swoje bestiariusze, poradniki i sourcebooki. To Ty, graczu, otrzymujesz na własność trzeci tom serii.Będzie Ci służył, możesz nam zaufać.ZAWARTOŚĆ DODATKU:Wyznawcy Molocha. Mówią na nas rozmaicie. Wyznawcy Molocha, choć nie każdy z nas wierzy, że Moloch to coś godnego czci. Agenci, chociaż nie znam nikogo, komu Sztuczny Mózg naprawdę dawałby rozkazy. A najczęstsze określenie to „zdrajcy”. Tak jakbyśmy byli coś winni ludzkości.Zostań zakałą ludzkości. Zerknij na zestaw przestępczych specjalizacji, czyli takich rozwinięć kilku klasycznych, podręcznikowych profesji, które pokazują ich ciemne strony. Ciemne, ale dochodowe.G.A.S.T.R.O. (Mała księga myśliwego). Skwiercząca od radioaktywności pustynia aż korci, by w niej poszperać i znaleźć cokolweik, co można by włożyć do gęby – czy to garść świecących grzybków, czy mniej toksyczną połówkę jaszczurki – trujki, czy może nawet wykopać z nory wielkiego, zmutowanego królika.Krater Genosite. Nawet w porządnym skafandrze lepiej nie przebywać tam zbyt długo, tym bardziej, że w okolicy kręci się mnóstwo wynaturzonych istot, które zrodzić mogła tylko ta przeklęta ziemia.Sposób na choróbska. Przeczytaj uważnie, a być może po raz pierwszy od zawsze będziesz mógł na parę dni odstawić fiolkę z tabletkami.Wstąp do Stalowej Policji. Wszędzie tam, gdzie pojawiają się Stalowi Policjanci, leje się krew. Krew przestępców, złoczyńców, zdrajców ideałów ludzkości. Sęk w tym, że to policjanci mają monopol na rozsądzanie, o jakie prawo chodzi i kto zalicza się do kategorii przestępcy.Przewietrz swój bagażnik. Przy odrobinie szczęścia pozbędziesz się zbędnego balastu i przy okazji zgarniesz parę gambli w poręczniejszej postaci.Zostań Szamanem. Nikt przy zdrowych zmysłach nie wierzy w cały ten szamański bełkot, bo to zwidy popaprańców, triki cwaniaków, albo mieszanina jednego z drugim, no nie? Tylko dlaczego co chwila pakujemy się w gówno, którego nie sposób wytłumaczyć jakoś normalnie i tylko szamani mają na nie jako taką odpowiedź?Reputacja do kwadratu. Spraw, żeby mamy-mutki straszyły tobą swoje pokraczne dzieci, by każdy członek gangu marzył o tym, by wykręcić kiedyś numer pod twoim przewodnictwem.Rozkazuj swoim pomocnikom. Billy wybywa na pół dnia, przetrząsa zamieszkane enklawy w ruinach miasta, odszukuje każdą zapyziałą knajpkę rozpytuje wśród ludzi. Wieczorem wraca i rzuca na stół buteleczkę z antidotum na ugryzienie helodermy.','','rpg-neuroshima-21-bohater-maxx','','','','RPG: Neuroshima: 21. Bohater Maxx','','','',''),(314,1,1,'Dodatek jest odpowiedzią na serię Bohater^2 oraz Bohater^3 i w całości przeznaczony jest dla MG, którzy znajdą w nim dziesiątki pomocy - przykładowe osady, knajpy i inne miejsca, w których zwykle żyją bohaterowie niezależni; sposoby na obronę tychże BN-ów przed zakusami bohaterów graczy; pomysły na to jak radzić sobie z rozbestwionymi graczami; jak zbudować świat, by wiernie oddawał klimat różnych kolorów NS; ściśle tajne dane tylko dla mistrzów gry: opis mutantów IV generacji, zarazy w Detroit i maszyn z Neodżungli - Smarta. A to bynajmniej nie wszystko.','','neuroshima-mistrz-gry2','','','','Neuroshima Mistrz Gry^2','','','',''),(315,1,1,'Wzdłuż autostrad stoją wraki dawnych samochodów, poprzewracane kilku \ndrogowskazów i zniszczone linie wysokiego napięcia. Na mapie Stanów ostało się \nkilka miast, kilkanaście większych miasteczek i setki, tysiące osad. Ruszysz sto \nmil i znajdziesz się samotny, jak rozbitek na falach oceanu. Gdziekolwiek się \nskierujesz, czeka cię niewiadoma i niebezpieczeństwo. Każde miasto przez lata \nodcięcia od innych wykształciło własne zwyczaje i prawa. Każda najmniejsza wieś \nto zupełnie nowy świat. ','','neuroshima-15-oprawa-twarda','','','','Neuroshima 1.5 (oprawa twarda)','','','',''),(316,1,1,'Na 48 stronach formatu B5 znajduje się pełna zwrotów akcji mini kampania, w \nktórej gracze będą mieli szansę odwiedzić Sharash, wstąpić w szeregi Valkirii, \nczy nawet wedrzeć się na tereny Molocha i spróbować wykraść mu coś bardzo \ncennego! Bohaterowie będą mieli możliwość zdobyć wielu interesujących przyjaciół \ni sojuszników, choć i narobią sobie wielu wrogów!','','neuroshima-06-zabi-szczura','','','','Neuroshima: 06. Zabić Szczura','','','',''),(317,1,1,'Dodatek w całości skierowany do graczy.','','neuroshima-bohater-2','','','','Neuroshima Bohater ^2','','','',''),(318,1,1,'Podwójna księga profesyjna Łowca Maszyn / Zabójca Mutantów została ukończona i trafila do druku. Bitwa została wygrana, ale wojna nadal trwa – na horyzoncie widać już zarysy Bestiariusza, Mutantów – alternatywnej podstawki dla graczy-mutków oraz uwaga!, antologii opowiadań ze świata NS. Wracając do najnowszej, profesyjnej księgi – dodatek jest obszerniejszy niż po prostu “Gladiator razy dwa\" (48 stron), ma bowiem 120 stron, a to już solidny kawał książki.','','neuroshima-owca-mutantw--zabjca-maszyn','','','','Neuroshima: Łowca Mutantów / Zabójca Maszyn','','','',''),(319,1,1,'Krew i Rdza 2 to dodatek przeznaczony dla Mistrzów Gry. Zbiór przynosi im wsparcie w postaci kilkudziesięciu scenariuszy i pomysłów na przygody w rozmaitych stylach, miejscach i kolorach. KiR2 to także zastrzyk informacji o świecie Neuroshimy: w rozdziale Tajemnice Mistrza Gry znajdziecie krwiste materiały poświęcone Neodżungli, Posterunkowi, Federacji Appalachów i innym miejscom, które dotąd pozostawione były samym sobie. Całość otwiera natomiast nowy neuroshimowy setting: Neuroshima 2020. Proponuje on rozgrywkę nie trzydzieści lat po zagładzie, lecz właśnie wtedy, gdy na Stany spadły bomby.','','neuroshima-17-krew-i-rdza-ii','','','','Neuroshima: 17. Krew i Rdza II','','','',''),(320,1,1,'Legend of the Five Rings RPG: The Book of Air to pierwszy z pięciu dodatek ze świata żywiołów.','','neuroshima-nowy-jork','','','','Neuroshima Nowy Jork','','','',''),(321,1,1,'None','','neuroshima-02---gladiator','','','','Neuroshima 02 - Gladiator','','','',''),(322,1,1,'Te co skaczą i fruwająPustynia: (...) Nagle z dna wychynęły dwa wielkie \n rogi, czy też kły, wyrzucając w powietrze fontannę piasku i kamieni, pokrywając \n szamoczącą się sylwetkę tumanem kurzu. Po chwili rozległo się miękkie \n trzaśnięcie i krzyk umilkł. To był Kopacz.','','neuroshima-bestiariusz-bestie','','','','Neuroshima Bestiariusz: Bestie','','','',''),(323,1,1,'Roboty \n      bojowe: (...) Wszystkie kończyny robota są \n      niesamowicie ostre, wystarczy, że zamachnie się ręką lub nogą, a mięśnie, \n      czasem nawet kości ofiar, rozmieniają się na drobne. Sceny walk z \n      Chudzielcem są niezmiernie krwawe.','','neuroshima-bestiariusz---maszyny','','','','Neuroshima: Bestiariusz - Maszyny','','','',''),(324,1,1,'Opis wydawcy:','','neuroshima-10---piraci','','','','Neuroshima 10 - Piraci','','','',''),(325,1,1,'Opis wydawcy:','','neuroshima-09---zaginione-miasto','','','','Neuroshima 09 - Zaginione miasto','','','',''),(326,1,1,'\n\n\n\nTajemnice Pętli to niezwykła gra fabularna przedstawiająca alternatywną \nwizję lat 80. XX wieku, gdzie na każdym kroku można spotkać latające statki i \nniesamowite roboty, a tajne rządowe eksperymenty oraz zagadkowe zjawiska burzą \nspokój codzienności.\n','','tajemnice-ptli---podrcznik-podstawowy','','','','Tajemnice Pętli - Podręcznik Podstawowy','','','',''),(327,1,1,'Zasobnik Mistrza jest świetną pomocą podczas gry w Tajemnicę Pętli!Ekran \njest zrobiony z grubej, twardej okładki, rozkładanej do szerokości ok. 85 cm. \nJedna strona zawiera piękną i niepokojącą jednocześnie ilustrację.','','tajemnice-ptli---zasobnik','','','','Tajemnice Pętli - Zasobnik','','','',''),(328,1,1,'Krajobraz \nwypełniały maszyny, a cały ten złom łączył się ze stojącym w pobliżu budynkiem \nelektrowni. Na horyzoncie zawsze czaiły się gigantyczne wieże chłodzące, \nregularnie mrugające zielonymi światłami ostrzegawczymi. Po przyłożeniu ucha do \nziemi można było usłyszeć bicie serca Pętli – pomruk Gravitronu, głównego \nelementu technologii tak zaawansowanej, że wręcz magicznej, na której opierały \nsię wszystkie prowadzone w Pętli eksperymenty.','','maszyny-nasi-przyjaciele-i-inne-tajemnice','','','','Maszyny, nasi przyjaciele i inne tajemnice','','','',''),(329,1,1,'Witajcie ponownie w świecie Pętli! Sporo się tu zmieniło od lat 80.  \nGdzieś tam, poza ogrodzeniami, poza polami i bagnami, jak bezpańskie psy \n wałęsały się porzucone maszyny. Niecierpliwe, niespokojne, czuły zmiany \n zachodzące w całym kraju.','','tajemnice-ptli---tajemnice-powodzi','','','','Tajemnice Pętli - Tajemnice Powodzi','','','',''),(330,1,1,'Robot pędził z łoskotem przez pole żyta, \nkierując się wprost na policyjną furgonetkę. Wtedy zrozumiałam, że trochę \nprzesadziliśmy - i to, prawdę mówiąc, już chwilę temu. Może wtedy, kiedy \nwłamaliśmy się do magazynu w Sätunie, gdzie Olof znalazł ten dziwny plecak? \nPowinnam była się zorientować, gdy wsunął rękę do tej wielkiej rękawicy, a \nistota pod plandeką nagle ożyła. A może wszystko zaczęło się od tego, jak \nuciekliśmy z domu przed obiadem? Latem dni wypełnione są przygodami i ciężko \nspamiętać, kiedy co się wydarzyło.','','tajemnice-ptli---zestaw-startowy','','','','Tajemnice Pętli - Zestaw Startowy','','','',''),(331,1,1,'Więcej niż zbiór \nscenariuszy!Podobno po polach na \nwyspach jeziora Melar krąży jakieś mechaniczne ustrojstwo. Tymczasem na tablicy \nogłoszeń przed spożywczakiem systematycznie przybywa ogłoszeń o zaginionych \nzwierzakach domowych. W telewizji gość od pogody donosi o „przypadkowych \nporywach burzowych” – i faktycznie od kilku dni, co noc pogoda mocno się \npsuje.','','tajemnice-ptli---spoza-czasu','','','','Tajemnice Pętli - Spoza Czasu','','','',''),(332,1,1,'Na rozdartym wojnami Kontynencie toczy się więcej opowieści niż tylko historia Geralta z Rivii. Biały Wilk podąża tropem swoich miłości. Niezliczone inne sagi rozwijają się w tym samym czasie. Każda z nich godna jest ballady mistrza Jaskra. Ty zaś staniesz się bohaterem jednej z nich!   \n\n“The Witcher RPG” to gra bez prądu, która pozwoli grupie znajomych stworzyć własną opowieść w wiedźmińskim świecie. Z pomocą tego podręcznika i odrobiny wyobraźni będziecie mogli przemierzyć cały Kontynent, napotkać jego żywe legendy i wpłynąć na jego dzieje. Weźmiecie udział w politycznych intrygach i brutalnej wojnie z Cesarstwem Nilfgaardu. Będziecie walczyć o życie i próbować na zgliszczach starego świata zbudować lepszą przyszłość.\n\nTen podręcznik pozwoli Wam: \n Stworzyć postaci reprezentujące znane z gier i książek archetypy: barda, czarodziejkę, kapłankę, kupca, medyczkę, przestępcę, rzemieślnika, zbrojnego i oczywiście, wiedźmina. \nPolować na liczne potwory, od szkodników takich jak utopce czy nekkery, po potężne bestie jak biesy i wiwerny. \nSięgnąć po potęgę nieprzewidywalnej magii wiedźmińskiego świata, wykorzystując nie tylko moc czarów, kapłańskich inwokacji i wiedźmińskich Znaków, ale też starożytnych rytuałów i przerażających klątw. \nToczyć krwawe i brutalne walki, w których spryt będzie często tryumfował nad siłą a śmierć zawsze będzie o krok nad bohaterami! \n','','the-witcher','','','','The Witcher','','','',''),(333,1,1,'33 nowe potwory: niechaj mieszkańcy Królestw Północy drżą z przerażenia przed wyrastającymi spod ziemi archesporami czy niesionymi mroźnym wichrem wendigo! To bestiariusz, na który czekałeś! ','','wiedmiskie-zapiski---the-witcher-rpg','','','','Wiedźmińskie Zapiski - The Witcher RPG','','','',''),(334,1,1,'The Witcher RPG: Władcy i Włości to świetne rozszerzenie pozwalające Mistrzowi Gry i graczom ożywić mroczny i niebezpieczny świat wiedźmiński w trakcie gry!','','wadcy-i-woci--the-witcher-rpg','','','','Władcy i Włości – The Witcher RPG','','','',''),(335,1,1,'None','','vampire-the-masquerade-5ed---fall-of-london','','','','Vampire the Masquerade 5ed - Fall of London','','','',''),(336,1,1,'Wampir: \n Maskarada to jedyna i unikatowa gra fabularna \nłącząca  w sobie dramat jednostki i polityczny horror.','','wampir-maskarada---podrcznik-gwny-5ed','','','','Wampir: Maskarada - Podręcznik Główny (5ED)','','','',''),(337,1,1,'Wampir: Maskarada - Ekran \nnarratora to przydatne narzędzie dla każdego Mistrza \nGry, które pomoże w utrzymaniu wszelkich niespodzianek w tajemnicy.','','wampir-maskarada---ekran-narratora','','','','Wampir: Maskarada - Ekran Narratora','','','',''),(338,1,1,'„Anarchiści” – podręcznik dodatkowy do „Wampira: Maskarady” 5 edycja.','','wampir-maskarada---anarchici','','','','Wampir: Maskarada - Anarchiści','','','',''),(339,1,1,'\n\n\n\n\"Świeża \n Krew\" to zestaw startowy wprowadzający do Świata Mroku oraz \"Wampira: \n Maskarady\". Zaprojektowany z myślą o nowych Narratorach i graczach, zawiera \nnową  historię uczącą grania w nową edycję gry fabularnej, skrót zasad, karty \nwrogów i  ofiar do samodzielnego wydruku, 7 postaci graczy oraz Mapę  \nRelacji. \n','','wampir-maskarada---wiea-krew','','','','Wampir: Maskarada - Świeża Krew','','','',''),(340,1,1,'Ostrzeżenie: \nZawiera pisemne oraz graficzne materiały dla dojrzałego odbiorcy, w tym: \nprzemoc, motywy seksualne i mocny język. Zaleca się dyskrecję \nczytelnika.','','wampir-maskarada---sabat','','','','Wampir: Maskarada - Sabat','','','',''),(341,1,1,'„Camarilla” – podręcznik dodatkowy do „Wampira: Maskarady” 5 edycja.','','wampir-maskarada---camarilla','','','','Wampir: Maskarada - Camarilla','','','',''),(342,1,1,'\n\n\n\nBrothers \nand Sisters in Caine, united under the banner of the Dark FatherAn \nantagonists’ guide to the cultic fanatics of the Sabbat, this book contains \neverything you need to incorporate the infamous Black Hand faction into your \nVampire chronicles. Inside you’ll find descriptions of the Paths of \nEnlightenment, the foundations of Sabbat identity, information on the Gehenna \nWar, and details on how the Sabbat opposes the dread Antediluvians. You’ll get \nnew tools to expand your chronicles, including Discipline powers, minions and \nservitors, and the horrifying Ritae of the Sword of Caine.Sabbat: \nThe Black Hand is a supplement for the Vampire: The Masquerade Roleplaying Game, \noutlining in detail the lore and background of the Sabbat, including new Paths \nand Disciplines, its current customs and practices, and new Storyteller \nresources for a richer Vampire roleplaying experience.\n','','vampire-the-masquerade-sabbat-the-black-hand','','','','Vampire The Masquerade: Sabbat The Black Hand','','','',''),(343,1,1,'Oficjalny zestaw 10-ściennych kości do V edycji Wampira Maskarady.','','vampire-the-masquerade-dice','','','','Vampire: The Masquerade Dice','','','',''),(344,1,1,'None','','vampire-the-masquerade-5ed---second-inquisition-en','','','','Vampire The Masquerade 5ED - Second Inquisition EN','','','',''),(345,1,1,'Opis wydawcy:','','notatnik-wampir-maskarada','','','','Notatnik Wampir: Maskarada','','','',''),(346,1,1,'None','','vampire-the-masquerade-5th-ed-cults-of-the-blood','','','','Vampire: The Masquerade 5th Ed Cults of the Blood','','','',''),(347,1,1,'Stary Świat umiera.  \n Toczy go wstrętna choroba, rozprzestrzeniająca się poprzez wiatr i wodę, zatruwająca nawet samą ziemię. Zarażone nią rośliny natychmiast rozkładają się, gniją lub więdną. U ludzi i zwierząt jej objawy manifestują się okropnymi mutacjami i deformacjami, które prowadzą zarażonych na krawędź szaleństwa, a następnie daleko poza nią. Chorobą tą jest Chaos – złowrogi cień, który od dawna rzucają na Stary Świat północne pustkowia. To zagrożenie, które spędza sen z powiek zarówno ludziom, jak i elfom oraz krasnoludom.    \n\nW Księdze Spaczenia, dodatku do gry fabularnej Warhammer Fantasy, Niszczycielskie Potęgi wreszcie zostają odsłonięte. Niniejsza książka ujawnia wszystkie sekrety Chaosu, opisując je nadzwyczaj starannie i z wielkim pietyzmem – począwszy od szczegółów dotyczących niezliczonych rodzajów mutacji, jakim ulec mogą istoty rozumne, poprzez różne istoty Chaosu, włącznie ze zwierzoludźmi zamieszkującymi mroczne ostępy Lasu Cieni oraz Drakwaldu, aż po straszliwe demony, zrodzone z pradawnych ludzkich koszmarów. Księga Spaczenia odpowie na wszystkie Twoje pytania dotyczące Chaosu – oraz na wiele takich, których nie miałeś odwagi zadać.   \n\nWewnątrz tej przeklętej księgi znajdziesz:  \n Ponad 150 nowych mutacji, dzięki którym stworzysz unikalnych i potwornych mutantów służących mrocznym bogom. \n Szczegółowe informacje dotyczące mrocznych kultów Starego Świata, między innymi o zdeprawowanych Sybarytach oraz kulcie Cuchnącej Paszczęki. \n Zasady tworzenia nowych kultów, jak również informacje niezbędne do przygotowania przywódców kultów, akolitów oraz czarnoksiężników. \n Lista artefaktów Chaosu, takich jak Posępna Wieczerza i Katalog Ciał.\n Wyczerpujące informacje dotyczące tworzenia zwierzoludzi, w znaczny sposób rozszerzające zasady opisane w Bestiariuszu Starego Świata.\n Kilkanaście nowych potworów zrodzonych z dotyku Chaosu, w tym amfisbena, bazyliszek oraz straszny dżabersmok.\n Opis Norski, wraz z zasadami tworzenia norsmeńskich Bohaterów Graczy oraz prowadzenia kampanii na terenie tej krainy.\n Szczegółowy opis barbarzyńskich plemion wyznających Bogów Chaosu, takich jak Kurganie, a także krasnoludy Chaosu!\n Obszerne zasady umożliwiające odgrywanie roli kultystów Chaosu, a w tym: nowe profesje, piętno Chaosu oraz błogosławieństwa Niszczycielskich Potęg.\n Ponad 100 naznaczonych przez Chaos broni oraz wiele innych przeklętych przedmiotów, które można wykorzystać, walcząc w imię Mrocznych Bóstw.\n Rozszerzone Tradycje Chaosu dla Czarnych Magistrów oddających cześć Nurglowi, Slaaneshowi lub Tzeentchowi, zawierające całkowicie nowe czary takie jak idylla albo marionetka.\n Rozszerzone tabele efektów ubocznych dla guślarzy i wiedźm praktykujących magię czarnoksięską.\n Pełne charakterystyki dobrze znanych demonów, zawierające opis wszelkich manifestacji Chaosu, począwszy od żałosnych, lecz obrzydliwych nurglingów, a skończywszy na straszliwym Strażniku Tajemnic.\n Nowe zarazy i choroby umysłu. \nDodatkowo w Księdze Spaczenia znajdziesz obszerne informacje dotyczące Pustkowi Chaosu oraz położonych tam dziwnych miejsc.','','warhammer-rpg-ii-edycja-ksiga-spaczenia','','','','Warhammer RPG II Edycja: Księga Spaczenia','','','',''),(348,1,1,'Middenheim \nzostało uratowane przed całkowitym zniszczeniem, lecz Wewnętrzny Wróg nie został \npokonany. Imperator i jego armia wyjechali ze stolicy, ruszając na północ, a w \nAltdorfie zło rośnie w siłę. W głębi miasta spoczywa ukryty sekret, który łudzi \nśmiertelników obietnicą niezmierzonej potęgi, lecz zsyła jedynie potępienie.','','warhammer-rpg-ii-edycja-wiee-altdorfu','','','','Warhammer RPG II Edycja: Wieże Altdorfu','','','',''),(349,1,1,'Koniec jest bliski!  \nKuźnie Nuln to ostatnia przygoda wchodząca w skład zawiłej i pełnej niebezpieczeństw kampanii Ścieżki Przeklętych. Upadły demon został powstrzymany w Popiołach Middenheim, a jego machinacje ujawnione w Wieżach Altdorfu. Teraz ma ostatnią szansę, aby się uwolnić i wywrzeć krwawy odwet na śmiertelnikach. Z nulneńskich kuźni oręża i odlewni armat biją w niebo grube słupy siarkowego dymu, zatruwając powietrze dawnej stolicy Imperium. Jednak bardziej toksyczna od metalicznych wyziewów manufaktur jest skaza Chaosu, tocząca zarówno możnych, jak i plebs tego miasta.  \n Nuln, zwane też “Klejnotem Imperium”, szykuje się do odsłonięcia prototypu nowego działa prochowego, skonstruowanego przez inżynierów z Imperialnej Akademii Artylerii. Na odsłonięcie Magnusa – gdyż tak nazwano armatę, na cześć najsłynniejszego nulneńczyka, Imperatora Magnusa Pobożnego – zaproszeni przez kapryśną Hrabinę Emmanuelle von Liebowitz przybyli arystokraci z najdalszych zakątków Starego Świata. Wielu z nich zostało też zaproszonych na dworski bal maskowy, jednak gdy elity się bawią, szalony morderca opętany przez demona zbiera krwawe żniwo w zaułkach miasta    \nKuźnie Nuln stanowią ekscytujące zakończenie kampanii Ścieżki Przeklętych, epickiej trylogii przygód do gry fabularnej Warhammer Fantasy. W niniejszej książce znajdziesz: \n Przygodę złożoną z siedmiu epizodów, w której wartka akcja wplącze prowadzących śledztwo Bohaterów w sieć nulneńskich intryg. \n Przewodnik po Nuln, mieście zwanym “Klejnotem Imperium”, zawierający szczegółowy plan miasta. \n Szereg pomysłów na dalsze przygody, które ubarwią dowolną kampanię prowadzoną w Imperium. \n Gotowe postacie Bohaterów Graczy, które umożliwią natychmiastowe rozpoczęcie przygody. \nJakie zło rzuca cień na Klejnot Imperium? Czy niewielka grupa zaciętych śmiałków powstrzyma siły Chaosu, zanim będzie za późno? Podążaj ścieżkami Przeklętych, aby się o tym przekonać!','','warhammer-rpg-ii-edycja-kunie-nuln','','','','Warhammer RPG II Edycja: Kuźnie Nuln','','','',''),(350,1,1,' Strzeż się! Tu grasują potwory!   \n\nKsięga Zasad Warhammera była tylko początkiem wielkiej wyprawy w ponury świat niebezpiecznych przygód. Bestiariusz Starego Świata to zestawienie zamieszkujących go stworów, które stanowią wielkie zagrożenie dla ludzkości. Znajdziesz tu opisy dzikich orków i podstępnych goblinów, jak również potwornych zwierzoludzi i odrażających mutantów. Ten bogato ilustrowany dodatek przedstawia także rzadziej spotykane potwory Starego Świata, takie jak trolle, pegazy, a nawet legendarne smoki.  \n\nPrzeznaczony zarówno dla graczy, jak i Mistrzów Gry, Bestiariusz Starego Świata zawiera między innymi:  \n Niebezpieczne stwory: O naturze istot dziwnych i złowrogich – dzieło słynnego podróżnika, Odrica z Wurtbadu, nieocenionego badacza Starego Świata. Setki opowieści, anegdot i legend o najstraszniejszych potworach z Imperium i innych krain.\n Opisy potworów– przedstawione z trzech punktów widzenia. Jak je widzi pospólstwo Starego Świata, co wiedzą o nich uczeni i co same potwory mają do powiedzenia o sobie – o ile potrafią mówić… \n Współczynniki potworów– gotowe do natychmiastowego wykorzystania w dowolnej przygodzie i większej kampanii. \n Nowe zdolności– takie jak demoniczna aura lub potężny cios. \n Nowe zaklęcia– strzeżcie się magii plemiennych szamanów! \n Rozszerzona lista mutacji Chaosu – dla demonów i wyznawców Niszczycielskich Potęg \n','','warhammer-rpg-ii-edycja-bestiariusz-starego-wiata','','','','Warhammer RPG II Edycja: Bestiariusz Starego Świata','','','',''),(351,1,1,' Burza Chaosu minęła!    \n\nImperium przetrwało kolejną Inwazję Chaosu, jednak pokój okupiono wielkimi stratami. W zniszczonych północnych prowincjach zginęły tysiące obywateli, miasta i wioski zostały złupione, a w ślad za wojną idą głód i zarazy. We wszystkich księstwach prorocy zagłady wieszczą nadejście końca świata, biczownicy i fanatycy nawołują do upustu krwi i pokuty, a kulty Chaosu podkopują fundamenty ładu. Oto Imperium w roku 2522 – niegdyś najpotężniejsze państwo Starego Świata, teraz kraina osłabiona i narażona na ciosy podstępnych nieprzyjaciół. Imperator ściga rozproszone resztki armii Archaona, lecz kto zmierzy się z wewnętrznym wrogiem potomków Sigmara?  \n\nDziedzictwo Sigmara to obszerny przewodnik po Imperium. Na jego stronach znajdziesz:  \n Historię Imperium, od najwcześniejszych lat wędrówek ludów aż do obecnych rządów Karla Franza. \nOpis stosunków społecznych oraz polityki na dworach Książąt-Elektorów. \nPrzepisy prawa, procedury jego egzekwowania oraz wymierzania kar dla złoczyńców. \nObszerne opisy wszystkich prowincji, włącznie ze szczegółowym spisem ważnych miast, osad i wiosek. \nNowe informacje o religii w Imperium. \n8 nowych profesji, w tym egzorcysty i szulera. \nGotowe do wykorzystania pomysły na przygody, włącznie z opisanymi Bohaterami Niezależnymi. \nNową, dwustronicową mapę Imperium. \nSpisek w Bögenhafen, przygodę dla postaci kończących pierwsze profesje. \nImperium to serce Starego Świata. Poznanie jego tajemnic zapewnia sukces każdej kampanii w grze fabularnej Warhammer Fantasy. Dziedzictwo Sigmara to podręcznik, na który czekali wszyscy Mistrzowie Gry.  \n Za Imperium! Za Sigmara! ','','warhammer-rpg-ii-edycja-dziedzictwo-sigmara','','','','Warhammer RPG II Edycja: Dziedzictwo Sigmara','','','',''),(352,1,1,'\nCo łączy astrologów, bagienne ośmiornice i cyrkowców? Otóż wszystkich możesz spotkać w trakcie swoich przygód i wszyscy zostali opisani w Poradniku Staroświatowca – zbiorze ciekawych informacji o Imperium i nie tylko! Dodatek ten szczególnie przydatny, gdy sesja będzie bądź jest prowadzona na wodzie. Poradnik opisuje system rzeczny imperium, oraz dodaje związane z nimi mechaniki. \nPoradnik Staroświatowca to zbiór wiedzy przydatny każdej postaci zamieszkującej Stary Świat. Znajdziesz w nim: \n Dokładny opis dróg wodnych Imperium, włącznie z opisem potworów żyjących w rzekach oraz zupełnie nowych profesji, takich jak strażnik rzeczny i doker.\nRzut oka na barwne i intrygujące życie staroświatowych trup cyrkowych.\nRozszerzone zasady dotyczące handlu dobrami i transportu osób w Imperium.\nDokładne opisy Sartosy, Miasta Piratów, oraz Tobaro, zwanego Miastem Głupców.\nOpis znaczenia znaków gwiezdnych.\nMedycyna i jej znaczenie w Starym Świecie, włącznie z historią tej nauki oraz nowymi zasadami dotyczącymi leczenia i dokładnej opieki medycznej.\nGotowe do natychmiastowego wykorzystania w przygodzie opisy lokacji, między innymi Prochowni Gugnira, karczmy „Arena” oraz zajazdu „Kogut w Kuble”.\nOpis Imperialnej Akademii Artylerii, włącznie z historią uczelni, zwyczajami i najważniejszymi osobistościami.\nZagrożenie dla Imperium w postaci złowieszczego Kultu Oświecenia.\nRozszerzenie wiedzy zebranej w Bestiariuszu Starego Świata o nowe potwory, między innymi bagienną ośmiornicę, krwawnika oraz straszliwego połatańca.  \nPoradnik Staroświatowca będzie niezbędny, aby Stary Świat, stał się jeszcze bardziej ponurym i groźnym miejscem.  \n Uwaga! To nie jest samodzielna gra! Do rozgrywki wymagany jest podręcznik podstawowy WFRP II ed \n','','warhammer-rpg-ii-edycja-poradnik-starowiatowca','','','','Warhammer RPG II Edycja: Poradnik Staroświatowca','','','',''),(353,1,1,' Kraina Królowej Lodu  opowiada o północnym królestwie ludzi zwanym Kislevem. Leży ono zaraz na południe od pustkowi chaosu. Sąsiaduje z imperium ludzkości, oraz barbarzyńskimi ludami zamieszkującymi norskę. Lud Kislevu od setek lat dzielnie stawia czoła Norsmenom, oraz chaosowi.   \nJednak królestwo zaczyna chwiać się w posadach. Po wojnie z chaosem, która miała miejsce dwa stulecia wcześniej, królestwo do dnia dzisiejszego nie odbudowało się w pełni. Inwazja sił chaosu niemalże unicestwiła lud Kislevu. Dopiero przybycie armii imperium pod wodzą imperatora Magnusa Pobożnego pozwoliło uratować stolice królestwa przed upadkiem. Pomimo heroiczenego zwycięstwa koalicji Ludzi i Krasnoludów, w Kisleve do dnia dzisiejszego można znaleźć ślady tamtych wydarzeń. Jak opuszczone grody i miasta. Czy duszę mieszkańców, które próbują znaleźć spokój, i drogę do krainy Moora.  \nObecna władczyni Kislevu, caryca Katarzyna chroni swój lud przed zakusami chaosu, oraz konspiratorami wewnątrz granic swego królestwa. Moce chaos są tu szczególnie obecne jak w żadnym innym królestwie ludzi.    \nKraina Królowej Lodu jest kompletnym przewodnikiem po Kislevie, bogaty w szczegóły opisujące ten kraj i jego mieszkańców. Ten obszerny dodatek zawiera między innymi:\nBogaty w szczegóły opis Kisleva z uwzględnieniem charakterów mieszkańców i surowości klimatu tej krainy.  \nDzieje Kisleva, włącznie z historią najazdów poszczególnych plemion, które uformowały obecnie istniejące Kislevskie społeczeństwo.\nSpojrzenie na politykę i ustrój prawny, uwypuklający napięcia i różnice pomiędzy Kislevskimi plemionami, a także między kastami społecznymi i religijnymi wyznaniami.\nDokładny opis głównych kultów w Kislevie, ze szczegółowymi informacjami o organizacji, zakonach i świątyniach takich bóstw jak Daż, Tor i Ursun.\nWskazówki dotyczące tego, jak wykorzystać Kislev jako miejsce przygód lub kampanii, włącznie z poradami, jak przetrwać w stranie, geograficznymi informacjami o poszczególnych  rejonach kraju, a także dokładnym opisem głównych miast: Kisleva, Praag i Erengradu.\nWszystkie informacje niezbędne do stworzenia i odgrywania Bohatera pochodzącego z Kislevu.\nNowe profesje, typowe dla tej krainy, między innymi lodowa czarownica, ambasador i husarz.\nNowe zasady magii, które oddają naturę Tradycji Lodu i Tradycji Wiedźm.\nOgromna ilość nowych zaklęć dla lodowych czarownic, wiedźm oraz kapłanów Daża, Tora i Ursuna.\nKrótką przygodę, która może być zalążkiem kampanii dziejącej się w Kislevie.\nEkscytujący bestiariusz, którego lektura od razu przywołuje egzotyczną atmosferę Kislevskiej przyrody.  \n Przygoda czeka na was w krainie niedźwiedzia! \n','','warhammer-rpg-ii-edycja-kraina-krlowej-lodu','','','','Warhammer RPG II Edycja: Kraina Królowej Lodu','','','',''),(354,1,1,'Noc w starym świecie stała się jeszcze mroczniejsza. Oprócz dobrze wam już znanych  przeciwników. Pojawiają się nowe zagrożenie. Prosto z Sylvania przybyły do imperium wampiry. Mimo że te mroczne istoty kiedyś były  dumny obywatelami, to obecnie jedynie czego pragną, zamiast wierzyć w Sigmara, jest krew! Przybyły tutaj na czele ze swym panem, byłym księciem elektorem  Manfred von Carsteinem, która nadal, mimo upływu setek lat, pragnie objąć tron i tytuł imperatora.   \n W legendach i koszmarach śmiertelników nieumarli wydają się przerażającymi potworami. Wychodzą z grobów, wzywani bluźnierczą mocą straszliwych nekromantów. Nachodzą zapomniane kurhany i pradawne krypty. Wędrują osłonięci mgły pokrywającą kobiercem jałowe pola i kryją się w zaułkach będących świadkami dawnych zbrodni. Lecz te gnijące, powykręcane męczarniami chodzące trupy nie wzbudzają tak wielkiej fascynacji jak nieumarli, którzy są prawdziwymi królami i królowymi nocy. Wampiry. Przebiegłe, inteligentne i na wskroś złe. Polują na śmiertelników niczym drapieżniki na swoje ofiary. Bywają piękne i uwodzicielskie, cieszące się wieczną młodością, lub potworne i zdeformowane, noszące na ciele oznaki wpływu przeklętej krwi i czarnoksięskich mocy. Każdy z nich niezależnie od wyglądu jest śmiertelnie niebezpieczny. Snują niezliczone intrygi i realizują długofalowe plany. Ich moc i majestat może zniewolić każdego, kto znajdzie się w cieniu ich potęgi.   \n\nDzięki niemu będziecie mogli tworzyć przygody, w których wampiry występują jako przeciwnicy Bohaterów Graczy lub wspierają ich w walce z większym zagrożeniem. Szykujcie kołki, trzymajcie pod ręką wodę święconą i zmówcie modlitwę do Morra. Mroczni władcy nocy powiodą was w samo serce ciemności.   \n\nStrzeżcie się nocy! \nDodatek Mroczni władcy nocy uchyla zasłonę tajemnicy, odkrywając sekrety wampirów Starego Świata. Na jego splamionych krwią stronicach znajdziecie:  \nSzczegółową historię wampirów, która rzuca światło na ich pochodzenie i działania \nRelacje uczonych w temacie mędrców, zawierające cenne wskazówki dla początkujących pogromców wampirów\nDokładne omówienie wampirów, ze szczegółowym przedstawieniem ich mocnych i słabych stron\nKompletny opis pięciu głównych rodów krwi, włącznie z rozpisanymi przykładowymi przeciwnikami, gotowymi do wykorzystania na sesjach\nSzczegółowy opis przeklętej Sylvanii\nZasady tworzenia wampirów jako przeciwników, a także łowców wampirów, zawierające nowe profesje, takie jak grabarz i Czarny Strażnik\nBestiariusz, który rozszerza wiedzę o nieumarłych w Starym Świecie, włącznie ze współczynnikami takich dziwacznych istot jak chyża dłoń czy widmuszka','','warhammer-rpg-ii-edycja-mroczni-wadcy-nocy','','','','Warhammer RPG II Edycja: Mroczni Władcy Nocy','','','',''),(355,1,1,' Módl się do swoich bogów, może cię wysłuchają!   \n Bogowie pomimo swojej wielkiej mocy nie są niezłomnymi obrońcami moralności. To bardziej niewytłumaczalne i trudne do objęcia rozumem żywioły, nierzadko równie groźne jak stwory, przed którymi śmiertelni szukają obrony. Bogów trzeba przebłagać, przekupić darami i raz po raz oddawać należną im cześć, aby zaskarbić sobie ich uwagę i przychylność.   \nKsięga Zbawienia to bezcenny dodatek dla graczy i Mistrzów Gry, zawierający ogromną ilość wartościowych informacji dla postaci silnych w wierze. Stanowi też skarbnicę pomysłów na przygody dla wszystkich Mistrzów Gry. Dzięki wiedzy zawartej w tym podręczniku, twój Bohater może stanąć do walki z sługami Chaosu wspierany mocą bogów!  \nDodtek ten  w szczegółowy sposób opisuje religie Imperium, rolę wiary w istnieniu tego wspaniałego narodu, a także funkcje, jaką pełni w złożonym społeczeństwie. W tym obszernym dodatku zamieszczono:  \n Bardzo szczegółową historię religii w Imperium, wypełnioną fascynującymi detalami, które mogą stanowić zalążki do wspaniałych przygód.  \nDokładny opis kultu każdego z bóstw, włączając w to strukturę, przykazania, informacje o najważniejszych dostojnikach i nie tylko. \nPrzekrojową analizę różnych sposobów na wyrażanie wiary w Starym Świecie – od ludowych przesądów po przesiąknięte fanatyzmem sekty, prezentujące ekstremalne oblicze duchowości. \nOpis pozostałych bóstw czczonych w Starym Świecie, od Khaina o Skrwawionych Dłoniach do Händricha, boga handlu, od bogów zielonoskórych po przeraźliwe bóstwa Chaosu. \nNajważniejsze święta i festyny w Starym Świecie, a także dokładny Kalendarz Imperium. \nWiedzę o życiu kapłanów, ich nauce, służbie oraz hierarchii kultu, a także opis rycerzy świątynnych, mnichów i pielgrzymów. \nZupełnie nowe zaklęcia magii prostej i powszechnej, między innymi mocne postanowienie i ślubowanie. \nRozszerzone listy zaklęć dla kapłanów dziewięciu głównych bóstw, a także zaklęcia dla pomniejszych bogów, takich jak Gunndred i Händrich. \nNieznane dotąd rytuały, relikwie i święte artefakty, między innymi Kufer Biedaka i Jadeitowy Amulet. \nNowe profesje, takie jak krzyżowiec i strażnik świątynny. \nI o wiele więcej \n','','warhammer-rpg-ii-edycja-ksiga-zbawienia','','','','Warhammer RPG II Edycja: Księga Zbawienia','','','',''),(356,1,1,' Warhammer Fantasy Roleplay 2 edycja , to klasyczna gra fabularna wydana w polsce w 2005 roku .Uznawana po dziś za kultową. System ten szczególnie znany i lubiany jest w naszym kraju uznawana za kultowy, który przez lata kształtował rodzimy fandom gier fabularnych.   \nPodręcznik ten przedstawia nam znany świat warhammera fantasy. Mroczne uniwersum, gdzie nikt nie może czuć się bezpiecznie. Od bandytów Czających się na szlakach, po zwierzoludzi w lasach i orków na górami krańca świata. Po Chaos, który jest przekleństwem tego świata. Chaos potrafi skusić i skorumpować każdego, nieważne na status społeczny, rasę, czy pochodzenie. Jednak w centrum starego świata istnieje kraj, który jest w stanie przeciwstawić się mrocznym mocą.Jest nim ,,Imperium Ludzkości’’  Jego założyciel. Sigmar młotodzierżca, zjednoczył zwaśnione plemiona ludzi, aby wspólnie mogły przeciwstawić się zagrożeniu z zewnątrz. Ludy te  wraz z sigmarem założyły imperium, które od ponad dwóch i pół tysiąca lat jednoczy rasę ludzką, w walce z siłami chaosu, oraz innych plugawych pomiotów starego świata.  \nGraczę, jako bohaterowie tego świata są jedynie drobnym trybikiem tego świata. Będą musieli wykazać się sprytem, zwinnością, siłą, oraz innymi umiejętności aby przetrwać w świecie, gdzie śmierć może czaić się tuż za rogiem. Możliwości wykreowania postaci jest wiele, i każda może zdobyć sławę i bogactwa, lub na samym początku umrzeć, i nie zostać zapamiętana przez nikogo. Nie wiecie, co los wam zgotował. \nZawartość podręcznika: \n System błyskawicznego tworzenia postaci. Wykreuj Bohatera w ciągu niespełna pół godziny i bez zbędnej zwłoki zacznij rozgrywkę.\n Łatwy do przyswojenia, ale bogaty w głębie zestaw zasad opisujących każdy aspekt rozgrywki, od interakcji z innymi postaciami do przerażających mutacji Chaosu.\n Unikatowy system rozwoju Bohatera, a także ponad 100 różnorodnych profesji – od akolity i banity do zabójcy trolli i żołnierza okrętowego.\n Kompletne zasady dotyczące magii, włączając w to tajniki mocy czarnoksięskich, oraz ponad 175 zaklęć. Potęga jest na wyciągnięcie dłoni, ale strzeżcie się Przekleństwa Tzeentcha!\n Obfity w szczegóły opis Imperium i Starego Świata. Porządek społeczny, religia, wierzenia oraz wiele innych cennych informacji.\n Kultową już przygodę wprowadzającą – Przez ostępy Drakwaldu. \nZa napisanie  podręcznika odpowiada znany i ceniony autor wielu książek że świata warhammera  Dana Abnetta.  \n Przygoda tylko czeka, aby ją napisać! \n','','warhammer-rpg-ii-edycja-podrcznik-podstawowy','','','','Warhammer RPG II Edycja: Podręcznik podstawowy','','','',''),(357,1,1,'Przed wyruszeniem w drogę należy zebrać... Arsenał! \nKażdy, kto chce wyruszyć na przygodę w starym świecie musi się odpowiednio wyposażyć. Wojownik z samym sztyletem niewiele zwojuje, a strzelec ze starym łukiem nic nie ustrzeli. Natomiast gdy odpowiednio zamienimy sztylet na halabardę straży reiklandu, a łuk na strzelbę hochlandzką, to różnica jest ogromna.Dodatek ten wprowadza Pełny spis wyposażenia, który każdy poszukiwacz przygód powinien zgromadzić  Oprócz samego oręża do ochrony, i zadawania bólu bliźniemu swemu, dodatek wprowadza wiele nowych ciekawych mechanik, przykładowo fałszowanie pieniądza.   \n\nZbrojownia Starego Świata: Uzbrojenie i ekwipunek zawiera również dodatkowe informacje. Są to między innymi:  \n Handel – szlaki handlowe, rody kupieckie, a także informacje o handlu wymiennym i towarowym.\n System monetarny – kompletny opis różnego rodzaju pieniędzy używanych w całym Starym świecie i nie tylko. Znajdziesz tu także zasady dotyczące fałszowania monet.\n Opancerzenie – opis wszystkich używanych pancerzy, włącznie z nowymi rodzajami zbroi – łuskową i ćwiekowaną. Oprócz tego regionalne odmiany pancerzy, godła i herby rycerskie oraz zasady niszczenia pancerzy czynią ten rozdział nieocenioną pomocą, jeśli zależy Ci na ochronie swojego Bohatera.\n Uzbrojenie – dokładny katalog broni, włącznie z nowymi rodzajami, modyfikacjami, a także rzadko spotykanymi i bezcennymi typami broni. Broń biała, krótka i długa, broń strzelecka i palna, a także zasady dotyczące broni oblężniczej uzupełniają ten istny arsenał wiedzy.\n Ekwipunek – wszystko, co przydaje się w trakcie podróży.  \nOsobliwości – nowe trucizny, mikstury i różnego rodzaju dziwne przedmioty, dzięki którym Twój Bohater stanie się naprawdę wyjątkowy! \n Transport – rozszerzone zasady dotyczące zwierząt i transportu. Niezbędne przy planowaniu dłuższej podróży! \n Biznes – wszystko, co musisz wiedzieć o handlu, prawie własności, kodeksie prawnym i zasadach prowadzenia działalności gospodarczej. \n Pracownicy – nowe zasady dotyczące wynajmowania pracowników najemnych. Wtedy, gdy potrzebujesz pomocy! \n Skarby – nagroda za trudy życia i poniesione ryzyko.  ','','warhammer-rpg-ii-edycja-zbrojownia-starego-wiata','','','','Warhammer RPG II Edycja: Zbrojownia Starego Świata','','','',''),(358,1,1,'Poznaj tajemnice magii!  \n Magia, była  wiele lat była traktowana w imperium za herezję, a czarodzieje, próbujący czarować, szybko kończyli na stosach uprzednio złapani i torturowani przez łowców czarownic. Dopiero imperialny dekret powołany i podpisany przez imperatora Magnusa Pobożnego. Zalegalizował  używanie magii,  na terenie imperium. Pierwsze imperialne kolegia magii zostały założone, przez trzech wysokich elfów  Teclis i jego dwaj towarzysze, Finreirem i Yrtle. W Imperium każdy, kto parał się magią, był postrzegany jako pionek Chaosu. Jednak z pomocą Wysokich Elfów można było nauczyć ludzi władania wiatrami magii bez zepsucia.    \nMagiczne wichry owiewają krainy ludzi. Potężne i niewidzialne, oplatają cały Stary Świat. Okiełznać je potrafią tylko czarodzieje dysponujący wielką wiedzą i mocą. Ten obszerny dodatek do Księgi Zasad Warhammera zawiera kompletny zbiór informacji o magii: od najdawniejszych czasów aż po założenie Kolegiów Magii i rolę czarodziejów we współczesnym Imperium. Traktowani z niechęcią, nieufnością, a nawet strachem, czarodzieje wielokrotnie dowiedli swojego oddania w walce z Chaosem. Ukazując kulisy działania Kolegiów Magii, dodatek jest nieocenioną pomocą dla tych, którzy zdecydowali się na podążanie ścieżką wiedzy tajemnej, jak też dla tych, którzy swoje życie poświęcili zwalczaniu czarnoksiężników.   \nNa stronach Królestwa Magii znajdziesz między innymi: \nDziesiątki nowych zaklęć dla każdego Wiatru Magii – między innymi wrząca krew i złudzenie śmierci. \n Wyczerpujące informacje na temat Kolegiów Magii, włącznie z ich historią, obszarami działania, ambicjami i najważniejszymi osobistościami!\n Opis magii czarnoksięskiej, włącznie z nowymi profesjami – czarownika i czarnoksiężnika.\n Rozszerzoną listę Przekleństwa Tzeentcha!\n Tajemne piętna doświadczonych Magistrów.\n Nowe zasady dotyczące odprawiania rytuałów, przygotowywania magicznych mikstur i kontrolowania chowańców.\n Nowe magiczne eliksiry – między innymi Mikstura uśmierzania bólu i Przyjaciel opoja.\n Nowe magiczne przedmioty – między innymi Czarna Czaszka Kalifa oraz Pierścień Fauschlagu.\n Magia runiczna – kompletne zasady wykuwania tajemnych znaków, włącznie z tak runami jak runa ognia oraz mistrzowska runa władzy królewskiej.\n Obszerny wykład o magicznych fenomenach i naturze magii.\n Rola magii w Starym Świecie, włącznie z różnymi sposobami jej postrzegania przez osoby wszystkich stanów i środowisk.\n Opis czarodziejów-renegatów, a także nieustępliwych łowców czarownic, którzy przysięgali walczyć z heretykami i czarnoksiężnikami.\n Okrutny koniec – przygoda T.S. Luikarta, rozgrywająca się w czasie averlandzkiego Święta Wina.\n Łatwy łup – opowiadanie Roberta Earla.  \n \n\nKrólestwo Magii to nieoceniony dodatek do Księgi Zasad Warhammera, przydatny zarówno dla graczy jak i Mistrzów Gry','','warhammer-rpg-ii-edycja-krlestwo-magii','','','','Warhammer RPG II Edycja: Królestwo Magii','','','',''),(359,1,1,'\nMiddenheim, miasto ważne dla każdego wyznawcy Ulryka. Jedno z najważniejszych miast imperium, przyjęło na siebie ciężar walk, związany z burza chaosu. Jedno Cień Mrocznych Bóstw nadal okrywa Miasto Białego Wilka. Skaza Chaosu uderzyła w samo serce miasta. Mroczne siły wciąż kryją się w ruinach domostw i w kanałach pod zniszczonymi ulicami. Kłamstwa, zdrada, mord i najgorsza z możliwych skaza duszy to niebezpieczeństwa, z jakimi zetkną się poszukiwacze prawdy. Gdy Bohaterowie przywożą starodawną ikonę do świątyni Sigmara, nawet nie podejrzewają, że wyznawcy Mrocznych Potęg jeszcze się nie poddali.   \n\nPopioły Middenheim to pierwsza część wielkiej trylogii Ścieżki Przeklętych. Oprócz scenariusza przygody w środku znajdziecie dokładny opis Middenheim po Burzy Chaosu, włącznie z mapami wszystkich dzielnic, najważniejszymi miejscami oraz osobistościami, które władają Miastem Białego Wilka.   \n\nJak straszna tajemnica kryje się u źródeł władzy w mieście Ulryka? Cóż może zdziałać niewielka grupka przypadkowych Bohaterów? Sprawdź sam w Popiołach Middenheim!','','popioy-middenheim---wfrp-ii-ed','','','','Popioły Middenheim - WFRP II ed','','','',''),(360,1,1,'Czy jesteś gotowy na życie po śmierci?   \nDaleko od wspaniałych miast Imperium i zamków dzielnych rycerzy Bretonii, nawet poza zwaśnionymi, rządzonymi przez złoto i występek miastami-państwami Tilei, leży kraina, gdzie zwykły najemnik może jednego dnia zostać królem, a następnego zginąć marnie od zdradzieckiego ciosu. To Księstwa Graniczne, Królestwa Renegatów – rządzone przez każdego i przez nikogo. To ziemie ciągłych wojen, morderczych bitew o skrawki jałowych terenów, intryg podsycanych przez ogromne ambicje i nieustającą żądzę władzy. Tak było od stuleci, lecz teraz nowe zagrożenie budzi się z pradawnego snu. To Karitamen Skarabeusz Śmierci, arcylicz i jeden z legendarnych Królów Katakumb. Zamknięty w swym sarkofagu, dzięki czarnoksięskiej mocy nawiedza sny i koszmary książąt z pobliskich zamków, z wolna zmieniając ich w swoich niewolników. Już niedługo Skarabeusz Śmierci ponownie obejmie rządy w należnym mu królestwie.  \n\n„Pokusa arcylicza” to przygoda, która rozgrywa się na niebezpiecznych ziemiach Księstw Granicznych. Oprócz szczegółowego scenariusza dodatek zawiera też: \nOpisy władców okolicznych ziem, włącznie z ich planami, dążeniami oraz niebezpieczeństwami, jakim zmuszeni są stawiać czoła.\nLiczne pomysły i niewielkie scenariusze, możliwe do rozegrania jako osobne przygody albo powiązane w jedną długą kampanię.\nZbiór informacji o starożytnym Imperium Nehekhary, z uwzględnieniem boskiego panteonu tej pradawnej krainy.\nSzczegółowy opis grobowca arcylicza, po brzegi wypełnionego przerażającymi strażnikami oraz zwykłymi i magicznymi pułapkami, które obudzą strach w sercu nawet najdzielniejszego bohatera.\nOpis arcylicza Karitamena, włącznie z jego intrygami i długofalowymi planami, które wykraczają poza ramy tego dodatku.\nStraszliwe klątwy, w tym przerażająca Klątwa Tysiąca Biczów.\nZasady tworzenia, zastawiania i wykrywania pułapek, a także obszerna lista przykładowych, gotowych do wykorzystania zasadzek.\nNowe choroby, między innymi straszliwy Oddech Śmierci.\nNowi, jeszcze bardziej przerażający przeciwnicy: runiczni strażnicy, szkieletowi gwardziści, ushabti oraz straszliwi uwięzieni.','','warhammer-rpg-ii-edycja-pokusa-arcylicza','','','','Warhammer RPG II Edycja: Pokusa Arcylicza','','','',''),(361,1,1,'Nastał mroczny czas w Imperium ludzkości. Najazd Chaosu pozostawił północ w dymiących zgliszczach, ponure ziemie są nękane przez zwierzoludzi, plenią się kulty Chaosu, dokładając starań, by zamienić uczciwych mężów i niewiasty w bełkoczących niewolników ciemności. Potworności te rodzą smutek i strach pośród pospólstwa, truchlejącego w obliczu cieni rzucanych przez odległą północ, szukającego wybawienia u bogów, bohaterów lub kogokolwiek mającego dość odwagi, by odzyskać zniszczone ziemie. I oto nadszedł bohater, lecz ludzie nie spodziewali się, że będzie nim młodzieniec z Jałowej Krainy.   \n\nTysiąc Tronów to kampania przeznaczona do Warhammer Fantasy Roleplay obiecująca poprowadzić poszukiwaczy przygód od cuchnących kanałów Marienburga do zachodnich krańców Kislevu. Gdy chłopiec ze znamieniem na piersi przedstawiającym kometę o dwóch ogonach własnoręcznie zabija dwójkę kultystów, zostaje ogłoszony Sigmarem Odrodzonym. Wspierani przez legion fanatycznych popleczników, Bohaterowie Graczy zostają wciągnięci w niebezpieczną i złowieszczą historię, w którą zamieszane jest starożytne zło, kulty Chaosu, panowie nocy i cała armia innych, śmiertelnie niebezpiecznych wrogów.  \n\nWewnątrz tego podręcznika znajdziesz dziewięć przygód: \nZew Chaosu: Poszukiwacze przygód przemierzą ulice i kanały Marienburga, by poznać ukrytą historię boskiego dziecka. \nCisza przed burzą: Podążając za świeżym śladem młodzieńca, Bohaterowie Graczy zostaną wplątani w dziwne wydarzenia w małym miasteczku na krańcu Imperium. \nKrucjata Dziecka: Atmosfera gęstnieje, gdy w tej straszliwej historii ujawniają się kolejni gracze i konspiratorzy. \nSpisane krwią: Gdy Krucjata dociera do Altdorfu, by negocjować z Wielkim Teogonistą, zagadka wyjaśnia się, gdy dotąd ukryty wróg wykonuje swój ruch, a nowi przeciwnicy robią wszystko, by wykorzystać młodzieńca do swych celów. \nMetamorfoza Villa Hahn: Po ujawnieniu ich głównego wroga, poszukiwacze przygód mierzą się z niebezpieczeństwami Drakwaldu, by uratować zaginionego chłopca nim wróg zrealizuje swój plan. \nZwiastuni Nowego Świtu: Gdy zmęczona Krucjata obozuje pod Wolfenburgiem, wrogowie knują plugawe spiski. \nAż śmierć nas nie rozłączy: Poboczna wyprawa do Sylvanii wyjaśnia wiele z mrocznych wydarzeń dziejących się wokół błogosławionego dziecka. \nCzarna Wiedźma: Poszukiwacze przygód śpieszą się do Kislevu, podążając za młodzieńcem do stoków Szarguńskich Turni. Tam powracają starzy wrogowie oraz pojawia się nowy, jeszcze groźniejszy przeciwnik. \nŁono Czarnej Wiedźmy: Wielkie zakończenie epickiej kampanii, poszukiwacze przygód muszą wkroczyć do serca Chaosu, walczyć i pokonać jej przerażające sługi, jeśli chcą powstrzymać Czarną Wiedźmę przed wypełnieniem jej szalonego planu.  \n\nNiezależnie od tego czy wykorzystasz pojedyncze przygody, czy też rozgrasz całą kampanię, Tysiąc Tronów zapewni miesiące ekscytującej akcji i śledztwa, pełne przekonujących postaci, dziwnych miejsc i zabójczych tajemnic, które zapewne doprowadzą bohaterów na kraniec szaleństwa, a nawet dalej!\n','','warhammer-rpg-ii-edycja-tysic-tronw','','','','Warhammer RPG II Edycja: Tysiąc Tronów','','','',''),(362,1,1,'None','','warhammer-rpg-ii-edycja-spladrowane-krypty','','','','Warhammer RPG II Edycja: Spladrowane Krypty','','','',''),(363,1,1,'Warhammer \n Fantasy Roleplay zabiera Was do Starego Świata. Załóżcie własną drużynę \nśmiałków  lub bandę rzezimieszków i wyruszcie z nimi w podróż. Zmierzycie się w \njej  trakcie z podłością, zepsuciem, intrygami i straszliwymi bestiami \npałającymi  żądzą zniszczenia.','','warhammer-rpg-iv-edycja-podrcznik-podstawowy','','','','Warhammer RPG IV Edycja: Podręcznik podstawowy','','','',''),(364,1,1,'\n','','warhammer-rpg-iv-edycja-zestaw-startowy','','','','Warhammer RPG IV Edycja: Zestaw Startowy','','','',''),(365,1,1,'I w wyznaczonym czasie powstaniemy z naszych miejsc ukrycia. Chaos ogarnie ziemię, a my, wybrani słudzy, zostaniemy wyniesieni w Jego oczach. Niech będzie pozdrowiony Tzeentch, Ten Który Zmienia Drogi. Njawrr’thakh ‘Lzimbarr Tzeentch!    \nWróg w Cieniach przedstawia pierwszą część kampanii Wewnętrzny Wróg, Przed wyruszeniem w drogę, zbierz drużynę, i wyruszcie w przygodę, Poznajcie tajemnice i zdobądźcie informację, które mogą odmienić losy imperium.  \n\nWróg w Cieniach to pierwsza część udoskonalonej i zaktualizowanej Wersji Reżyserskiej Wewnętrznego Wroga. Wróg w Cieniach rozpoczyna pięcioczęściową serię ponurych i niebezpiecznych przygód Warhammera Fantasy. Wersja Reżyserska zawiera wnikliwe komentarze z elementami czarnego humoru, sprytnych sugestii jak poprowadzić kampanię na nowe sposoby oraz obszerny przewodnik po Bögenhafen pełen ekscytujących miejsc do odwiedzenia i zbadania.  \n\nWróg w Cieniach zawiera:  \nPierwsze dwie przygody kampanii Wewnętrzny Wróg: Pomylona Tożsamość i Cienie nad Bögenhafen, obie zostały poprawione i zaktualizowane przez Graeme Davisa, legendarnego autora WFRP i jednego z oryginalnych autorów kampanii.\nSzereg ramek „Dla Grognardów”. Są to „teksty w ramce” na marginesie książki, które dodają zupełnie nowe sposoby na przeżywanie przygód. Nawet ci, którzy grali wcześniej w kampanię Wewnętrzny Wróg, poczują powiew świeżości we Wrogu w Cieniach.\nKompletny Przewodnik po Bögenhafen, jednym z najważniejszych miast w Reiklandzie, pełnym ekscytujących miejsc do zwiedzenia.','','warhammer-rpg-iv-edycja-wrg-wewntrzny---cz-1--wrg-w-cieniach','','','','Warhammer RPG IV Edycja: Wróg Wewnętrzny - Cz. 1 – Wróg w cieniach','','','',''),(366,1,1,' I w wyznaczonym czasie powstaniemy z naszych miejsc ukrycia. Chaos ogarnie ziemię, a my, wybrani słudzy, zostaniemy wyniesieni w Jego oczach. Niech będzie pozdrowiony Tzeentch, Ten Który Zmienia Drogi. Njawrr’thakh ‘Lzimbarr Tzeentch!    Niezbędnik Wroga w Cieniach to przewodnik do pierwszej części kampanii Wewnętrzny Wróg. Wypełniony jest dodatkowymi zasadami, opcjonalnymi Bohaterami Niezależnymi, ciekawymi pomysłami na przygody i poradami zarówno dla nowych jak i doświadczonych MG. Dodatek ten,, wzbogaci wasze doświadczenia podczas Wroga w Cieniach czy każdej innej przygody WFRP. Zawiera on również nowe zasady, Profesję Wywyższonego Kultu Tzeentcha, trzy klasyczne spotkania, oraz Sprawę Zaginionego Klejnotu, dramatyczną opowieść pełną heroizmu i intryg. Niezbędnik Wroga w Cieniach to idealny dodatek dla każdej grupy grającej w Wewnętrznego Wroga czy dowolną inną kampanię w Imperium. Niezbędnik Wroga w Cieniach zawiera:','','warhammer-rpg-iv-edycja-wrg-wewntrzny---cz-1---wrg-w-cieniach-niezbdnik','','','','Warhammer RPG IV Edycja: Wróg Wewnętrzny - Część 1 - Wróg w cieniach: Niezbędnik','','','',''),(367,1,1,' I w wyznaczonym czasie powstaniemy z naszych miejsc ukrycia. Chaos ogarnie ziemię, a my, wybrani słudzy, zostaniemy wyniesieni w Jego oczach. Niech będzie pozdrowiony Tzeentch, Ten Który Zmienia Drogi. Njawrr’thakh ‘Lzimbarr Tzeentch!    \n\nWróg w Cieniach przedstawia pierwszą część kampanii Wewnętrzny Wróg, Przed wyruszeniem w drogę, zbierz drużynę, i wyruszcie w przygodę, Poznajcie tajemnice i zdobądźcie informację, które mogą odmienić losy imperium.   \n\nWróg w Cieniach to pierwsza część udoskonalonej i zaktualizowanej Wersji Reżyserskiej Wewnętrznego Wroga. Wróg w Cieniach rozpoczyna pięcioczęściową serię ponurych i niebezpiecznych przygód Warhammera Fantasy. Wersja Reżyserska zawiera wnikliwe komentarze z elementami czarnego humoru, sprytnych sugestii jak poprowadzić kampanię na nowe sposoby oraz obszerny przewodnik po Bögenhafen pełen ekscytujących miejsc do odwiedzenia i zbadania.   \n\nWróg w Cieniach zawiera:  \n Pierwsze dwie przygody kampanii Wewnętrzny Wróg: Pomylona Tożsamość i Cienie nad Bögenhafen, obie zostały poprawione i zaktualizowane przez Graeme Davisa, legendarnego autora WFRP i jednego z oryginalnych autorów kampanii.\nSzereg ramek „Dla Grognardów”. Są to „teksty w ramce” na marginesie książki, które dodają zupełnie nowe sposoby na przeżywanie przygód. Nawet ci, którzy grali wcześniej w kampanię Wewnętrzny Wróg, poczują powiew świeżości we Wrogu w Cieniach.\nKompletny Przewodnik po Bögenhafen, jednym z najważniejszych miast w Reiklandzie, pełnym ekscytujących miejsc do zwiedzenia.\n','','warhammer-rpg-iv-edycja-wrg-wewntrzny---cz-1---edycja-kolekcjonerska','','','','Warhammer RPG IV Edycja: Wróg Wewnętrzny - Cz. 1 - Edycja Kolekcjonerska','','','',''),(368,1,1,'\n\n\n\nEkran \nMistrza Gry WFRP to niezbędny element arsenału każdego MG. Nieważne, jak długo \ngracie w Warhammera i co w nim najbardziej lubicie, znajdziecie tu multum \nprzydatnych materiałów, narzędzi i zasad.\n','','warhammer-rpg-iv-edycja-ekran-mistrza-gry','','','','Warhammer RPG IV Edycja: Ekran Mistrza Gry','','','',''),(369,1,1,' Pozwólcie przybliżyć sobie dzieje śmiertelnie niebezpiecznego sporu między grafinią Marią Ulryką von Liebwitz-Ambosstein i baronem Eberhardtem von Dammenblatzem. To porywająca historia pełna nieoczekiwanych zwrotów akcji. Usłyszycie w niej o złych czarownicach, zatrważających demonach i nieuchwytnych zabójcach, a krew poleje się wartkim strumieniem! Największą atrakcją tej opowieści jest wizyta w operze w u boku Księżnej-Elektorki Nuln. Wystawiany spektakl wyszedł spod pióra Detlefa Siercka, najwybitniejszego aktora w historii Imperium! Zaprawdę, to historia warta opowiedzenia. Siądźcie więc wygodnie i zaczynamy!    \nCiężkie Dnie i Niespokojne Noce to pięć przygód autorstwa doskonale znanego weterana Warhammer Fantasy Roleplay, Graeme’a Davisa. Te ekscytujące scenariusze można rozegrać samodzielnie lub połączyć je w kampanię składającą się z pięciu aktów. Bohaterowie Graczy uwikłają się w spór między dwoma skłóconymi arystokratycznymi rodami, które ścierać się będą w przeróżnych miejscach rozsianych po Reiklandzie.    \nCiężkie Dnie i Niespokojne Noce oddają w Wasze ręce nową grywalną rasę, gnomy. Ponadto znajdziecie tu opisy szeregu karczemnych gier i zabaw, które pozwolą poszukiwaczom przygód rozluźnić się po ponurych i niebezpiecznych przygodach.\n\n','','warhammer-rpg-iv-edycja-cikie-dnie-i-niespokojne-noce','','','','Warhammer RPG IV Edycja: Ciężkie dnie i Niespokojne noce','','','',''),(370,1,1,' Witajcie w Księstwie Ubersreiku! Czas odmierzany jest tu stukotem ciężkich żołnierskich butów Armii Prowincji. Za zamkniętymi wrotami dokonywane są trudne wybory, które ukazują prawdziwe znaczenie słowa lojalność. To czas zmian i wielkich możliwości zarówno dla bogaczy, jak i biedaków.    \n\nPrzygody w Ubersreiku to zestaw sześciu scenariuszy do Warhammer Fantasy Roleplay rozgrywających się w Księstwie Ubersreiku. \nWewnątrz tej książki znajdziecie wybór porad, trików i dodatkowych zagrożeń, które będą pomocne w powiązaniu scenariuszy ze sobą. Ponadto otrzymacie wskazówki, jak dostosować je do Bohaterów Graczy, którzy mają już pewien bagaż doświadczeń – jeśli zdecydujecie się z nich skorzystać, przygody będą nie tylko ponure i niebezpieczne, ale też prawdziwie zabójcze!  \n Przygody w Ubersreiku to:  \n Gdyby wzrok mógł zabijać: Legenda głosi, że Bestia z Ortschalamm nawiedza bagna nieopodal Ubersreiku. Tylko nieliczni dają temu wiarę… \nSzaleńcy z Gotheim: Po wsi Gotheim nie pozostało nic prócz ruin. Na domiar złego wszystko wskazuje na to, że jej mieszkańcy powariowali z niewyjaśnionych przyczyn.\nSerce ze szkła: Bohaterowie Graczy zostają wynajęci przez arystokratkę, by odkryli prawdę stojącą za tajemniczym zabójstwem. W trakcie śledztwa natkną się perfidnych kultystów i niestrudzoną łowczynię czarownic, a to jeszcze nie wszystko.\nJatka w Spittlefeld: W slumsach Ubersreiku zakorzeniła się zjadliwa zaraza. Czy zdołacie ją powstrzymać?\nPrzynęta i zaklęcie: Cordelia Wessenlingh potrzebuje, by ktoś odwrócił od niej uwagę. Na jej szczęście idealni ochotnicy do wykonania tego zadania właśnie przekroczyli próg jej apteki.\nWinna strona: Ktoś sabotuje dyliżanse wyprawiające się do Ubersreiku. Na trop wpadł miejscowy śledczy.\n','','warhammer-rpg-iv-edycja-przygody-w-ubersreiku','','','','Warhammer RPG IV Edycja: Przygody w Ubersreiku','','','',''),(371,1,1,' I w wyznaczonym czasie wyjdziemy z lasów, by mordować i palić. Nasi bracia wyjdą ze swych miejsc ukrycia i wyburzą miasta Imperium. Chaos okryje ziemię, a my, uniżeni słudzy, zostaniemy wyniesieni w Jego oczach. Niech będzie pochwalony Tzeentch, Ten Który Zmienia Drogi! Njawrr’thakh ‘Lzimbarr Tzeentch!    \n\nŚmierć na Rzece Reik jest drugim tomem unowocześnionej i zaktualizowanej wersji reżyserskiej Wewnętrznego Wroga, jednej z najwyżej ocenianych kampanii RPG, które kiedykolwiek powstały. Akcja Śmierci na Rzece Reik rozpoczyna się w momencie, w którym zakończył się Wróg w Cieniach, i zabiera bohaterów na niesamowitą przygodę w górę i w dół niezwykłego Reiku, największej rzeki w Starym Świecie i głównego szlaku handlowego Imperium.','','warhammer-rpg-iv-edycja-wrg-wewntrzny---cz-2---mier-na-rzece-reik','','','','Warhammer RPG IV Edycja: Wróg Wewnętrzny - Cz. 2 - Śmierć na rzece Reik','','','',''),(372,1,1,'\nŚmierć na Rzece Reik jest drugim tomem unowocześnionej i zaktualizowanej wersji reżyserskiej Wewnętrznego Wroga, jednej z najwyżej ocenianych kampanii RPG, które kiedykolwiek powstały. Akcja Śmierci na Rzece Reik rozpoczyna się w momencie, w którym zakończył się Wróg w Cieniach, i zabiera bohaterów na niesamowitą przygodę w górę i w dół niezwykłego Reiku, największej rzeki w Starym Świecie i głównego szlaku handlowego Imperium.  \nNiezbędnik Śmierci na Rzece Reik zawiera:  \nZioła i ich zastosowanie – bogaty opis ziół występujących na terenach Imperium  wraz z przepisami na kataplazmy, mikstury i napary przygotowywane z ich wykorzystaniem. \nRzeki Imperium – opis najważniejszych rzek przepływających przez Reikland oraz przykładowe spotkania na rzece do wykorzystania podczas przygody. \nDodatkowe zasady obsługi łodzi – nowe zasady wykorzystujące warunki pogodowe, szczegółowe obrażenia łodzi i rzeczne niebezpieczeństwa. \nBohaterowie Niezależni – przykładowe postacie, które można spotkać w czasie rejsów po rzekach Reiklandu. \nStworzenia rzeczne – bestiariusz Stworzeń, które mogą zagrozić rejsowi bohaterów graczy. \nImperator Luitpold – opis luksusowego liniowca rzecznego oraz tajemnic kryjących się w jego obszernych ładowniach i kajutach. \nNowa Profesja – Wojownik Tzeentcha oraz nowe zaklęcia z Tradycji Tzeentcha.  \nWewnętrzny Wróg to kultowa kampania, w którą każdy gracz powinien zagrać przynajmniej raz w życiu, co sprawia, że ​​Śmierć na Rzece Reik jest obowiązkową pozycją dla wszystkich fanów RPG.','','warhammer-rpg-iv-edycja-wrg-wewntrzny---cz-2---mier-na-rzece-reik-niezbdnik','','','','Warhammer RPG IV Edycja: Wróg Wewnętrzny - Cz. 2 - Śmierć na rzece Reik: Niezbędnik','','','',''),(373,1,1,'Wewnętrzny \nWróg to kultowa kampania, w którą każdy gracz powinien zagrać \nprzynajmniej raz w życiu, co sprawia, że ​​Szara \nEminencja jest obowiązkową pozycją dla wszystkich fanów RPG.','','warhammer-rpg-iv-edycja-wrg-wewntrzny---cz-3---szara-eminencja-niezbdnik','','','','Warhammer RPG IV Edycja: Wróg Wewnętrzny - Cz. 3 - Szara Eminencja: Niezbędnik','','','',''),(374,1,1,'Szara \nEminencja to trzecia z pięciu części ponurych i \nniebezpiecznych przygód Warhammera Fantasy, będących inspiracją dla pokolenia \ngraczy. Wersję reżyserską opatrzono wnikliwym komentarzem z elementami czarnego \nhumoru, sprytnych sugestii, jak poprowadzić kampanię na zupełnie nowe sposoby, \noraz uzupełniono wachlarzem mentorów, którzy przygotują twoich graczy na \nnadchodzące niebezpieczeństwa.','','warhammer-rpg-iv-edycja-wrg-wewntrzny---cz-3---szara-eminencja---edycja-kolekcjonerska','','','','Warhammer RPG IV Edycja: Wróg Wewnętrzny - Cz. 3 - Szara Eminencja - Edycja Kolekcjonerska','','','',''),(375,1,1,'Z Middenheim - Miastem \nBiałego Wilka opuścicie znajome trakty Wielkiej \nProwincji Reiklandu i znajdziecie się w centrum ulrykańskiej wiary i jej wpływów \nw Starym Świecie. Middenheim to bijące serce północnej części Imperium i \ndoskonałe tło dla niekończących się ponurych i niebezpiecznych przygód! Każda \ndzielnica tej metropolii została tu dokładnie opisana, wraz z jej \ncharakterystycznymi punktami, pomysłami na przygody i BN-ami, których nie da się \nzliczyć! Piękna mapa w wersji dla MG oraz Graczy przedstawia miasto w całej jego \nokazałości.','','warhammer-rpg-iv-edycja-middenheim-miasto-biaego-wilka','','','','Warhammer RPG IV Edycja: Middenheim: Miasto Białego Wilka','','','',''),(376,1,1,'Altdorf to stolica Imperium, miejsce narodzin Sigmara Młotodzierżcy. Jest to najbardziej zaludnione miasto w Starym Świecie i miejsce, w którym znajduje się kilka słynnych i majestatycznych zabytków. W tętniących życiem dzielnicach Wschodniego Krańca i w gwarnych Dokach na północy strach przed gangami i rewolucyjny zapał mają większy wpływ na codzienne życie niż słowa kapłanów Sigmara czy prawa Imperatora.','','warhammer-rpg-iv-edycja-altdorf---korona-imperium','','','','Warhammer RPG IV Edycja: Altdorf - Korona Imperium','','','',''),(377,1,1,'Śmierć na Rzece Reik to druga z pięciu części ponurych i niebezpiecznych przygód Warhammera Fantasy, będących inspiracją dla pokolenia graczy. Wersję reżyserską opatrzono wnikliwym komentarzem z elementami czarnego humoru, sprytnych sugestii, jak poprowadzić kampanię na zupełnie nowe sposoby, oraz uzupełniono wachlarzem mentorów, którzy przygotują twoich graczy na nadchodzące niebezpieczeństwa.','','warhammer-rpg-iv-edycja-wrg-wewntrzny---cz2---mier-na-rzece-reik---edycja-kolekcjonerska','','','','Warhammer RPG IV Edycja: Wróg Wewnętrzny - Cz.2 - Śmierć na Rzece Reik - Edycja Kolekcjonerska','','','',''),(378,1,1,'Imperator nie żyje, a jego następcą nie został wyznaczony. Podczas zjazdu Książąt-Elektorów zawiodła dyplomacja, trąby wojenne wybrzmiewają głośno i wyraźnie, a konflikt zbrojny jest nieunikniony!','','warhammer-fantasy-roleplay-ksita---elektorzy','','','','Warhammer Fantasy Roleplay: Książęta - Elektorzy','','','',''),(379,1,1,'Przygody w Ubersreiku II zawierają pięć zupełnie nowych przygód, wraz z informacjami rozszerzającymi wydarzenia w mieście Ubersreik, miejscu wprowadzonym w Zestawie Startowym Warhammer Fantasy Roleplay (4. Edycja), odzwierciedlającymi rozwój wydarzeń, których Twoje postacie mogły doświadczyć (lub spowodować!) podczas kampanii Wewnętrzny Wróg. Zawiera również przewodnik po Księstwie Czarnej Skały, domu niegdyś potężnych Jungfreudów, których Imperator bezlitośnie pozbawił szlachetnego prawa do władania Ubersreikiem. Dowiedz się więcej o tym rodzie, jego sojusznikach, wrogach, planach i intrygach, gotowych do zgłębienia przez Graczy.','','warhammer-fantasy-roleplay-4-edycja-przygody-w-ubersreiku-ii','','','','Warhammer Fantasy Roleplay (4. Edycja): Przygody w Ubersreiku II','','','',''),(380,1,1,'Burza \nSigmara rozbiła hordy Chaosu, stając się iskrą, która ponownie rozpaliła \nnadzieję w ludach zamieszkujących Krainy Śmiertelnych. Położone w ten sposób \npodwaliny cywilizacji umożliwiły powstanie bastionów sił Ładu i przez krótki \nczas wydawało się, że niekończący się napływ ciemności może zostać powstrzymany. \nWtedy jednak nadszedł Nekrowstrząs, a nieumarłe legiony Nagasha powstały, by \nstrzaskać Miasta Sigmara. Nadzieja przygasa i Krainom Śmiertelnych ponownie \ngrozi pochłonięcie przez ciemność…','','soulbound---edycja-kolekcjonerska','','','','Soulbound - Edycja Kolekcjonerska','','','',''),(381,1,1,'\n\n\n\nVenture \ninto the deadly mist-shrouded streets of Anvilgard in the first ever campaign \nfor Warhammer Age of Sigmar: Soulbound. Shadows in the Mist is a sprawling \nsix-part campaign set within the free city of Anvilgard and sees a group of \nSoulbound heroes tasked with rooting out cmrnption in the city and exposing the \nmysterious Blackscale Coil – an organisation made up of members of the Dark.ling \nCovens, Scourge Privateers, and other Aelven outcasts.The \nCoil has used coercion, bribery, and violence to gain a stranglehold on the \ncity. Even the Grand Conclave that is supposed to govern Anvilgard seems to have \nbeen infiltrated by the Coil, making it impossible to know who to trust. But an \neven greater rot is growing in the heart of Anvilgard, one that could consume \nthe city entirely if it is not stopped in time.\n','','age-of-sigmar-soulbound-shadows-the-mist---en','','','','Age of Sigmar: Soulbound Shadows The Mist - EN','','','',''),(382,1,1,'The Mortal Realms are besieged. Packs of savage beasts stalk the wilderness. Parades of disquiet dead stirred by baleful magics haunt the nights, enacting terrible vengeance upon the living. Hordes of Orruks, Grots, and Gargants rampage unchecked, driven by little more than destruction and despoilment for their own amusement. And the innumerable servants of the Ruinous Powers that once brought about the end of the world take root wherever mortals tread. The realms are rocked by never-ending conflict and nowhere is truly safe…  \nThe Mortal Realms are filled with countless strange creatures and monstrous beasts. The Warhammer Age of Sigmar Soulbound Bestiary provides a vast collection of these great and terrible foes to use in your Warhammer Age of Sigmar: Soulbound adventures, and gives GMs advice on how best to build exciting encounters with these monstrous and maniacal foes.\n\nAdditional information  \n- Hardcover textbook,   \n- 192 pages  \nWeight:700g\n','','soulbound---bestiary-eng','','','','Soulbound - Bestiary ENG','','','',''),(383,1,1,'Warhammer Age of Sigmar Soulbound: Artefacts of Power is perfect for those who want to fill their Soulbound games with incredible magical items, adventures about fate-defining artefacts, and terrifying arcane manifestations unlike anything seen before.','','age-of-sigmar-artefacts-of-power---en','','','','Age of Sigmar: Artefacts Of Power - EN','','','',''),(384,1,1,'Embrace the Waaagh! and become a Champion of Destruction!\n\nChampions of Destruction allows players to create the most brutally cunning — or cunningly brutal — characters for Warhammer Age of Sigmar: Soulbound! Become Da Boss, set out across the Mortal Realms in search of a good scrap, and face down the biggest, baddest, creatures in all of the realms! The book features new Destruction aligned Species, new Archetypes, new Talents, tooth splittingly destructive new spells, Miracles and more.','','soulbound---champions-of-destruction-eng','','','','Soulbound - Champions Of Destruction ENG','','','',''),(385,1,1,'Ekran Mistrza Gry do Warhammer Age of Sigmar: Soulbound jest niezbędnym elementem arsenału każdego MG! Niezależnie od stylu gry i poziomu doświadczenia Ekran MG zawiera wiele przydatnych informacji.','','warhammer-age-of-sigmar---soulbound--ekran-mistrza-gry','','','','Warhammer: Age of Sigmar - Soulbound – Ekran Mistrza Gry','','','',''),(386,1,1,'Dodatek Czempioni Ładu zapewnia graczom wiele nowych możliwości podczas tworzenia postaci do Warhammer Age of Sigmar Roleplay: Soulbound. Zawiera nowe Archetypy, Talenty oraz nowe niszczycielskie zaklęcia. Dodatek, który trzymasz w rękach, jest pełen treści i opcji pozwalających ci na niezwykłe urozmaicenie waszych sesji Soulbound.','','warhammer-age-of-sigmar-soulbound---czempioni-adu','','','','Warhammer Age of Sigmar: Soulbound - Czempioni Ładu','','','',''),(387,1,1,'Pozwól się wciągnąć w niepokojący świat mitów H.P. Lovecrafta, zbierz drużynę \n Badaczy Tajemnic i opowiedz im przerażającą historię.','','ksiga-stranika---zew-cthulhu','','','','Księga Strażnika - Zew Cthulhu','','','',''),(388,1,1,'Zasobnik Strażnika jest świetną pomocą podczas gry w 7. edycję Zewu \nCthulhu!','','zasobnik-stranika---zew-cthulhu','','','','Zasobnik Strażnika - Zew Cthulhu','','','',''),(389,1,1,'','','podrcznik-badacza---zew-cthulhu','','','','Podręcznik badacza - Zew Cthulhu','','','',''),(390,1,1,'\n\n\n\nZestaw Startowy zawiera wszystko, czego potrzebujesz, aby rozpocząć \nprzygodę z Zew Cthulhu RPG – fabularną grą pełną zagadek i horroru! Jeden z \ngraczy wciela się w Strażnika Tajemnic, narratora prowadzącego grę, który \nprzedstawia pozostałym uczestnikom zabawy historię i fabułę przygody oraz \nodgrywa spotykane przez nich postacie. Pozostali gracze wcielają się w Badaczy \nTajemnic, odkrywających mroczne tajemnice, spotykających przerażające potwory i \nudaremniających plany złowrogich sekt bohaterów z przypadku.\n','','zew-cthulhu-7ed-zestaw-startowy','','','','Zew Cthulhu 7ed. Zestaw Startowy','','','',''),(391,1,1,'Pięć scenariuszy dla  \npoczątkujących Strażników Tajemnic','','zew-cthulhu-7ed-wrota-ciemnoci','','','','Zew Cthulhu 7ed. Wrota Ciemności','','','',''),(392,1,1,'Brawurowa \nwalka z koszmarami mitów! Wzywamy wszystkich Bohaterów! Nadszedł czas, aby \nstawić czoła Cthulhu!','','zew-cthulhu-7ed-pulp-cthulhu','','','','Zew Cthulhu 7ed. Pulp Cthulhu','','','',''),(393,1,1,'Czy \nprzeciwstawisz się grozie kryjącej się w mrokach nocy?','','podrcznik-badaczki---zew-cthulhu-7ed','','','','Podręcznik badaczki - Zew Cthulhu 7ed.','','','',''),(394,1,1,'Udaj się do Egiptu, aby \nuczestniczyć w polskiej wyprawie archeologicznej!','','dwie-z-tysica---zew-cthulhu','','','','Dwie z Tysiąca - Zew Cthulhu','','','',''),(395,1,1,'Zbiór scenariuszy 1 na 1 \ndo Zewu \nCthulhu','','zew-cthulhu-7ed-twarz-w-twarz','','','','Zew Cthulhu 7ed. Twarzą w twarz','','','',''),(396,1,1,'Pięć scenariuszy do Zewu \nCthulhu','','zew-cthulhu-7ed-posiadoci-szalestwa-tom-i','','','','Zew Cthulhu 7ed. Posiadłości Szaleństwa TOM I','','','',''),(397,1,1,'Na \nkartach tej księgi zebrane zostały zaklęcia z podręczników do Zewu Cthulhu \nwydanych w ciągu ponad trzydziestu lat. Wszystkie zostały dostosowane do wymogów \n7. edycji Zewu Cthulhu, a wiele zostało również uzupełnionych o elementy \ngłębszej magii, z której korzystają tylko najpotężniejsi czarownicy i stwory \nmitów Cthulhu. Wszystko po to, aby mamić i zaskakiwać Badaczy.','','zew-cthulhu-7ed-wielki-grymuar-magii','','','','Zew Cthulhu 7ed. Wielki Grymuar Magii','','','',''),(398,1,1,'W \nnikczemnej atmosferze światowej stolicy grzechu, kwestionowana jest sama natura \nczłowieczeństwa.W \nnastępstwie Wielkiej Wojny Berlin zyskał reputację europejskiej stolicy \nrozwiązłości – miejsca, gdzie za odpowiednią cenę można dostać wszystko. Jest to \nzarówno miasto hedonizmu, jak i biznesu. Jego ulice są pełne niepełnosprawnych \nweteranów, prostytutek, biednych imigrantów i agitatorów politycznych. Rynsztoki \nspływają krwią ofiar zabójstw politycznych – efektów starć komunistów i \nnacjonalistów völkisch, a także policji.','','zew-cthulhu-7ed-berlin-miasto-grzechu','','','','Zew Cthulhu 7ed. Berlin, Miasto Grzechu','','','',''),(399,1,1,'Poznaj \nświat, w którym H.P. Lovecraft nigdy nie stał się sławny… ale Przedwieczni i ich \nkulty istnieją naprawdę!Ostrzeżenia zawarte \nna kartach prozy samotnika z Providence nie rozświetliły mroków skrywających \nWielkich Przedwiecznych. Ich kulty, działając pod przykrywką legalnych \norganizacji religijnych, zrzeszają możnych tego świata, by za ich pieniądze \nrealizować swe złowieszcze plany.','','widmo-nad-arkham','','','','Widmo nad Arkham','','','',''),(400,1,1,'Samotnie przeciwko \n mrozowi to klimatyczna, jednoosobowa przygoda w przerażającym świecie mitów \n Cthulhu. Akcja gry przeniesie cię w lata 20. XX wieku; wraz z ekspedycją  \nbadawczą udasz się na mroźne, niegościnne Północno-Zachodnie Terytoria Kanady. W \n tej opowieści wybierasz swoją własną drogę – od twoich wyborów zależy, czy \n osiągniesz sukces, czy też poniesiesz porażkę!','','zew-cthulhu-7ed-samotnie-przeciwko-mrozowi','','','','Zew Cthulhu 7ed. Samotnie przeciwko mrozowi','','','',''),(401,1,1,'\nNie umarło, co wiecznie może trwać uśpione,\nZ biegiem dziwnych eonów i śmierć może skona.\n\nKawalkada potworów i boskich, obcych inteligencji, wykraczających poza ludzkie pojmowanie. Ponad 250 wpisów, które zainspirują niezliczoną ilość przygód! \n\nTa dwuczęściowa kolekcja pełna jest pomysłów, koncepcji i spostrzeżeń, które pozwolą Ci zbadać dogłębnie mity Cthulhu podczas scenariuszy i kampanii.\n\nPolska edycja jest bogatsza o blisko 20 nowych ilustracji!\n\nTom I: Potwory z mitologii Cthulhu – Ponad 150 wpisów dotyczących potworów z mitów Cthulhu, obcych gatunków, a także stworzeń z folkloru i zwierzęcych bestii. Ten tom dostarcza bogactwa pomysłów, które pozwolą Ci tchnąć życie w kampanie i scenariusze pełne niewypowiedzianych okropności. \n\nTom II: Bogowie mitologii Cthulhu – Ten tom zawiera podstawowe prawdy o kosmosie, które można wykorzystać w niezliczonych przygodach, wprowadzając Cthulhu, Hastura, Azathotha i wielu innych do swoich gier. Obejmuje ponad 110 wpisów dotyczących Wielkich Przedwiecznych, Bogów Zewnętrznych, Starszych Bogów, awatarów i unikatowych istot.\n\nChociaż ludzkość może pragnąć zarówno wygody, jak i prawdy, możliwe jest tylko jedno albo drugie.\n\nInformacje dodatkowe:\nWiększość ilustracji przygotował Loïc Muzy, ale pojawi się także blisko 20 ilustracji polskich autorów: Martyna Starczewska, Roch Urbaniak, Udnua.\nOkładka autorstwa - Loïc Muzy\nFormat podręczników - A4 \nTom I: 208 stron, Tom II: 256 stron\nWydruk: kolor\nOkładka: twarda','','zew-cthulhu-7ed-malleus-monstrorum','','','','Zew Cthulhu 7ed. Malleus Monstrorum','','','',''),(402,1,1,'\"Na tropie Cthulhu\" - podręcznik główny - opis \n wydawcy:','','na-tropie-cthulhu','','','','Na tropie Cthulhu','','','',''),(403,1,1,'Tajemnicze morderstwa, niewyjaśnione zaginięcia i niewypowiedziana groza… \nScenariusze z tego podręcznika wrzucą Waszych Badaczy w wir wydarzeń, z których \ntylko nieliczni wyjdą o własnych siłach. Tajemnica złotego pociągu, działalność \ntajnych służb w czasach PRL-u, dramatyczne wydarzenia podczas wielkiej imprezy \nplenerowej pod Częstochową, sekret, którego strzegą mieszkańcy Zakopanego – to \ntylko niektóre z rzeczy, jakie na nich czekają.','','horror-w-tatrach---zew-cthulhu','','','','Horror w Tatrach - Zew Cthulhu','','','',''),(404,1,1,'','','zew-cthulhu-7ed-samotnie-przeciwko-ciemnoci','','','','Zew Cthulhu 7ed. Samotnie przeciwko ciemności','','','',''),(405,1,1,'None','','starter-maski-nyarlathotepa','','','','Starter Maski Nyarlathotepa','','','',''),(406,1,1,'Miasto, gdzie spotykają się \ndwa światy!Poznajcie Warszawę lat \n20. XX wieku – miasto bawiące się w cieniu nadchodzącej tragedii. Jeszcze piękne \ni żywe, ale już skazane na zagładę. Przenieście się w czasie do 1926 roku i \nprzejdźcie ulicami stolicy młodego kraju. Gdy w tle rozgrywają się wielkie \nhistoryczne wydarzenia, Badacze odkrywają mroczne, zacienione zakamarki \nWarszawy, gdzie czają się złowrogie kulty, rozciągając wokół swoje macki. Nikt \nnie wie, jak daleko nimi sięgają…','','zew-cthulhu-7ed-warszawa-stracone-miasto','','','','Zew Cthulhu 7ed. Warszawa, Stracone Miasto','','','',''),(407,1,1,'\n\n\n\n\n','','koci-rpg-pathfinder-age-of-ashes','','','','Kości RPG Pathfinder Age of Ashes','','','',''),(408,1,1,'\n\n\n\n\n','','koci-rpg-pathfinder-extinction-curse-entertainer','','','','Kości RPG Pathfinder Extinction Curse Entertainer','','','',''),(409,1,1,'\n\n\n\n\n','','koci-rpg-pathfinder-extinction-curse-performer','','','','Kości RPG Pathfinder Extinction Curse Performer','','','',''),(410,1,1,'\n\n\n\n\n','','koci-rpg-pathfinder-agents-of-edgewatch','','','','Kości RPG Pathfinder Agents of Edgewatch','','','',''),(411,1,1,'\n\n\n\n\n','','koci-rpg-pathfinder-playtest','','','','Kości RPG Pathfinder Playtest','','','',''),(412,1,1,'None','','koci-rpg-zew-cthulhu-7-edycja-biao-niebieskie','','','','Kości RPG Zew Cthulhu 7. Edycja Biało-Niebieskie','','','',''),(413,1,1,'None','','koci-rpg-zew-cthulhu-7-edycja-czarne-magenta','','','','Kości RPG Zew Cthulhu 7. Edycja Czarne-Magenta','','','',''),(414,1,1,'Jedną \nze stron tej welurowej sakiewki zdobi kunsztowny glif elfickich druidów \nprzedstawiający  drzewo wpisane w okrąg. Czyni to sakiewkę idealną do \nprzechowywania składników czarów, alchemicznych ingrediencji, ziół lub \nszczęśliwych kości.','','sakiewka-welurowa---lena---czarno-zielona','','','','Sakiewka welurowa - leśna - czarno-zielona','','','',''),(415,1,1,'None','','koci-rpg-celtyckie-3d-czerwono-czarne','','','','Kości RPG Celtyckie 3D Czerwono-czarne','','','',''),(416,1,1,'None','','koci-rpg-klasyczne-biao-czarne','','','','Kości RPG Klasyczne Biało-czarne','','','',''),(417,1,1,'\n\n\n\n\n','','koci-rpg-klasyczne-perowo-czerwone','','','','Kości RPG Klasyczne Perłowo-czerwone','','','',''),(418,1,1,'\n\n\n\n\n','','koci-rpg-krasnoludzkie-czerwono-czarne','','','','Kości RPG Krasnoludzkie Czerwono-czarne','','','',''),(419,1,1,' ','','koci-rpg-pathfinder-rise-of-runelords','','','','Kości RPG Pathfinder Rise of Runelords','','','',''),(420,1,1,'\n\n\n\n\n','','koci-rpg-pathfinder-jade-regent','','','','Kości RPG Pathfinder Jade Regent','','','',''),(421,1,1,'None','','koci-rpg-pathfinder-council-of-thieves','','','','Kości RPG Pathfinder Council of Thieves','','','',''),(422,1,1,'None','','koci-rpg-runiczne-biao-czarne','','','','Kości RPG Runiczne Biało-czarne','','','',''),(423,1,1,'None','','koci-rpg-runiczne-czarno-biae','','','','Kości RPG Runiczne Czarno-białe','','','',''),(424,1,1,'None','','koci-rpg-klasyczne-oliwkowo-biae','','','','Kości RPG Klasyczne Oliwkowo-białe','','','',''),(425,1,1,' ','','koci-rpg-klasyczne-karmelowo-te','','','','Kości RPG Klasyczne Karmelowo-żółte','','','',''),(426,1,1,'\n\n\n\n\n','','koci-rpg-klasyczne-popielato-biae','','','','Kości RPG Klasyczne Popielato-białe','','','',''),(427,1,1,'Wciel się w postać poszukiwacza przygód, który \nwyrusza na niebezpieczną wyprawę do samego serca Ognistej Góry. Po drodze \nbędziesz musiał podjąć szereg decyzji, od których będzie zależał Twój los. \nWędruj przez labirynt korytarzy, walcz o życie i dokonuj właściwych wyborów. To \nTy jesteś bohaterem tej opowieści!','','fighting-fantasy-czarnoksinik-z-ognistej-gry','','','','Fighting Fantasy: Czarnoksiężnik z Ognistej Góry','','','',''),(428,1,1,' Wojownik autostrady. Tom 1. Piekło na autostradzie  \n\nKultowa powieść paragrafowa.  \n\nGrupka ocaleńców wojny atomowej podprzywództwem Cala Phoenixa przedziera się ze zrujnowanego Teksasu do relatywnie bezpiecznej Kalifornii. Wszelkie decyzje co do ich losów należą do czytelnika.  \nOtrząśnij z kurtki pustynny kurz, uzupełnij magazynek i zatankuj do pełna swojego roadstera. Gotowy na ostrą jazdę bez trzymanki? „Wojownik autostrady” zaciera granicę między książką, a grą, wrzucając czytelnika w sam środek postapokaliptycznych wertepów Ameryki. Must have dla fanów „Mad Maxa” i „Fallouta”.  \nTytuł oryginalny: Freeway Warrior. Highway Holocaust \nTłumacz: Wojtek Cajgner \nStron: 354 \nFormat: 135x210 \nWydanie: I (w tej edycji) \nOprawa: twarda, foliowana \nGatunek: lit. młodzieżowa/fantastyka\n','','wojownik-autostrady---tom-1','','','','Wojownik autostrady - Tom 1','','','',''),(429,1,1,'Nikt do końca nie wierzył w jego istnienie. \nMarynarze nie chcieli nawet wymawiać tej nazwy. Legendarny dziennik pokładowy z \nwyprawy morskiej z 1907 roku owiany był tajemnicą… aż do dziś.','','dziennik-wyprawa-1907','','','','Dziennik: Wyprawa 1907','','','',''),(430,1,1,'List \nwysłany z prestiżowego Uniwersytetu Miskatonic zaprasza cię do poprowadzenia \nlegendarnej ekspedycji w odległe i niebezpieczne rejony Antarktyki. To twoja \nszansa, aby zdobyć sławę i prestiż, ale coś złowrogiego nawiedza ekspedycje \nPadoble. Jakie przerażające sekrety są ukryte na odludnych, arktycznych rejonach \nświata? Co znaczą te przedziwne, skamieniałe odciski znalezione w lodzie? Czy \nbędziesz w stanie odkryć straszliwą tajemnicę Obozu Lake’a?','','choose-cthulhu-2---w-grach-szalestwa','','','','Choose Cthulhu 2 - W górach szaleństwa','','','',''),(431,1,1,'\nStarożytne ruiny ukryte pośród wydm Półwyspu Arabskiego czekają na śmiałków, którzy odważą się je odnaleźć. Dziwne budowle, jakby nieprzystosowane dla ludzi, skrywają wiedzę i skarby starsze niż ludzkość. Czy zdołasz rozszyfrować prastare sekrety ukryte w tekstach Abdula al-Hazreda i odnajdziesz Bezimienne miasto? Czy uda ci się przetrwać w labiryntach jego tuneli i pośród kolosalnych ruin? Jakie stwory wciąż pełzają po tych mrocznych korytarzach, dawno zapomnianych przez wszystkich śmiertelników?\n\nW grze paragrafowej Choose Cthulhu 4: Bezimienne miasto kierujesz losami bohatera zmagającego się z wyzwaniami znanymi z opowiadania Bezimienne miasto H. P. Lovecrafta. Dzięki twoim wyborom historia może potoczyć się inaczej! \n\nInformacje dodatkowe:\n\nFormat: A5\nLiczba stron: 136\nWydruk: czarno-biały\nOprawa: twarda','','choose-cthulhu-4---bezimienne-miasto','','','','Choose Cthulhu 4 - Bezimienne Miasto','','','',''),(432,1,1,'\nCoś zakłóca spokój odludnego miasteczka Dunwich. Krążą plotki o dziwnych poczynaniach niepokojącej rodziny Whateleyów. Ich związek z bezbożnymi demonicznymi rytuałami stał się tematem rozmów nielicznych mieszkańców wciąż zamieszkujących pośród surowych wzgórz Massachusetts. Czy z pomocą kolegów z Uniwersytetu Miskatonic uda ci się rozwikłać zagadkę rodziny Whateleyów? Jakie rytuały i zaklęcia kryją się na kartach przerażającego Necronomiconu, którego pożądają Whateleyowie? Czy uda ci się przetrwać spotkanie z horrorami, które czają się na farmach i w lasach Dunwich? \n\nW grze paragrafowej Choose Cthulhu 5: Zgroza w Dunwich kierujesz losami bohatera zmagającego się z wyzwaniami znanymi z opowiadania Zgroza w Dunwich H.P. Lovecrafta. Dzięki twoim wyborom historia może potoczyć się zupełnie inaczej!\n\nInformacje dodatkowe:\n\nFormat: A5\nLiczba stron: 168\nWydruk: czarno-biały\nOprawa: twarda','','choose-cthulhu-5--zgroza-w-dunwich','','','','Choose Cthulhu 5 -Zgroza w Dunwich','','','',''),(433,1,1,'\nOpętała cię potrzeba wiedzy absolutnej. Wszechświat jest złożoną i straszliwą zagadką, którą nauka dopiero próbuje rozwikłać. Wiedziony pogłoskami o istnieniu złej czarownicy, która rości sobie prawo do panowania nad tajemnicami czasu i przestrzeni, udajesz się na opuszczone Wzgórze Orne\'a, aby zamieszkać w jej rezydencji. Czy zdołasz odkryć jej sekrety i związek, jaki mają z nowoczesną nauką? Czy przerażające pogłoski o porwaniach i tajemniczych satanistycznych rytuałach, które rzekomo wciąż mają miejsce w starym mieście Arkham, są prawdziwe? Czy uda ci się przetrwać sny szeptane na strychu Domu Wiedźmy? \n\nW grze paragrafowej Choose Cthulhu 6: Sny w Domu Wiedźmy kierujesz losami bohatera zmagającego się z wyzwaniami znanymi z opowiadania Sny w Domu Wiedźmy H.P. Lovecrafta. Dzięki twoim wyborom historia może potoczyć się zupełnie inaczej!\n\nInformacje dodatkowe:\n\nFormat: A5\nLiczba stron: 136\nWydruk: czarno-biały\nOprawa: twarda','','choose-cthulhu-6---sny-w-domu-wiedmy','','','','Choose Cthulhu 6 - Sny w Domu Wiedźmy','','','',''),(434,1,1,'None','','dziennik-ksiga-rytuaw','','','','Dziennik: Księga rytuałów','','','',''),(435,1,1,'None','','choose-cthulhu-7---kolor-z-innego-wszechwiata','','','','Choose Cthulhu 7 - Kolor z innego Wszechświata','','','',''),(436,1,1,'Spędź święto z \nrodziną!W ciemną i mroźną grudniową \nnoc wyruszyłeś w odwiedziny do krewnych w Kingsport, aby wziąć udział w \nstarożytnej rodzinnej ceremonii. Miasteczko wydaje się zagubione w czasie, a w \ndomu krewnych panuje złowroga atmosfera. Dlaczego mają tam kopię Necronomiconu? \nCzy będziesz miał odwagę dołączyć do procesji zakapturzonych postaci? Jaki \ntajemniczy pogański rytuał czeka na ciebie na dole niekończących się schodów? \nCzy po zakończeniu ceremonii zachowasz poczytalność? A przede wszystkim, czy \nwyjedziesz z Kingsport żywy?','','choose-cthulhu-8---wito','','','','Choose Cthulhu 8 - Święto','','','',''),(437,1,1,'Jagodowy Las to miejsce, w którym krasnoludki i oswojone zwierzęta żyją w zgodzie, daleko od ludzkich siedzib. Krasnoludki mieszkają w swoich wioskach, ukrytych przed oczami ludzi głęboko w lesie, w pniach drzew lub w norkach, po sąsiedzku ze zwierzętami. Strażnicy to młode krasnoludki, w których role wcielają się gracze.','','jagodowy-las---wesoe-wyprawy','','','','Jagodowy Las - Wesołe Wyprawy','','','',''),(438,1,1,'Jeszcze wczoraj byłeś Nathanielem Wingate Peasleyem, profesorem ekonomii politycznej na Uniwersytecie Miskatonic. Nagły atak amnezji zabrał ci pięć lat życia. Kiedy odzyskałeś pamięć, zaczęły nękać cię koszmary i niezrozumiała wiedza. Gdzie przebywał twój umysł przez ostatnie pięć lat? Czy istnieje sposób, aby udowodnić, że twoje sny i wizje były rzeczywistością? Gdzie – a może – kiedy zostałeś uwięziony? Czy odpowiedź na te pytania kryje się pod piaskami pustyni, nawiedzanymi cieniami spoza czasu?','','choose-cthulhu-12-cie-spoza-czasu','','','','Choose Cthulhu 12: Cień spoza czasu','','','',''),(439,1,1,' Wrota do Umberfoal stoją otworem!    \n Odwiedźcie Umberfoal, starożytne miasto kryjące się od tysiąca lat pod Złą Ziemią, opustoszałym i zapomnianym przez wszystkich południowym krańcu Equestrii. Miasto chronione jest przed światem zewnętrznym potężnymi czarami, ale nękają je czyhające w ciemnościach złe moce – dlatego potrzebuje Waszej pomocy! Czy zajrzycie w najgłębsze jeziora i najciemniejsze jaskinie, aby stawić czoła zagrożeniom? Czy zdołacie pomóc Kucykom z Umberfoal w Ceremonii Świateł, ich starożytnym i magicznym rytuale?    \n\nTa przygoda pozwoli Wam odkryć niesamowite tajemnice podziemnego miasta Umberfoal, spotkać ciekawe stworzenia i poznać nowych przyjaciół, ale nie traćcie czujności! Ciemne zakamarki jaskiń skrywają ogromne niebezpieczeństwo.   \nDruga z serii przygoda do gry Equestria: Puść Wodze Fantazji! Odwiedźcie Umberfoal, starożytne miasto kryjące się od tysiąca lat pod Złą Ziemią, opustoszałym i zapomnianym przez wszystkich południowym krańcu Equestrii. \n','','equestria---ceremonia-wiate','','','','Equestria - Ceremonia świateł','','','',''),(440,1,1,'Keep \ncrucial rules on hand, and protect your notes and die rolls from player eyes \nwith the Pathfinder Roleplaying Game: GM Screen! This \nbeautiful four-panel, landscape-style screen features stunning artwork from \nEkaterina Burmak on the players\' side, and a huge number of charts and tables on \nthe GM\'s side to speed up play and reduce time spent leafing through rulebooks \nin search of key modifiers or results.','','pathfinder-2-ed-gm-screen','','','','Pathfinder 2 ed GM Screen','','','',''),(441,1,1,'Explore \nthe Galaxy!','','starfinder-rpg-beginner-box-en','','','','Starfinder RPG Beginner Box EN','','','',''),(442,1,1,'Zwycięzca prestiżowej \nnagrody ENnies 2019 za najlepszą grę!','','mothership-rpg','','','','Mothership RPG','','','',''),(443,1,1,'None','','starfinder-core-rulebook-pocket-edition','','','','Starfinder Core Rulebook Pocket Edition','','','',''),(444,1,1,' Kosmos jest niezmierzony, mroczny i wrogi. Promienie gamma i fale neutrin strzelają z umierających gwiazd z mocą zdolną upiec cię żywcem, czarne dziury rozedrą cię na najdrobniejsze cząsteczki, a pustka zagotuje twoją krew i opanuje umysł. Możesz krzyczeć, lecz nikt cię nie usłyszy. Wstrzymaj oddech, a próżnia rozsadzi ci płuca. Przestrzeń nie jest tak pusta, jak myślisz – jej granice nieustannie się rozszerzają. Rywalizujące rządy toczą zimną wojnę, której brutalność przechodzi wszelkie wyobrażenie, zaś chciwe korporacje walczą o cenne surowce. Koloniści sięgają gwiazd i rzucają na szalę własne życie, zdając sobie sprawę, że na każdej nowo zasiedlonej planecie czeka ich ogromna nagroda albo śmierć. Jakby tego było mało, w cieniu każdej asteroidy czają się istoty… Dziwne, nieznane i zabójcze.   \n\nGra fabularna OBCY to wspaniale ilustrowana, kolorowa książka w twardej oprawie, która zawiera zarówno opis świata OBCEGO w 2183 roku, jak i zestaw zasad, stworzonych z myślą o zachowaniu klimatu OBCEGO. Rozgrywka może się toczyć w dwóch różnych trybach:  \nTryb filmowy opiera się na gotowych scenariuszach, które nawiązują do pełnej zwrotów akcji fabuły filmów z serii OBCY. Opracowany z myślą o jednym intensywnym spotkaniu, ten tryb kładzie nacisk na ryzykowną, szybką i brutalną grę. Szansa, że wszyscy przeżyjecie, jest znikoma.  \nTryb kampanii stworzono do dłuższych rozgrywek, w których biorą udział te same grupy postaci graczy podczas wielu kolejnych sesji. Pozwala to poznawać świat OBCEGO bez jakichkolwiek ograniczeń . \n\nZasady gry oparto na systemie ,,Roku Zero,\'\' wykorzystanym w wielu nagrodzonych grach, między innymi Tajemnicach pętli czy Mutancie: Roku Zero. Zaadaptowano go jednak i rozwinięto, aby mógł sprostać wymaganiom i tematyce OBCEGO: horrorowi oraz dynamicznej akcji toczącej się w zimnej i mrocznej przestrzeni kosmicznej.  \n Jest rok 2183 – nieco ponad trzy lata po zniszczeniu kolonii Hadley’s Hope na LV-426, zniknięciu okrętu USS Sulaco oraz zamknięciu więzienia i odlewni ołowiu na Fiorinie 161. Strata oddziału Piechoty Kolonialnej z Sulaco oraz dwóch placówek finansowanych przez firmę Weyland-Yutani, jak również następstwa nieczystych zagrywek korporacji wynikające z tych incydentów, stworzyły atmosferę nieufności pomiędzy Firmą a rządem Zjednoczonych Ameryk.   \n\nOliwy do ognia dolała intensyfikacja konfliktów pomiędzy rywalizującymi sektorami kosmosu, którą można było zaobserwować na przestrzeni ostatnich pięciu lat. Choć te informacje nie zostały potwierdzone, wielu uważa, że Hadley’s Hope stanowiła poligon doświadczalny dla broni biologicznych produkowanych przez Weyland-Yutani oraz że wrogie państwo wysłało okręt wojenny, który zbombardował placówkę z orbity pociskami nuklearnymi. Inni uważają, że Firma współpracuje z jakimś nieznanym graczem i zamierza przejąć kontrolę nad koloniami na Pograniczu.  \n\nÓsma dekada XXII wieku nie należy do najbezpieczniejszych.','','obcy-gra-fabularna','','','','Obcy gra fabularna','','','',''),(445,1,1,' Ostrza w mroku  to gra fabularna o szajce śmiałych łotrów szukających szczęścia na nawiedzonych ulicach fantastyczno-industrialnego miasta. Znajdziecie w niej skoki, pościgi, okultystyczne tajemnice, niebezpieczne układy, krwawe potyczki oraz nieprzebrane bogactwa – jeśli tylko macie w sobie dość odwagi, by po nie sięgnąć.   Wasza nowo powstała szajka musi przetrwać pośród innych gangów, potężnych rodów szlacheckich, żądnych zemsty duchów i Błękitnych Płaszczy ze Straży Miejskiej oraz stawić czoła kuszącej, lecz zepsutej pieśni własnych dusz. Czy zdobędziecie wpływy w półświatku? Ile będziecie gotowi poświęcić, aby wspiąć się na sam szczyt? W podręczniku znajdziecie:','','ostrza-w-mroku---podrcznik-gwny','','','','Ostrza w Mroku - Podręcznik Główny','','','',''),(446,1,1,'Wyobraź sobie, że jesteś bohaterem lub bohaterką. Odważnym rycerzem, mądrą \nczarodziejką, ciekawskim podróżnikiem czy złotowłosą pieśniarką. Prowadzisz \nswoją drużynę ku nowemu wyzwaniu. Przemierzacie magiczny, baśniowy świat. \nOdkrywacie zapomniane ruiny, rozwiązujecie zagadki, poznajecie tajemnice i \nspotykacie przerażających przeciwników. Brzmi to, jak dobra książka lub gra \nkomputerowa? Jesteś blisko.','','mistrz-bani---edukacyjna-gra-fabularna','','','','Mistrz Baśni - edukacyjna gra fabularna','','','',''),(447,1,1,'Od tropikalnej dżungli po mroźne rubieże dalekiej północy rozciągają się  \nziemie pełne istot, które mają kłopoty. Wiele z nich zgubiło bliską osobę, którą \n spragnieni przygód bohaterowie pomogą odnaleźć. Łuskowaci przyjaciele utracili \n kontakt ze sobą z powodu awarii magicznego urządzenia. Mała dziewczynka wędruje \n boso po śniegu i szuka zaginionego towarzysza zabaw. Złota kura pragnie \nodrobiny  wolności i chowa się przed zrozpaczonym olbrzymem.','','mistrz-bani-zestaw-scenariuszy-1','','','','Mistrz Baśni Zestaw Scenariuszy 1','','','',''),(448,1,1,'Witajcie w przededniu śmierci przyszłości.   \n\n\"Czarny Kod\" to swoista skrzynka z narzędziami, która służy do opowiadania historii osadzonych w mrocznej przyszłości. Jako gracz otrzymasz mnóstwo opcji, aby stworzyć taką postać, o jakiej zawsze marzyłeś. Jako Mistrz Kodu otrzymasz bogaty świat, w którym będziesz mógł osadzić swoje przygody. Jeśli nie chcesz korzystać ze wszystkich transhumanistycznych elementów, możesz wybrać tylko te, które przypadną ci do gustu lub je dowolnie zmodyfikować. Wszystko zaś opiera się na prostych i szybkich zasadach mechanicznych, które są jednak na tyle złożone, aby podejmowane na sesji decyzje miały znaczenie dla rozwoju fabuły.   \n\nCzarny Kod to transhumanistyczna, cyberpunkowa gra fabularna, osadzona w świecie w przyszłości, w której człowieczeństwo i technologia są ze sobą tak bardzo powiązane, że nie wiemy, dokąd nas to zaprowadzi. Ogromne korporacje manipulują technologią, aby osiągać własne cele, a coś mrocznego czai się w kanałach i zaułkach…\n','','czarny-kod','','','','Czarny Kod','','','',''),(449,1,1,'Dziś gratka dla fanów gier fabularnych! Zestaw startowy do Obcego Gry \nFabularnej to świetne uzupełnienie twojej sesji o nowe handouty, które \nzdecydowanie pomogą Matkom Gry. Starter ma dziś premierę, dlatego od dziś \nmożecie go znaleźć w najlepszych sklepach z podręcznikami RPG oraz naszym \ngalaktycznym sklepiku.','','obcy-zestaw-startowy','','','','Obcy Zestaw Startowy','','','',''),(450,1,1,' Patrol jest grą fabularną osadzoną w trakcie 2 wojny indochińskiej (Wojny w Wietnamie).  Gracze wcielają się w minimum 3 osobowy oddział żołnierzy jednej ze stron konfliktu. Podręcznik daje graczom wiele mechanik, dzięki którym mogą rozegrać różnorodne scenariusze. Możliwości są nieograniczone, na przykład:   \n\nMożecie zostać oddziałem amerykańskich żołnierzy, którzy zostali desantowani w środku dżungli przy pomocy helikopterów. W celu odnalezienia i zniszczenia północno wietnamskich składów amunicji, oraz zlikwidowania wysoko postawionego oficera.   \n\nNa innej sesji możecie zagrać jako partyzanci wietkongu, których głównym celem  jest podburzanie miejscowej ludności w południowym wietnamie, przeciwko rządowi w sajgonie.   \n\nCzy jako ocalali z zestrzelonego śmigłowca. Nie wiecie gdzie dokładnie się znajdujecie. Jesteście ranni oraz  oszołomieni, nie macie łączności z dowództwem. Pogoda także nie jest po waszej stronie. Właśnie rozpętała się burza, która szybko się nie skończy, W tej sytuacji wrodzy żołnierze mogą okazać się jednym z mniejszych zmartwień.  \n\nWasi żołnierze będą potrzebowali wszystkich swoich umiejętności oraz niezwykłej determinacji, aby przeżyć rok w piekle, nie wariując przy tym i nie zatracając swojej duszy.  \n Podręcznik Umożliwia także rozgrywanie scenariuszy z innych konfliktów z czasów zimnej wojny. \n Mechanika Patrolu została zaprojektowana w taki sposób, aby wspierać opowiadanie historii traktujących o wojnie partyzanckiej, długich misjach i starciach piechoty. \n Szybka i śmiertelna rozgrywka, która korzysta z prawdziwych map. \nNiezwykle przystępna mechanika: trzy cechy, wyraziste umiejętności, jasno określone akcje i pule kości sześciościennych. \n Innowacyjnie rozwiązana kwestia morale, która wymusza dokonywanie trudnych wyborów. \n Unikatowa struktura tur, która realistycznie oddaje kilkudniowe misje. \n Prosta, lecz mająca znaczenie w grze logistyka, która nie powoduje bólu głowy. \n Możliwość wcielenia się w role żołnierzy stojących po drugiej stronie konfliktu.\nOś czasu obejmująca wszystkie okresy wojny w Wietnamie: wczesną wojnę, jej eskalację, ofensywę Tet, wietnamizację i ostatnie dni. \n 204 strony zasad, sprzętu i informacji historycznych \n','','patrol---podrcznik-podstawowy','','','','Patrol - Podręcznik Podstawowy','','','',''),(451,1,1,' Never Going Home: Bez powrotu  to drużynowa gra fabularna osadzona w nawiedzanych koszmarami okopach I wojny światowej.   \n\nPierwsze 2 lata wojny potoczyły się w taki sam sposób, jak w naszej rzeczywistości. Jednak rok 1916 zmienił wszystko. Konflikt stał się jeszcze krwawszy, a przedewszystkim mroczniejszy. Nowoczesne technologie, wymieszały się z magią, okultyzmem i zjawiskami paranormalnymi. Czy zdołacie przeżyć, w piekle, okopów północnej francji zwanym ,,Ziemią niczyją\'\',  czy ziem królestwa polskiego ?   \n\nNever Going Home: Bez powrotu opiera się na Systemie+One, w którym rozgrywka i rozwój postaci skupiają się na wkładzie poszczególnych bohaterów w szerzej zakrojoną historię grupy żołnierzy zwanej oddziałem. Pojedyncze postaci mogą opuścić grę z powodu śmierci na wskutek odniesionych ran bądź pogrążając się w szaleństwie za sprawą nadprzyrodzonych sił zza Zasłony. Nowych bohaterów tworzy się szybko, więc gracze są w stanie ponownie dołączyć do rozgrywki, wcielając się w kolejnego członka oddziału. Każdy z nich może przeżywać swoje chwile chwały, ale to historia oddziału jest najważniejsza.  \n\nPodręcznik zawiera pełną mechanikę:\n 9 opisów nacji. \n6 magicznych ścieżek. \n12 potworów,. \n3 przygody.\n','','never-going-home----bez-powrotu','','','','Never Going Home -  Bez powrotu','','','',''),(452,1,1,'W kosmosie nikt nie usłyszy, jak odchodzicie od zmysłów.  \nFunt Ciała to zbiór narzędzi do gry Mothership, pozwalający ci zbudować swoją własną, podniszczoną, czarnorynkową stację kosmiczną. Broszura zawiera także zasady dodawania cybernetycznych ulepszeń do twojej postaci jak i ogrom nowych broni, potworów, narkotyków i wiele, wiele więcej.\nW broszurze znajdziesz: \n\nW pełni gotową stację kosmiczną Marzenie Prospera, opakowaną w wiele lokacji i BN-ów, wraz z narzędziami do prowadzenia własnych przygód na tej wielkiej jak miasto stacji.|\nNarzędzia do tworzenia własnych stacji kosmicznych.\nZasady dodawania cybermodyfikacje do swojej postaci.\nWiele nowych broni, potworów, narkotyków i wszystkiego, co może się przydać kosmicznym kryminalistom.\nWylosuj to!\n\nFunt Ciała daje dostęp do łatwych w użyciu generatorów do szybkiego zaludniania twojego sektora obskurnymi stacjami kosmicznymi i zapuszczonymi posterunkami. W kilku rzutach kością będziesz mógł stworzyć niepowtarzalną stację, a potem odkryć, jakie problemy ona posiada.\nZapraszamy!\n\nZbudowaliśmy ten ciemny zakamarek wszechświata, żebyś mógł wrzucić go do swojej kampanii Mothershipa (albo innego RPG Sci-Fi), i wypełniliśmy go paskudnymi bohaterami niezależnymi, uzbrojonymi po zęby w broń masowej destrukcji i napompowanych nielegalnymi stymulantami. Myślimy, że wam się spodoba. \nOdkryj Marzenie \n\nMarzenie Prospera to gotowa do gry stacja kosmiczna z ponad 10 sekcjami (zawierających: melinę opium, kompanię najemników, i więcej!), tuzin BN-ów zalążki przygód dla wszystkich żądnych wyzwań na stacji lub poza nią.\n','','mothership---funt-ciaa','','','','Mothership - Funt Ciała','','','',''),(453,1,1,'Drzwi \nstarego domu otwierają się ze skrzypnięciem, rdza na zawiasach trzeszczy, a we \nwnętrzu widać kurz, unoszący się w powietrzu niczym zarodniki. W słabym świetle \ntanich latarek widzicie schody prowadzące na wyższe piętro; poręcze sąwyszczerbione \ni popękane jak spróchniałe zęby. Krzywizna sprawia, że stopnie przypominają \nwygłodniały uśmiech, a wy zastanawiacie się, czy tak stara konstrukcja utrzyma \nwasz ciężar. Mimo to musicie wejść.','','dzieciaki-na-rowerach','','','','Dzieciaki na rowerach','','','',''),(454,1,1,'Przedstawiamy \noficjalną grę fabularną OBCY - uniwersum wszechobecnej grozy i korporacyjnych \ngierek, gdzie syntetyczni ludzie bawią się w Boga, a załoganci statków \nkosmicznych i żołnierze piechoty kolonialnej stają się nosicielami dla \nprzerażających stworów. To brutalny i bezlitosny wszechświat, w którym urodziłeś \nsię spisany na straty.','','obcy-gra-fabularna--niszczyciel-wiatw','','','','OBCY Gra Fabularna – Niszczyciel światów','','','',''),(455,1,1,'W Dzieciakach \nna miotłach wcielicie się w role czarownic i \nczarodziejów, uczęszczających do szkoły magii, miejsca pełnego tajemnic, \nniebezpieczeństw i ekscytujących przygód. Będziecie radzić sobie z surowymiprofesorami, walczyć z mitycznymi bestiami, \nlatać na miotłach, warzyć eliksiry i rzucać potężne zaklęcia, odkrywając przy \ntym niesamowite sekrety waszej szkoły i jej mieszkańców.','','dzieciaki-na-miotach','','','','Dzieciaki na miotłach','','','',''),(456,1,1,'Nibiru \nto gra fabularna z gatunku science fiction, o utraconych wspomnieniach. Gracze \nwcielają się w Tułaczy: cierpiących na amnezję ludzi, zagubionych w ogromnej, \nzamieszkałej przez miliony mieszkańców stacji kosmicznej, gdzie każdy dzień jest \nwalką o przetrwanie. ','','nibiru---podrcznik-gwny','','','','Nibiru - podręcznik główny','','','',''),(457,1,1,'Never Going Home: Księga spaczonych bestii to podręcznik dodatkowy do Never \nGoing Home: Bez powrotu. Zawiera 24 nowe potwory oraz 3 przygody do \nrozegrania.','','never-going-home---ksiga-spaczonych-bestii','','','','Never Going Home - Księga spaczonych bestii','','','',''),(458,1,1,'Iglica: Miasto musi upaść to gra fabularna z gatunku fantasypunk, w której główne role odgrywają intryga, podstęp i bunt. Ty i twoi przyjaciele staniecie się komórką drowich, zdesperowanych bojowników o wolność, którzy za wszelką cenę chcą wyszarpać władze nad miastem z rąk wysokich elfów. Gra posługuje się prostymi zasadami, które pomogą ci opowiadać historie o brutalnych rebeliach, podczas których życie jest tanie, sojusze kruche, a magia dziwna oraz złowieszcza.   \n\nIglica: Miasto musi upaść - Podręcznik główny zawiera wszystkie zasady, które są potrzebne do poprowadzenia rozgrywki oraz szczegółowe opisy poszczególnych dzielnic i frakcji Iglicy:  \nOdwróć role - wciel się w tych \"złych\" światów fantasy i obal tyranię tych \"dobrych\". \nSkorzystaj z szybkich zasad opartych na puli kości dziesięciościennych (k10). \nStwórz nietypową postać, która będzie dokonywała trudnych wyborów w walce z władzą. \nUżyj zdolności, które na zawsze zmienią Iglicę - chociaż często za cenę twojego życia.\nChroń swoją drowią społeczność, nawet jeśli ona sama nie rozumie, że potrzebuje ochrony. \nPoznawaj tajemnice najwspanialszego miasta na świecie. \nUstalaj, co jest prawdą, a co fałszem w twojej własnej wersji Iglicy. \nDaj się porwać swojej wyobraźni i swobodnie osadzaj swoje pomysły w grze. \nSprawdź, dlaczego tak wielu graczy i tak wiele graczek pokochało ten system.\n','','iglica-miasto-musi-upa---podrcznik-gwny','','','','Iglica: miasto musi upaść - podręcznik główny','','','',''),(459,1,1,'Koniec \njest zaledwie początkiem…','','cie-wadcy-demonw-podrcznik-gwny','','','','Cień Władcy Demonów podręcznik główny','','','',''),(460,1,1,'Cień władcy demonów: \n Suplement władcy demonów to podręcznik dodatkowy do \n gry Cień Władcy Demonów.','','suplement-wadcy-demonw','','','','Suplement Władcy Demonów','','','',''),(461,1,1,'Cień władcy demonów: Kości \ndemona to zestaw kostek do gry fabularnej Cień władcy \ndemonów.','','koci-demona','','','','Kości demona','','','',''),(462,1,1,'Grobowce \nPustkowia  to \npodręcznik dodatkowy do gry Cień \nWładcy Demonów, opisujący północne krańce kontynentu Rul.','','grobowce-pustkowia-podrcznik-dodatkowy','','','','Grobowce Pustkowia podręcznik dodatkowy','','','',''),(463,1,1,'Podręcznik \ndodatkowy + PDF. ','','niepewna-wiara-podrcznik-dodatkowy','','','','Niepewna wiara podręcznik dodatkowy','','','',''),(464,1,1,'Podręcznik \ndodatkowy + PDF. ','','straszliwe-pikno-podrcznik-dodatkowy','','','','Straszliwe piękno podręcznik dodatkowy','','','',''),(465,1,1,'Podręcznik \ndodatkowy + PDF. ','','rozkoszna-agonia-podrcznik-dodatkowy','','','','Rozkoszna agonia podręcznik dodatkowy','','','',''),(466,1,1,'Podręcznik \ndodatkowy + PDF. ','','gd-w-pustce-podrcznik-dodatkowy','','','','Głód w Pustce podręcznik dodatkowy','','','',''),(467,1,1,'Podręcznik \ndodatkowy do \"Cienia Wladcy Demonów\". Zawiera kod na darmowy pdf do pobrania ze \nstrony alisgames.pl','','cwd-chwalebna-mier','','','','CWD Chwalebna śmierć','','','',''),(468,1,1,'Ciemne \nsprawki w Ostatniej \nNadziei + PDF \nGRATIS (kod na darmowy pdf jest umieszczony wewnątrz \nsuplementu).','','cwd-ciemne-sprawki-w-ostatniej-nadziei','','','','CWD Ciemne sprawki w Ostatniej Nadziei','','','',''),(469,1,1,'Na talię składa się 99 kart zaklęć i 1 karta użycia:\n\nINKANTACJE - 9 kart\nMAGIA FEY - 14 kart\nMAGIA KRWI - 6 kart\nCZARY Z GWP - 25 kart\nCZARY Z SP - 15 kart\nCZARY Z GP - 9 kart\nCZARY Z RA - 21 kart\nTABELA UŻYCIA ZAKLĘĆ - 1 karta\n\nZaklęcia i czary pochodzą z \"Suplementu Władcy Demonów\", \"Straszliwego piękna\", \"Grobowców Pustkowia\", \" Głodu w Pustce\" oraz \"Rozkosznej agonii\".','','karty-demona---zestaw-v','','','','Karty Demona - Zestaw V','','','',''),(470,1,1,'Na talię składa się 100 kart zaklęć:\n\nCHAOS - 11 kart\nCZAS - 11 kart\nILUZJA - 11 kart\nJASNOWIDZENIE - 11 kart\nKLĄTWY (Czarna Magia) - 11 kart\nMAGIA BITEWNA - 11 kart\nMAGIA BURZY - 11 kart\nMAGIA CIENIA - 11 kart\nMAGIA NIEBIAŃSKA - 11 kart\nWYCZUCIE MAGII - 1 karta','','karty-demona---zestaw-i','','','','Karty Demona - Zestaw I','','','',''),(471,1,1,'Na talię składa się 99 kart zaklęć i 1 karta użycia:\n\nMAGIA PIERWOTNA - 11 kart\nMAGIA RUNICZNA - 11 kart\nNATURA - 11 kart\nNEKROMANCJA (Czarna Magia) - 11 kart\nOCHRONA - 11 kart\nOGIEŃ - 11 kart\nPIEŚNI - 11 kart\nPOWIETRZE - 11 kart\nPRZEMIANY - 11 kart\nTABELA UŻYCIA ZAKLĘĆ - 1 karta','','karty-demona---zestaw-ii','','','','Karty Demona - Zestaw II','','','',''),(472,1,1,'Na talię składa się 100 kart zaklęć:\n\nPRZYWOŁANIA - 11 kart\nSZTUKI TAJEMNE - 11 kart\nSZTUKI ZAKAZANE (Czarna Magia) - 12 kart\nTECHNOMANCJA - 11 kart\nTELEPORTACJA - 11 kart\nTEURGIA - 11 kart\nTRANSFORMACJA - 11 kart\nUROKI - 11 kart\nWODA - 11 kart','','karty-demona---zestaw-iii','','','','Karty Demona - Zestaw III','','','',''),(473,1,1,'Na talię składa się 100 kart zaklęć:\n\nZIEMIA - 11 kart\nZNISZCZENIE - 11 kart\nŻYCIE - 11 kart\nALCHEMIA - 11 kart\nŚMIERĆ (Czarna Magia) - 11 kart\nDEMONOLOGIA (Czarna Magia) - 11 kart\nSPIRYTYZM - 11 kart\nTELEKINEZA - 11 kart\nTELEPATIA - 11 kart\nWIEDŹMI OGIEŃ-1 karta','','karty-demona---zestaw-iv','','','','Karty Demona - Zestaw IV','','','',''),(474,1,1,'Na przestrzeni pięciu różnych cykli Horror w Arkham: Gry karcianej z każdym  \n rozszerzeniem mieliście okazję napotkać nowych badaczy, tym samym zyskując nowe \n  możliwości tworzenia i rozbudowywania swych talii, by stawić czoła rozmaitym  \n mitom. Teraz, możecie zgłębiać nieznane w towarzystwie kolejnego nowego   \nśmiałka,  dołączającego do waszych przygód dzięki talii początkowej badacza –   \nHarvey  Walters. ','','horror-w-arkham-gra-karciana---winifred-habbamock','','','','Horror w Arkham: Gra Karciana - Winifred Habbamock','','','',''),(475,1,1,'Na \n przestrzeni pięciu różnych cykli Horror \n w Arkham: Gry karcianej z każdym rozszerzeniem \n mieliście okazję napotkać nowych badaczy, tym samym zyskując nowe możliwości \n tworzenia i rozbudowywania swych talii, by stawić czoła rozmaitym mitom. Teraz, \n możecie zgłębiać nieznane w towarzystwie kolejnego nowego śmiałka, \ndołączającego  do waszych przygód dzięki talii początkowej badacza \n– Jacqueline \n Fine.','','horror-w-arkham-gra-karciana---jacqueline-fine','','','','Horror w Arkham: Gra Karciana - Jacqueline Fine','','','',''),(476,1,1,'Na przestrzeni pięciu różnych cykli Horror w Arkham: Gry karcianej z każdym \nrozszerzeniem mieliście okazję napotkać nowych badaczy, tym samym zyskując nowe \nmożliwości tworzenia i rozbudowywania swych talii, by stawić czoła rozmaitym \nmitom. Teraz, możecie zgłębiać nieznane w towarzystwie kolejnego nowego śmiałka, \ndołączającego do waszych przygód dzięki talii początkowej badacza – Stella \nClack. ','','horror-w-arkham-gra-karciana----stella-clark','','','','Horror w Arkham: Gra Karciana -  Stella Clark','','','',''),(477,1,1,'None','','horror-w-psiarkham-intrygi-miaulathotepa','','','','Horror w Psiarkham Intrygi Miaulathotepa','','','',''),(478,1,1,'None','','horror-w-arkham-gra-karciana---morderstwo-w-hotelu-excelsior','','','','Horror w Arkham: Gra Karciana - Morderstwo w Hotelu Excelsior','','','',''),(479,1,1,'Przepowiednia \n jeszcze się nie wypełniła. Mroczne knowania ponownie spowijają Lożę Srebrnego  \nŚwitu, zaś w miarę jak karty odkrywają fragmenty historii przekonasz się, że to \n Ty jesteś kluczem do rozwikłania tajemnicy.','','horror-w-arkham-gra-karciana---powrt-przerwanego-krgu','','','','Horror w Arkham: Gra Karciana - Powrót Przerwanego Kręgu','','','',''),(480,1,1,'Najstarszym i najsilniejszym uczuciem rodzaju \nludzkiego jest strach, zaś najstarszym i najsilniejszym rodzajem strachu jest \nstrach przed nieznanym. - H. P. Lovecraft','','horror-w-arkham-gra-karciana---zestaw-podstawowy-nowa-edycja','','','','Horror w Arkham: Gra Karciana - Zestaw podstawowy (nowa edycja)','','','',''),(481,1,1,'\n\n\n\nA \nmonstrous presence once terrorized the secluded village of Dunwich. The season \nof horror ended only after three professors from Miskatonic University—Dr. Henry \nArmitage, Dr. Francis Morgan, and Professor Warren Price—ventured to Dunwich, \narmed with secret knowledge that enabled them to defeat the creature. Now, \nseveral months later, Dr. Armitage’s colleagues have gone missing, and he fears \nthe worst…Return \nto the very first cycle of content for Arkham Horror LCG with The Dunwich Legacy \nInvestigator Expansion. Similar to the previously-announced Edge of the Earth \nexpansions, all player cards for this cycle can be found within the Investigator \nExpansion.Note: \nAny longtime fans of Arkham Horror: The Card Game who already own everything \nfrom the original The Dunwich Legacy cycle will not find any new cards or \ncontent within this expansion.Not \na standalone product. A copy of the Arkham Horror: The Card Game core set is \nrequired to play.\n','','arkham-horror-the-card-game---the-dunwich-legacy-investigator-expansion','','','','Arkham Horror: The Card Game - The Dunwich Legacy Investigator Expansion','','','',''),(482,1,1,'\n\n\n\nA \nmonstrous presence once terrorized the secluded village of Dunwich. The season \nof horror ended only after three professors from Miskatonic University—Dr. Henry \nArmitage, Dr. Francis Morgan, and Professor Warren Price—ventured to Dunwich, \narmed with secret knowledge that enabled them to defeat the creature. Now, \nseveral months later, Dr. Armitage’s colleagues have gone missing, and he fears \nthe worst…Return \nto the very first cycle of content for Arkham Horror LCG with The Dunwich Legacy \nCampaign Expansion. Similar to the previously-announced Edge of the Earth \nexpansions, all campaign- and scenario-related cards for this \"cycle\" can be \nfound in the Campaign Expansion. This is the perfect opportunity for new fans of \nthe game to experience its very first full-length campaign, and for longtime \nfans to catch up on any parts they may have missed.Note: \nAny longtime fans of Arkham Horror: The Card Game who already own everything \nfrom the original The Dunwich Legacy cycle will not find any new cards or \ncontent within this expansion.Not \na standalone product. A copy of the Arkham Horror: The Card Game core set is \nrequired to play.\n','','arkham-horror-the-card-game---the-dunwich-legacy-campaign-expansion','','','','Arkham Horror: The Card Game - The Dunwich Legacy Campaign Expansion','','','',''),(483,1,1,'\n\n\n\nCoś \njest nie tak. Laureaci Nagrody Nobla całkowicie zniknęli wraz z ich rewolucyjnym \nodkryciem. To rozdarcie w rzeczywistości jest ogromną stratą dla ludzkości, \ndlatego trzeba je naprawić. W Machinacjach \nw czasie, \nwyjątkowym scenariuszu do Horror \nw Arkham: Gra karciana, \nbadacze podróżują po przeszłości, teraźniejszości i przyszłości, aby przywrócić \nliniom czasu właściwy bieg, nieustannie ścigani przez potworne Ogary i inne \npomioty z Tindalos. Ten scenariusz może być rozegrany przez 1-4 graczy w trybie \nsamodzielnej rozgrywki lub jako historia poboczna w dowolnej kampanii. \nPosiadając trzy kopie tego scenariusza, można również rozegrać go w Epickim \ntrybie wieloosobowym dla 3-12 badaczy.\n','','horror-w-arkham-gra-karciana--machinacje-w-czasie','','','','Horror w Arkham: Gra karciana – Machinacje w czasie','','','',''),(484,1,1,'\n\n\n\nThe \nboundaries between worlds have drawn perilously thin. Dark forces work in the \nshadows and call upon unspeakable horrors, strange happenings are discovered all \nthroughout the city of Arkham, Massachusetts, and behind it all an Ancient One \nmanipulates everything from beyond the veil. It is time to revisit that which \nstarted it all…With \na revamped system of organization and a number of quality-of-life improvements, \nthis new version of the beloved LCG’s core set is the perfect way for someone to \ndive into the game. The box comes with everything you need to get your Arkham \ncampaigns started, including enough cards and components for up to three other \nplayers to join you in your quest against the Mythos. There is a reason why \nArkham Horror: The Card Game has captivated players for almost five whole \nyears!\n','','arkham-horror-the-card-game---revised-core-set','','','','Arkham Horror: The Card Game - Revised Core Set','','','',''),(485,1,1,'None','','horror-w-arkham-gra-karciana---kltwa-rougarou','','','','Horror w Arkham: Gra Karciana - Klątwa Rougarou','','','',''),(486,1,1,'None','','horror-w-arkham-gra-karciana---karnawa-koszmarw','','','','Horror w Arkham: Gra Karciana - Karnawał Koszmarów','','','',''),(487,1,1,'Uwięziony \nw wymyślonym mieście pośród gwiazd Władca Carcosy stara się szerzyć szaleństwo i \nnieszczęście pośród niczego nieświadomych ludzi. Są jednak tacy, którzy są \ngotowi poświęcić swoje zdrowie psychiczne, aby zamknąć szlaki prowadzące do jego \nkoszmarnego królestwa.','','horror-w-arkham-gra-karciana---szlak-do-carcosy--rozszerzenie-badaczy','','','','Horror w Arkham: Gra Karciana - Szlak do Carcosy – Rozszerzenie Badaczy','','','',''),(488,1,1,'','','horror-w-arkham-gra-karciana---poeracze-snw-deluxe','','','','Horror w Arkham: Gra Karciana - Pożeracze Snów Deluxe','','','',''),(489,1,1,'None','','horror-w-arkham-gra-karciana---powrt-zapomnianej-ery','','','','Horror w Arkham: Gra Karciana - Powrót Zapomnianej Ery','','','',''),(490,1,1,'None','','horror-w-arkham-gra-karciana---zbyt-gboko','','','','Horror w Arkham: Gra Karciana - Zbyt Głęboko','','','',''),(491,1,1,'None','','horror-w-arkham-gra-karciana---diabelska-rafa','','','','Horror w Arkham: Gra Karciana - Diabelska Rafa','','','',''),(492,1,1,'Mroczne \nsiły opanowały Innsmouth! Z trudem udało wam się uciec razem z agentką Harper z \ntej nadmorskiej osady rybackiej, a teraz pędzicie na złamanie karku w kierunku \nlatarni morskiej na Sokolim Przylądku – gdzie macie nadzieję znaleźć kolejne \nwskazówki, które pozwolą wam poskładać fragmenty waszych wspomnień w spójną \ncałość. Jednak ledwo wyjechaliście poza granice miasteczka, a już dostrzegacie \nwe wstecznym lusterku blask reflektorów. Nie jesteś sami wśród tych \nopuszczonych, krętych dróg – czeka was pełny niebezpieczeństw wyścig do \ncelu!','','horror-w-arkham-gra-karciana---na-wysokich-obrotach','','','','Horror w Arkham: Gra Karciana - Na Wysokich Obrotach','','','',''),(493,1,1,'Światło pośród mgieł, to czwarty Zestawu Mitów z cyklu Zmowa nad Innsmouth do \ngry Horror w Arkham: Gra karciana!','','horror-w-arkham-gra-karciana---wiato-pord-mgie','','','','Horror w Arkham: Gra Karciana - Światło Pośród Mgieł','','','',''),(494,1,1,'Disney Lorcana to wielowarstwowa gra karciana, dostępna dla graczy o różnym poziomie doświadczenia - zarówno dla tych, którzy dopiero zaczynają swoją przygodę z grami karcianymi, jak i dla weteranów oraz kolekcjonerów. W trakcie rozgrywki będziesz manipulować potężnymi mocami magicznego tuszu, aby przywołać postaci znane z popularnych animacji. Bohaterowie mogą pojawić się w swoich klasycznych, dobrze rozpoznawalnych wcieleniach, ale również w zupełnie nowych, fantastycznych formach. Razem ze swoimi ulubionymi postaciami będziesz toczyć pojedynki z innymi graczami, znanych jako Illumineers, walcząc o zdobycie punktów opowieści, zwanych Lore. Pierwszy gracz, który zbierze 20 punktów, zwycięża!\n\nKażdy Disney Lorcana: Rise of the Floodborn - Booster Pack zawiera 12 losowych kart, w tym 6 kart typu Common, 3 typu Uncommon, 2 typu Rare, Super Rare lub Legendary i 1 losową kartę w wariancie foil. Disney Lorcana: Rise of the Floodborn - Booster Pack pomoże rozbudować Twoją kolekcję i zdobyć karty do zbu