ery z Disney Lorcana: Into the Inklands.\n\nKażdy booster zawiera dwanaście losowych kart:\n\n6 kart zwykłych\n3 karty rzadkie\n2 karty rzadkie, super rzadkie lub legendarne\n1 kartę foliowaną (losowy poziom rzadkości)\n','','disney-lorcana-into-the-inklands-booster-box','','','','Disney Lorcana: Into the Inklands Booster Box','','','',''),(497,1,1,'Disney Lorcana to wielowarstwowa gra karciana, dostępna dla graczy o różnym poziomie doświadczenia - zarówno dla tych, którzy dopiero zaczynają swoją przygodę z grami karcianymi, jak i dla weteranów oraz kolekcjonerów. W trakcie rozgrywki będziesz manipulować potężnymi mocami magicznego tuszu, aby przywołać postaci znane z popularnych animacji. Bohaterowie mogą pojawić się w swoich klasycznych, dobrze rozpoznawalnych wcieleniach, ale również w zupełnie nowych, fantastycznych formach. Razem ze swoimi ulubionymi postaciami będziesz toczyć pojedynki z innymi graczami, znanych jako Illumineers, walcząc o zdobycie punktów opowieści, zwanych Lore. Pierwszy gracz, który zbierze 20 punktów, zwycięża!  Każdy Disney Lorcana: Into the Inklands - Booster Pack zawiera 12 losowych kart, w tym 6 kart typu Common, 3 typu Uncommon, 2 typu Rare, Super Rare lub Legendary i 1 losową kartę w wariancie foil. Disney Lorcana: Into the Inklands - Booster Pack pomoże rozbudować Twoją kolekcję i zdobyć karty do zbudowania unikalnej talii.','','disney-lorcana-into-the-inklands---booster-pack','','','','Disney Lorcana: Into the Inklands - Booster Pack','','','',''),(498,1,1,'Aby zagrać w Disney Lorcana, każdy gracz będzie potrzebował talii sześćdziesięciu kart. Gotowe do gry talie początkowe zawierają wstępnie skonstruowaną talię z określoną listą kart. Jeśli dopiero zaczynasz przygodę z kolekcjonerskimi grami karcianymi lub chcesz doświadczyć gry z talią zaprojektowaną i przetestowaną przez projektantów gry, to jest produkt idealny dla Ciebie!','','disney-lorcana-rise-of-the-floodborn-amethyst--steel-starter-deck','','','','Disney Lorcana Rise of the Floodborn: Amethyst & Steel Starter Deck','','','',''),(499,1,1,'Aby zagrać w Disney Lorcana, każdy gracz będzie potrzebował talii sześćdziesięciu kart. Gotowe do gry talie początkowe zawierają wstępnie skonstruowaną talię z określoną listą kart. Jeśli dopiero zaczynasz przygodę z kolekcjonerskimi grami karcianymi lub chcesz doświadczyć gry z talią zaprojektowaną i przetestowaną przez projektantów gry, to jest produkt idealny dla Ciebie!','','disney-lorcana-rise-of-the-floodborn-amber--sapphire-starter-deck','','','','Disney Lorcana Rise of the Floodborn: Amber & Sapphire Starter Deck','','','',''),(500,1,1,'Ruby / Sapphire','','disney-lorcana-into-the-inklands---starter-deck','','','','Disney Lorcana: Into the Inklands - Starter Deck','','','',''),(501,1,1,'Sometimes, in order to truly appreciate a tale, one must first go back to its beginning. Grand adventures and strong fellowships are important and wonderful, but the first step of any journey is just as important as the last. With that in mind, it’s time to return to the beginning of one of the most epic adventures of all…With increased contents and some quality-of-life improvements, this new version of the classic LCG’s core set is the perfect opportunity for a new player to dive into the game. The box comes with everything you may need to kick off your adventures, including enough cards and components for four-player games right out of the gate. There is a reason why The Lord of the Rings: The Card Game has been a fan favorite for over ten years!','','the-lord-of-the-rings-the-card-game-revised-core-set','','','','The Lord of the Rings: The Card Game Revised Core Set','','','',''),(502,1,1,'\n\n\n\nEvery \nadventure begins with the first step. For many new fans of The Lord of the \nRings: The Card Game, the Revised Core Set is that first step. But what about \nthe next step? Or, beyond that, what if your friend is the one with the Revised \nCore Set, and you want a deck to call your very own? Not to worry, because there \nwon’t just be one deck for you to choose from—there will be four!Each \nstarter deck is built around a different theme and playstyle, and they all can \nprovide the perfect jumping-off point for players who want to try the game with \na friend or dabble in deckbuilding beyond what is available in the Revised Core \nSet. The Dwarves of Durin starter deck focuses on \"delving\" through your deck \nand drawing on the strength of Dwarven kinship. In addition to having a fully \npre-built player deck that is usable from the moment you open the box, this \nproduct also includes multiple additional cards that can be used to enhance any \ndecks you build yourself. Whether you plan to use this deck yourself or lend it \nto a friend who’s trying the game for the first time, there is no doubt that you \nwill want to add this starter deck to your collection!Note: \nFor longtime fans of The Lord of the Rings: The Card Game, if you already own \nall of the game’s expansions, you will not find any new cards in any of the \nstarter decks. However, you may find it helpful to have one of these decks on \nhand when you introduce a friend to the game, since these decks have been \ntailor-made for new players.Not \na standalone product. A copy of The Lord of the Rings: The Card Game core set is \nrequired to play.\n','','lord-of-the-rings-the-card-game-dwarves-of-durin-starter-deck---en','','','','LORD OF THE RINGS: THE CARD GAME DWARVES OF DURIN STARTER DECK - EN','','','',''),(503,1,1,'\n\n\n\nEvery \nadventure begins with the first step. For many new fans of The Lord of the \nRings: The Card Game, the Revised Core Set is that first step. But what about \nthe next step? Or, beyond that, what if your friend is the one with the Revised \nCore Set, and you want a deck to call your very own? Not to worry, because there \nwon’t just be one deck for you to choose from—there will be four!Each \nstarter deck is built around a different theme and playstyle, and they all can \nprovide the perfect jumping-off point for players who want to try the game with \na friend or dabble in deckbuilding beyond what is available in the Revised Core \nSet. The Elves of Lórien starter deck focuses on making tactical use of your \nSilvan allies and triggering their abilities multiple times. In addition to \nhaving a fully pre-built player deck that is usable from the moment you open the \nbox, this product also includes multiple additional cards that can be used to \nenhance any decks you build yourself. Whether you plan to use this deck yourself \nor lend it to a friend who’s trying the game for the first time, there is no \ndoubt that you will want to add this starter deck to your collection!Note: \nFor longtime fans of The Lord of the Rings: The Card Game, if you already own \nall of the game’s expansions, you will not find any new cards in any of the \nstarter decks. However, you may find it helpful to have one of these decks on \nhand when you introduce a friend to the game, since these decks have been \ntailor-made for new players.Not \na standalone product. A copy of The Lord of the Rings: The Card Game core set is \nrequired to play.\n','','lord-of-the-rings-the-card-game-elves-of-lorien-starter-deck---en','','','','LORD OF THE RINGS: THE CARD GAME ELVES OF LORIEN STARTER DECK - EN','','','',''),(504,1,1,'\n\n\n\nEvery \nadventure begins with the first step. For many new fans of The Lord of the \nRings: The Card Game, the Revised Core Set is that first step. But what about \nthe next step? Or, beyond that, what if your friend is the one with the Revised \nCore Set, and you want a deck to call your very own? Not to worry, because there \nwon’t just be one deck for you to choose from—there will be four!Each \nstarter deck is built around a different theme and playstyle, and they all can \nprovide the perfect jumping-off point for players who want to try the game with \na friend or dabble in deckbuilding beyond what is available in the Revised Core \nSet. The Defenders of Gondor starter deck focuses on high-risk, high-reward \ngameplay and standing strong in the face of overwhelming odds. In addition to \nhaving a fully pre-built player deck that is usable from the moment you open the \nbox, this product also includes multiple additional cards that can be used to \nenhance any decks you build yourself. Whether you plan to use this deck yourself \nor lend it to a friend who’s trying the game for the first time, there is no \ndoubt that you will want to add this starter deck to your collection!Note: \nFor longtime fans of The Lord of the Rings: The Card Game, if you already own \nall of the game’s expansions, you will not find any new cards in any of the \nstarter decks. However, you may find it helpful to have one of these decks on \nhand when you introduce a friend to the game, since these decks have been \ntailor-made for new players.Not \na standalone product. A copy of The Lord of the Rings: The Card Game core set is \nrequired to play.\n','','lord-of-the-rings-the-card-game-defenders-of-gondor-starter-deck---en','','','','LORD OF THE RINGS: THE CARD GAME DEFENDERS OF GONDOR STARTER DECK - EN','','','',''),(505,1,1,'\n\n\n\nEvery \nadventure begins with the first step. For many new fans of The Lord of the \nRings: The Card Game, the Revised Core Set is that first step. But what about \nthe next step? Or, beyond that, what if your friend is the one with the Revised \nCore Set, and you want a deck to call your very own? Not to worry, because there \nwon’t just be one deck for you to choose from—there will be four!Each \nstarter deck is built around a different theme and playstyle, and they all can \nprovide the perfect jumping-off point for players who want to try the game with \na friend or dabble in deckbuilding beyond what is available in the Revised Core \nSet. The Riders of Rohan starter deck focuses on hit-and-run tactics and \nabilities that trigger after allies leave play. In addition to having a fully \npre-built player deck that is usable from the moment you open the box, this \nproduct also includes multiple additional cards that can be used to enhance any \ndecks you build yourself. Whether you plan to use this deck yourself or lend it \nto a friend who’s trying the game for the first time, there is no doubt that you \nwill want to add this starter deck to your collection!Note: \nFor longtime fans of The Lord of the Rings: The Card Game, if you already own \nall of the game’s expansions, you will not find any new cards in any of the \nstarter decks. However, you may find it helpful to have one of these decks on \nhand when you introduce a friend to the game, since these decks have been \ntailor-made for new players.Not \na standalone product. A copy of The Lord of the Rings: The Card Game core set is \nrequired to play.\n','','the-lord-of-the-rings-the-card-game---riders-of-rohan-starter-deck','','','','The Lord of the Rings: The Card Game - Riders of Rohan Starter Deck','','','',''),(506,1,1,'The mysterious Dúnedain tirelessly protect the Free Peoples from lurking shadows and unseen dangers. In their duty to safeguard the realm, these Rangers of the North selflessly walk in harm’s way…The Angmar Awakened Hero Expansion includes 8 heroes for The Lord of the Rings: The Card Game, as well as all of the player cards and customization options featured in The Lost Realm and the original Angmar Awakened cycle. Use iconic characters like Aragorn and Arwen to quest through Middle-earth and thwart dangerous foes. Rise to the occasion by using valor cards and partake in new adventures pursuing thrilling side quests.The Angmar Awakened Hero Expansion can be used to build or enhance player decks for any The Lord of the Rings: The Card Game scenario or campaign.','','lord-of-the-rings-the-card-game-angmar-awakened-hero-expansion','','','','LORD OF THE RINGS: THE CARD GAME ANGMAR AWAKENED HERO EXPANSION','','','',''),(507,1,1,'None','','the-lord-of-the-rings-the-card-game---the-fellowship-of-the-ring-saga-expansion','','','','The Lord of the Rings: The Card Game - The Fellowship of the Ring Saga Expansion','','','',''),(508,1,1,'Your Fellowship of heroes have narrowly escaped from their ordeal in Dol Guldur. After a brief stay in Lórien, your party is on its way back to Thranduil when they see smoke billowing up from the eaves of Mirkwood. The black plumes lead you to the smoldering remains of a Woodman village, with bodies strewn about and black-feathered arrows sticking from their backs. This is clearly the work of Goblins, and the pained gasps of a dying Woodman tells you that the survivors were taken by the fiends to their lair within the forest. You swear an oath to rescue them if you can, or avenge them if you cannot, and so you draw your weapons and follow the trail into the woods.\n\nThis standalone scenario pack contains two adventures: The Oath and The Caves of Nibin-dûm. These scenarios were originally released as part of the Limited Collector’s Edition for The Lord of the Rings LCG. Now, with the inclusion of new boon and burden cards and the onset of the Revised Core Set, you and your fellow heroes can take on these two challenging scenarios as their own two-part adventure or as an extension of the core set’s Mirkwood Paths campaign. Will you track down the Goblins and rescue the captives? Or will you become lost in the dark of Mirkwood?','','lord-of-the-rings-the-card-game-the-dark-of-mirkwood-scenario-pack---en','','','','LORD OF THE RINGS: THE CARD GAME THE DARK OF MIRKWOOD SCENARIO PACK - EN','','','',''),(509,1,1,' Od zawsze Elfowie z Szarych Przystani wznosili okazałe okręty, aby podążać ku Zachodowi. Nikt nie jest bardziej zaznajomiony z tajemnicami mórz niż oni, ale tacy żeglarze i nawigatorzy z Noldoru zawsze muszą być na straży. Nagłe niebezpieczeństwa ze strony potężnych sztormów czy armii rabunkowych Korsarzy zawsze czyhają w oddali.','','lord-of-the-rings-the-card-game-dream-chaser-hero-expansion---en','','','','LORD OF THE RINGS: THE CARD GAME DREAM-CHASER HERO EXPANSION - EN','','','',''),(510,1,1,'Lord of the Rings: TCG - Dream-Chaser Campaign to niezwykła przygoda, która przeniesie Cię w głąb magicznego świata Śródziemia! Ta ekscytująca kampania do gry The Lord of the Rings: The Card Game pozwoli Ci wcielić się w bohaterów i wyruszyć na niebezpieczne wyprawy na pełne nieznanych terytoriów.\n\nW Dream-Chaser Campaign otrzymasz zestaw unikalnych kart, które pozwolą Ci stawić czoła nowym wyzwaniom. Wraz z Twoimi towarzyszami będziesz odkrywał tajemnice morskich głębin, walcząc z piratami i przerażającymi stworzeniami, które czekają na Twoją drużynę.','','lord-of-the-rings-the-card-game---dream-chaser-campaign-expansion','','','','Lord of the Rings: The Card Game - Dream-Chaser Campaign Expansion','','','',''),(511,1,1,'The Fellowship has broken. During a fateful confrontation at Amon Hen, large Orcs bearing the White Hand of Saurman attacked the company, and in the chaos some members were captured, others killed. Now, Aragorn and the remainder of the Fellowship must let Frodo travel to Mordor while they pursue the Orcs that captured their friends.\n\nExperience the next chapter of the journey to destroy the One Ring in The Two Towers Saga Expansion for The Lord of the Rings: The Card Game! This expansion contains six scenarios that recreate the adventures featured in the second part of the legendary The Lord of the Rings saga. You’ll also find over 50 hero and player cards, which can be used to build or enhance your decks for any The Lord of the Rings: The Card Game scenario or campaign!\n\nNote: For longtime fans of The Lord of the Rings: The Card Game, this expansion combines all of the contents from The Treason of Saruman and The Land of Shadow. If you already own those two expansions, you will not find any new cards or content in this product. ','','the-lord-of-the-rings-the-card-game---the-two-towers-saga-expansion','','','','The Lord of the Rings: The Card Game - The Two Towers Saga Expansion','','','',''),(512,1,1,'The western lands of Eriador have long remained peaceful under the vigilance of the Rangers of the North. Yet no grave can contain the evil forces of Angmar, which lurk in wild and ancient places, stretching the valorous Dúnedain rangers far and thin in their duty to protect the land.\n\nIn the Angmar Awakened Campaign Expansion, one to four players join forces with the Dúnedain to defend Eriador and investigate the source of the evil that plagues the land. Across nine scenarios, playable over the course of a sequential campaign, they must confront Orcs, trolls, wraiths, and a cunning villain who wields dark sorcery.\n\nThis expansion includes all of the scenarios featured in The Lost Realm and the original Angmar Awakened cycle, now repackaged into one box, along with all-new campaign content.','','lord-of-the-rings-the-card-game-angmar-awakened-campaign','','','','LORD OF THE RINGS: THE CARD GAME ANGMAR AWAKENED CAMPAIGN','','','',''),(513,1,1,'As dark threats loom over Middle-earth, ever more people are torn from their homes and left without safety or refuge. What begins as a simple task of escorting a band of such wanderers to a new home quickly evolves into something drastically more perilous when a mighty threat emerges from the wilds of Rhovanion.  \n\nIn the Ered Mithrin Campaign Expansion for The Lord of the Rings: The Card Game, one to four players explore the Wilderlands of Middle-earth in their quest to defeat a dragon that is terrorizing the countryside. Over the course of nine scenarios—which can be played standalone or as part of a larger campaign—the heroes must battle Goblins, explore the vast Wilderland, and steel themselves for a showdown with the dragon itself! \n\nThis expansion includes all of the scenarios originally featured in The Wilds of Rhovanion and the Ered Mithrin cycle, now repackaged into one box along with all-new campaign content. ','','the-lord-of-the-rings-the-card-game---ered-mithrin-campaign-expansion','','','','The Lord of the Rings: The Card Game - Ered Mithrin Campaign Expansion','','','',''),(514,1,1,'None','','star-wars-unlimited---spark-of-rebellion---two-player-starter','','','','Star Wars: Unlimited - Spark of Rebellion - Two-Player Starter','','','',''),(515,1,1,'Enter a galaxy of endless possibilities in Star Wars™: Unlimited! In this fast-paced, easy-to-learn trading card game, you and your opponent face off in exciting head-to-head battles full of iconic Star Wars characters. In this booster pack display for the game’s first set, Shadows of the Galaxy, you’ll find 24 individually wrapped booster packs. Each pack contains 9 common cards, 3 uncommon cards, 1 rare or legendary card, 1 leader, 1 base/token, and 1 foil card.','','star-wars-unlimited---shadows-of-the-galaxy-booster-display-24-booster---en','','','','Star Wars: Unlimited - Shadows of the Galaxy: Booster Display (24 Booster) - EN','','','',''),(516,1,1,'Enter a galaxy of endless possibilities in Star Wars™: Unlimited! In this fast-paced, easy-to-learn trading card game, you and your opponent face off in exciting head-to-head battles full of iconic Star Wars characters. In the Two-Player Starter for the game’s second set, Shadows of the Galaxy, you’ll find two fully built, ready-to-play decks for you and a friend to dive in and start learning the game. Outmaneuver your foes as the Mandalorian or overwhelm your \nenemies as Moff Gideon!\n\nThe Shadows of the Galaxy set features characters and content from The Mandalorian™ series, Solo: A Star Wars Story™, The Book of Boba Fett™ series, and more. Once you have learned the game, you can expand your collection with Star Wars: Unlimited booster packs, sold separately.','','star-wars-unlimited---shadows-of-the-galaxy-two-player-starter---en','','','','Star Wars: Unlimited - Shadows of the Galaxy: Two-Player Starter - EN','','','',''),(517,1,1,'Star Wars: Unlimited to strategiczna gra karciana w typie TCG, w której gracze wcielają się w role liderów - kultowych postaci ze świata Gwiezdnych Wojen - którzy gromadzą swoje siły, by stoczyć walkę o bazę przeciwnika. Potęgę graczy reprezentuje talia 50 kart zbudowana z jednostek, zdarzeń i ulepszeń.\n\nStar Wars: Unlimited - Twilight of the Republic - Two-Player Starter to dwie gotowe do gry talie, szybkie wprowadzenie w zasady i masa akcesoriów.','','star-wars-unlimited---twilight-of-the-republic-two-player-starter---en','','','','Star Wars: Unlimited - Twilight of the Republic Two-Player Starter - EN','','','',''),(518,1,1,'Wejdź do galaktyki nieskończonych możliwości w Star Wars™: Unlimited! W tej szybkiej, łatwej do opanowania grze karcianej ty i twój przeciwnik zmierzycie się w ekscytujących pojedynkach pełnych kultowych postaci z Gwiezdnych Wojen. W tym zestawie promocyjnym do trzeciego zestawu gry, Twilight of the Republic, znajdziesz 24 indywidualnie zapakowane zestawy booster. \n\nKażde opakowanie zawiera 9 kart zwykłych, 3 karty rzadkie, 1 kartę rzadką lub legendarną, 1 lidera, 1 podstawkę/token i 1 kartę foliową.\nZestaw Twilight of the Republic podkreśla konflikty zbrojne między Republiką Galaktyczną a Konfederacją Niezależnych Systemów, z udziałem bohaterów i złoczyńców, którzy walczyli ze sobą podczas Wojen Klonów.','','star-wars-unlimited---twilight-of-the-republic-booster-display','','','','Star Wars: Unlimited - Twilight of the Republic Booster Display','','','',''),(519,1,1,'Wejdź do galaktyki nieskończonych możliwości w Star Wars™: Unlimited! W tej szybkiej, łatwej do opanowania grze karcianej ty i twój przeciwnik zmierzycie się w ekscytujących pojedynkach pełnych kultowych postaci z Gwiezdnych Wojen. W tym zestawie promocyjnym do trzeciego zestawu gry, Twilight of the Republic, znajdziesz 24 indywidualnie zapakowane zestawy booster. \n\nKażde opakowanie zawiera 9 kart zwykłych, 3 karty rzadkie, 1 kartę rzadką lub legendarną, 1 lidera, 1 podstawkę/token i 1 kartę foliową.\nZestaw Twilight of the Republic podkreśla konflikty zbrojne między Republiką Galaktyczną a Konfederacją Niezależnych Systemów, z udziałem bohaterów i złoczyńców, którzy walczyli ze sobą podczas Wojen Klonów.','','star-wars-unlimited---twilight-of-the-republic---booster','','','','Star Wars: Unlimited - Twilight of the Republic - Booster','','','',''),(520,1,1,'Enter a galaxy of endless possibilities in Star Wars™: Unlimited! In this fast-paced, easy-to-learn trading card game, you and your opponent face off in exciting head-to-head battles full of iconic Star Wars characters. In this booster pack display for the game’s first set, Shadows of the Galaxy, you’ll find 24 individually wrapped booster packs. Each pack contains 9 common cards, 3 uncommon cards, 1 rare or legendary card, 1 leader, 1 base/token, and 1 foil card.','','star-wars-unlimited---shadows-of-the-galaxy---booster','','','','Star Wars: Unlimited - Shadows of the Galaxy - Booster','','','',''),(521,1,1,'None','','magic-the-gathering-streets-of-new-capenna---collector-booster-box-12-szt','','','','Magic the Gathering: Streets of New Capenna - Collector Booster box (12 szt.)','','','',''),(522,1,1,'Przyłącz się do niezwykłej imprezy z najpotężniejszymi Planeswalkerami w świecie Magic: The Gathering z deckiem Planeswalker Party! Ten wyjątkowy deck Commander przenosi Cię do walki z boku sławnych postaci, oferując emocjonujące strategie i niezwykłe mechaniki.','','commander-masters-c-deck-planeswalker-party','','','','Commander Masters C. Deck Planeswalker Party','','','',''),(523,1,1,'Powerful new cards to shake up the metagame. Returning favorites from Magic\'s past to join the Modern era. Amazing reprints to build, customize, and expand your collection. All of this—and more—awaits players with Modern Horizons 3.','','magic-the-gathering-modern-horizons-3---bundle','','','','Magic the Gathering: Modern Horizons 3 - Bundle','','','',''),(524,1,1,'Powerful new cards to shake up the metagame. Returning favorites from Magic\'s past to join the Modern era. Amazing reprints to build, customize, and expand your collection. All of this—and more—awaits players with Modern Horizons 3.','','magic-the-gathering-modern-horizons-3---commander-deck---creative-energy','','','','Magic the Gathering: Modern Horizons 3 - Commander Deck - Creative Energy','','','',''),(525,1,1,'Powerful new cards to shake up the metagame. Returning favorites from Magic\'s past to join the Modern era. Amazing reprints to build, customize, and expand your collection. All of this—and more—awaits players with Modern Horizons 3.','','magic-the-gathering-modern-horizons-3---commander-deck---eldrazi-incursion','','','','Magic the Gathering: Modern Horizons 3 - Commander Deck - Eldrazi Incursion','','','',''),(526,1,1,'The past is yours to explore! This Magic: The Gathering - Assassin’s Creed Bundle contains 9 Assassin’s Creed Beyond Boosters, plus other Assassin’s Creed-themed goodies, including 1 Traditional Foil card with Bundle-exclusive alternate-art, 40 Basic Land cards (20 Traditional Foils and 20 nonfoils), 1 oversized Spindown for life counter, 1 card storage box, and 2 reference cards. Beyond Boosters provide a curated opening experience for fans, with 7 Magic cards and 1 token/ad card or Art Card (Art Card in 8% of packs) in each pack. Every pack includes a combination of 1–4 card(s) of rarity Rare or higher, 3–5 Uncommon cards, and 0–1 Basic Land card. A foil-stamped Signature Art Card replaces the Art Card in 1% of Beyond Boosters. A Traditional Foil Borderless Mythic Rare card can be found in &lt;1% of boosters.','','magic-the-gathering-assassins-creed-bundle','','','','Magic the Gathering: Assassin\'s Creed Bundle','','','',''),(527,1,1,'Take a trip back in time with the Animus and track down history’s most elusive relics—all hidden inside Assassin’s Creed Collector Boosters. We’ve synchronized each booster with Traditional Foils, Rares and/or Mythics, Borderless and Extended-Art cards, and two Foil-Etched cards. Use your Eagle Vision and you may even spot alt-art cards with thematic Showcase frames, a card with a special type of foil treatment, or a Serialized card printed with a unique number. This Magic: The Gathering—Assassin’s Creed Collector Booster Box contains 12 Assassin’s Creed Collector Boosters. Each booster contains 10 Magic: The Gathering cards and 1 Traditional Foil double-sided token, with a combination of 4–5 cards of rarity Rare or higher, 5 Uncommon cards, and 0–1 Land cards. Every pack contains 2 Foil-Etched cards and 6–7 Traditional Foil cards. Serialized card in &lt;1% of boosters.','','magic-the-gathering-assassins-creed-collectors-booster','','','','Magic the Gathering: Assassin\'s Creed Collector\'s Booster','','','',''),(528,1,1,'Assassin\'s Creed emerges from the shadows and joins Magic the Gathering! You and your friends can run around historical locations with your favorite assassins, take a leap of faith... The past is waiting to be discovered!','','magic-the-gathering-assassins-creed-beyond-booster-display-24-packs','','','','Magic the Gathering: Assassin\'s Creed Beyond Booster Display (24 Packs)','','','',''),(529,1,1,'Assassin\'s Creed emerges from the shadows and joins Magic the Gathering! You and your friends can run around historical locations with your favorite assassins, take a leap of faith... The past is waiting to be discovered!','','magic-the-gathering-assassins-creed-beyond-booster','','','','Magic the Gathering: Assassin\'s Creed Beyond Booster','','','',''),(530,1,1,'Infiltrate the world of Assassin’s Creed and begin your initiation into the Order. Gear up for your first games of Magic with two Assassin’s Creed-themed decks (featuring two Mythic Rare cards and eight Rare cards). Learn the ropes with the included booklet, then leap into action and claim victory! This Magic: The Gathering - Assassin’s Creed Starter Kit contains 2 ready-to-play 60-card decks (Lands included), 2 deck boxes to store them in, 1 Magic how-to-play guide booklet, and 2 double-sided reference cards (Turn Order/Attacking &amp; Blocking).','','magic-the-gathering-assassins-creed-starter-kit','','','','Magic the Gathering: Assassin\'s Creed Starter Kit','','','',''),(531,1,1,'Each booster contains 15 Magic: The Gathering cards, with a total of 12 foil cards (3–10 Surge Foils and 2–9 Rainbow Foils) and 1 Surge Foil or Traditional Foil double-sided token. Every pack includes a combination of 7–14 cards of rarity Rare or higher and up to 7 Uncommon, up to 5 Common, and 1 Land cards.','','magic-the-gathering-doctor-who-collector-booster','','','','Magic the Gathering: Doctor Who Collector Booster','','','',''),(532,1,1,'W Bloomburrow dolinie zagrażają żywioły wymykające się spod kontroli, a konieczność niesienia ratunku spada na barki najmniejszych obrońców. Gracze wystawiają do walki swoje najlepsze łapki, walcząc u boku myszek, żab, nietoperzy, ptaków i niezliczonej liczby innych malutkich stworzeń - wszystko po to, aby przywrócić równowagę, pokój i udowodnić, że odwagę można znaleźć w każdym istnieniu, niezależnie od rozmiaru!','','magic-the-gathering-bloomburrow---commander-deck-box-4','','','','Magic the Gathering: Bloomburrow - Commander Deck Box (4)','','','',''),(533,1,1,'W Bloomburrow dolinie zagrażają żywioły wymykające się spod kontroli, a konieczność niesienia ratunku spada na barki najmniejszych obrońców. Gracze wystawiają do walki swoje najlepsze łapki, walcząc u boku myszek, żab, nietoperzy, ptaków i niezliczonej liczby innych malutkich stworzeń - wszystko po to, aby przywrócić równowagę, pokój i udowodnić, że odwagę można znaleźć w każdym istnieniu, niezależnie od rozmiaru!','','magic-the-gathering-bloomburrow---bundle','','','','Magic the Gathering: Bloomburrow - Bundle','','','',''),(534,1,1,'W Bloomburrow dolinie zagrażają żywioły wymykające się spod kontroli, a konieczność niesienia ratunku spada na barki najmniejszych obrońców. Gracze wystawiają do walki swoje najlepsze łapki, walcząc u boku myszek, żab, nietoperzy, ptaków i niezl