aymata Gathering','','','',''),(576,1,1,'Deck \nten dostarcza ciągłych pokusswoim wrogom, zarówno w pośrednim jak i bezpośrednim \nstylu. Twoje wampiry zrobią wszystko, by uniknąć przeciwnika – będą się \nprzekradać, hipnotyzować a nawet zmieniać swoje kształty! Twoja obrona jest \nograniczona ale nadal trzymasz kilka anarchowych trików w rękawie.','','v5---the-ministry--ministerium','','','','V5 - The Ministry / Ministerium','','','',''),(577,1,1,'Gangrele \nto wyrzutki zamieszkujące dzicz i przedmieścia, unikając intryg i polityki. \nTrzymają z naturą i Wewnętrzną Bestią, ceniąc sobie wolność, za którą są gotowi \nwalczyć do końca. Klan dołączył właśnie do ruchu Anarchistów – nie będą już \npopychadłami a ich kły są gotowe, by ranić mocno.','','v5---gangrel','','','','V5 - Gangrel','','','',''),(578,1,1,'Kiedyś \nDzieci Haqima były samotnymi wojownikami, czarodziejami i zabójcami. Obecnie są \nrozdarci pomiędzy dziedzictwem a obsesją moralności i szybkiej sprawiedliwości. \nW społeczności wampirzej są często odpowiedzialni za egzekwowanie prawa bowiem \nzawsze ktoś jest winny. A winny musi ponieść karę.','','v5---banu-haqim','','','','V5 - Banu Haqim','','','',''),(579,1,1,'Klan \nBrujah to awanturnicy, którzy kwestionują każdą władzę. Lubią przemieniać \nkażdego, o silnych poglądach i donośnym głosie; nastoletnich punków, członków \ngangów i wszelakich aktywistów. Wielu Brujah potrafi krzyczeć, ale wielu szybko \nrównież robi użytek ze swojego gniewu – nic tak dobrze nie rozwiązuje debaty jak \nszybki cios z pięści!','','v5---brujah','','','','V5 - Brujah','','','',''),(580,1,1,'Nosferatu \nto pokraki czające się w nocy. Zwane “szczurami kanałowymi”, ukrywają swój \nprawdziwy wygląd w ciemnościach, otaczając się zwierzęcymi sługami, które pełnią \nrolę szpiegów i strażników. W odwiecznej wojnie bywają pasywni, ale kiedy już \nzaatakują, czynią to z brutalną siłą.','','v5---nosferatu','','','','V5 - Nosferatu','','','',''),(581,1,1,'W Mini Tinie znajdziesz dwa boo