ktyw: Drugie dno','','','',''),(608,1,1,'\n\n\n\nDetektyw: Sezon Pierwszy to samodzielna gra na bazie bestsellera Portal \nGames – Detektywa: Kryminalnej Gry Planszowej. Jest to zestaw trzech unikatowych \nspraw, z których każda zabierze was w inne miejsce i wprowadzi w kryminalną \nzagadkę w innym stylu. Żadna z nich nie przypomina tych, które do tej pory \nrozwiązywaliście w Detektywie. To w pełni kooperacyjna gra dla 1-5 graczy, która \nzamieni wasze spotkania przy stole w fascynujące śledztwa.\n','','detektyw-sezon-1','','','','Detektyw: Sezon 1','','','',''),(609,1,1,'','','detektyw','','','','Detektyw','','','',''),(610,1,1,'Każdy czasem potrzebuje wytchnienia, nawet agenci \nspecjalni. Przychodzą do domu i chcą się przytulić. Najlepiej do kogoś z \nsierścią, wilgotnym noskiem i merdającym ogonem. A jeżeli ten ktoś potrafi \ndodatkowo rozwiązać kryminalne śledztwo… Oficerowie z \npazurem to dodatek \ndo kultowej kryminalnej gry planszowej Ignacego \nTrzewiczka, Detektyw. Autorami scenariusza do gry są Mike \nSelinker, Liz Spain i Skylar Woodies, członkowie prestiżowego zespołu  Lone \nShark Games. Tym razem \ndo drużyny śledczych Antares dołączają ich pupile! ','','detektyw-oficerowie-z-pazurem','','','','Detektyw: Oficerowie z pazurem','','','',''),(611,1,1,'','','kroniki-zbrodni-modu-rzeczywistoci-wirtualnej','','','','Kroniki Zbrodni: Moduł rzeczywistości wirtualnej','','','',''),(612,1,1,'Gra detektywistyczna, łącząca mechanikę escape roomów z klimatem popularnych \nskandynawskich thrillerów. Łączcie przedmioty, rozwiązujcie tajemnice i \nłamcie szyfry, aby ukończyć historię. Smartfon lub tablet stanie się waszym \ntowarzyszem gry, rejestrując postępy lub oferując pomoc w razie potrzeby. ','','50-clues-wahado-umarych-cz1','','','','50 Clues: Wahadło umarłych cz.1','','','',''),(613,1,1,'','','50-clues-biay-sen-cz2','','','','50 Clues: Biały sen cz.2','','','',''),(614,1,1,'Gra detektywistyczna, łącząca mechanikę escape roomów z klimatem popularnych \nskandynawskich thrillerów. Łączcie przedmioty, rozwiązujcie tajemnice i \nłamcie szyfry, aby ukończyć historię. Smartfon lub tablet stanie się waszym \ntowarzyszem gry, rejestrując postępy lub oferując pomoc w razie potrzeby. ','','50-clues-przeznaczenie-leopolda-cz3','','','','50 Clues: Przeznaczenie Leopolda cz.3','','','',''),(615,1,1,'Wyspa \nOshra pogrążona jest w chaosie. Śmierć Cesarza sprawiła, że konflikt pomiędzy \nGórskimi Plemionami a Armią Imperialną przybrał na sile. Podczas gdy Wodne Ludy \nza wszelką cenę próbują utrzymać w ryzach zwaśnionych rywali, Nieumarli dążą do \notwartej wojny. Cała nadzieja w szóstce dzieci Cesarza. Które z nich obejmie \ntron? GRA PEŁNA DEDUKCJI Ukryci Liderzy to szybka i lekka strategiczna gra \nkarciana z dużą ilością bezpośredniej interakcji między graczami. To świetne \npołączenie mechaniki budowania własnego obszaru gry z elementami dedukcji i \nwyjątkowym mechanizmem określania zwycięzcy.','','ukryci-liderzy','','','','Ukryci liderzy','','','',''),(616,1,1,'Crime \n zoom to seria gier detektywistycznych przeznaczonych \n dla 16 graczy. Zasady tłumaczy się w 2 minuty, a sama rozgrywka zajmuje około \n godziny.','','crime-zoom-ostatnia-karta','','','','Crime zoom: Ostatnia karta','','','',''),(617,1,1,'None','','crime-zoom-ptaki-zej-wrby','','','','Crime zoom: Ptaki złej wróżby','','','',''),(618,1,1,'Kroniki \nZbrodni: 1400 jest samodzielną grą, rozwijającą pomysły znane z podstawowych \n,,Kronik zbrodni\". Zastosowana w niej technologia Scan &amp; Play pozwala \npołączyć zalety gry planszowej i elektronicznej. Przesłuchuj świadków i \npodejrzanych, gromadź dowody rzeczowe i zatrzymaj mordercę, zanim będzie za \npóźno!','','kroniki-zbrodni-1400','','','','Kroniki zbrodni: 1400','','','',''),(619,1,1,'\n\n\n\nNazywasz \nsię Victor Lavel i jesteś młodym, ambitnym reporterem. Jest rok 1900. Już \nwkrótce o tych czasach będzie się mówić La Belle poque Paryż, stolica Francji, \ntętni życiem. Tyle tu się dzieje! Jednak ciebie znacznie bardziej interesują \nmorderstwa, porwania i spektakularne kradzieże. Twój stryj jest komisarzem \npolicji, więc jako jedna z pierwszych osób dowiadujesz się o nowych zdarzeniach. \nCzy potrafisz wykorzystać swoje zdolności i wykryć sprawcę zbrodni?Kroniki \nZbrodni: 1900 to niezależna, kooperacyjna gra detektywistyczna. Zastosowana w \nniej technologia Scan &amp; Play pozwala połączyć zalety gry planszowej i \nelektronicznej. Gracz może prowadzić wiele różnych dochodzeń, korzystając z tych \nsamych elementów.Jedyna \nw swoim rodzaju, kooperacyjna gra detektywistyczna.Nie \nmusisz czytać zasad, po prostu rozpocznij śledztwo!Przenieś \nsię na miejsce zbrodni jakbyś naprawdę tam był.Przesłuchuj \nświadków i podejrzanych, gromadź dowody rzeczowe i zatrzymaj mordercę, zanim \nbędzie za późno!\n','','kroniki-zbrodni-1900','','','','Kroniki zbrodni: 1900','','','',''),(620,1,1,'None','','escape-room-zamek-drakuli','','','','Escape Room: Zamek Drakuli','','','',''),(621,1,1,'\n      Kryptyda to strategiczna gra planszowa wydana przez Lucrum Games, która przenosi graczy w tajemniczy i niebezpieczny świat kryptologii. Gracze wcielają się w rolę ekspertów od kryptozoologii, którzy próbują odkryć tajemnicę tajemniczego stworzenia, zwanego Kryptyda.\n    ','','kryptyda','','','','Kryptyda','','','',''),(622,1,1,'None','','ukryci-liderzy-kompania-krlowych','','','','Ukryci liderzy: Kompania Królowych','','','',''),(623,1,1,'W wyniku serii niefortunnych zdarzeń straciłem połowę załogi. Reszta, w przekonaniu, że okręt jest przeklęty, opuściła mnie w małym porcie, do którego zawinęliśmy, by uzupełnić zapasy wody. Zaciągnięcie nowej załogi w miejscowej tawernie poszło zaskakująco łatwo. Cieszyłbym się, gdyby nie dziwne przeczucie, że część z nowych załogantów ma jakieś nikczemne zamiary…','','kraken-gra-ukrytych-tosamoci-i-buntu-na-pokadzie','','','','Kraken: Gra ukrytych tożsamości i buntu na pokładzie','','','',''),(624,1,1,'Arkana \nMiłości to ekskluzywna seria gier dla par i osób, które dopiero się poznają, \nszukając bliskiej relacji lub przygody. Łączy proste zasady z przepiękną oprawą \ngraficzną.','','arkana-mioci---talia-romantyczna','','','','Arkana miłości - Talia romantyczna','','','',''),(625,1,1,'Światło świec, ciepło skóry, dreszcz emocji…   \nZamknij oczy i zastanów się, czego naprawdę pragniesz.','','arkana-mioci-2','','','','Arkana miłości 2','','','',''),(626,1,1,'Arkana \nMiłości to seria ekskluzywnych gier erotycznych, \nktóre łączą proste zasady i zróżnicowane zadania pomagające przełamać \nnieśmiałość, budujące seksualne napięcie i wprowadzające szczyptę pikanterii do \nWaszego związku. Gra ma klimatyczną oprawę graficzną ze zdjęciami zmysłowych \naktów pobudzających wyobraźnię, a także intrygującymi aforyzmami.','','arkana-mioci--edycja-premium','','','','Arkana miłości  Edycja premium','','','',''),(627,1,1,'Światło świec, ciepło skóry, dreszcz emocji… \nZamknij oczy i zastanów się, czego naprawdę pragniesz.','','arkana-mioci-kochankowie','','','','Arkana miłości Kochankowie','','','',''),(628,1,1,'Dawno, \ndawno temu Wielki Smok czuwał nad losem całego ludu. Pewnego razu zawistny \nczarownik zamienił go w kamień, a jego ognisty oddech zaklął w krwistoczerwony \nklejnot, nazwany sercem smoka. W tychże zarówno baśniowych, jak i \nniebezpiecznych czasach odważne księżniczki muszą opędzać się od śmiałków i \ntrolli, jednocześnie próbując odczarować skamieniałego smoka i zgromadzić całe \nmnóstwo cennych skarbów. Chrapkę na skarby mają również potężne ogniste smoki, \njednak ich tropem podążają już wprawne łowczynie. Jedynie krasnoludy nie biorą \nudziału w całym zamieszaniu i troszczą się jedynie o własne interesy.','','serce-smoka','','','','Serce Smoka','','','',''),(629,1,1,'Jesteś tylko ty…i twój przeciwnik. Karty \nzapewnią Ci potężne moce… lecz pchną Cię również na krawędź szaleństwa. Odkryj \nstarożytną wiedzę… lub pogrąż się w odmętach szaleństwa tracąc ostatnie resztki \nczłowieczeństwa...','','poprzez-wieki---droga-do-szalestwa','','','','Poprzez Wieki - Droga do Szaleństwa','','','',''),(630,1,1,'Premiera: I kwartał \n2023','','star-wars-the-deckbuilding-game-edycja-polska','','','','Star Wars: The Deckbuilding Game (edycja polska)','','','',''),(631,1,1,'\n\n\n\nLogiczna \ngra dla dwóch lub czterech graczy. Rozgrywka w \"Sąsiadów\" trwa dwie rundy, w \ntrakcie których gracze kolejno stają po stronie hodowcy królików i owiec. Sąsiad \nhodujący króliki zawsze stawia im długie i proste zagrody, a jego rywal hodujący \nowce - zagrody w kształcie litery L. Celem gry jest zbudowanie większej liczby \nzagród niż przeciwnik. Za każdą niewybudowaną zagrodę otrzymuje się punkty \nkarne. Mechanika gry przypomina Tetrisa, a każda rozgrywka jest inna za sprawą \nzmiennej planszy.\n','','ssiedzi-muduko','','','','Sąsiedzi MUDUKO','','','',''),(632,1,1,'W Królestwie panował pokój i dobrobyt. Król - \n łaskawy władca - zajmował się nie tylko sprawami wielkiej wagi, ale także \nmałymi  problemami ludzie biedniejszych i zamieszkujących bardziej odległe \n ziemie. ','','drako-rycerze-i-trolle','','','','Drako Rycerze i Trolle','','','',''),(633,1,1,'Pomóż gejszom zdobyć doświadczenie w sztuce parzenia herbaty!','','gejsze-2-herbaciarnie','','','','Gejsze 2: Herbaciarnie','','','',''),(634,1,1,'Dynamiczna \ngra karciana, która świetnie sprawdzi się zarówno do rozwijania dziecięcego \nsłownictwa, jak i na imprezy! Naszym zadaniem jest najszybsze wymyślanie słów \nspełniających dwa kryteria: pierwszą literę oraz kategorię. ','','ekspreswka','','','','Ekspresłówka','','','',''),(635,1,1,'\n\n\n\n\nGra \no kotach biegających za kłębkiem! Każdy gracz ma planszę przedstawiającą pokój \npełen zabawek. Po pokojach biegają koty. Im więcej zabawek zainteresuje kota, \ntym więcej punktów gracz zdobędzie. Pięknie zilustrowana gra z wyjątkowymi \nelementami: sznurkami i specjalnymi planszami. Doskonała zabawa nie tylko dla \ndzieci.\n\n','','kociaki-obuziaki','','','','Kociaki Łobuziaki','','','',''),(636,1,1,'La Cucaracha to zręcznościowa gra dla dzieci od szóstego roku życia, w której gracze mają za zadanie pozbyć się karalucha, który opanował kuchnię! Wiadomo, że w takich warunkach nie można gotować, dlatego czym prędzej trzeba zrobić porządek z robakami! Liczy się pomysłowość, zręczność i dobry refleks, karaluchy to cwane stworzenia!','','la-cucaracha','','','','La Cucaracha','','','',''),(637,1,1,'Gra \ncud miód ultramaryna!','','uratuj-pszczo','','','','Uratuj pszczołę','','','',''),(638,1,1,'Czy to wina pralki? Nie! To skarpetkowe stwory zbierają skarpetki i chowają \nje w swoich norkach. Z pomocą przychodzą Wam uczynne skrzaty. Gotowi na \nposzukiwania skarpet?','','skarpetkowe-stwory','','','','Skarpetkowe stwory','','','',''),(639,1,1,'Bestsellerowa \ngra zręcznościowa - teraz także w wersji dla najmłodszych!','','jungle-speed-kids','','','','Jungle Speed: Kids','','','',''),(640,1,1,'None','','wik-plusk','','','','Żółwik Plusk!','','','',''),(641,1,1,'\n\n\n\nGracze \nprzemieszczają swoje myszki na planszy i starają się zdobyć smakowity ser. Muszą \njednak wystrzegać się kota, który depcze ich po piętach. Gra ma dynamiczne tempo \ni dostarcza dużych emocji. Świetna także dla starszych \ngraczy.\n','','dzielne-myszki','','','','Dzielne myszki','','','',''),(642,1,1,'Świąteczna wersja \nbestsellerowej gry.','','pdzce-wie-wycig-do-choinki','','','','Pędzące żółwie wyścig do choinki','','','',''),(643,1,1,'Dinozaur Grześ traci grunt pod nogami. Kto \nspowoduje jego upadek, przegrywa! Ostrożnie wybijaj kolejne kamienie i staraj \nsię nie być osobą, która doprowadzi do tego nieszczęsnego wydarzenia i uratuje \ngo z opałów.','','dinozaur-w-opaach','','','','Dinozaur w opałach','','','',''),(644,1,1,'Świetna zabawa dla starszych i młodszych dzieci.','','supernogi-stonogi-xxxl','','','','Supernogi Stonogi XXXL','','','',''),(645,1,1,'Wytęż \numysł i spróbuj swoich sił w grze, która rozwinie rozmaite funkcje Twojego \nmózgu. Podejmij się 8 różnych testów sprawdzających rozumowanie, pamięć i \nszybkość. Przygotuj się na zadania wymagające myślenia przestrzennego, \nzapamiętywania, analizy, logiki, a nawet… rozpoznawania kształtów wyłącznie za \npomocą dotyku!','','cortex-harry-potter','','','','Cortex Harry Potter','','','',''),(646,1,1,'None','','cortex-super-cortex','','','','Cortex Super Cortex','','','',''),(647,1,1,'None','','dobble-disney-princess','','','','Dobble Disney Princess','','','',''),(648,1,1,'\n\n\n\nŚpiące Królewny 2: \n Na ratunek! to \n kontynuacja popularnej gry matematycznej o budzeniu zaklętych królewien. Tym \n razem mamy przed sobą zupełnie nowe wyzwanie: musimy uratować określoną liczbę  \nksiążąt! Czeka na nas mnóstwo niebezpieczeństw takich jak dzikie krasnale, \n zdradliwe wierzby usypiające i niezwykle podstępne czarownice zamiennice. Na \n szczęście mamy też wielu sojuszników, których możemy wezwać układając z kart z \n cyframi proste równania. \n','','pice-krlewny-2-na-ratunek','','','','Śpiące Królewny 2: Na ratunek!','','','',''),(649,1,1,'Połączcie \nze sobą elementy Wystrzałowych \nkatapult oraz dodatku Wystrzałowe katapulty: \nOblężenie. Dzięki temu wariantowi będziecie mogli stoczyć bitwę od 2 do \n4 graczy.','','wystrzaowe-katapulty-oblenie','','','','Wystrzałowe katapulty: Oblężenie','','','',''),(650,1,1,'Kroniki \nPrzygody to przygodowa gra rodzinna łącząca grę planszową z możliwościami \naplikacji mobilnej.','','kroniki-przygody-wyprawa-po-ksiycowe-kamienie','','','','Kroniki Przygody: Wyprawa po księżycowe kamienie','','','',''),(651,1,1,'None','','grzybobranie-w-zielonym-gaju','','','','Grzybobranie w Zielonym Gaju','','','',''),(652,1,1,'Wiek: od 4 latLiczba graczy: 2-4 osoby','','grzybobranie--rajd-samochodowy','','','','Grzybobranie / Rajd Samochodowy','','','',''),(653,1,1,'None','','kto-to-zrobi','','','','Kto to zrobił?','','','',''),(654,1,1,'Wysil \nswój umysł i wypełnij dostępną przestrzeń kociakami o różnych kształtach i \nrozmiarach. I pamiętaj: przestrzeń bez kota to przestrzeń stracona!','','cat-stax','','','','Cat Stax','','','',''),(655,1,1,'Final Girl to wyjątkowo klimatyczna i różnorodna gra dla jednego gracza oparta na unikalnym systemie filmów.','','final-girl---pudeko-podstawowe','','','','Final Girl - Pudełko Podstawowe','','','',''),(656,1,1,'Aleja Klonów była spokojną podmiejską dzielnicą, dopóki dzieciaki nie zaczęły umierać we śnie. Dr Fright - doktor snu powrócił, by torturować rodziny, które zrujnowały jego życie. We śnie nie ma gdzie się ukryć…','','final-girl---rze-w-witym-gaju','','','','Final Girl - Rzeź w świętym gaju','','','',''),(657,1,1,'Po przeprowadzce do niesławnego Nawiedzonego dworu Carolyn, najmłodsza dziewczynka w rodzinie, zaczyna zauważać zjawiska nadprzyrodzone. W tajemniczych zakamarkach nowego domu czai się morderca nie z tego świata. Czy młoda niania da radę znaleźć Carolyn i uciec, zanim będzie za późno?','','final-girl---legenda-nawiedzonego-dworu','','','','Final Girl - Legenda Nawiedzonego dworu','','','',''),(658,1,1,'Pret-a-porter to ekonomiczna gra planszowa, której tematyką jest świat mody. Każdy z graczy wciela się tu we właściciela firmy branży odzieżowej i rozpoczyna zaciętą walkę o sukces swojego przedsiębiorstwa.','','pret-a-porter-trzecia-edycja','','','','Pret-a-Porter (trzecia edycja)','','','',''),(659,1,1,' Roll for the \nGalaxy to gra kościana \no budowaniu międzygwiezdnych imperiów. Siedem rodzajów specjalnie przygotowanych \nkości symbolizuje Twoich robotników. W każdej rundzie wykonujesz rzut swoimi \nkośćmi robotników i przydzielasz ich do różnych zadań, aby rozwijali nowe \ntechnologie, zasiedlali planety, produkowali dobra, a wreszcie dostarczali je na \nlokalny rynek.','','roll-for-the-galaxy','','','','Roll For the Galaxy','','','',''),(660,1,1,'Ten \nmoment musiał nadejść – korporacje rywalizujące ze sobą o wyższość na Marsie \npostanowiły połączyć siły i wspólnie przeforsować rozwiązania, które uważają za \nnajkorzystniejsze dla rozwoju. W tym celu powstał marsjański parlament, w którym \ndelegaci najważniejszych firm podejmują decyzje kluczowe dla przyszłości \nCzerwonej Planety.','','terraformacja-marsa-niepokoje','','','','Terraformacja Marsa: Niepokoje','','','',''),(661,1,1,'Denerwują \n cię przesuwające się kostki surowców? Twoi znajomi mają tak zamaszyste ruchy, \nże  potrafią w sekundę przerobić stal na tytan? Często “coś ci się nie zgadza” i \nnie  możesz się doliczyć, na jakim poziomie produkcji byłeś?','','terraformacja-marsa---zestaw-5-plansz-graczy','','','','Terraformacja Marsa - Zestaw 5 plansz graczy','','','',''),(662,1,1,'None','','die-macher-edycja-polska','','','','Die Macher (edycja polska)','','','',''),(663,1,1,'Świat się \nzmienił.','','new-angeles','','','','New Angeles','','','',''),(664,1,1,'Sid \n Meier’s Civilization: Nowy początek odtwarza bestsellerową serię komputerowych \n strategicznych w formie gry planszowej. W tej dynamicznej i przystępnej \n adaptacji gracze poprowadzą swoje nacje do wyścigu o terytoria, technologię i \n wyjątkowe cuda świata.','','sid-meiers-civilization-nowy-pocztek','','','','Sid Meier\'s Civilization: Nowy początek','','','',''),(665,1,1,'Przyznam, ostatnio przeżywaliśmy dość trudny \n okres. Jednak to, co nam się przydarzyło po drodze do Newdale, przekroczyło \n nasze najśmielsze oczekiwania.','','wyprawa-do-newdale','','','','Wyprawa do Newdale','','','',''),(666,1,1,'Zostań \nwładcą międzynarodowego imperium. Produkuj surowce, wznoś majestatyczne \nkonstrukcje i rozwijaj nowoczesne technologie?','','nowy-wspaniay-wiat','','','','Nowy wspaniały świat','','','',''),(667,1,1,'Wielki Sapa Inka Pachacutec zwrócił się do swego \npotomstwa, rozkazując mu wyruszyć na podbój czterech stron świata. Tak daleko, \njak wędrują lamy, rozciągać się będzie jego \npotęga. Tawantinsuyu: Imperium Inków to \nrozbudowana strategiczna gra Dávida Turcziego (Tekhenu: \nObelisk Słońca, Anachrony), w której \n1-4 graczy stanie na czele inkaskich plemion, walczących ze sobą o przejęcie \nschedy po legendarnym królu.','','tawantinsuyu-imperium-inkw','','','','Tawantinsuyu: Imperium Inków','','','',''),(668,1,1,'None','','terraformacja-marsa--zestaw-dodatkowy-5','','','','Terraformacja Marsa- Zestaw dodatkowy 5','','','',''),(669,1,1,'W czasach niesłychanego dobrobytu i postępu \nludzkości wreszcie jesteśmy gotowi, by przekroczyć dotychczasowe granice i \nzbudować nowy dom pośród gwiazd. Mars to nie tylko nowy świat, który zapewni dom \nrosnącej populacji. To także pierwszy krok z wielu, które poprowadzą ludzkość w \nkierunku wykorzystania potencjału całego wszechświata.','','terraformacja-marsa-ekspedycja-ares','','','','Terraformacja Marsa: Ekspedycja Ares','','','',''),(670,1,1,'None','','civilization-nowy-pocztek-terra-incognita','','','','Civilization: Nowy początek Terra Incognita','','','',''),(671,1,1,'Drugie \nwydanie Great \nWestern Trail to powrót na polski rynek kultowej gry \nstrategicznej Alexandra Pfistera, wzbogaconej o nowe mechanizmy oraz elementy. \nGra, która już w pierwszej edycji była bestsellerem teraz stała się jeszcze \nlepsza!','','great-western-trail-druga-edycja','','','','Great Western Trail (druga edycja)','','','',''),(672,1,1,'Dodatek \n zawiera dwustronną planszę przedstawiającą 2 regiony na Marsie.','','terraformacja-marsa-hellas-i-elysium','','','','Terraformacja Marsa: Hellas i Elysium','','','',''),(673,1,1,'Obwieszczenie \no terraformacji:','','terraformacja-marsa','','','','Terraformacja Marsa','','','',''),(674,1,1,'Witajcie \nw Zielonym Jarze, królestwie rządzonym przez wspaniałomyślnego Wiekuistego \nKróla. W swojej niezmiernej dobroci Król wydał dekret, którego efektem będzie \nzakładanie nowych osad poza granicami Królestwa. Do każdego z tych miejsc \nwybranych zostało sześcioro wyjątkowych mieszczan, którzy dzięki swoim bardzo \nprzydatnym umiejętnościom staną się pionierami w tych jakże odległych regionach. \nKról obiecał nagrodę dla tego, który przyczyni się do rozwoju regionu w \nnajwiększym stopniu, nagradzając go Wieczną Chwałą!','','charterstone','','','','Charterstone','','','',''),(675,1,1,'','','charterstone-recharge-pack','','','','Charterstone: Recharge Pack','','','',''),(676,1,1,'','','wyspa-skye','','','','Wyspa Skye','','','',''),(677,1,1,'W \ngrze 5 sekund bez cenzury pytania zostały przygotowane z myślą o pełnoletnich \ngraczach, a odpowiedzi na nie nie obejdą się bez dwuznacznych aluzji.','','5-sekund-bez-cenzury','','','','5 Sekund: Bez cenzury','','','',''),(678,1,1,'Czółko, \n czyli cztery kategorie, piętnaście trybów rozgrywki i nowość! Wariant  \nBombowy!','','czko','','','','Czółko!','','','',''),(679,1,1,'\n\n\n\nVEGAS \ndodatek do bestsellerowej gry planszowej RYZYK FIZYKCo \nwydarzyło się w Vegas, zostaje w Vegas!Do \nrozgrywki jest potrzebna podstawowa gra Ryzyk Fizyk.Ze \nwzględu na tematykę wielu pytań dodatek jest odpowiedni dla dorosłych graczy. \nIle wynosi suma wszystkich liczb na polach ruletki? Jaki procent Polaków śpi \nnago?W \ntym dodatku zebrano imprezowe, ciekawe i często pikantne pytania skierowane do \ndorosłych graczy. Dodatkowa dwustronna plansza wprowadza nowe pola do \nobstawiania oraz punktacji.Zestaw \nzawiera także plastikowy podajnik na pytania, z którego wygodnie będzie \nkorzystać w trakcie gry.\n','','ryzyk-fizyk-dodatek-vegas','','','','Ryzyk Fizyk, dodatek Vegas','','','',''),(680,1,1,'Gracze \nkolejno wykładają karty. Gdy na kartach 2 graczy pojawi się ten sam obrazek, \nnastępuje pojedynek! Jak najszybciej podaj wtedy hasło z kategorii znajdującej \nsię na karcie przeciwnika! Wygraj jak najwięcej pojedynków!','','na-kocu-jzyka','','','','Na końcu języka','','','',''),(681,1,1,'Gracze \n kolejno wykładają karty. Gdy na kartach 2 graczy pojawi się ten sam obrazek, \n następuje pojedynek!','','na-kocu-jzyka-2','','','','Na końcu języka 2','','','',''),(682,1,1,'Doskonała gra towarzyska w pikantnym \n wydaniu!Czółko: Bez cenzury to kultowa gra \n towarzyska dla dorosłych w wersji karcianej! Lepiej nie zaczynaj, jeśli nie \nmasz  osiemnastki na karku!','','czko-bez-cenzury','','','','Czółko: Bez cenzury','','','',''),(683,1,1,'Szukaj par wśród symboli z gier planszowych!Specjalne \nwydanie gry Miszmasz!, stworzone w hołdzie dla gier planszowych! Każdy ze wzorów \nnawiązuje do jednej ze 119 gier – czy uda Ci się rozpoznać je wszystkie?','','miszmasz---gramy','','','','Miszmasz! - Gramy','','','',''),(684,1,1,'','','alias-original','','','','Alias Original','','','',''),(685,1,1,'','','alias-kobiety-vs-mczyni','','','','Alias: Kobiety vs Mężczyźni','','','',''),(686,1,1,'Lubisz \nadrenalinę? Polubisz 5 sekund! Zmierz się z \nczasem w nowej grze towarzyskiej, w której szybko myślisz i szybko mówisz.','','5-sekund','','','','5 Sekund','','','',''),(687,1,1,'Zapraszamy \ndo nietypowej gry moralnych dylematów i trudnych wyborów! Usiądźcie w okręgu w \ngrupie od 4 do 15 osób i rozdajcie każdemu z graczy po 2 karty do głosowania \n(“A” oraz “B”). Wybierzcie talię, którą będziecie grali oraz tego, kto \nrozpocznie zabawę.','','dylematy','','','','Dylematy','','','',''),(688,1,1,'','','stwory-z-obory','','','','Stwory z obory','','','',''),(689,1,1,'Każdy \ngracz zakłada na głowę opaskę z kartą. Zawodnik rozgrywający rundę wyjaśnia \nkolejno każdemu, czyj wizerunek przedstawiony jest na jego karcie. Zwycięży ten, \nkto zajdzie najdalej!','','alias-ja-to-kto','','','','Alias: Ja to kto?','','','',''),(690,1,1,'Napęd CD, pierwszy dodatek do genialnej słownej gry towarzyskiej Decrypto, \nwprowadza nową mechanikę prowadzącą do zwycięstwa. Świat komunikacji wkracza w \nnową erę dzięki napędowi CD. Na początku każdej rundy gracze odkrywają kartę \nNapędu, która wskazuje kategorię, do której Szyfrant musi dostosować chociaż \njedną ze swoich 3 wskazówek. Jeśli żadna wskazówka nie odpowiada kategorii, \ndrużyna otrzymuje żeton Porażki. Jeśli wszystkie wskazówki odpowiadają \nkategorii, drużyna zyskuje żeton Lasera. Na koniec każdej rundy drużyna może \npostanowić wydać  2 żetony Lasera, aby spróbować odgadnąć Słowo Kluczowe \ndrużyny przeciwnej i zdobyć żeton Sukcesu. Dodatek zawiera 54 karty Napędu \n(kategorie) i zapewnia jeszcze większą regrywalność Decrypto.','','decrypto-napd-cd','','','','Decrypto: Napęd CD','','','',''),(691,1,1,'Zamówienie złożone - czas na pokaz przygotowania sushi!','','maki-stack','','','','Maki Stack','','','',''),(692,1,1,'Przygotowane \nspecjalnie z myślą o najmłodszych graczach wydanie gry 5 sekund! Z pewnością bez trudu jesteś w \nstanie wymienić 3 smaki dżemu - ale czy dasz radę zrobić to pod presją czasu? \nMasz 5 sekund, a pozostali gracze tylko czekają na Twoje potknięcie! Czas nie \njest Twoim sprzymierzeńcem, dlatego mówisz co ci ślina na język przyniesie. \nPodajesz czasem dziwaczne, czasem śmieszne odpowiedzi, podczas gdy kulki szybko \nmkną w dół spirali specjalnego czasomierza. Jeśli pytanie sprawia ci kłopot - \nwykorzystujesz karty \"Czasu\" lub \"Zmiany\". Na żółtej stronie kart znajdują się \npytania dla młodszych dzieci, a na czerwonej dla starszych. 5 sekund - szalona i \nzabawna gra teraz w wersji junior! Nagroda Główna w konkursie \n\"Świat przyjazny dziecku\" organizowanym przez Komitet Ochrony Praw Dziecka w \nkategorii \"Zabawka dla dzieci w wieku 3-7 lat\".','','5-sekund-junior','','','','5 Sekund: Junior','','','',''),(693,1,1,'Do \nPolski zawitał największy bestseller gier oryginalnie wydanych przez kampanie \ncrowdfundingowe. Gra, która jeszcze przed wydaniem stała się hitem. W czym tkwi \ntajemnica jej sukcesu? No cóż, jeśli nie wiadomo o co chodzi, to chodzi o koty \n:)','','eksplodujce-kotki','','','','Eksplodujące Kotki','','','',''),(694,1,1,'Nowa \nwersja popularnej gry imprezowej, stworzona w poszanowaniu środowiska. Pudełko \nzostało przeprojektowane w taki sposób, by ograniczyć zużycie plastiku do \nminimum. Główny element gry, czyli totem, wykonany jest z drewna produkowanego w \nJurze we Francji i posiada certyfikat PEFC. Gra zawiera również woreczek z \nbawełny z upraw ekologicznych, posiadającej certyfikat GOTS. Elementy papierowe, \ntakie jak karty, instrukcja i samo opakowanie również zostały wykonane w sposób \nzoptymalizowany i posiadają certyfikat FSC.','','jungle-speed-eco-2020','','','','Jungle Speed: Eco (2020)','','','',''),(695,1,1,'Czółko: \nJunior to rodzinna edycja popularnej gry towarzyskiej \nCzółko, w której gracze odgadują hasła za pomocą pytań. W Czółko Junior mogą \nzagrać już dzieci od 6 lat. Na ilustrowanych kartach jest aż 330 haseł w 8 \nkategoriach, dzięki czemu gra zapewni długą zabawę dla całej rodziny.','','czko-junior','','','','Czółko Junior','','','',''),(696,1,1,'Dylemat \nwagonika to imprezowa gra karciana przeznaczona dla \nosób pełnoletnich. Łączy filozoficzne rozważania z krwawą jatką i zmusza \nuczestników do podejmowania trudnych moralnie decyzji. ','','dylemat-wagonika','','','','Dylemat wagonika','','','',''),(697,1,1,'','','munchkin-cthulhu-4---pomylone-pieczary','','','','Munchkin Cthulhu 4 - Pomylone Pieczary','','','',''),(698,1,1,'Jeszcze więcej pyszniutkich mózgów do zjedzenia.......jeszcze więcej \n Potworów do pokonania, jeszcze więcej Lochów do zwiedzenia! Munchkin Zombie 3/4 \n - Ręka, Noga, Mózg w Kanale to 55 nowych kart Drzwi i Skarbów, 20 kart Lochów \n oraz 16 Portali! Wykorzystaj nową Moc, Solo, i pokaż innym zombiakom z dzielni, \n kto tu rządzi. Złap Części Zamienne, załóż Rękawice do Kręgli i dopadnij \nTwojego  Byłego Współlokatora. A to wszystko w Biurowcu Żywych Trupów lub Barze \nSzybkiej  Śmierci! Łapiesz klimat?','','munchkin-zombie-34---rka-noga-mzg-w-kanale','','','','Munchkin Zombie 3/4 - Ręka, Noga, Mózg w Kanale','','','',''),(699,1,1,'','','list-miosny-edycja-premium','','','','List miłosny (edycja premium)','','','',''),(700,1,1,'Punto to \ngra, w której starasz się stworzyć linię z 4 lub 5 kart. Tyle że nie zawsze \nmożesz umieszczać je tam, gdzie chcesz!','','punto-pl','','','','Punto PL','','','',''),(701,1,1,'','','the-resistance---wrogie-zamiary--tajne-cele','','','','The Resistance - Wrogie zamiary & tajne cele','','','',''),(702,1,1,'Stań do walki o losy wszechświata w tej szybkiej grze karcianej wymagającej \n umiejętności dedukcji i gotowości do podejmowania ryzyka!','','marvel-rkawica-nieskoczonoci','','','','Marvel: Rękawica Nieskończoności','','','',''),(703,1,1,'Ostrzeżenie: \nta gra jest bardzo uzależniająca! Nie jest przeznaczona dla żółtodziobów, \nczerwonokrwistych, zielonych z zazdrości, bezbarwnych, czarnowidzących i \nnoszących różowe okulary...','','color-addict-pl','','','','Color Addict PL','','','',''),(704,1,1,'ZAŁOGA STATKU PIRACKIEGO \nWYBRAŁA NOWEGO KAPITANA. TO WŁAŚNIE TEN CZŁOWIEK BĘDZIE TWOIM GWARANTEM SUKCESU… \nALBO KLĘSKI. NA SZCZĘŚCIE MASZ NA TO WPŁYW – MOŻESZ WYWOŁAĆ BUNT, KTÓRY SPRAWI, \nŻE TO TY ZOSTANIESZ KAPITANEM!','','jolly-roger--piracka-gra-o-upach-i-buntach','','','','Jolly Roger- Piracka Gra o Łupach i Buntach','','','',''),(705,1,1,'Zbieraj \nbycze głowy, ale tylko te odpowiednie! Gracze starają się zebrać jak najwięcej \nzielonych byczych głów, które dają punkty dodatnie. Jednocześnie próbują unikać \nzbierania czerwonych byczych głów, które oznaczają punkty ujemne. Warto też \nzwracać uwagę na karty specjalne, które dają dodatkowe punkty.','','5-bierze','','','','5. bierze!','','','',''),(706,1,1,'\n\n\n\nMystic Vale Big Box zawiera grę \nbazową Mystic Vale oraz 3 dodatki: Dolina Magii, Dolina Dziczy i Burza Many. \nMystic Vale to innowacyjna gra karciana w której gracze przewodzą klanami \ndruidów starającymi się ściągnąć klątwę ze swojej doliny. W tej grze \nstrategicznej nie tylko budujemy swoje talie, ale też same karty – bardzo \nciekawa pozycja dla wielbicieli karcianek.\n','','mystic-vale-big-box','','','','Mystic Vale Big Box','','','',''),(707,1,1,'\n\n\n\nNadchodzi Ragnarök, spełnia się przepowiadany zmierzch bogów. Czy nic nie \nda się już zrobić? Norny, trzy boginie losu, w wirujących wodach Urðr dostrzegły \npromień nadziei. Grupa bohaterów musi połączyć swe siły w walce ze śmiertelnym \nwrogiem.God of War: Gra karciana to kooperacyjna gra karciana oparta na \nserii kultowych gier wideo. By powstrzymać koniec świata, będziecie musieli \nzaprzeczyć własnemu przeznaczeniu. Czeka na Was sześciu bohaterów znanych z \nkultowej serii. Wcielicie się w potężnego Kratosa, zręcznego Arteusa albo Freyę, \nwładczynię pradawnej magii. Każdy z Was będzie dysponował własną, niepowtarzalna \ntalią. Rozgrywka to nie jeden scenariusz, lecz kilka połączonych ze sobą \nhistorii, które sami wybierzecie. Pamiętajcie, koniec jest bliski, a Wy nie \nmacie wyboru. Jeżeli nie znajdziecie swoich wrogów, oni znajdą \nWas.Atuty:Kooperacyjna gra karciana oparta na kultowej serii God of \nWar.Sześciu bohaterów do wybory z indywidualnymi kartami startowymi i \nmechaniką budowania talii.Niepowtarzalna rozgrywka, w której gracze sami \nwybierają kolejne rozdziały historii.\n','','god-of-war','','','','God of War','','','',''),(708,1,1,'Chcieliście więcej Munchkina, oto i On!  \nDodatek zawiera 110 kart do legendarnej gry karcianej MUNCHKIN, w której \n oszukujesz kumpli, zabijasz potwory i zgarniasz ich skarby, bez tego całego \n durnego odgrywania postaci! Zagraj nową rasą - Gnomem! Spróbuj \nszczęścia  w nowej klasie Barda! Staw czoła wzbudzającemu popłoch u \nnowobogackich  Janosikowi, wbij jego Ciupagę w plecy szalejącego po Żoliborzu \nŻelkowego Golema,  Rzuć Pokurcza w wir walki ze śmierdzącymi Utytłanymi Gotami, \nzagraj hymn  pochwalny z Wielką Orkiestrą Potwornej Mocy i znajdź w kupie \nskarbów tajemniczy  Talizman z Magdą i Mieciem, a munchkinowa chwała stanie się \nTwoim udziałem! No i  zostaniesz zapamiętany jako bohater...przynajmniej do \nnastępnej Potwornej Partii  Munchkina! Dodatek Munchkin 3 zawiera \nunikatowe karty, stworzone  specjalnie na potrzeby polskiej \nedycji!','','munchkin-3---kardynalne-bdy','','','','Munchkin 3 - Kardynalne Błędy','','','',''),(709,1,1,'\n\n\n\nGra karciana, składająca się ze 108 kart w 4 różnych kolorach oraz kart \nakcji. Celem gry jest jak najszybsze pozbycie się kart w każdej rundzie i \nzdobycie punktów za karty, które zostały w rękach innych graczy. Zwycięża gracz, \nktóry jako pierwszy zdobędzie 500 punktów. Po wyłożeniu przedostatniej karty \ngracz musi krzyknąć UNO, tzn. jeden. Jeśli nie krzyknie i zostanie przyłapany, \nbierze kolejne karty.\n','','uno','','','','Uno','','','',''),(710,1,1,'Światem Tygla, niczym morską tonią, rządzą \nprzypływy i odpływy. Podczas gdy jedne stworzenia znikają z naszych oczu, inne \npojawiają się znikąd wraz z kolejną falą i przynoszą zupełnie nową jakość. A gdy \nzajrzysz w głębiny, kogo ujrzysz w mrocznej ciemności? Nadchodzi przypływ, a \nwraz z nim zbliża się zupełnie nowa era, która zmieni Tygiel na zawsze!','','keyforge-mroczny-przypyw---talia-archonta-deluxe','','','','KeyForge: Mroczny przypływ - Talia Archonta deluxe','','','',''),(711,1,1,'Uzbrojeni i niebezpieczni: tak nowi rewolwerowcy przybywają do miasta, z\n palcami świerzbiącymi na spustach rewolwerów. Nie wspominając o ładunku nowych \ndóbr, które przybyły wraz z nimi. Zawiera on wiele niespodzianek: wyśmienitą \nbroń, potężne wyposażenie i zabójczą amunicję... kart niebezpieczeństwa. Jednak \nmożliwość ich użycia jest ograniczona i jeśli nie będziesz wystarczająco szybki, \nby z nich skorzystać, twoi przeciwnicy na pewno będą!','','bang-uzbrojeni-i-niebezpieczni','','','','BANG! Uzbrojeni i Niebezpieczni','','','',''),(712,1,1,'DINOZAURY! \nWRRRRRRRRRRRRRR!Nie-tak-bardzo-dzielni poszukiwacze przygód będą \nmusieli się zmierzyć z najwredniejszymi potworami z prehistorii! Tym razem nie \nbędzie potrzeba asteroidy, by dinozaury wyginęły, wystarczą głodne poziomów \nmunchkiny!Zmierz się ze straszliwym \nKaczkodontem, rymującym Mezoraptorem i uciekaj przed Wrednozauresm! Ale i tak \nwszystko na nic, gdy dopadnie cię Prehisteria!','','munchkin-9---dinoary-nie-wymary','','','','Munchkin 9 - Dinożarły Nie Wymarły','','','',''),(713,1,1,'CENTAURY I JASZCZUROLUDZIE!','','munchkin-8---p-konia-a-ucignie','','','','Munchkin 8 - Pół Konia, a Uciągnie','','','',''),(714,1,1,'KOCHASZ ŁĄCZYĆ WSZYSTKIE SWOJE MUNCHKINY?Im dziwniejsze połączenia, tym lepiej! Teraz \nmożesz grać w swojego wymarzonego Gwiezdnego Munchkina Cthulhu Zombie z \nKaraibów!Munchkin 7 - Oszukując oburącz \nzostał stworzony do mega rozgrywek, w których wszystkie chwyty są dozwolone, \nkażda talia jest w grze i żadne kombo nie jest zbyt dziwne. Po co być Super \nMunchkinem, skoro możesz być Ultra Munchkinem?Jeśli \nbycie Mieszańcem Ci nie wystarcza, zostań Wielorasowcem. A jeśli Kanciarz to za \nmało - Kantuj, Jakby Jutra Miało Nie Być!W \ntym dodatku pojawia się sporo Wzmocnień Przedmiotów i Wzmocnień Potworów… oraz \nnowy typ kart, Wzmocnienia Wzmocnień! Cała masa słabych Potworów pozwoli Ci na \nszybkie zdobycie poziomów. Chyba że ktoś weźmie tę Skarpecynkę i zmieni ją w \nUber-Rzadką, Ekstremalnie Szczwaną Skarpecynkę Z Dodatkowym Serem!Munchkin \n7 - Oszukując oburącz był częścią większego dodatku Munchkin 7/8… ale to było \nkiedyś.','','munchkin-7---oszukujc-oburcz','','','','Munchkin 7 - Oszukując Oburącz','','','',''),(715,1,1,'Świat stopniowo pogrąża się w mroku, a pod jego osłoną \nzło posuwa się naprzód. Wolnir, zwany Wielkim Władcą, upomina się o swoje \ndziedzictwo, a w jego cieniu kroczą inni – splugawieni słudzy ciemności zabrali \ngłos. Dark Souls: \nThe Card Game to \nkooperacyjna gra karciana Davida Carla (seria Warmachine). Kultowy tytuł wideo wreszcie trafia na \nstół!','','dark-souls-gra-karciana','','','','Dark Souls: Gra karciana','','','',''),(716,1,1,'Z \n tym dodatkiem będziesz miał jeszcze więcej frajdy \nsprowadzając Apokalipsę \n na świat! 106 nowych kart do Munchkina Apokalipsy da Ci jeszcze \n więcej możliwości. Wyposaż swoją postać w Amerykański Topór i Ketchup \n w Sprayu, by pokonać Mrozistów! Wykorzystaj Bombowy Kostium i Podręcznik \n Przetrwania albo przez Media Niespołecznościowe umrzesz zbyt \n szybko! Wystrzegaj się nowych Katastrof i przerażających \n nowych Pieczęci. \n Zostań Hardkorem! Ta klasa postaci jest idealna dla prawdziwego \n Munchkina!','','munchkin-apokalipsa-2---inwazja-owcych-ed-jubileu','','','','Munchkin Apokalipsa 2 - Inwazja Owcych Ed. Jubileu','','','',''),(717,1,1,'Aeon’s \n End to kooperacyjna gra karciana oparta o mechanikę  \n budowania talii, w której karty na żadnym etapie nie są tasowane, a zmienna  \nkolejność tur graczy symuluje chaos bitwy. Gracze podejmują znaczące decyzje  \npoprzez zarządzanie swoją talią.','','aeons-end-druga-edycja','','','','Aeon\'s End (druga edycja)','','','',''),(718,1,1,'\n\n\n\nAeon’s \n End Legacy to samodzielna kooperacyjna gra karciana w świecie fantasy dla 1-4 \n osób zawierająca kampanię z elementami legacy i oparta na popularnej grze \nAeon’s  End. Na graczy czeka 7 rozdziałów z nowymi przygodami, kartami i \nNemezis. Z  upływem gry zasady będą się zmieniać, a na karty instrukcji trafią \nkolejne  naklejki modyfikujące rozgrywkę. Decyzje podjęte w pierwszej rozgrywce, \nbędą  miały wpływ na przyszłe gry w kampanii. Postaci nauczą się nowych mocy i \n efektów, których będą mogły wykorzystać do rozgrywki w innych grach Aeon’s End \n po zakończeniu kampanii.RozgrywkaAeon’s \n End: Legacy to kooperacyjna gra karciana, oparta o mechanikę budowania talii, w \n której karty na żadnym etapie nie są tasowane. Celem graczy jest pokonanie \n Nemezis, zanim zniszczy ono Gravehold, lub zanim broniący go Magowie Bram padną \n z wyczerpania. Podczas każdej rundy, gracze i Nemezis rozgrywają swoje tury w \n losowej kolejności (zgodnie z kartą wyciągniętą z Talii Tur). Podczas ich \n trwania, gracze mogą aktywować Zaklęcia, pozyskiwać Klejnoty, Artefakty oraz \n Zaklęcia z rynku zasobów oraz manipulować swoimi Bramami. Każda z dołączonych \ndo  gry Nemezis, charakteryzuje się odmiennymi akcjami, jakie podejmuje w \ntrakcie  swojej tury i wymaga od graczy wypracowania innej strategii, aby ją  \npokonać. \n\n\n\n\nAtuty:       \n      \n\n\n▪\nEdycja \n                        legacy popularnej gry karcianej, w której rozgrywasz \n            dużą przygodę              podzieloną na 7 \n      rozdziałów\n\n\n\n▪\nNowe \n                        Nemezis do pokonania wraz z nowymi taliami kart o \n            lepszej jakości             względem \ntradycyjnych\n\n\n\n▪\nNowe \n                        arkusze Magów z umiejętnościami do odblokowania w \n            kolejnych             rozdziałach \n\n\n\n\nWażne:Aeon\'s End: Legacy jest drukowany w       \n      oryginalnej drukarni wraz z macierzystymi angielskimi egzemplarzami. W     \n        związku z tym, polskie wydanie będzie miało karty różniące się gramaturą \n             papieru w stosunku do polskiego wydania Aeon\'s End oraz Aeon\'s End \n      Wieczna       Wojna. Może to delikatnie utrudnić łączenie Aeon\'s End \n      Legacy z zestawem       Aeon\'s End oraz Aeon\'s End Wieczna \n   Wojna.\n','','aeons-end-legacy-edycja-polska','','','','Aeon\'s End: Legacy (edycja polska)','','','',''),(719,1,1,'Stań do walki przeciwko nienazwanemu \nzłu!','','aeons-end-otcha','','','','Aeon\'s End: Otchłań','','','',''),(720,1,1,'Stań do walki przeciwko nienazwanemu \nzłu!','','aeons-end-niezbadany-mrok','','','','Aeon\'s End: Niezbadany Mrok','','','',''),(721,1,1,'Core game: - 1 x Rulebook - 1 x The Mission Book - 8 x Map tiles - 8 x Corridor tiles - 14 x Plastic doors - Hero models (B.J. Blazkowicz, Anya   Oliwa, Set Roth, Bombate, Max Hass, Klaus Kreutz) - Enemy models (8 x Soldat, 8 x Space   Marine, 4 x Supersoldat, 3 x Panzerhund, 6 x Officer, 8 x Drone, 4 x   Übersoldat, 2 x Fire Trooper, 2 x Rocket Trooper) - Boss models (Professor Solomon Bevli,   General Oscar von Grim, Mecha-Hitler, Adolf Hitler) - 12 x Custom attack dice (D12) - 62 x Equipment cards - 14 x Chest cards - 6 x Heroes cards - 51 x Enemy cards - 31 x Weapon cards - 20 x Event cards - 24 x Hit Points tokens (1HP, 2HP,   3HP) - 24 x Armor tokens (1, 2, 3) - 8 x Shared Life tokens - 5 x Stun tokens - 8 x Reload tokens - 4 x Fatigue tokens - 8 x Chest tokens - 5 x Event tokens - 1 x Heroes spawn tokens (A, B, C, D) - 1 x Nazi spawn tokens (A, B, C, D) - 1 x Mission Objective tokens (A, B, C,   D) - 32 x Glory Point tokens - 12 x Light ammo tokens - 12 x Heavy ammo tokens - 12 x Special ammo tokens - 8 x Noise tokens - 1 x AI Controller token - 2 x Secret Passage tokens (A, B, C) - 4 x Barricade - 4 x Difficult Area tokens - 1 x Shoshanna token - 2 x Power Suit token - 2 x Sabotage token - 1 x Hazard Tracker - 1 x Round Tracker - 4 x   Plastic event tokens - 4 x   Plastic chest tokens - 4 x   Plastic noise tokens - 4 x   Difficult area tokens - 4 x   Character dashboards - 1 x   Plastic Mission Objective tokens (A, B, C, D) - 1 x   Plastic Nazi spawn tokens (A, B, C, D) - 1 x   Plastic Heroes spawn tokens (A, B, C, D) - 2 x   Plastic Secret Passage tokens (A, B, C) - 12 x   Plastic Light ammo tokens - 12 x   Plastic Heavy ammo tokens - 12 x   Plastic Special ammo tokens -   Plastic tray','','wolfenstein-the-board-game-en','','','','WOLFENSTEIN: THE BOARD GAME EN','','','',''),(722,1,1,'Czy zdołasz powstrzymać inwazję hordy \nciemności?','','aeons-end-czelucie','','','','Aeon\'s End: Czeluście','','','',''),(723,1,1,'Stań do walki przeciwko nienazwanemu \nzłu!','','aeons-end-bezimienni','','','','Aeon\'s End: Bezimienni','','','',''),(724,1,1,'Astronauci \n poszukiwani! Naukowcy twierdzą, że na skraju Układu Słonecznego istnieje \n tajemnicza dziewiąta planeta. Jednak mimo usilnych prób, jak na razie nie udało \n się znaleźć jednoznacznych dowodów na jej istnienie. Dołącz do \nekscytującej  ekspedycji kosmicznej, mającej na celu ustalenie, czy te teorie to \ntylko  mrzonki, czy może naprawdę uda się odkryć Dziewiątą Planetę.','','zaoga---w-poszukiwaniu-dziewitej-planety','','','','Załoga - W poszukiwaniu dziewiątej planety','','','',''),(725,1,1,'Pora \nskoczyć na głęboką wodę! Zostaliście zaproszeni do udziału w niesamowitej \nekspedycji w morskie odmęty. Głęboko pod powierzchnią natrafiono na pradawne \nartefakty i to wy musicie wyruszyć, by odkryć ich pochodzenie. Wasi mocodawcy \nnie mówią wam jednak wszystkiego. Sami musicie zanurzyć się w nieznane, by móc \nrozwikłać tę zagadkę. ','','zaoga-wyprawa-w-gbiny','','','','Załoga: Wyprawa w Głębiny','','','',''),(726,1,1,'None','','marvel-united-rise-of-the-black-panther-edycja-polska','','','','Marvel United: Rise of the Black Panther (edycja polska)','','','',''),(727,1,1,'None','','marvel-united-tales-of-asgard-edycja-polska','','','','Marvel United: Tales of Asgard (edycja polska)','','','',''),(728,1,1,'W \ngrze wspólnie zarządzacie ruchem pociągów w centrum Europy i Ameryce Północnej, \nw zależności którą stronę planszy wybierzecie. Waszym zadaniem będzie \nprzetransportować towary z różnych miast do ich punktów docelowych. W tym celu \ntrzeba użyć specjalnych szybkich ruchów przy pomocy kości. Za pomocą kart akcji \nustalicie miejsca w których będą rozmieszczone semafory i światła dzięki którym \npociągi obiorą odpowiednią trasę do celu. W każdej rozgrywce pojawią się \npomocnicy, którzy będą Was wspierać Was specjalnymi umiejętnościami.','','zwrotnice-i-semafory','','','','Zwrotnice i semafory','','','',''),(729,1,1,'Ta plaga pochodzi z piekieł. ','','bloodborne-gra-planszowa','','','','Bloodborne: Gra planszowa','','','',''),(730,1,1,'Machina \nArcana to kooperacyjna gra planszowa w klimacie \nhorroru, osadzona w steampunkowym uniwersum i przeznaczona dla 1-4 graczy. W jej \ntrakcie uczestnicy wcielają się w odkrywców penetrujących tajemnicze podziemia i \nstawiających czoła istotom inspirowanym Mitologią Cthulhu autorstwa H.P. \nLovecrafta. Rozgrywka opiera się na idei dungeon crawlera, a fabuła jest \nscenariuszowa - każda osobna przygoda obejmuje szereg pięknie zilustrowanych \nkart, które prowadzą graczy naprzód, a także charakteryzuje się unikatowymi \nzestawami kart Grozy i odkrywców.','','machina-arcana-edycja-polska','','','','Machina Arcana (edycja polska)','','','',''),(731,1,1,'Przeżyj \nniesamowitą przygodę i odkryj moc przyjaźni, lojalności i prawdziwej magii w tej \nnowej edycji gry Talisman!','','talisman-harry-potter','','','','TALISMAN: HARRY POTTER','','','',''),(732,1,1,'\n\n\n\nWitaj \nponownie w świecie Sword &amp; Sorcery… W rozszerzeniu Sword &amp; Sorcery \nNadejście mroku ścieżka prowadzi bohaterów ku finałowi, który zaważy o ich \nlosie. Mrok zalega w całej krainie, bramy cmentarzy staja otworem, a \nnieśmiertelni bohaterowie muszą zmierzyć się teraz z wrogami, którzy ignorują \nból i nigdy nie śpią… nieumarłymi, a właściwie cała ich armia! Szkielety, \nwampiry i wilkołaki pojawiają się wszędzie… Czy bohaterowie wypełnia swa misje \ni ostatecznie uwolnią dusze od czaru klejnotów dusz? Poznaj zakończenie \nepickiej kampanii bohaterów dzięki zadaniom z tego rozszerzenia, które obejmuje \nzupełnie nowy AKT legendarnej sagi. Czekaja na Ciebie zdolności z najwyższych \npoziomów duszy, skarby oraz wymagający wrogowie! Przygotuj się na najbardziej \nwciągające i chwalebne doświadczenie w krainie Sword &amp; \nSorcery!\n','','sword--sorcery-nadejcie-mroku','','','','Sword & Sorcery: Nadejście mroku','','','',''),(733,1,1,'None','','marvel-united-enter-the-spider-verse-edycja-polska','','','','Marvel United: Enter the Spider-Verse (edycja polska)','','','',''),(734,1,1,'','','sherlock-holmes---detektyw-doradczy-01','','','','Sherlock Holmes - Detektyw Doradczy 01','','','',''),(735,1,1,'3 fascynujące przygody w jednym pudełku','','unlock-wielka-ucieczka','','','','Unlock! Wielka Ucieczka','','','',''),(736,1,1,'List „Drogi szefie” został dostarczony do \nLondyńskiej Centralnej Agencji Informacyjnej w czwartek, 27 września 1888 roku. \nDwa dni później został przekazany Scotland Yardowi. Został zapisany czerwonym \natramentem i zawierał tyle makabrycznych szczegółów, że nie można go było \nzignorować. Autor listu podpisał się jako Kuba rozpruwacz. Koszmar z Whitechapel \nzyskał imię. Imię, które na zawsze odciśnie krwawe piętno w annałach tej \ndzielnicy.','','listy-z-whitechapel---drogi-szefie','','','','Listy z Whitechapel - Drogi szefie','','','',''),(737,1,1,'None','','wampir-maskarada---dziedzictwo','','','','Wampir Maskarada - Dziedzictwo','','','',''),(738,1,1,'Klasyczne \nszachy to gra logiczna znana na całym świecie, w którą rozgrywane są turnieje, a \nnajlepsi zawodnicy cieszą się sławą i uznaniem.Szachy \nto klasyczna gra strategiczna wymyślona już ok 6 wieku n.e. Na 64 - polowej \nszachownicy gracze prowadzą prawdziwą wojenną potyczkę, która ma doprowadzić do \nobalenia króla. Zestaw sklada się z dwóch 16 elementowych armii.Pionki \nsą bardzo ladnie wykończone w klasycznym stylu. Oczywiście z drewna ! Dodatkowo \nich spód wykończony jest miękkim materiałem. Nie będą rysowaly planszy i lepiej \nbędą się trzymać podłoża.Wspaniała \nzabawa zarówno dla dzieci i dla rodziców. Gra rozwija zdolności logiczne dziecka \ni może stać się prawdziwym hobby. Kto z nas nie chiałby zostać Arcymistrzem \nszachów ?','','drewniane-szachy','','','','Drewniane szachy','','','',''),(739,1,1,'Anglia, \nrok 1558. Katedra w Kingsbridge wciąż jeszcze dumnie wznosi się nad miastem. \nJednak konflikt między katolikami i protestantami dogłębnie dzieli Europę. Pół \nkontynentu zmaga się z zamieszkami. Sprytnie wykorzystując religijny układ sił, \ngracze starają się nawiązywać kontakty z ważnymi osobistościami europejskiego \nspołeczeństwa i poszerzać swoje wpływy. Nieustannie dochodzi do próby sił, a ci, \nktórzy przegrają, nierzadko są zmuszani do opuszczenia swojego kraju.','','sup-ognia','','','','Słup Ognia','','','',''),(740,1,1,'Zadaniem \ngraczy będzie uszycie wygodnego i dobrze wyglądającego kocyka dla swoich kotów. \nGracze używają do tego kafelków przedstawiających skrawki materiału w różnych \nkolorach i wzorach i umieszczają je na swojej planszetce. Gracze starają się \nułożyć materiały w takie wzory, by przyciągnąć uwagę najbardziej milusińskich \nkotów i dobrać taką kolorystykę, by dopasować do niej fikuśne guziki. Niech nie \nzmyli Was wygląd.','','calico','','','','Calico','','','',''),(741,1,1,'Patchwork \nto metoda szycia, w której łączy się małe kawałki materiału w większą całość, \ntworząc nowy wzór. W przeszłości wykorzystywano ją, żeby zagospodarować \nniechciane ścinki i skrawki.','','patchwork','','','','Patchwork','','','',''),(742,1,1,' ','','gejsze','','','','Gejsze','','','',''),(743,1,1,'Abalone \nto fascynująca gra, w której proste zasady łączą się z niezliczoną mnogością \nmożliwości, a do tego... kontaktem z fantastycznie wykonanymi elementami \ngry!','','abalone-classic-nowa-edycja','','','','Abalone Classic (nowa edycja)','','','',''),(744,1,1,'','','dog-pile','','','','Dog Pile','','','',''),(745,1,1,'None','','pstryk','','','','Pstryk!','','','',''),(746,1,1,'Rój jest grą logiczną dla 2 graczy. Celem gry jest otoczenie królowej przeciwnika. Każdy gracz ma 11 płytek przedstawiających 5 różnych owadów. Gracze wykonują swoje ruchy na zmianę. W swoim ruchu mogą albo dołożyć owada do roju, albo przesunąć jedną z wcześniej zagranych płytek. Każda płytka posiada unikalny sposób poruszenia (jak w szachach) naśladujący ruch przedstawionego na niej owada. Na przykład, konik polny jest jedynym owadem potrafiącym przeskakiwać inne płytki. Proste reguły i ogromna ilość dostępnych kombinacji sprawiają, że Rój jest prawdziwym wyzwaniem dla graczy ceniących sobie intelektualną rozrywkę. Gracze muszą wykazać się umiejętnościami strategicznego planowania, taktycznego myślenia i wyobraźni przestrzennej. Kluczem do zwycięstwa jest sprytne atakowanie królowej przeciwnika i pozostawienie wystarczających odwodów do obrony własnej.Elegancka torba służąca do przechowywania płytek sprawia, że grę łatwo się przenosi i przechowuje, a niewielkie rozmiary i brak planszy umożliwiają rozgrywkę praktycznie w każdym miejscu.','','rj','','','','Rój','','','',''),(747,1,1,'','','3w1-szachy-warcaby-i-mynek','','','','3w1 szachy, warcaby i młynek','','','',''),(748,1,1,'','','fikolo','','','','Fikolo','','','',''),(749,1,1,'Z nadejściem XX wieku następuje rozwój sieci \nkolejowej - podróżowanie między większymi miastami zajmuje zaledwie kilka dni. \nPrzewóz towarów jeszcze nigdy nie był tak szybki i tani, więc pracownicy stacji \nrozrządowych na czele z inżynierami mają pełne ręce roboty i robią co mogą, aby \nustawić wagony towarowe na odpowiednie tory. ','','logiquest-wsi-do-pocigu---zmiana-toru','','','','Logiquest: Wsiąść do Pociągu - Zmiana toru','','','',''),(750,1,1,'None','','sea-stax-edycja-polska','','','','Sea Stax (edycja polska)','','','',''),(751,1,1,'\n\n\n\nKlasyczna gra w szachy w nowoczesnym wydaniu bo z magnesem. Dzięki temu \nteraz nie pogubisz żadnych figur. Produkt zapakowany w kartonowe opakowanie. \nPodane wymiary są wymiarami opakowania.\n','','gra-szachy','','','','Gra szachy','','','',''),(752,1,1,'None','','match-harry-potter','','','','Match Harry Potter','','','',''),(753,1,1,'Przenieś się do świata magii, wybierz jednego z 15 bohaterów Fantastycznych Zwierząt i zmierz się z pozostałymi graczami. Wybieraj spośród niezwykłych postaci czy będzie to Newton Skamander, Gellert Grinelwald, Albus Dumbledore, jedna z sióstr Goldstein czy może Jacob Kowalski? Sprawdź który z bohaterów doprowadzi Cię do zwycięztwa. Ułóż linię pięciu jednakowych postaci i wygraj! Sprawdź czy uda Ci się wygrać 5 rund i zostać zwycięzcą całej rozgrywki.','','match-zbrodnie-grindenwalda','','','','Match Zbrodnie Grindenwalda','','','',''),(754,1,1,'Gra Logiczna dla dzieci, Uniwersalna. Dedykowana dla graczy od 3 lat. Minimalna liczba graczy: 2, maksymalna liczba graczy: 2. Szacowany czas zabawy: Do 30 minut','','match-dinozaury','','','','Match Dinozaury','','','',''),(755,1,1,'Płytki stonóg mogą być dodawane do standardowego zestawu Roju. Podczas rozgrywki są one wprowadzane do gry w taki sam sposób jak pozostałe owady. Stonoga porusza się o jedno pole. Dodatkowo posiada specjalną zdolność, której może użyć zamiast wykonywać ruch. Zdolność ta pozwala jej poruszyć sąsiednią płytkę (swoją lub przeciwnika) o dwa pola. Najpierw na siebie, a następnie w dół, na inne wolne pole z nią sąsiadujące. Płytka poruszona przez stonogę, nie może być poruszona (bezpośrednio lub za pomocą innej stonogi) w następnej turze przeciwnika. Rój został uznany przez MENSA za najlepszą grę umysłową 2006 roku! Inne rekomendacje są zbędne! Zawartość: 2 bakelitowe płytki instrukcja Liczba graczy: 2 Wiek graczy: od 9 lat Czas gry: 10 - 30 min.','','rj---dodatek-stonoga','','','','Rój - dodatek Stonoga','','','',''),(756,1,1,'Dodatek do gry głównej pod tą samą nazwą - Rój.Są to dwa dodatkowe elementy, których można użyć w grze','','rj---dodatek-komar','','','','Rój - dodatek Komar','','','',''),(757,1,1,'Płytki biedronek mogą być dodawane do standardowego zestawu Roju. Podczas rozgrywki są one wprowadzane do gry w taki sam sposób jak pozostałe owady.Podczas ruchu, biedronka porusza się dokładnie o trzy pola: dwa na górze roju oraz jedno w dół (musi zejść z roju w ostatnim etapie ruchu). Nie może poruszać się jedynie dookoła roju, ani nie może zakończyć ruchu na innej płytce. Nie może blokować innych owadów zatrzymując się na nich, jednak może kończyć ruch na polach otoczonych ze wszystkich stron. Jej cechą jest duża szybkość.','','rj---dodatek-biedronka','','','','Rój - dodatek Biedronka','','','',''),(758,1,1,'Dostępność: IV kwartał  \n2020','','nemesis-ed-polska','','','','Nemesis (ed. polska)','','','',''),(759,1,1,'Znajdźcie broń i eksterminujcie \nzombie','','zombicide-zielona-horda','','','','Zombicide: Zielona Horda','','','',''),(760,1,1,'Niebezpiecznie \nwychodzić za własny próg, mój Frodo! Trafisz na gościniec i jeżeli nie \npowstrzymasz swoich nóg, ani się spostrzeżesz, kiedy cię poniosą”.','','wadca-piercieni-podre-przez-rdziemie','','','','Władca pierścieni: Podróże przez Śródziemie','','','',''),(761,1,1,'Zorganizuj \nekspedycję i udaj się w podróż przez dżunglę. Będziesz potrzebował \ndoświadczonych przewodników i odpowiedniego sprzętu. Zatrudnisz zwiadowcę czy \nskorzystasz z pomocy tubylców? Wybierzesz podróż statkiem czy wynajmiesz \nsamolot? Bądź szybszy od rywali! Każda rozgrywka wymaga innej strategii.','','wyprawa-do-el-dorado','','','','Wyprawa do El Dorado','','','',''),(762,1,1,'Hit! Gra numer 1 w rankingu Boardgamegeek!!!!','','gloomhaven-pl','','','','Gloomhaven PL','','','',''),(763,1,1,'Jesteśmy \n  świadkami świtu nowej ery kosmicznej. Ksenium, wyjątkowe paliwo o \n ponadprzeciętnych właściwościach, zostało odkryte na odległej planecie PK-L7. \n Baza się rozrastała, a górnicy drążyli coraz bardziej w głąb planety, gdy nagle \n wydarzyło się coś niespodziewanego. Xenosy, uważani za pokojowy gatunek obcych, \n nagle oszaleli i zwrócili się przeciwko nam. Są zarażeni niczym \n zombie...','','zombicide-najedca','','','','Zombicide: Najeźdźca','','','',''),(764,1,1,'','','time-stories---madame','','','','T.I.M.E. Stories - Madame','','','',''),(765,1,1,' ','','horror-w-arkham-3ed-miertelna-gbia-nocy','','','','Horror w Arkham 3ed: Śmiertelna głębia nocy','','','',''),(766,1,1,'None','','posiado-szalestwa-2ed---cieka-wa','','','','Posiadłość szaleństwa 2ed - Ścieżka Węża','','','',''),(767,1,1,'Czasem na Pustkowiach możesz poczuć się samotny. Jak by nie \n patrzeć, tułasz się po napromieniowanym piekle waląc, w co popadnie (z \nnaciskiem  na mijane ghule) i próbując wieść najlepsze życie, na jakie cię stać. \nAle  czekaj! Może wcale nie musisz być sam? Może jakimś cudem trafisz na ludzi, \n którzy będą chcieli spędzić z tobą trochę czasu? Kto wie, czy razem nie \n dokonacie czegoś wielkiego?','','fallout-atomic-bonds-eng','','','','Fallout: Atomic Bonds ENG','','','',''),(768,1,1,'Jest tak wiele wiedzy do zdobycia…','','posiado-szalestwa-2ed---za-progiem','','','','Posiadłość Szaleństwa 2ed - Za Progiem','','','',''),(769,1,1,'Czy uda Wam się uciec z tej tajemniczej wyspy?Wyspa przygód to pełna \nwyzwań kooperacyjna gra karciana dla 2-5 osób autorstwa Michaela Palma i Lukasa \nZacha. Podzielona jest na rozdziały (przygody), w wyniku których wchodzą nowe \nkarty. Sposób i kolejność w jakiej zostaną dodane, zależy od was, graczy. \nZapewnia to regrywalność i nieliniowość rozgrywki. Nie trzeba rozgrywać \nwszystkich przygód w tym samym gronie (nie jest to kampania legacy), a każda z \nnich jest w pełni samodzielna, choć rozgrywając nowe scenariusze posiadacie \nwiedzę z poprzednich przygód.','','wyspa-przygd','','','','Wyspa przygód','','','',''),(770,1,1,'GLOOMHAVEN \n gra Zapomniane kręgi Forgotten Circles','','gloomhaven---zapomniane-krgi','','','','Gloomhaven - Zapomniane Kręgi','','','',''),(771,1,1,'Mroczna wizja Nowej Anglii, opisana w \n twórczości H.P. Lovecrafta, nie kończy się na miasteczku Arkham. Pobliskim \n Dunwich wstrząsają straszliwe wydarzenia i nieziemskie siły. Oprócz groźby, \njaką  stanowi przebudzenie się Przedwiecznego, Badacze będą musieli zmierzyć się \nz  gniewem Koszmaru z Dunwich…Koszmar z Dunwich \n wprowadza do gry Horror w Arkham kilka nowych elementów, w tym rozerwania bram, \n karty Ran i Szaleństwa, zadania i misje, i nowy rodzaj ruchu  potworów. \n Gracze znajdą tu również nową planszę, przedstawiającą wioskę Dunwich, 8 nowych \n Badaczy, 4 nowych Przedwiecznych, ponad 20 nowych żetonów potworów, tuziny \n nowych przedmiotów i umiejętności, i dostatecznie dużo nowych spotkań, aby \n podwoić rozmiar każdej talii Obszarów. W sumie Koszmar z Dunwich dodaje do \n podstawowej gry ponad 300 nowych kart.','','horror-w-arkham-koszmar-z-dunwich','','','','Horror w Arkham: Koszmar z Dunwich','','','',''),(772,1,1,'Gdy się budzisz, głowa Ci pęka. Do tego nie masz \npojęcia gdzie jesteś, ani co cię tu sprowadziło. Jak okiem sięgnąć, zewsząd \notaczają Cię połacie dzikiego terenu. W oddali słychać wycie jakiegoś \nzwierzęcia. Musisz jednak na jakiś czas wstrzymać swoje poszukiwania odpowiedzi \nna pytania kotłujące się w głowie – obecnie najważniejsze jest przetrwanie. Czy \nzdecydujesz się pomóc innym, którzy także się tu znaleźli? A może twoja chęć \nprzetrwania będzie tak silna, że postanowisz ich wykorzystać?','','discover--nieznane-ldy','','','','Discover- Nieznane Lądy','','','',''),(773,1,1,'Potęga mrocznych sił \nrośnie!','','eldritch-horror-zaginiona-wiedza','','','','Eldritch Horror: Zaginiona Wiedza','','','',''),(774,1,1,'\nNa długo przed pojawieniem się ludzi na Ziemi żyły Starsze Istoty. Teraz, w roku \n1926, coś zakłóciło ich długi sen. Zaczęły rozszerzać swój mroczny wpływ, \nwpełzając do ludzkich umysłów i zmuszając do realizacji tajemniczego celu. \nKilku odważnych badaczy przeczuwa zbliżającą się katastrofę i wyrusza na \nAntarktydę, aby odnaleźć źródło zagrożenia. Tylko oni mogą powstrzymać \nnadciągającą zagładę, więc doprowadzą zadanie do końca albo popadną w obłęd \npróbując.','','eldritch-horror-gry-szalestwa','','','','Eldritch Horror: Góry Szaleństwa','','','',''),(775,1,1,'Era ludzi dobiega \nkońca!','','eldritch-horror-miasta-w-gruzach','','','','Eldritch Horror: Miasta w Gruzach','','','',''),(776,1,1,'Londyn, 1888 rok, labirynt cuchnących i \nzatłoczonych uliczek. Niektórzy mówią, że ta dzielnica to \npiekło. Inni, do których nie uśmiechnęło się szczęście, nazywają ją \ndomem. Na każdym rogu znajdziesz prostytutki. Ludzie nazywają je \nnieszczęśnicami” i nie ma chyba dla nich trafniejszej nazwy. Witaj w \ndzielnicy Whitechapel. Witaj na ulicach Kuby Rozpruwacza.','','listy-z-whitechapel','','','','Listy z Whitechapel','','','',''),(777,1,1,'Nie prześcigniesz \nsmoka. Musisz prześcignąć przyjaciół!','','drakon','','','','Drakon','','','',''),(778,1,1,' Dawno dawno temu, na japońskim cesarskim dworze. \nPo długiej serii sporów, relacje dyplomatyczne pomiędzy Japonią a Chinami w końcu się poprawiły. Aby odpowiednio uczcić tę zgodę chiński cesarz ofiarował japońskiemu władcy święte zwierzę, dużego misia pandę, symbol pokoju.   \n\nJapoński cesarz powierzył ludziom ze swojego dworu (graczom) trudne zadanie zadbania o zwierzaka i przygotowanie dla niego ogrodu bambusowego. Gracze będą pielęgnować pola uprawne, nawadniać je i uprawiać na nich jeden z trzech rodzajów bambusa (zielony, żółty i różowy) przy pomocy cesarskiego ogrodnika. Swą rolę odegra także pogoda, od słonecznych dni, po pory monsunowe.  \n\nBędą musieli także znosić wilczy apetyt pandy, łasej na soczyste pędy bambusa…  \n\nGracz któremu uda się zdobyć najwięcej punktów poprzez odpowiednią uprawę bambusa i karmienie pandy wygra grę.  \n\nTakenoko jest niebanalną grą o stosunkowo prostych zasadach, w którą można grać w dowolnym gronie. Tematyka poruszona w grze oraz pierwszorzędne wykonanie elementów sprawiają, że obcowanie z tą pozycją jest niezwykle miłe i przyjazne dla oka. W grę można grać już z dziećmi w wieku 8 lat, ale z doświadczenia wiemy, że przy pomocy rodziców świetnie radzą sobie z nią także 6 latki.\n\n','','takenoko','','','','Takenoko','','','',''),(779,1,1,' Od morza aż do Tatr, jak Polska długa i szeroka, rozciągają się przepiękne tereny, które tylko czekają na odkrycie. Chcesz poobserwować żubry w cieniu Puszczy Białowieskiej? A może wolisz pospacerować urokliwymi uliczkami Wrocławia? Wsiąść do Pociągu: Polska zabierze Cię w wyjątkową podróż do przeszłości, podczas której wcielisz się w kolejowego magnata z poprzedniego stulecia i przyczynisz się do rozwoju sieci połączeń kolejowych nie tylko w kraju, lecz także w sąsiednich państwach. \n\nWsiąść do Pociągu: Polska to dodatek zaprojektowany pod kątem rozgrywki dla 2–4 osób. Gra toczy się na planszy z mapą Polski, a celem uczestników jest zrealizowanie jak największej liczby tras. Budując połączenia między miastami, a także łącząc ze sobą poszczególne kraje sąsiadujące, gracze próbują zdobyć monopol w segmencie komunikacji publicznej. Im wcześniej uda im się skomunikować dwa państwa, tym więcej punktów otrzymają.\n\n\nNa czym polega gra?\nNa samym początku zabawy gracze losują karty tras. Wskazują one, jakie dwa miasta mamy połączyć nieprzerwaną trasą kolejową. Im dłuższa trasa, tym więcej punktów da nam na koniec gry, jednak jeśli nie uda nam się jej zrealizować – przyniesie nam punkty ujemne! \nPodczas gry uczestnicy dobierają kolorowe karty wagonów. Stanowią one walutę, która pozwala nam budować odpowiednie odcinki między miastami. Przykładowo aby wybudować trasę między Płockiem a Kaliszem potrzebujemy trzech pomarańczowych kart, a między Gdańskiem a Olsztynem – trzech czarnych. \nJeśli na początku swojej tury mamy odpowiedni zestaw kart, możemy wydać je, aby postawić swoje wagoniki w wybranym miejscu. Łącząc poszczególne odcinki w dłuższe trasy staramy się realizować jak najwięcej biletów. Zwycięża gracz, który uzbiera na nich najwięcej punktów.  \nCo wyróżnia ten dodatek?  \nKażda mapa z serii Wsiąść do Pociągu charakteryzuje się indywidualnymi zasadami, które wpływają na przebieg rozgrywki i planowanie ruchów. W przypadku mapy Polski jest to usprawnianie komunikacji między państwami ościennymi. Oprócz łączenia ze sobą miast, nasze trasy mogą docierać również do przejść granicznych, a tym samym łączyć sąsiadujące z nami kraje. Jeśli w naszej turze uda nam się stworzyć takie połączenie, dobieramy wierzchnie karty ze specjalnych stosów obu państw. Ich wartość punktowa ułożona jest malejąco, co oznacza, że gracze, który jako pierwsi dobierają karty, mogą liczyć na wyższy bonus punktowy.\n','','wsi-do-pocigu---polska---kolekcja-map-65','','','','Wsiąść do Pociągu - Polska - Kolekcja Map 6.5','','','',''),(780,1,1,'Gra dla 1-6 osób.','','patchwork-doodle','','','','Patchwork Doodle','','','',''),(781,1,1,'\n\n\n\nPOJEDYNEK \n SUPERBOHATERÓW DC \nDC DECK BUILDING \n GAME \n\nGra karciana z uniwersum DC \n Comics oparta na popularnym mechanizmie budowania talii! \n\nWciel \n się w ulubionego superbohatera DC Comics – BATMANA, FLASHA, WONDER WOMAN i \n innych. Zdobądź potężne supermoce, mega sprzęt i lojalnych sprzymierzeńców. \n  \nA \n może wolisz wykorzystać łotrów, by zaatakować swoich współgraczy? Wybierz swoją \n strategię i ruszaj po zwycięstwo!  \n\nGra karciana, w której bohaterem \n jesteś ty! \n\nW \n trakcie gry tworzysz swoją talię postaci. Na początku dysponujesz tylko \nprostymi  ciosami, jednak w trakcie gry zdobywasz nowe potężniejsze karty. Karty \nwzajemnie  na siebie oddziałują i współgrają z umiejętnościami twojej postaci. \nTylko dobrze  działająca i naoliwiona maszyna pozwoli ci pokonać Superłotrów i \nzwyciężyć  grę! \n\nJak grać?  \n\nWybierz, \n którym bohaterem będziesz grać. BATMAN! SUPERMAN! WONDER WOMAN! AQUAMAN! FLASH! \n GREEN LANTERN! CYBORG! Ligi Sprawiedliwości jest gotowa do walki! \n\nW \n każdej turze dobierasz pięć kart na rękę. Zagrywasz karty, wykonujesz opisane \nna  nich działania, a za zebraną MOC kupujesz nowe karty do swojej talii. Możesz \nw  ten sposób pozyskać ekwipunek, supermoce, sprzymierzeńców oraz takie lokacje \njak  JASKINIA BATMANA czy FORTECA SAMOTNOŚCI.  \n\nJeśli \n zbierzesz wystarczająco dużo MOCY, możesz pokonać SUPERŁOTRA. Bądź jednak \n pewien, że na jego miejscu pojawi się nowy ZŁOCZYŃCA, który będzie chciał  \nzniszczyć LIGĘ SPRAWIEDLIWOŚCI. Czy będziesz gotowy, by odeprzeć jego \n atak? \n\nGra \n kończy się, gdy wszyscy SUPERŁOTRZY zostaną pokonani. Wygra gracz, który \n zdobędzie najwięcej punktów ze swoich kart. \n\nElementy gry:\n- \n 114 kart talii głównej\n- \n 36 startowych Ciosów\n- \n 16 startowych Bezsilności\n- \n 16 Kopniaków\n- \n 12 Superłotrów\n- \n 20 Słabości\n\nLiczba \n graczy: 2-5 \nWiek \n 14+ \nCzas \n rozgrywki: 45 minut \n','','pojedynek-superbohaterw-dc','','','','Pojedynek Superbohaterów DC','','','',''),(782,1,1,'\n\n\n\nPonadczasowa \ngra imprezowa!Każdy \ngracz tworzy swoją linię czasu, dokładając do niej kolejne wydarzenia. Aby \nwygrać, nie trzeba znać dokładnych dat, wystarczy ułożyć je chronologicznie. Baw \nsię, ryzykuj i poznaj różne ciekawostki.Wtedy \nKiedy to polska edycja światowego bestsellera Chronology.Idealna \ngra imprezowa:- \nproste i intuicyjne zasady!- \nprzygotowanie gry trwa mniej niż 10 sekund!- \nmoże grać nawet osiem osób!Zawartość:- \nponad 500 ciekawych wydarzeń z nowożytnej i współczesnej historiiCechy \ngry:- \nliczba graczy: 2+- \nwiek gracza: 10+Uwaga! \nNieodpowiednie dla dzieci w wieku poniżej 3 lat.\n','','wtedy-kiedy','','','','Wtedy Kiedy','','','',''),(783,1,1,'\n\n\n\nPierwszy dodatek do gry: Wtedy Kiedyzawiera 110 nowych, szalonych i \nzaskakujących wydarzeń.Uwaga! To nie jest samodzielna gra! Do rozgrywki \nwymagana jest podstawowa wersja gry: Wtedy Kiedy.\n','','wtedy-kiedy--szalone-fakty-dodatek','','','','Wtedy Kiedy- Szalone fakty (dodatek)','','','',''),(784,1,1,'\n\n\n\nŻycie \nw Tokio stało się jeszcze bardziej niebezpieczne. W mieście pojawił się nowy \npotwór niesamowity Pandaka! Pozostałe potwory muszą zmutować i ewoluować, by \nstawić mu czoła. Walko o Tokio już nigdy nie będzie taka sama.Pudełko \nzawiera karty pasujące zarówno do nowej jak i starej edycji Potworów w \nTokio.\n','','potwory-w-tokio-power-up-doadowanie','','','','Potwory w Tokio: Power Up! Doładowanie','','','',''),(785,1,1,'Widzieliście \n kiedyś grę z ruchomą planszą? Musicie poznać grę \"PENTAGO\", zdobywczyni  \n trzynastu nagród w Europie, Stanach Zjednoczonych i Japonii!Wydawnictwo Egmont  \n wprowadza na rynek 2-osobową grę \"PENTAGO\", która zdobyła szereg nagród na  \ncałym  świecie. Gra przeznaczona jest dla dorosłych wielbicieli gier \n logicznych,  jednak  jej proste zasady pozwolą cieszyć się nią również dzieciom \n w wieku  powyżej 8  lat.Polskie wydanie będzie specjalną edycją gry, \n umożliwiającą  zabranie gry w  podróż, do szkoły lub na spotkanie z \nprzyjaciółmi  bez  konieczności dźwigania  całego pudełka.Na czym polega \n\"PENTAGO\"? Gracze na  przemian układają na planszy  po jednej kuli w swoim \nkolorze. Wygra gracz,  który  jako pierwszy ułoży 5 swoich  kul w jednej linii. \nWydaje się łatwe? Tylko  pozornie - po wyłożeniu każdej kuli  gracz obraca jedną \nz czterech ruchomych  części planszy o 90 stopni! Żeby wygrać  trzeba włączyć \nlogiczne  myślenie!','','pentago','','','','Pentago','','','',''),(786,1,1,'\n\n\n\nPotrójnie \n zakręcona gra logiczna!Nowa \n wersja popularnej gry Pentago. W grze są 3 kolory kul oraz karty zadań, które \n urozmaicają zasady pierwowzoru i umożliwiają grę 4 osobom  jednocześnie.\n\n','','pentago-triple','','','','Pentago Triple','','','',''),(787,1,1,'\n\n\n\nTrójwymiarowe \nszaleństwo!Najnowsza \nwersja światowego bestsellera! W grze są przestrzenne klocki, które wprowadzają \nzabawę w zupełnie nowy (trzeci) wymiar. Rozgrywka staje się jeszcze bardziej \nwymagająca i fascynująca. Tak jak w pierwowzorze gracze starają się jak \nnajszybciej zapełnić puste pola na swoich planszach, tylko tym razem muszą to \nzrobić dwuwarstwowo. Gracze, którym uda się rozwiązać łamigłówkę na czas, \nzdobywają klejnoty. Cztery poziomy trudności pozwolą na dostosowanie gry do \nwieku i doświadczenia graczy.\n','','ubongo-3d','','','','Ubongo 3D','','','',''),(788,1,1,'\n\n\n\n\nŚwiatło, \nkamera, akcja!Zostań producentem filmowym i nakręć najlepszy film roku! \nMusisz zainwestować miliony dolarów i zebrać odpowiednią ekipę: reżysera, \naktorów, operatora i innych specjalistów. O największe gwiazdy będziesz \nrywalizował z przeciwnikami. Ale możesz też zawsze kręcić horrory klasy \nD...\n\n','','hollywood','','','','Hollywood','','','',''),(789,1,1,'W \ntym wyścigu wygra najwolniejszy ślimak. Podczas gry nie znasz kolorów ślimaków \nnależących do rywali. Za pomocą kostek przemieszczasz nie tylko swojego, lecz \ntakże pozostałe ślimaki.','','limaki-to-miczaki','','','','Ślimaki to mięczaki','','','',''),(790,1,1,'Mały \n dodatek z 5 dodatkowymi kafelkami, która pozwalają grać w Tajniaków: Obrazki w \n układzie 5x5 haseł.','','tajniacy-obrazki---dodatkowe-kafle-agentw','','','','Tajniacy Obrazki - Dodatkowe Kafle Agentów','','','',''),(791,1,1,'Średniowieczne \nmiasta zamieszkiwali rozmaici ludzie. Nie tylko pobożni mnisi, skromni uczeni i \ngodni zaufania kupcy, ale też wredni, nieszczerzy i chciwi. Witaj w \nChytrogrodzie, gdzie możesz stać się postacią należącą do tej drugiej \nkategorii.','','chytrogrd','','','','Chytrogród','','','',''),(792,1,1,'Sekretne \n cele, niespodziewane zdarzenia, jeszcze więcej intrygowania i knucia. \nChytrogród  wita ponownie!','','chytrogrd-zoto-baznw','','','','Chytrogród Złoto Błaznów','','','',''),(793,1,1,'Przyjaciel \n zaginął bez śladu. Grając jako Harry, Ron, Hermiona, Ginny, Luna lub Neville, \n spróbuj odkryć, KTO to zrobił, JAKIEGO zaklęcia lub przedmiotu użył oraz G|DZIE \n został zaatakowany. Czy był to Fenrir Greyback z przeklętym naszyjnikiem w \n zakazanym lesie?','','harry-potter-cluedo','','','','Harry Potter Cluedo','','','',''),(794,1,1,'Gracze \nwybierają się w podróż do świata ze snów. Czekają na nich niezwykłe krainy: \nniektóre jak z bajki, inne z kolei mroczne i pełne kruków. Podglądaj i przejmuj \nsny rywali. Celem gry jest stworzenie snu z jak najmniejszą liczbą kruków.','','sen---gra-karciana','','','','Sen - gra karciana','','','',''),(795,1,1,'','','santorini','','','','Santorini','','','',''),(796,1,1,'Dodatek do gry Wtedy kiedyZawiera 110 wydarzeń Mieści się w pudełku \npodstawowej gry','','wtedy-kiedy--niezwyka-polska-dodatek','','','','Wtedy Kiedy- Niezwykła Polska (dodatek)','','','',''),(797,1,1,'W \ngrze \"Gnaj do celu w PRL - u\", zgodnie z tytułem, gracze rywalizują o zwycięstwo \nw epoce Rzeczypospolitej Ludowej. Zmagania uczestników gry toczą się w \ncharakterystycznych dla PRLu realiach. Tworzyły je pamiętne jeszcze dla wielu \npolaków nieustanne kolejki w sklepach, brak towaru, kartki na żywność, proszek \ndo prania, mydło itp. Były to czasy czynów społecznych, pochodów 1 majowych i \nczęstych strajków. O jakości życia decydowały wówczas również zjawiska, które i \ndziś nie straciły na znaczeniu - jak znajomości czy przynależność do partii. \nWszystko to tworzy rzeczywistość, w której poruszają sie gracze w wyścigu do \nzwycięstwa.','','gnaj-do-celu-w-prlu','','','','Gnaj do celu w PRLu','','','',''),(798,1,1,'','','bolidy---niebezpieczne-wirae','','','','Bolidy - Niebezpieczne wiraże','','','',''),(799,1,1,'Zapewnij \n chwałę swemu rodowi i Rzymowi','','concordia','','','','Concordia','','','',''),(800,1,1,'Odkryjcie \nnowe terytoria','','concordia---egipt--kreta','','','','Concordia - Egipt / Kreta','','','',''),(801,1,1,'Dobra \ntaktyka i karma doprowadzą Cię do sławy i bogactwa.','','ganges','','','','Ganges','','','',''),(802,1,1,'Osadnicy \nz trzech północnych królestw, poszukując możliwości dalszego rozwoju, wypływają \nw kierunku obcych lądów w nadziei na znalezienie nowych zasobów. Budują nowe \nkonstrukcje, wykorzystują nadchodzące wydarzenia i przechytrzając przeciwników, \ntorują sobie drogę do wielkości.','','osadnicy-krlestwa-pnocy','','','','Osadnicy: Królestwa północy','','','',''),(803,1,1,'Podczas \n zabawy każdy z graczy będzie rozwijał swój własny rezerwat poprzez wykładanie \nna  specjalną planszę kart ptaków. Gra składa się z następujących po sobie tur. \nAby  wykonać jedną z dostępnych akcji, należy umieścić kostkę akcji w \nodpowiednim  miejscu swojej planszy. Z każdą rundą (a będzie ich cztery), gracze \nbędą mieli  coraz mniej akcji do wykorzystania, ale ich efekty będą bardziej \nrozbudowane. Na  samym początku gra będzie szła szybciej, jednak w miarę \nkrystalizowania się  strategii, poszczególne tury mogą zajmować coraz więcej \nczasu.','','na-skrzydach','','','','Na skrzydłach','','','',''),(804,1,1,'\n\n\n\nDodatek \n do gry Pojedynek superbohaterów DC!Dołącz \n Strażników do podstawowej gry Pojedynek Superbohaterów DC i wciel się w \n legendarne postaci z powieści graficznej Alana Moore\'a i Dave\'a Gibbonsa. \n Dodatek wprowadza nowy tryb gry z tajnymi rolami. Jeden z graczy jest \n spiskowcem, który stara się udaremnić plany współgraczy. Komu zaufasz w tej \ngrze  wzajemnych podejrzliwości? \n','','dodatek-do-gry-pojedynek-superbohaterw-stranicy','','','','Dodatek do gry Pojedynek Superbohaterów. Strażnicy','','','',''),(805,1,1,'\n\n\n\nDługo \noczekiwany dodatek do przebojowej Concordii!Największe \ndotychczas wydane rozszerzenie do Concordii. W pudełku są 3 dodatki, które \npozwalają na odkrycie nowych strategii, ciekawe zagrania, budowanie unikalnej \nsiły każdego gracza. Sól jest nowym dobrem, które zastępuje każde inne, ale nie \ntak łatwo ją zdobyć. Kafelki forum budują unikalną siłę gracza i pozwalają na \nnowe strategie. Plansza z 2 nowymi mapami urozmaici kolejne \nrozgrywki.\n','','concordia-salsa---dodatek-do-gry','','','','Concordia. Salsa - dodatek do gry','','','',''),(806,1,1,'Bras: \nLancashire trafi przede wszystkim w gusta osób, które lubią spędzać długie \ngodziny nad wykręcającymi mózg grami ekonomicznymi o minimalnej losowości oraz \nktórym nie straszne jest wybieganie myślą o klika kroków strategicznych w przód. \nCzęsto uznawana za grę dla graczy, przy skromnej ilości akcji, oferuje pokaźną \nliczbę możliwości ich taktycznego wykorzystania. Nie tylko po to, żebyśmy mogli \nzgarnąć kilka punktów zwycięstwa za odwrócone żetony przedsiębiorstw pod koniec \nktórejś z er, ale również dlatego, by naszym zagraniem podkręcić paraliż \ndecyzyjny przeciwnika oraz nieodstępujące go na krok wrażenie żalu za \nniezrealizowaną dwie tury temu akcją.','','brass-lancashire','','','','Brass Lancashire','','','',''),(807,1,1,'Masz \nochotę na wzięcie udziału w nowej erze Rewolucji Przemysłowej, w realiach jednej \nz najlepszych gier ekonomicznych wszech czasów? ','','brass-birmingham','','','','Brass Birmingham','','','',''),(808,1,1,'Dodatek \ndo gry Na skrzydłach','','na-skrzydach---ptaki-europy','','','','Na skrzydłach - Ptaki Europy','','','',''),(809,1,1,'','','pandemic---szybka-reakcja','','','','Pandemic - Szybka Reakcja','','','',''),(810,1,1,'\n\nSand \n Runners to pozostałość   \noddziału wojskowego, który na początku wojny został wysłany do walki z Molochem. \n Zgraja trepów, którym odbiło do szczętu. Dokładnie wtedy gdy uznasz, że \n poznałeś ich na wylot, zaczynają dziać się rzeczy, októrych nie śniło się   \nszamanom...\nGłówną \n  zaletą armii jest możliwość wyłączania z Bitwy kluczowego pola za pomocą Burzy \n piaskowej. Kilku Wojowników Sand Runnersów posiada cechy Modułów co pozwala im  \nwspierać się wzajemnie podczas Bitwy. Ponadto, żeton Sztabu jest dwustronny  \nijedna ze stron pozwala mu wyeliminować pojedynczy groźny, lecz wolniejszy cel,  \nzanim ten zdąży zaatakować.Wadą armii jest stosunkowo niska bazowa Inicjatywa. \n Dodatkowo, nierozważne odwrócenie Sztabu na stronę zatakiem wtylko jednym  \nkierunku, może skutkować brakiem możliwości zabicia otaczających go jednostek  \npodczas  \nBitwy.\n\nZawartość:\n\n\n\n54 \n     	   żetony\n\ninstrukcja\n\nworeczek \n     	strunowy\n\nWiek: \n13+\nLiczba \n graczy: 2-4\nCzas \n gry: 30min\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n','','neuroshima-hex-sand-runners-edycja-30','','','','Neuroshima HEX: Sand Runners (edycja 3.0)','','','',''),(811,1,1,'\n\nDalekomorskie \n wyprawy Królestw Północy odkryły ziemie Dalekiego Wschodu! Rozciągające się na  \nniezliczonych wyspach Imperium Japońskie szybko zdobyło sobie reputację godnego  \npartnera... i przebiegłego kupca. Cywilizacje połączyła gęsta sieć dyplomacji,  \nzwiększając przestrzeń do wymiany \n handlowej.\nDodatek \n Królestwa Północy: Wyspy \n Japonii wprowadza do gry 2 nowe Klany oraz 14 Wysp. Klany Japończyków oferują   \nnowe strategie i rozwiązania mechaniczne, takie jak Wymiana i  \nDokowanie. \nZawartość:\n\n\n\n80 \n     	kart\n\n4 \n     	   żetony Statków Klanu\n\n2 \n     	znaczniki Klanu\n\ninstrukcja\n\nWiek:14+Liczba \n graczy:1-4Czas \n gry:60 - 90  \nmin\n\n\n\n\n\n\n','','osadnicy-krlestwa-pnocy---wyspy-japonii','','','','Osadnicy: Królestwa północy - Wyspy Japonii','','','',''),(812,1,1,'Monolith\n Arena: Akademicy - Army \nPack to dodatek do taktycznej gry planszowej Monolith \nArena. Zawiera zastęp magów mesmeryzacji i wiele potężnych runów. Znajdziesz w\n nim nową mechanikę zwaną Maną oraz Mędrca zdolnego wyleczyć twoje jednostki na \nplanszy.','','monolith-arena---akademicy','','','','Monolith Arena - Akademicy','','','',''),(813,1,1,'Zaimponuj królowi wznosząc niezwykłe i imponujące budowleAkcja \nArchitektów zachodniego królestwa toczy się u schyłku Imperium Karolińskiego, \n około 850 r. n.e. Jako królewscy architekci, będziecie rywalizować, by \n zaimponować królowi i zachować swój szlachetny status, budując różne \nkonstrukcje  na jego nowych włościach.','','architekci-zachodniego-krlestwa','','','','Architekci zachodniego królestwa','','','',''),(814,1,1,'Czy uda się obronić kraj przed najeźdźcami?Akcja \nPaladynów zachodniego królestwa rozgrywa się w burzliwym okresie historii \npaństwa zachodniofrankijskiego, około 900 r. n.e. Pomimo ostatnich wysiłków nad \nrozwojem Waszego miasta, okolicznym siedliskom wciąż grozi atak ze strony \nagresywnych najeźdźców.','','paladyni-zachodniego-krlestwa','','','','Paladyni zachodniego królestwa','','','',''),(815,1,1,'  ','','scythe-fenris-powstaje','','','','Scythe: Fenris Powstaje','','','',''),(816,1,1,'W \n uroczej dolinie Everdell, pod gałęziami wysokich drzew, wśród omszałych głazów, \n rozwija się cywilizacja leśnych zwierząt. Wiele lat minęło od jej początków i   \nwreszcie nadszedł czas, by odkryć nowe tereny i zakładać zupełnie nowe miasta.   \nGdy zasiądziesz do gry, wcielisz się w lidera grupy stworzeń, które wyruszą na  \npodbój nieznanego. Trzeba będzie zbudować wiele budynków, poznać nowe  \n stworzenia  i dać się ponieść nadchodzącym wydarzeniom. To będzie pracowity  \n rok!','','everdell','','','','Everdell','','','',''),(817,1,1,'Odkryj \n zupełnie nowe zakamarki leśnej krainy Everdell i poprowadź swoje zwierzęta do \n zwycięstwa.','','everdell-krostawiec','','','','Everdell Krostawiec','','','',''),(818,1,1,'<p>Adeptus Titanicus is a tabletop game of devastating combat between awe-inspiring god-machines, set during the civil war that tore the galaxy apart. Two players take control of a variety of Titans – colossal, bipedal war engines covered in thick armour and weapons which can level a city in a single salvo. It is a strategic challenge in which you pit your skill and cunning against your opponent in a battle to the death; a test of tactical skill demanding the management of the resources at your disposal, determining the optimal reactions to the evolving state of the battlefield. In this boxed set you will find: – 1x 96-page softcover Adeptus Titanicus rulebook. This contains the full rules for the game, and will teach you the basics as well as introducing you to advanced rules and tactics, and three different ways to play. – 1x Reaver Battle Titan. This plastic model comes with chainfist, volcano cannon, melta cannon and turbo laser destructor options. It is supplied with a 105mm round base. – 1x Reaver Battle Titan. This plastic model comes with power fist, laser blaster, gatling blaster and Apocalypse missile launcher options. It is supplied with a 105mm round base. – 2x Warhound Scout Titan. These plastic models each come in 62 components, including multiple weapons options. Each has an 80mm round base. – 2x Cerastus Knight. This 58-component plastic kit includes two 50mm round bases. – 6x Battlefield Assets, plastic models used to represent stratagems on the battlefield that can interact with your Titans in different ways – 58x Status Markers and Movement Template Set – 20x Adeptus Titanicus Dice (18x D6, 2x D10) – 3x Adeptus Titanicus Weapon Templates – 2x Reference Sheets – 4x Titan Command Terminals – 2x Knight Banner Command Terminals – 24x Mission and Stratagem Cards – 16x Titan Weapon Cards – 1x Range Ruler – 3x Transfer sheets – one each for Reaver Titans, Warhound Titans and Cerastus Knights</p>','','adeptus-titanicus-the-horus-heresy','','','','Adeptus Titanicus: The Horus Heresy','','','',''),(819,1,1,'<p>None</p>','','adeptus-titanicus-shadow-and-iron','','','','Adeptus Titanicus: 