 największych i najbardziej zaciekłych bitew, które wstrząsnęły Age of Darkness. To naprawdę oszałamiająca skala i fantastyczny projekt hobbystyczny dla zapalonych malarzy, którzy chcą wykorzystać swoje umiejętności w dziesiątkach małych, ale niezwykle szczegółowych miniatur.','','legions-imperialis-marauder-destroyers','','','','LEGIONS IMPERIALIS: MARAUDER DESTROYERS','','','',''),(836,1,1,'Legions Imperialis powiększa się, aby przedstawić jedne z największych i najbardziej zaciekłych bitew, które wstrząsnęły Age of Darkness. To naprawdę oszałamiająca skala i fantastyczny projekt hobbystyczny dla zapalonych malarzy, którzy chcą wykorzystać swoje umiejętności w dziesiątkach małych, ale niezwykle szczegółowych miniatur.','','legions-imperialis-marauder-bomber-squadron','','','','LEGIONS IMPERIALIS: MARAUDER BOMBER SQUADRON','','','',''),(837,1,1,'Legions Imperialis powiększa się, aby przedstawić jedne z największych i najbardziej zaciekłych bitew, które wstrząsnęły Age of Darkness. To naprawdę oszałamiająca skala i fantastyczny projekt hobbystyczny dla zapalonych malarzy, którzy chcą wykorzystać swoje umiejętności w dziesiątkach małych, ale niezwykle szczegółowych miniatur.','','legions-imperialis-civitas-imperialis-city-road-tiles','','','','LEGIONS IMPERIALIS: CIVITAS IMPERIALIS CITY ROAD TILES','','','',''),(838,1,1,' ','','blood-bowl-gwakamoli-crater-gators--lizardmen-team','','','','Blood Bowl: Gwaka\'moli Crater Gators / Lizardmen Team','','','',''),(839,1,1,'None','','blood-bowl-fire-mountain-gut-busters--ogre-team','','','','Blood Bowl: Fire Mountain Gut Busters / Ogre Team','','','',''),(840,1,1,'None','','blood-bowl-snotling-team-card-pack','','','','Blood Bowl: Snotling Team Card Pack','','','',''),(841,1,1,'None','','blood-bowl-crud-creek-nosepickers--snotling-team','','','','Blood Bowl: Crud Creek Nosepickers / Snotling Team','','','',''),(842,1,1,'Blood Bowl: Second Season edition to nowa odsłona klasycznej gry Games Workshop. Nowa edycja zapowiada największe zmiany zasad od momentu powstania systemu i ma zapewnić gładszą rozgrywkę w każdym aspekcie gry. Blood Bowl jest grą fantasy pozwalającą nam rozgrywać mecze futbolu amerykańskiego pomiędzy drużynami z uniwersum Warhammera. Kombinacja strategii, taktyki i całkowitej bezmyślnej przemocy stanowi esencję futbolu w świecie fantasy. Dwóch graczy wciela się w trenerów wybierając spośród najróżniejszych przedstawicieli Starego Świata. Blood Bowl to nie tylko gra planszowa ale również gra strategiczna za pomocą, której będziecie mogli rozgrywać pojedyncze gry sparingowe, turnieje, ligi oraz mini gry.  Zestaw startowy pozwala na rozegranie brutalnych meczy pomiędzy dwiema całkiem nowymi drużynami: Ludzi - Imperialnych Arystokratów i dzikich Czarnych Orków. Obie drużyny są kompletne - tak, NAPRAWDĘ kompletne - z własnymi zaktualizowanymi modelami Star Player i Big Guy, więc w zestawie znajdziesz wszystko, czego potrzebujesz, aby rozgrywać mecze przez całą ligę, zaraz po wyjęciu z pudełka. Baronowie z Bögenhafen są prowadzeni przez legendarnego asa drużyny Griffa Oberwalda i przywieźli też ze sobą Ogra, aby wzmocnić swoje możliwości ofensywne. Zespół Imperialnych Arystokratów jest bardziej krzykliwy, bardziej skupiony na j grze mobilnej i obronie, w porównaniu ze standardową drużyną ludzi.','','blood-bowl-second-season-edition','','','','Blood Bowl Second Season Edition','','','',''),(843,1,1,'Witajcie fani sportu! Blood Bowl - legendarna gra fantasy football -  powraca \n na nowy sezon niezwykle brutalnego sportowego chaosu. ','','blood-bowl-rulebook','','','','Blood Bowl Rulebook','','','',''),(844,1,1,'\n\n\n\n\n','','blood-bowl-spike-journal---issue-11---blood-bowl','','','','Blood Bowl: Spike! Journal - Issue 11 - Blood Bowl','','','',''),(845,1,1,'','','blood-bowl-treeman---blood-bowl','','','','Blood Bowl: Treeman - Blood Bowl','','','',''),(846,1,1,'Brutalna siłą, krwawe rozgrywki oraz budząca przerażenie w sercach wroga \n drużyna ,,Necromantic\", sprawi, że Twoja rozgrywka w Blood Bowl-a już nigdy nie \n będzie taka sama.','','blood-bowl-wolfenburg-crypt-stealer--necromantic-horror-team','','','','Blood Bowl: Wolfenburg Crypt-Stealer / Necromantic Horror Team','','','',''),(847,1,1,'\n\n\n\n\n','','blood-bowl-spike-journal---issue-12---blood-bowl','','','','Blood Bowl: Spike! Journal - Issue 12 - Blood Bowl','','','',''),(848,1,1,'','','blood-bowl-the-thunder-valley-greenskins--black-orc-team','','','','Blood Bowl: The Thunder Valley Greenskins / Black Orc Team','','','',''),(849,1,1,'','','blood-bowl-the-bogenhafen-barons--imperial-nobility-team','','','','Blood Bowl: The Bogenhafen Barons / Imperial Nobility Team','','','',''),(850,1,1,'','','blood-bowl-griff-oberwald','','','','Blood Bowl: Griff Oberwald','','','',''),(851,1,1,'','','blood-bowl-varag-ghoul-chewer','','','','Blood Bowl: Varag Ghoul-Chewer','','','',''),(852,1,1,'','','blood-bowl-elf-and-dwarf-biased-referees','','','','Blood Bowl: Elf and Dwarf Biased Referees','','','',''),(853,1,1,'','','blood-bowl-sevens-pitch','','','','Blood Bowl Sevens Pitch','','','',''),(854,1,1,'\n\n\n\nOGRE TEAM PITCH &amp; DUGOUTS - Stadiony ogrów byłyby niezmiernie piękne, \npołożone wysoko w górach, jak to często bywa, gdyby nie plamy krwi i kratery \npełne zebranych kości. Jeśli lubisz takie rzeczy, jest to niezwykle ładne. Jeśli \nnie, mogą być trochę mniej niż przyjazne.OGRE TEAM PITCH &amp; DUGOUTS - Po \njednej stronie boiska znajduje się jałowe, skaliste pole, nad którym dominuje \nząbkowany dół z twarzą ogra, wypełniony szczątkami ich ostatniej drużyny lub \nposiłkiem, jak lubią to nazywać. Po drugiej stronie znajduje się to samo boisko, \nale pokryte śniegiem po zimowej zamieci, z kilkoma złowieszczymi czerwonymi \n„oznaczeniami” dla stref końcowych…OGRE TEAM PITCH &amp; DUGOUTS \n-   Znajdziesz również parę dopasowanych dwustronnych lawek \nrezerwowych, aby uzupełnić temat. Zaprojektowana na nowo z myślą o najnowszej \nedycji gry, każdy z boksów zawiera liczniki punktów, tur i przerzutów, a także \npola rezerw, znokautowanych i poszkodowanych. Uwzględniono zasady korzystania z \nkażdej strony boiska.\n','','blood-bowl-ogre-team-pitch--dugouts-2021','','','','Blood Bowl: Ogre Team Pitch & Dugouts 2021','','','',''),(855,1,1,'None','','blood-bowl-shambling-undead-pitch--dugouts','','','','Blood Bowl: Shambling Undead Pitch & Dugouts','','','',''),(856,1,1,'None','','blood-bowl-khorne-team-card-pack','','','','Blood Bowl: Khorne Team Card Pack','','','',''),(857,1,1,'None','','blood-bowl-skull-tribe-slaughterer--khorne-team','','','','Blood Bowl: Skull Tribe Slaughterer / Khorne Team','','','',''),(858,1,1,'','','marvel-crisis-protocol---miniatures-game-core','','','','Marvel: Crisis Protocol - Miniatures Game Core','','','',''),(859,1,1,'','','marvel-crisis-protocol---hulk','','','','Marvel: Crisis Protocol - Hulk','','','',''),(860,1,1,'','','marvel-crisis-protocol---black-panther-and-kilmonger','','','','Marvel: Crisis Protocol - Black Panther and Kilmonger','','','',''),(861,1,1,'Shuri \n - sister to T’Challa, the Black Panther - has proven herself a hero through her \n innate genius and fierce dedication to her people. With her spirited \npersonality  and intellectual prowess, Shuri has become the top innovator and \ninventor within  the technologically advanced nation of Wakanda, and she puts \nher innovations to  good use to defend her home and its people by whatever means \nnecessary.','','marvel-crisis-protocol---shuri-and-okoye','','','','Marvel: Crisis Protocol - Shuri and Okoye','','','',''),(862,1,1,'','','marvel-crisis-protocol---venom','','','','Marvel: Crisis Protocol - Venom','','','',''),(863,1,1,'','','marvel-crisis-protocol---spider-man--ghost-spider','','','','Marvel: Crisis Protocol - Spider-Man & Ghost-Spider','','','',''),(864,1,1,'','','marvel-crisis-protocol---thor--valkyrie','','','','Marvel: Crisis Protocol - Thor & Valkyrie','','','',''),(865,1,1,'','','marvel-crisis-protocol---loki-and-hela','','','','Marvel: Crisis Protocol - Loki and Hela','','','',''),(866,1,1,'','','marvel-crisis-protocol---vision-and-winter-soldier','','','','Marvel: Crisis Protocol - Vision and Winter Soldier','','','',''),(867,1,1,'','','marvel-crisis-protocol---corvus-glaive-and-proxima-midnight','','','','Marvel: Crisis Protocol - Corvus Glaive and Proxima Midnight','','','',''),(868,1,1,'','','marvel-crisis-protocol---gamora-and-nebula','','','','Marvel: Crisis Protocol - Gamora and Nebula','','','',''),(869,1,1,'','','marvel-crisis-protocol---rocket-and-groot','','','','Marvel: Crisis Protocol - Rocket and Groot','','','',''),(870,1,1,'','','marvel-crisis-protocol---star-lord','','','','Marvel: Crisis Protocol - Star-Lord','','','',''),(871,1,1,'','','marvel-crisis-protocol---green-goblin','','','','Marvel: Crisis Protocol - Green Goblin','','','',''),(872,1,1,'','','marvel-crisis-protocol---doctor-strange--wong','','','','Marvel: Crisis Protocol - Doctor Strange & Wong','','','',''),(873,1,1,'','','marvel-crisis-protocol---thanos','','','','Marvel: Crisis Protocol - Thanos','','','',''),(874,1,1,'','','marvel-crisis-protocol---ant-man--wasp','','','','Marvel: Crisis Protocol - Ant-Man & Wasp','','','',''),(875,1,1,'','','marvel-crisis-protocol---ghost-rider','','','','Marvel: Crisis Protocol - Ghost Rider','','','',''),(876,1,1,'','','marvel-crisis-protocol---kingpin','','','','Marvel: Crisis Protocol - Kingpin','','','',''),(877,1,1,'','','marvel-crisis-protocol---bullseye--daredevil','','','','Marvel: Crisis Protocol - Bullseye & Daredevil','','','',''),(878,1,1,'None','','star-wars-legion---leia-organa-commander-expansion','','','','Star Wars: Legion - Leia Organa Commander Expansion','','','',''),(879,1,1,'None','','star-wars-legion---han-solo-commander-expansion','','','','Star Wars: Legion - Han Solo Commander Expansion','','','',''),(880,1,1,'None','','star-wars-legion---rebel-commandos-unit-expansion','','','','Star Wars: Legion - Rebel Commandos Unit Expansion','','','',''),(881,1,1,'None','','star-wars-legion---jyn-erso-commander-expansion','','','','Star Wars: Legion - Jyn Erso Commander Expansion','','','',''),(882,1,1,'None','','star-wars-legion---rebel-pathfinders-unit-expansion','','','','Star Wars: Legion - Rebel Pathfinders Unit Expansion','','','',''),(883,1,1,'None','','star-wars-legion---director-orson-krennic-commander-expansion','','','','Star Wars: Legion - Director Orson Krennic Commander Expansion','','','',''),(884,1,1,'Tactically advancing across the battlefields like inhuman revenants, Imperial Death Troopers are a terrifying sight. Adorned in jet black armor and carrying an arsenal of weapons and equipment, these troopers are the elite soldiers of the Tarkin Initiative. Candidates are hand-selected from the Stormtrooper Corps by Imperial Intelligence itself. Trained to be efficient and merciless, they are also rumored to undergo classified medical augmentations.With the Imperial Death Troopers Unit Expansion, you can unleash these elite troops on the battlefields of Star Wars™: Legion. This expansion contains everything you need to add a squad of ruthless death troopers to your Imperial army, including six finely sculpted death trooper miniatures, a unit card, and an array of upgrade cards that give your Death Troopers access to even more advanced weaponry.','','sw-legion---imperial-death-troopers-unit-expansion','','','','SW Legion - Imperial Death Troopers Unit Expansion','','','',''),(885,1,1,'None','','star-wars-legion---tx-225-gavw-occupier-combat-assault-tank-unit-expansion','','','','Star Wars: Legion - TX-225 GAVw Occupier Combat Assault Tank Unit Expansion','','','',''),(886,1,1,'None','','star-wars-legion---sabine-wren-operative-expansion','','','','Star Wars: Legion - Sabine Wren Operative Expansion','','','',''),(887,1,1,'None','','star-wars-legion---rebel-veterans-unit-expansion','','','','Star Wars: Legion - Rebel Veterans Unit Expansion','','','',''),(888,1,1,'None','','star-wars-legion---tauntaun-riders-unit-expansion','','','','Star Wars: Legion - Tauntaun Riders Unit Expansion','','','',''),(889,1,1,'None','','star-wars-legion---imperial-shoretroopers-unit-expansion','','','','Star Wars: Legion - Imperial Shoretroopers Unit Expansion','','','',''),(890,1,1,'None','','star-wars-legion---crashed-escape-pod-battlefield-expansion','','','','Star Wars: Legion - Crashed Escape Pod Battlefield Expansion','','','',''),(891,1,1,'None','','star-wars-legion---count-dooku-commander-expansion','','','','Star Wars: Legion - Count Dooku Commander Expansion','','','',''),(892,1,1,'\nThe Phase I Clone Troopers Unit Expansion contains a full unit of seven unique, unpainted Phase I Clone miniatures, identical to the Phase I Clone Troopers included in the Star Wars: Legion Clone Wars Core Set. Five Phase I Clone Troopers wielding DC-15A Blaster Rifles are joined by a Z-6 Phase I Trooper and a DC-15 Phase I Trooper. This expansion also includes a unit card and an assortment of upgrade cards, inviting you to customize your Clone Troopers’ gear to fit your battle plan.\n\nProtect democracy across the galaxy with the seven unique, highly detailed miniatures featured in this expansion pack! Five troopers with DC-15A Blaster Rifles appear in different poses while a Phase I Clone Trooper carrying a Z-6 Rotary Blaster Cannon and a DC-15 Phase I Trooper bring heavy weapons to the front lines.','','star-wars-legion---phase-i-clone-troopers-unit-expansion','','','','Star Wars: Legion - Phase I Clone Troopers Unit Expansion','','','',''),(893,1,1,'\nThe B1 Battle Droids Unit Expansion gives you the chance to supplement your Separatist Alliance forces with even more battle droids. Nine unpainted and finely-sculpted B1 Battle Droid miniatures identical to those found in the Star Wars: Legion Clone Wars Core Set stand ready to form the backbone of your army, including two miniatures carrying heavy weapons. Joining these miniatures are a unit card and a variety of upgrade cards inviting you to make your own personal refinements to your battle droids.\n\nCreate a massive droid army with the nine highly-detailed B1 Battle Droid miniatures found in this expansion! Seven Battle Droids can lay down heavy fire with their E-5 Blaster Rifles, while a B1 Trooper with an E-60R poses a threat to enemy vehicles. Finally, an E-5C B1 Trooper adds even more firepower to your battle droids in their quest to bring down the Republic.','','star-wars-legion---b1-battle-droids-unit-expansion','','','','Star Wars: Legion - B1 Battle Droids Unit Expansion','','','',''),(894,1,1,'None','','star-wars-legion---droidekas-unit-expansion','','','','Star Wars: Legion - Droidekas Unit Expansion','','','',''),(895,1,1,'Selecting the troops that you’ll lead into battle is only the first step in creating your own Star Wars: Legion army. Once you’ve supplemented your armies with fresh recruits, you can further enhance them with the addition of upgrade cards. Each upgrade unlocks new tactical possibilities for your army, giving you the freedom to customize your units to meet your individual preferences.  While every Unit Expansion contains a variety of upgrade cards that help enhance that particular unit’s natural abilities, the Upgrade Card Pack conveniently puts a vast library of upgrade cards at your fingertips no matter which faction you play. Within this pack, you\'ll find copies of the following upgrade cards:  5 Command Upgrade Cards 1 Aggressive Tactics 1 Commanding Presence 1 Esteemed Leader 1 Improvised Orders 1 Strict Orders 13 Comms Upgrade Cards 2 Comms Jammer 3 Comms Relay 3 HQ Uplink 3 Linked Targeting Array 2 Long-Range Comlink 5 Force Upgrade Cards 1 Battle Meditation 1 Force Guidance 1 Force Push 1 Force Reflexes 1 Saber Throw 16 Gear Upgrade Cards 2 Electrobinoculars 3 Emergency Stims 3 Environmental Gear 3 Grappling Hooks 3 Recon Intel 2 Targeting Scopes 6 Grenade Upgrade Cards 2 Concussion Grenades 2 Fragmentation Grenades 2 Impact Grenades 15 Training Upgrade Cards 3 Duck and Cover 3 Endurance 3 Hunter 3 Overwatch 3 Tenacity','','star-wars-legion---upgrade-card-pack','','','','Star Wars: Legion - Upgrade Card Pack','','','',''),(896,1,1,'None','','sw-legion---rebel-troopers-upgrade-expansion','','','','SW Legion - Rebel Troopers Upgrade Expansion','','','',''),(897,1,1,'None','','sw-legion---cassian-andor-and-k-2so-expansion','','','','SW Legion - Cassian Andor and K-2SO Expansion','','','',''),(898,1,1,'None','','necromunda-the-book-of-ruin','','','','Necromunda: The Book of Ruin','','','',''),(899,1,1,'Palanite Subjugator Patrol to kompletnie nowa drużyna do Necromundy, która \nnaszym zdaniem są wspaniałe.','','necromunda-palanite-subjugator-patrol','','','','Necromunda: Palanite Subjugator Patrol','','','',''),(900,1,1,'Corpse Grinder Cult Gang to kolejna nowa banda do nekromundy w stylistyce \napokalipsy i kanibali. Tych modeli nie powinno zabraknąć w twojej kolekcji.','','necromunda-corpse-grinder-cult','','','','Necromunda: Corpse Grinder Cult','','','',''),(901,1,1,'None','','necromunda-zone-mortalis-columns-and-walls','','','','Necromunda: Zone Mortalis Columns and Walls','','','',''),(902,1,1,'None','','necromunda-house-of-chains','','','','Necromunda: House of Chains','','','',''),(903,1,1,'None','','necromunda-goliath-stimmers--forgeborn','','','','Necromunda: Goliath Stimmers & Forgeborn','','','',''),(904,1,1,'None','','necromunda-house-of-blades','','','','Necromunda: House of Blades','','','',''),(905,1,1,'None','','necromunda-jotunn-h-grade-servitor-ogryns','','','','Necromunda: Jotunn H-Grade Servitor Ogryns','','','',''),(906,1,1,'None','','necromunda-escher-death-maidens--wyld-runners','','','','Necromunda: Escher Death Maidens & Wyld Runners','','','',''),(907,1,1,'\n\n\n\n\n','','necromunda-house-of-iron','','','','Necromunda: House of Iron','','','',''),(908,1,1,'\n\n\n\n\n','','necromunda-orlock-arms-masters--wreckers','','','','Necromunda: Orlock Arms Masters & Wreckers','','','',''),(909,1,1,'\n\n\n\n\n','','necromunda-house-of-artifice','','','','Necromunda: House of Artifice','','','',''),(910,1,1,'\n\n\n\n\n','','necromunda-van-saar-archeoteks--grav-cutters','','','','Necromunda: Van Saar Archeoteks & Grav-cutters','','','',''),(911,1,1,'\n\n\n\nCawdor Gang Tactics Cards - Uwolnij gniew Domu Wiary za pomocą tych 26 \nprzydatnych kart referencyjnych, reprezentujących niezliczone sztuczki i \nschematy, które można wykorzystać, aby uzyskać przewagę w podludziu. Oprócz 18 \nkart taktyk specyficznych dla gangów, które doskonale opisują sposób walki Rodu \nCawdor, jest też 8 pustych kart wojowników, dzięki którym możesz śledzić swój \ngang.To pudełko zawiera 26 kart 100mm x 75mm do wykorzystania w grach \nNecromunda:– 18x kart Taktyk dla gangów Cawdor– 8x Puste karty \nWojownikówPotrzebujesz kopii Necromunda: Rulebook i Necromunda: House of \nFaith, aby korzystać z zawartości tego zestawu.\n','','necromunda-cawdor-gang-cards','','','','Necromunda: Cawdor Gang Cards','','','',''),(912,1,1,'\n\n\n\nNecromunda: House of Faith - Z zewnątrz inni Nekromundczycy postrzegają \nDom Cawdor jako zbieraczy kości, padlinożerców i żebraków, niewiele lepszych niż \nszczury. Ale Dom Cawdor ma wiarę, wiarę tak silną, że została uratowana przed \nzagładą, podczas gdy tak wiele innych Domów Klanów uległo upływowi czasu lub \ninnym nieszczęściom. Zdobądź kompletny przewodnik po Domu Cawdor. Ta \n136-stronicowa książka w twardej oprawie zawiera ostateczną historię Domu i \nzasady wystawiania ośmiu różnych typów wojowników dostępnych dla Domu Cawdor - \nStrażników Słowa, Kapłanów, Ognistych, Diakonów, Braci Cawdor, Braci \nRedemptionist, Bonepickers i Zealots. Jest idealny dla fanów House Cawdor lub \nkażdego, kto chce zagłębić się w ciemną stronę podziemnego ula.Necromunda: \nHouse of Faith - W tej książce znajdziesz:– Historia i tło rodu Cawdorów: \nrozległe i obszerne tło na temat początków rodu Cawdor i tego, jak stał się \nnajwiększym klanem na Necromundzie.– Lista gangów Cawdorów: Wszystkie \nzasady, których potrzebujesz, aby wystawić gang Cawdorów w grach Necromunda, w \ntym zasady korzystania z Redemptionistów w swoich gangach lub zakładania gangów \nstworzonych wyłącznie z tych płonących fanatyków.– Hangers-on and Brutes: \nZasady zatrudniania Hangers-on i Brutes do swojego gangu, w tym tych \nspecyficznych dla Cawdora i używania ich w grach Necromunda.– Hired Guns: \nZasady korzystania z Łowców Nagród, Agentów Domowych i Szumowiny Uli.– Silne \nsojusze: Zasady zawierania sojuszy z trzema organizacjami, z którymi Dom Cawdor \nma powiązania, w tym z Gildią Zwłok, Rogue Factoria i Domem Ko\'iron – \nSzlachetnym Domem, który wspiera Dom Wiary.– Dodatkowe zasady: Ta sekcja \nzawiera nowe i dodatkowe zasady, z których mogą korzystać gangi Rodu Cawdor w \ngrach Necromunda, zapewniając graczom Cawdor wiele opcji, w tym umiejętności, \nzdolności i teren charakterystyczny dla gangu.– Tabela referencyjna broni: \nobszerna tabela referencyjna broni dla wszystkich rodzajów broni i sprzętu \nbojowego dostępnych dla domu Cawdor i jego sojuszników.– Taktyka gangów rodu \nCawdorów: tabela D66 dotycząca taktyk gangów do wykorzystania w \nscenariuszach.– Dramatis Personae: Zasady zatrudniania i używania czterech \nzupełnie nowych postaci Dramatis Personae w grach Necromunda.Jest to \nrozszerzenie do Necromundy – do korzystania z zawartości tej książki będziesz \npotrzebować egzemplarza instrukcji Necromunda lub instrukcji Necromunda: Dark \nUprising.\n','','necromunda-house-of-faith','','','','Necromunda: House of Faith','','','',''),(913,1,1,'\n\n\n\nCawdor Redemptionists - Sekta Redemptionistów wierzy, że Ludzkość spadła \nze ścieżki prawości ogłoszonej przez Boga-Imperatora i że grzechy ludzkości \nutopią Imperium w brudzie i zepsuciu. Dopóki ludzkość nie będzie w stanie \nkontrolować swojej grzesznej natury, nie będzie w stanie zjednoczyć się i podbić \ngwiazd, tak jak naprawdę chce tego Imperator. Grzech musi zostać oczyszczony ze \nwszystkich ogniem, krwią i wiarą, a Odkupiciele są z tego powodu bardzo \nszczęśliwi.Cawdor Redemptionists - Rozbuduj swój gang Cawdor o tych sześciu \nwojowników lub rozpocznij własną krucjatę Redemptionist. Kapłan Redemptor jest \nprzywódcą gangu, a za nim do walki podąża jego Deacon (czempion gangu), trzech \nBraci (Gangers) i Zelota (Juve). Niezależnie od tego, czy wyślesz ich jako \nwłasny gang, czy dodasz ich do istniejących bojowników Cawdor, ich unikalna broń \nwkrótce pomoże ci oczyścić underhive z grzechu.Cawdor Redemptionists - Ten \n76-częściowy plastikowy zestaw zapewnia:– 2x Odkupiciel Kapłan lub \nBracia– 2x Diakon lub Bracia– 2x Zelota lub BraciaJest dostarczany z \nokrągłymi podstawkami 25mm. Zasady korzystania z tych modeli w grach Necromunda \nmożna znaleźć w dodatku House of Faith.\n','','necromunda-cawdor-redemptionists','','','','Necromunda: Cawdor Redemptionists','','','',''),(914,1,1,'None','','necromunda-delaque-gang-tactics-cards','','','','Necromunda: Delaque Gang Tactics Cards','','','',''),(915,1,1,'None','','necromunda-house-of-shadow','','','','Necromunda: House of Shadow','','','',''),(916,1,1,'Ten zestaw jest dostarczany jako 98 komponentów, które tworzą następujące siedem miniatur:\n- 2x Nacht-Ghul with 2x 25mm Necromunda Bases)\n- 2x Psy-Gheists with 1x 32mm Necromunda Base and 1x 25mm Necromunda Base\n- 2x Psychoterric Wyrms with 2x 25mm Necromunda Bases\n- 1x Piscean Spektor with 1x 40mm Necromunda Base and 1x 45mm Groove Stem set','','necromunda-delaque-nacht-ghul-and-psy-gheists','','','','Necromunda: Delaque Nacht-Ghul and Psy-Gheists','','','',''),(917,1,1,'None','','necromunda-the-book-of-peril','','','','Necromunda: The Book of Peril','','','',''),(918,1,1,'None','','the-starblood-stalkers---warhammer-underworlds','','','','The Starblood Stalkers - Warhammer Underworlds','','','',''),(919,1,1,'Zestaw zawiera:\n\n- 56-stronicowy Rulebook\n- 56-stronicową instrukcję do gry\n- Kompletny zespół Farstriders - kompania Stormcast Eternals składająca się z trzech wciskanych figurek, odlanych z niebieskiego plastiku, dzięki czemu wyróżniają się nawet niepomalowane, a także karty wojowników i pełną talię Rivals z kartami specyficznymi dla oddziału, które pozwalają uwolnić ich szlachetne strategie w bitwie.\n- Kompletna banda Gwardii Sepulkralnej - grupa szkieletowych wojowników składająca się z siedmiu wciskanych modeli odlanych z plastiku w kolorze kości, a także kart wojowników i pełnej talii kart Rivals, które pozwalają wykorzystać ich moc w bitwie.\n- 2 dwustronne, rozkładane plansze do gry, które można wykorzystać do tworzenia pól bitewnych.\n- Żetony Warhammer Underworlds, w tym cele, znaczniki ran, punkty chwały i wiele innych.\n- 8 kości - 5 kości ataku i 3 kości obrony, wystarczające do zadawania najbardziej niszczycielskich ciosów i desperackiej obrony!','','warhammer-underworlds-starter-set','','','','Warhammer Underworlds Starter Set','','','',''),(920,1,1,'\n','','the-crimson-court','','','','The Crimson Court','','','',''),(921,1,1,'None','','kainans-reapers','','','','Kainan\'s Reapers','','','',''),(922,1,1,'None','','elathains-soulraid','','','','Elathain’s Soulraid','','','',''),(923,1,1,'','','blackpowders-buccaneers---warhammer-underworlds','','','','Blackpowder\'s Buccaneers - Warhammer Underworlds','','','',''),(924,1,1,'None','','gorechosen-of-dromm','','','','Gorechosen Of Dromm','','','',''),(925,1,1,'Zestaw zawiera:\n- 7x push-fit Grinkrak’s Looncourt miniatures\n- 7x double-sided fighter cards\n- 1x Grinkrak’s Looncourt Warband Background / Rivals Deck Card\nTalia rywali składająca się z 32 kart:\n- 12x Grinkrak’s Looncourt objective cards\n- 10x Grinkrak’s Looncourt gambit cards\n- 10x Grinkrak’s Looncourt upgrade cards','','warhammer-underworlds-grinkraks-looncourt','','','','Warhammer Underworlds: Grinkrak\'s Looncourt','','','',''),(926,1,1,'Warhammer Underworlds: Gryselle\'s Arenai to rozszerzenie do popularnej gry planszowej Warhammer Underworlds, które przenosi graczy do tajemniczej i mrocznej krainy, zwaną Beastgrave.\n\nW zestawie znajdują się karty i modele do gry dla dwóch nowych frakcji: Morgwaeth\'s Blade-Coven oraz Grymwatch. Każda z frakcji ma swoje unikalne umiejętności i strategie, co pozwala na wiele wariantów rozgrywki. Dodatkowo, zestaw zawiera również nowe karty do ulepszania istniejących frakcji oraz nowe zasady i przeszkody, które wprowadzają nowe wyzwania dla graczy.\n\nWarhammer Underworlds: Gryselle\'s Arenai to idealny wybór dla fanów gier planszowych, którzy chcą rozbudować swoją kolekcję i doświadczyć nowych frakcji i wyzwań. Dodatek ten oferuje wiele możliwości dla bardziej zaawansowanych graczy, jak i dla początkujących, którzy chcą poznać świat gry Warhammer Underworlds.','','warhammer-underworlds-gryselles-arenai','','','','Warhammer Underworlds: Gryselle\'s Arenai','','','',''),(927,1,1,'Gnarlwood: Beastbound Assault to rozszerzenie do gry Warhammer Age of Sigmar, które umożliwia graczom przeprowadzenie epickich bitew w tajemniczej i niebezpiecznej krainie Gnarlwood.\n\nW zestawie znajdują się modele do gry dla dwóch nowych frakcji: Sylwety i Gniewne Bestie, a każda z nich ma swoje unikalne umiejętności i strategie. Gracze będą musieli wykorzystać całą swoją wiedzę i doświadczenie, aby pokonać przeciwnika i osiągnąć zwycięstwo.\n\nDodatkowo, zestaw zawiera również nowe karty, które pozwalają na ulepszanie istniejących frakcji oraz wprowadzają nowe zasady i przeszkody, co pozwala na jeszcze bardziej złożoną rozgrywkę.\n\nGnarlwood: Beastbound Assault to idealny wybór dla fanów gry Warhammer Age of Sigmar, którzy chcą rozszerzyć swoją kolekcję i doświadczyć nowych frakcji i wyzwań. Rozszerzenie to oferuje wiele możliwości dla bardziej zaawansowanych graczy, jak i dla początkujących, którzy chcą poznać świat gry Warhammer Age of Sigmar.','','gnarlwood-beastbound-assualt','','','','Gnarlwood: Beastbound Assualt','','','',''),(928,1,1,'None','','warhammer-underworlds-skabbiks-plaguepack','','','','Warhammer Underworlds: Skabbiks Plaguepack','','','',''),(929,1,1,'None','','rivals-deck---paths-of-prophecy','','','','Rivals deck - Paths of Prophecy','','','',''),(930,1,1,'None','','silent-menace-universal-deck','','','','Silent Menace Universal Deck','','','',''),(931,1,1,'None','','malevolent-masks-rivals-deck','','','','Malevolent Masks Rivals Deck','','','',''),(932,1,1,'Zondara and Ferlain have had their love torn apart by a terrible curse that has turned Ferlain into a snarling fiend. Calling on the bestial magic of Ghur and the forbidden power of necromancy, Zondara has raised a band of animated corpses to plunder the glacial depths of the Deathgorge and discover some way of returning her lover to his previous state. This new warband comes with a Rivals deck that uses undead thralls to unearth powerful upgrades for Zondara and Ferlain.','','zondaras-gravebreakers','','','','Zondara\'s Gravebreakers','','','',''),(933,1,1,'Some say that the ancient ice encasing the blood-magic artefacts deep with the Deathgorge can be thawed out through the shedding of blood in combat. Rimelocked Relics breathes frosty new life into your warbands with special Rimelocked upgrades whose powerful abilities must be coaxed out with Thaw counters across the game. As this deck doesn’t come with any Gambit spell cards, it can be used by any warband in the game.','','rimelocked-relics','','','','Rimelocked Relics','','','',''),(934,1,1,'None','','hexbanes-hunters','','','','Hexbane\'s Hunters','','','',''),(935,1,1,'None','','kill-team-killzones','','','','Kill Team: Killzones','','','',''),(936,1,1,'None','','kill-team-core-book','','','','Kill Team: Core Book','','','',''),(937,1,1,'None','','kill-team-adeptus-astartes-dice-set','','','','Kill Team: Adeptus Astartes Dice Set','','','',''),(938,1,1,'None','','kill-team-chaotica-dice-set','','','','Kill Team: Chaotica Dice Set','','','',''),(939,1,1,'None','','kill-team-ork-kommandos-dice-set','','','','Kill Team: Ork Kommandos Dice Set','','','',''),(