h tego okresu, takich jak oblężenie Terra czy bitwa na Istaavan III.\n\nDodatek ten zawiera szczegółowe zasady, które umożliwiają graczom na korzystanie z kultowych jednostek i modeli pojazdów, takich jak Legionowe Łodzie Bojowe i Warhoundy, a także pozwala na korzystanie z nowych zasad, które odzwierciedlają specyficzne taktyki i broń używane w czasach Heresy.\n\nHorus Heresy: Age of Darkness to doskonały wybór dla fanów Warhammera 40,000, którzy chcą przenieść się w czasie i odtworzyć epickie bitwy z czasów Heresy. Dzięki szczegółowym zasadom i modelom, gracze będą mieli możliwość odtworzenia tych legendarnych bitew w sposób epicki i emocjonujący.','','horus-heresy-age-of-darkness','','','','Horus Heresy: Age of Darkness','','','',''),(990,1,1,'None','','kratos-heavy-assault-tank','','','','Kratos Heavy Assault Tank','','','',''),(991,1,1,'None','','land-raider-proteus','','','','Land Raider Proteus','','','',''),(992,1,1,'None','','legion-astartes-mkiii-tactical-squad','','','','Legion Astartes: MKIII Tactical Squad','','','',''),(993,1,1,'Zanurz się w epickim świecie Warhammer the Horus Heresy z figurką \"Imotek the Stormlord\" od Games Workshop. Ten oddział natarciowy wyposażony w zestawy skokowe jest idealnym do realizowania taktyk dywersyjnych i pozycjonowania wroga na polu bitwy. Pokonywanie trudnych terenów i fortyfikacji to ich specjalność, a cios który przez nich zadany będzi niewątpliwie bolesn ydla wroga i być może kluczowy dla przebiegu bitwy.','','legion-mkvi-assault-squad','','','','Legion MKVI Assault Squad','','','',''),(994,1,1,'','','legion-mkvi-tactical-squad','','','','Legion MKVI Tactical Squad','','','',''),(995,1,1,'None','','cataphractii-terminator-squad','','','','Cataphractii Terminator Squad','','','',''),(996,1,1,'None','','cerberus-heavy-tank','','','','Cerberus Heavy Tank','','','',''),(997,1,1,'Contemptor Dreadnought to potężna, opancerzona maszyna wojenna, która jest jednym z najpotężniejszych i najstraszliwszych bojowych wozów w un