tami, które miały miejsce w czasach Heresy. Gracze mogą wcielić się w dowódców i prowadzić swoje armie do walki w najbardziej legendarnych bitwach tego okresu, takich jak oblężenie Terra czy bitwa na Istaavan III.\n\nDodatek ten zawiera szczegółowe zasady, które umożliwiają graczom na korzystanie z kultowych jednostek i modeli pojazdów, takich jak Legionowe Łodzie Bojowe i Warhoundy, a także pozwala na korzystanie z nowych zasad, które odzwierciedlają specyficzne taktyki i broń używane w czasach Heresy.\n\nHorus Heresy: Age of Darkness to doskonały wybór dla fanów Warhammera 40,000, którzy chcą przenieść się w czasie i odtworzyć epickie bitwy z czasów Heresy. Dzięki szczegółowym zasadom i modelom, gracze będą mieli możliwość odtworzenia tych legendarnych bitew w sposób epicki i emocjonujący.','','horus-heresy-age-of-darkness','','','','Horus Heresy: Age of Darkness','','','',''),(1008,1,1,'None','','kratos-heavy-assault-tank','','','','Kratos Heavy Assault Tank','','','',''),(1009,1,1,'None','','land-raider-proteus','','','','Land Raider Proteus','','','',''),(1010,1,1,'None','','legion-astartes-mkiii-tactical-squad','','','','Legion Astartes: MKIII Tactical Squad','','','',''),(1011,1,1,'Zanurz się w epickim świecie Warhammer the Horus Heresy z figurką \"Imotek the Stormlord\" od Games Workshop. Ten oddział natarciowy wyposażony w zestawy skokowe jest idealnym do realizowania taktyk dywersyjnych i pozycjonowania wroga na polu bitwy. Pokonywanie trudnych terenów i fortyfikacji to ich specjalność, a cios który przez nich zadany będzi niewątpliwie bolesn ydla wroga i być może kluczowy dla przebiegu bitwy.','','legion-mkvi-assault-squad','','','','Legion MKVI Assault Squad','','','',''),(1012,1,1,'','','legion-mkvi-tactical-squad','','','','Legion MKVI Tactical Squad','','','',''),(1013,1,1,'Leviathan Dreadnought With Claws/Drills to potężna figura do gry bitewnej Warhammer 40,000, stanowiąca nierozerwalną część armii Kosmicznych Marines. Zestaw ten zawiera model Dreadnoughta Leviathan z zamontowanymi wielkimi pazurami i wiertłami, które są gotowe do rozszarpania i przewiercenia wrogów.\n\nLeviathan Dreadnought With Claws/Drills jest jednym z najpotężniejszych modeli Dreadnoughtów, jakie można znaleźć w grze. Posiada on wiele różnych broni i umiejętności, które czynią go niezwykle skutecznym w walce z wrogami.\n\nModel ten został wykonany z wysokiej jakości tworzywa sztucznego, co gwarantuje jego trwałość i odporność na uszkodzenia. Jest on łatwy do złożenia dzięki instrukcjom, które znajdują się w zestawie.\n\nLeviathan Dreadnought With Claws/Drills jest idealnym wyborem dla graczy, którzy chcą wzmocnić swoją armię Kosmicznych Marines o potężnego i niezwykle skutecznego wojownika. Jego pancerz jest w stanie wytrzymać ciężkie ataki, a jego broń jest wystarczająco silna, aby zniszczyć każdego wroga.\n\n','','leviathan-dreadnought-with-clawsdrills','','','','Leviathan Dreadnought With Claws/Drills','','','',''),(1014,1,1,'None','','leviathan-siege-dreadnought-ranged-weapons-frame','','','','Leviathan Siege Dreadnought Ranged Weapons Frame','','','',''),(1015,1,1,'None','','age-of-darkness-armiger-warglaives','','','','Age of Darkness Armiger Warglaives','','','',''),(1016,1,1,'None','','age-of-darkness-knight-questoris','','','','Age of Darkness Knight Questoris','','','',''),(1017,1,1,'None','','archmagos-prime','','','','Archmagos Prime','','','',''),(1018,1,1,'None','','castellax-battle-automata-maniple','','','','Castellax Battle-automata Maniple','','','',''),(1019,1,1,'The Acheron variant of the noble Cerastus Knight is unmatched when it comes to getting up close and personal with the enemy. Armed with a flamestorm cannon and a reaper chainfist, it can sweep away enemy infantry with powerful bursts of superheated promethium or wide swings of its chain. It\'s an exterminator, a grim steed designed for the exclusive purpose of slaughtering foes.','','cerastus-knight-acheron','','','','Cerastus Knight Acheron','','','',''),(1020,1,1,'The Castigator prefers to engage in combat at medium range, unleashing a barrage of highly explosive shells from its castigator boltcannon. Nevertheless, it can also excel in close-quarters combat with its tempest warblade - a mighty sword that harnesses volkite technology to inflict truly substantial damage. It is a true engine of destruction, ready to unleash fiery havoc both at a distance and in close combat.','','cerastus-knight-castigator','','','','Cerastus Knight Castigator','','','',''),(1021,1,1,'Cerastus Knight Lancer to potężny model z uniwersum Warhammer 40,000 oferowany przez Games Workshop. Jest to imponujący Rycerz Domu, charakteryzujący się niebywałą wysokością i niezwykłą ruchomością. Zestaw zawiera 517 naklejek z różnorodnymi emblematami Domów Rycerzy, co pozwala na dostosowanie wyglądu modelu do własnych preferencji. Cerastus Knight Lancer może być wykorzystywany zarówno w emocjonujących bitwach w Warhammer 40,000, jak i w epickich starciach z czasów Herezji Horusa. Dzięki swojej potężnej sile i zdolnościom taktycznym, ten model staje się niezbędnym elementem dla kolekcjonerów i graczy poszukujących dynamicznych i wciągających rozgrywek w świecie Warhammera.','','cerastus-knight-lancer','','','','Cerastus Knight Lancer','','','',''),(1022,1,1,'To pudełko zawiera 29 nowych plastikowych figurek Mechanicum do Warhammer Horus Heresy\n\n- 2x Castellax Battle-automata \n-20 Adsecularis Tech-thralls \n- 6x cyborg Thallax\n- 1x Triaros Conveyor','','horus-heresy-mechanicum-battle-group','','','','Horus Heresy: Mechanicum Battle Group','','','',''),(1023,1,1,'Grupa bojowa rycerzy łączy rycerza Cerastusa Castigatora z wariantem Acherona w zabójczy duet gotowy do zdominowania pola bitwy. Dzięki kolosalnemu działku boltowemu i trzeszczącej burzowej warblade Kastigator stanowi zagrożenie dla piechoty i lekkich pojazdów, podczas gdy Acheron terroryzuje wrogów za pomocą zamontowanego na ramieniu działa burzowego i wypruwa ciężki pancerz za pomocą pięści łańcuchowej żniwiarza.','','knight-battle-group-castigator-and-acheron','','','','Knight Battle Group: Castigator and Acheron','','','',''),(1024,1,1,'None','','mechanicum-dice-set','','','','Mechanicum Dice Set','','','',''),(1025,1,1,'None','','tech-thralls-covenant','','','','Tech-thralls Covenant','','','',''),(1026,1,1,'None','','thallax-cohort','','','','Thallax Cohort','','','',''),(1027,1,1,'None','','thanatar-cavas-siege-automata','','','','Thanatar Cavas Siege-automata','','','',''),(1028,1,1,'None','','triaros-armoured-conveyor','','','','Triaros Armoured Conveyor','','','',''),(1029,1,1,'None','','hermes-light-sentinel-squadron','','','','Hermes Light Sentinel Squadron','','','',''),(1030,1,1,'Zanurz się w epickim świecie Warhammer The Horus Heresy z zestawem \"Aethon Heavy Sentinel\" od Games Workshop. Te mechy bojowe świetnie nadają się do przecierania szlaków dla pozostałych oddziałów. Prowadzone przez zatwardziałych weteranów armii z łatwością rozpoznają najniebezpieczniejsze zagrożenia a dzięki szerokiemu arsenałowi dostępnemu dla tych maszyn, równie szybko może niebezpieczeństwo zniwelować.','','solar-auxilia--aethon-heavy-sentinel','','','','Solar Auxilia – Aethon Heavy Sentinel','','','',''),(1031,1,1,'None','','solar-auxilia--dracosan-armoured-transport','','','','Solar Auxilia – Dracosan Armoured Transport','','','',''),(1032,1,1,'Zanurz się w epickim świecie Warhammer The Horus Heresy z zestawem \"Solar Auxilia Lasrifle Section\" od Games Workshop. To podstawowa jednostka armii wyposażona w pancerze które pozwalają na walkę w praktycznie każdych warunkach, nawet w przestrzeni kosmicznej. Podstawowy wariant Lasguna to idealna broń o niezwykle wysokim potencjale bojowym, a dobrana z odpowiednim treningiem militarnym stanowi przerażająco skuteczne i śmiercionośne połączenie.','','solar-auxilia--lasrifle-section','','','','Solar Auxilia – Lasrifle Section','','','',''),(1033,1,1,'Zanurz się w epickim świecie Warhammer The Horus Heresy z zestawem \"Solar Auxilia Leman Russ Assult Tank\" od Games Workshop. Te ciężko opancerzone pojazdy idealnie nadają się do rozmieszczenia w centrum wiru walki. Jego opancerzenie gwarantuje bezpieczeństwo załodze, co pozwala na toczenie długich bojów nawet najgorszych warunkach.','','solar-auxilia--leman-russ-assault','','','','Solar Auxilia – Leman Russ Assault','','','',''),(1034,1,1,'Zanurz się w epickim świecie Warhammer The Horus Heresy z zestawem \"Solar Auxilia – Leman Russ Strike Tanks\" od Games Workshop. Te ciężko opancerzone maszyny gwarantują wysoką przeżywalność załogi dzięki czemu mogą spędzać długi okres czasu na polach bitwy a dowodzone przez dowódców na polach bitwy skutecznie rozprawiają się z zagrożeniami wszelkiego kalibru.','','solar-auxilia--leman-russ-strike-tanks','','','','Solar Auxilia – Leman Russ Strike Tanks','','','',''),(1035,1,1,'Zanurz się w epickim świecie Warhammer The Horus Heresy z zestawem \"Malcador Heavy Tank\" od Games Workshop. Te ciężko opancerzone kolosy mimo swojego rozmiaru i wagi potrafią utrzymać niemałą prędkość. Asekurowane przez modele Leman Russ mogą skupić się na generowaniu gigantycznych zniszczeń za pomocą niejednego wariantu frontowego działa.','','solar-auxilia--malcador-heavy-tank','','','','Solar Auxilia – Malcador Heavy Tank','','','',''),(1036,1,1,'Zanurz się w epickim świecie Warhammer The Horus Heresy z zestawem \"Solar Auxilia Tactical Command Section\" od Games Workshop. Ci młodsi pułkownicy walczą na polach walki i dbają o to aby wszystkie rozkazy były na bieżąco przekazywane i wypełniane. Koordynują oni ostrzał i ułożenie oddziałów oraz na bieżąco poprawiają taktykę i przekazują informacje sztabowi oficerskiemu.','','solar-auxilia--tactical-command-section','','','','Solar Auxilia – Tactical Command Section','','','',''),(1037,1,1,'Zanurz się w epickim świecie Warhammer The Horus Heresy z zestawem \"Veletaris Storm Section\" od Games Workshop. Ta elitarna jednostka piechoty jest dużo lepiej przygotowana, zarówno w dziedzinie treningów jak i sprzętu, do prowadzenia działań militarnych. Zorganizowani i oddani zrobią wszystko żeby dopilnować że rozkazy zostaną wykonane.','','solar-auxilia--veletaris-storm-section','','','','Solar Auxilia – Veletaris Storm Section','','','',''),(1038,1,1,'None','','solar-auxilia-basilisk--medusa','','','','Solar Auxilia Basilisk & Medusa','','','',''),(1039,1,1,'None','','alpha-legion-transfer-sheet','','','','Alpha Legion Transfer Sheet','','','',''),(1040,1,1,'None','','blood-angels-legion-transfer-sheet','','','','Blood Angels Legion Transfer Sheet','','','',''),(1041,1,1,'None','','campaigns-in-the-age-of-darkness-the-battle-for-beta-garmon','','','','Campaigns in the Age of Darkness: The Battle for Beta-Garmon','','','',''),(1042,1,1,'None','','campaigns-of-the-age-of-darkness-the-martian-civil-war','','','','Campaigns of The Age of Darkness: The Martian Civil War','','','',''),(1043,1,1,'None','','death-guard-legion-transfer-sheet','','','','Death Guard Legion Transfer Sheet','','','',''),(1044,1,1,'None','','emperors-children-legion-transfer-sheet','','','','Emperor\'s Children Legion Transfer Sheet','','','',''),(1045,1,1,'None','','exemplary-battles-of-the-age-of-darkness-volume-one','','','','Exemplary Battles of The Age of Darkness: Volume One','','','',''),(1046,1,1,'\n\n\n\n\n','','horus-heresy-age-of-darkness-rulebook','','','','Horus Heresy: Age of Darkness Rulebook','','','',''),(1047,1,1,'None','','horus-heresy-reference-cards','','','','Horus Heresy: Reference Cards','','','',''),(1048,1,1,'None','','iron-warriors-legion-transfer-sheet','','','','Iron Warriors Legion Transfer Sheet','','','',''),(1049,1,1,'None','','legion-dice---blood-angels','','','','Legion Dice - Blood Angels','','','',''),(1050,1,1,'None','','legion-dice---iron-hands','','','','Legion Dice - Iron Hands','','','',''),(1051,1,1,'None','','legion-dice---raven-guard','','','','Legion Dice - Raven Guard','','','',''),(1052,1,1,'None','','legion-dice---space-wol