tadel 60 mm i 2x okrągłe podstawki Citadel 25 mm.','','treebeard-mighty-ent','','','','Treebeard Mighty Ent','','','',''),(1072,1,1,'Ent to opiekun drzew z lasu Fangorn. Enty są bardzo cierpliwymi i spokojnymi stworzeniami, które miłują przyrodę, jednak sprowokowane do działania Enty mogą stanowić niepowstrzymaną siłę, która jest w stanie pokonać każdego przeciwnika. Zdolność Entów do miotania głazami sieje popłoch w szeregach wroga. Gruba kora Entów oraz długie ramiona czynią z nich groźnych przeciwników na polu walki.','','ent','','','','Ent','','','',''),(1073,1,1,'None','','galadriel-and-celeborn','','','','Galadriel and Celeborn','','','',''),(1074,1,1,'None','','wood-elf-warriors','','','','Wood Elf Warriors','','','',''),(1075,1,1,'None','','galadhrim-warriors','','','','Galadhrim Warriors','','','',''),(1076,1,1,'None','','galadhrim-knights','','','','Galadhrim Knights','','','',''),(1077,1,1,'None','','hobbit-archers','','','','Hobbit Archers','','','',''),(1078,1,1,'None','','hobbit-militia','','','','Hobbit Militia','','','',''),(1079,1,1,'None','','farmer-maggot--hounds','','','','Farmer Maggot & Hounds','','','',''),(1080,1,1,'None','','arwen-foot-and-mounted','','','','Arwen Foot and Mounted','','','',''),(1081,1,1,'\n\n\n\n0\n','','elf-command','','','','Elf Command','','','',''),(1082,1,1,'None','','numenorean-bowmen','','','','Numenorean Bowmen','','','',''),(1083,1,1,'None','','rohan-royal-guard-on-foot','','','','Rohan Royal Guard on Foot','','','',''),(1084,1,1,'None','','prince-imrahil-of-dol-amroth-foot-and-mounted','','','','Prince Imrahil of Dol Amroth Foot and Mounted','','','',''),(1085,1,1,'None','','faramir-foot--mounted','','','','Faramir Foot & Mounted','','','',''),(1086,1,1,'\n\n\n\n0 \n','','osgiliath-veterans','','','','Osgiliath Veterans','','','',''),(1087,1,1,'None','','faramir-madril-and-damrod-rangers-of-ithilien','','','','Faramir, Madril and Damrod, Rangers of Ithilien','','','',''),(1088,1,1,'None','','warriors-of-the-fiefdo