łot, włócznię. Cave Troll jest nie opancerzony, gdyż ma na tyle grubą skórę, że nie potrzebuje dodatkowego pancerza.','','cave-troll','','','','Cave Troll','','','',''),(1104,1,1,'None','','sauron-the-necromancer','','','','Sauron the Necromancer','','','',''),(1105,1,1,'None','','ruffians','','','','Ruffians','','','',''),(1106,1,1,'None','','in-the-clutches-of-shelob','','','','In the Clutches of Shelob','','','',''),(1107,1,1,'None','','the-scouring-of-shire','','','','The Scouring of Shire','','','',''),(1108,1,1,'None','','uruk-hai-scouts','','','','Uruk-hai Scouts','','','',''),(1109,1,1,'Moria Goblins Warriors to małe, oślizgłe potwory zamieszkujące dawną kopalnię Morię. Wprowadziły się one tam po tym, jak okrutny demon, Balrog spustoszył jej wnętrze i wybił do nogi wszystkich mieszkających tam krasnoludów. Moria Goblins Warriors charakteryzują się w walce dużą przebiegłością, zręcznością oraz szczególnym okrucieństwem. Przeciwnicy zwykle są atakowani z zaskoczenia, wybijani do nogi po czym często zjadani.\nMoria Goblins Warriors mogą być wyposażeni w łuki lub tarcze, mieczem i włócznie. Przedstawieni są w dynamicznych, przebiegłych pozach, gotowi w każdej chwili do zmasowanego ataku, lub też ucieczki gdyby się okazało, że przeciwnik posiada przewagę liczebną lub jest gotowy do walki. Rzadko się zdarza, by Moria Goblins Warriors przegrały walkę - bo gdy wiedzą, że mogą przegrać to po prostu uciekają.','','moria-goblins','','','','Moria Goblins','','','',''),(1110,1,1,'None','','gandalf-the-grey-foot-mounted-and-on-cart','','','','Gandalf the Grey Foot, Mounted and on Cart','','','',''),(1111,1,1,'None','','mirkwood-rangers','','','','Mirkwood Rangers','','','',''),(1112,1,1,'None','','palace-guards','','','','Palace Guards','','','',''),(1113,1,1,'None','','warriors-of-dale','','','','Warriors of Dale','','','',''),(1114,1,1,'None','','warriors-of-erebor','','','','Warriors of Erebor','','','',''),(1115,1,1,'None','','grim-hammers','','','','Grim Hammers','',