zbroję i miecz\n- Krasnolud Fili, czempion Ereboru - wyposażony w ciężką zbroję krasnoludzką i miecz\n- Krasnolud Balin, czempion Ereboru - wyposażony w ciężką zbroję krasnoludzką i dwuręczną maczugę\n- Krasnolud Dwalin, czempion Ereboru - wyposażony w ciężką zbroję krasnoludzką, dwuręczny topór i dwa topory\n- Krasnolud Bifur, czempion Ereboru - wyposażony w ciężką zbroję krasnoludzką i półtoraręczny topór\n- Krasnolud Bofur, czempion Ereboru - wyposażony w ciężką zbroję krasnoludzką i półtoraręczny młot\n- Krasnolud Bombur, czempion Ereboru - wyposażony w ciężką zbroję krasnoludzką i cep.\n- Krasnolud Ori, czempion Ereboru - wyposażony w ciężką zbroję krasnoludzką i półtoraręczny topór.\n- Krasnolud Nori, czempion Ereboru - wyposażony w ciężką krasnoludzką zbroję, buzdygan i tarczę.\n- Krasnolud Dori, czempion Ereboru - wyposażony w ciężką zbroję krasnoludzką i dwuręczny buzdygan.\n- Krasnolud Oin, czempion Ereboru - wyposażony w ciężką zbroję krasnoludzką, miecz i tarczę.\n- Krasnolud Gloin, Mistrz Ereboru - wyposażony w ciężką krasnoludzką zbroję i dwuręczny topór\n- Bilbo Baggins, mistrz włamań - wyposażony w Jedyny Pierścień, mithrilowy płaszcz i Żądło','','the-champions-of-erebor','','','','The Champions of Erebor','','','',''),(1129,1,1,'None','','beorn--bear','','','','Beorn & Bear','','','',''),(1130,1,1,'None','','sauron-the-necromancer','','','','Sauron the Necromancer','','','',''),(1131,1,1,'None','','riddles-in-the-dark','','','','Riddles in the Dark','','','',''),(1132,1,1,'None','','bat-swarm','','','','Bat Swarm','','','',''),(1133,1,1,'None','','hunter-orcs-on-fell-wargs','','','','Hunter Orcs on Fell Wargs','','','',''),(1134,1,1,'None','','goblin-king--retinue','','','','Goblin King & Retinue','','','',''),(1135,1,1,'None','','hunter-orcs','','','','Hunter Orcs','','','',''),(1136,1,1,'None','','goblin-warriors','','','','Goblin Warriors','','','',''),(1137,1,1,'None','','fell-wargs','','','','Fell Wargs','','','',''),(1138,1,1,'None','','bolg-castellan-of-mount-gundabad','','','','Bolg, Castellan of Mount Gundabad','','','',''),(1139,1,1,'\n\n\n\n\n','','azog-foot--mounted','','','','Azog Foot & Mounted','','','',''),(1140,1,1,'None','','yazneg-foot--mounted','','','','Yazneg Foot & Mounted','','','',''),(1141,1,1,'None','','narzug-and-fimbul-hunter-orc-captains','','','','Narzug and Fimbul, Hunter Orc Captains','','','',''),(1142,1,1,'\n\n\n\n\n','','spiders-of-middle-earth','','','','Spiders of Middle-earth','','','',''),(1143,1,1,'None','','thrain-the-broken--gandlf-the-grey','','','','Thrain the Broken & Gandlf the Grey','','','',''),(1144,1,1,'\n\n\n\n\nMiddle-Earth SBG: Gondor at War to suplement, w którym na koniec \nTrzeciej Ery Gondor był największym z istniejących królestw Ludzi stojących\n przeciwko siłom Mordoru. Kiedy Sauron uwolnił swe mroczne siły to Gondor był \njedyną siłą stojącą przeciwko siłom hordy Orków i ich mrocznych sojuszników. I \nto pod bramami Białego Miasta, na Polach Pelennoru prawowity król powrócił na \nswój tron.\nMiddle-Earth SBG: Gondor at War to dodatek do gry Middle-earth SBG, \nktóry skupia się na wydarzeniach związanych z atakiem Sauronana Gondor. Książka\n zawiera w sobie informacje o Gondorze i Białym Mieście Minas Tirith, wraz z \nnowymi zasadami, scenariuszami, profilami i całym przebiegiem kampanii, która \nodtwarza jedne z największych bitew Trzeciej Ery.\nMiddle-Earth SBG: Gondor at War zawiera w sobie:– Historię Gondoru:\n Przewodnik po królestwie Gondoru od jego założenia przez Elendila do powrotu \nKróla Ellesara– Scenariusze: 29 narratywnych scenariuszy, od małych bitew do \nwielkich bitew, w których odtwarzasz najlepsze bitwy z tej wojny– Kampania \nGondor at War : System powiązania scenariuszy w jedną dużą kampanię– Armis: \nTaktyki i listy armii dla: sił Minas Tirith, Rohan, The Fiefdoms, Umarłych z \nDunharrow, Mordoru, Wężowej Hordy, Dalekiego Harad oraz Umbarskich Korsarzy.  \nZawiera też nowe profile dla Bohaterów.– Legendarne Legiony:  8 \nsamodzielnych list armii, odtwarzających główne siły Wojny o Pierścień: Rangers \nof Ithilien, The Grey Company, The Return of the King™, The Riders of Théoden, \nThe Men of the West, The Army of Gothmog, Grand Army of the South, and The Black \nGate Opens\n','','gondor-at-war','','','','Gondor at War','','','',''),(1145,1,1,'None','','rohan-house','','','','Rohan House','','','',''),(1146,1,1,'None','','rohan-watchtower-and-palisades','','','','Rohan Watchtower and Palisades','','','',''),(1147,1,1,'','','quest-of-the-ringbearer','','','','Quest of the Ringbearer','','','',''),(1148,1,1,'','','fall-of-the-necromancer','','','','Fall of the Necromancer','','','',''),(1149,1,1,'None','','goblin-town','','','','Goblin Town','','','',''),(1150,1,1,'None','','armies-of-the-lord-of-the-rings','','','','Armies of the Lord of the Rings','','','',''),(1151,1,1,'None','','armies-of-the-hobbit','','','','Armies of the Hobbit','','','',''),(1152,1,1,'None','','battle-companies','','','','Battle Companies','','','',''),(1153,1,1,'Figurka dostępna poprzez usługę Mail Order ze strony Games Workshop. \nPośredniczymy w składaniu takich zamówień. ','','lake-town-house','','','','Lake-Town House','','','',''),(1154,1,1,'None','','mines-of-moria','','','','Mines of Moria','','','',''),(1155,1,1,'Battle of osgiliath to zestaw figurkowy oparty na filmowej trylogii Władca Pierścieni. Zawiera on modele żołnierzy Gondoru i Minas Morgul w skali 28 mm, a także elementy terenu do zbudowania odtworzenia bitwy o Osgiliath - ważnego miasta na granicy Gondoru.\n\nW zestawie znajdują się modele 24 żołnierzy Gondoru oraz 14 żołnierzy Minas Morgul, w tym dowódcy obu stron konfliktu. Dodatkowo, w zestawie znajdują się elementy terenu, w tym ruiny mostu i wieże, które pomogą Ci odtworzyć bitwę w realistyczny sposób.','','m-e-sbg-battle-of-osgiliath','','','','M-E SBG: BATTLE OF OSGILIATH','','','',''),(1156,1,1,'None','','ruins-of-middle-earth','','','','Ruins of Middle-earth','','','',''),(1157,1,1,'None','','middle-earth-sbg-rules-manual-2022','','','','Middle-Earth SBG Rules Manual 2022','','','',''),(1158,1,1,'None','','gondor-mansion','','','','Gondor Mansion','','','',''),(1159,1,1,'None','','gondor-tower','','','','Gondor Tower','','','',''),(1160,1,1,'None','','gondor-ruins','','','','Gondor Ruins','','','',''),(1161,1,1,'None','','kingdom-of-bretonnia-dice','','','','Kingdom of Bretonnia Dice','','','',''),(1162,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Battle Pilgrims\" od Games Workshop. Ci fanatycy religijni pojawiają się wszędzie tam gdzie Rycerze Świętego Grala, wysławiając ich imię i asystując im w ich misjach. Kąpiąc się w blasku ich chwały przemierzają ziemie w procesjach podąrzając za swoimi idolami.','','kingdom-of-bretonnia-battle-pilgrims','','','','Kingdom of Bretonnia: BATTLE PILGRIMS','','','',''),(1163,1,1,'Zanurz się w epickim świecie Warhammer: The Old World z figurką \"Battle Stndard Bearer on Royal Pegasus\" od Games Workshop. Temu świątobliwemu Paladynowi przypada bardzo szlachetne zadanie dzierżenia sztandaru armii w trakcie prowadzenia szturmu na legione oponenta. Obraz tego wojownika determinuje wręcz do porwania sie do boju.','','kingdom-of-bretonnia-battle-standard-bearer-on-royal-pegasus','','','','Kingdom of Bretonnia: Battle Standard Bearer on Royal Pegasus','','','',''),(1164,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Bretonnian Questing Knights\" od Games Workshop. Ci rycerze są w trakcie wiecznej podróży poszukując Pani Jezior oraz magicznego reliktu Świętego graala. Na w jej trakcie są poddawani wielu próbą które mają określić ich chwalebność, dobroć i godność dostąpienia zaszczytu napicia się z graala, jednakże kiedy słychać głos fanfarów jednoczą się żeby walczy ku sprawie Bretonni.','','kingdom-of-bretonnia-bretonnian-questing-knights','','','','Kingdom of Bretonnia: Bretonnian Questing Knights','','','',''),(1165,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Bretonnian Questing Knights Command\" od Games Workshop. Ci podróżnicy to emerytowani Rycerze przemierzający świat w poszukiwaniu Świętego Graala, jednak kiedy przychodzi im wesprzeć Królestwo Bretonni jednoczą się i pełnią ważne role na polach bitwy. Mogą pełnić rolę polowego barda, chorążego a nawet i dowódcy oddziału jako że ich doświadczenie rycerskie jest nieocenione i godne zaufania.','','kingdom-of-bretonnia-bretonnian-questing-knights-command','','','','Kingdom of Bretonnia: Bretonnian Questing Knights Command','','','',''),(1166,1,1,'None','','kingdom-of-bretonnia-field-trebuchet-fw','','','','Kingdom of Bretonnia: Field Trebuchet (FW)','','','',''),(1167,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"GrailKnights\" od Games Workshop. Ci świątobliwi rycerze którzy napili się z Świętego Grala odmienili się. Ich aura rozjaśnia i napawa nadzieją, ciała rozbudowały się a ich życia wydłużyły wielokrotnie. Obowiązuje ich przysięga względem Grala, zarówno jak i względem wybranej damy, a tą przysięgę wierności może złamać tylko śmierć.','','kingdom-of-bretonnia-grail-knights','','','','Kingdom of Bretonnia: GRAIL KNIGHTS','','','',''),(1168,1,1,'None','','kingdom-of-bretonnia-grail-reliquae','','','','Kingdom of Bretonnia: Grail Reliquae','','','',''),(1169,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Knights of the Realm on foot\" od Games Workshop. Te rycerskie oddziały składają się z pomniejszych szlachciców wielkich rodów, dumnie je reprezentujacych na swoich pancerzach i sztandarach. Dzięki temu zestawowi można złożyć jeden wielki lub dwa mniejsze oddziały rycerskie na które będą przypadać po jednym grajku, championie i nosicielu sztandaru.','','kingdom-of-bretonnia-knights-of-the-realm-on-foot','','','','Kingdom of Bretonnia: Knights of the Realm on Foot','','','',''),(1170,1,1,'None','','kingdom-of-bretonnia-lord-on-royal-pegasus','','','','Kingdom of Bretonnia: Lord on Royal Pegasus','','','',''),(1171,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Lord with Great Weapon\" od Games Workshop. Ci mężni wojownicy to także szlachetni Paladyni, miłościwi Baronowie i majętni szlachcice pobłogosławieni przez wielką Panią którzy również dostąpili zaszczytu wypić z kielicha Świętego Graala. Dzierżący potężne greatswordy kroczą w towarzystwie sług którzy noszą im hełmy z świętymi insygniami. ','','kingdom-of-bretonnia-lord-with-great-weapon','','','','Kingdom of Bretonnia: LORD WITH GREAT WEAPON','','','',''),(1172,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Mounted Yeomen Command\" od Games Workshop. Ta dumna formacja kawaleryjska jest z regóły dowodzona przez strażników a towarzyszy im najczęściej jeden grajek dla podniesienia morali w trakcie szarży. Do tego na polwu walki, dzierżą oni sztandar miasta.','','kingdom-of-bretonnia-mounted-yeomen-command','','','','Kingdom of Bretonnia: MOUNTED YEOMEN COMMAND','','','',''),(1173,1,1,'PEGASUS KNIGHTS to zestaw trzech figurek najodważniejszych z bretońskich rycerzy wzbijających się w przestworza na grzbietach majestatycznych skrzydlatych rumaków, atakując wrogów lancami.','','kingdom-of-bretonnia-pegasus-knights','','','','Kingdom of Bretonnia: Pegasus Knights','','','',''),(1174,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Prophetesses of the Lady\" od Games Workshop. Te wychowywane w zakonach swojej Bogini niewiasty to najznamienitsze maginie Królestw Bretonni. Obeznane w potężnych arcanach na polach bitwy stanowią wielkie wsparcie jako iż ich magia może nie tylko krzywdzić wroga ale również ratować szlachetnych Rycerzy i wojowników. Te potężne maginie występują w wariantach na koniu oraz pieszo aby w pełni wyposażyć swoje oddziały o wsparcie którego potrzebują.','','kingdom-of-bretonnia-prophetesses-of-the-lady','','','','Kingdom of Bretonnia: Prophetesses of the Lady','','','',''),(1175,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Squires\" od Games Workshop. Ci giermkowie podążają i osłaniają swoich rycerskich panów licząc chociażby na awansowanie swojego statusu. Uzbrojeni w długie łuki świetnie nadają się do wykonywania operacji zwiadowczych ale też i sabotażu czy osłabienia jednostek oponenta dla rycerskiej kawalerii. Każda z postaci giermka ma inną pozę i pięknie się prezentują u boku swoich Panów.','','kingdom-of-bretonnia-squires','','','','Kingdom of Bretonnia: Squires','','','',''),(1176,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Squires Command\" od Games Workshop. Ci giermkowie świetnie odnajdują się w roli zwiadowców, obserwując i uprzedzając o nadchodzących zagrożeniach swoich rycerskich Panów. Choć nie tak prestiżowi jak rycerze, też tworzą swoje własne oddziały dowodzone przez kapitanów i wzbogacone o rolę grajków oraz chorążych.','','kingdom-of-bretonnia-squires-command','','','','Kingdom of Bretonnia: Squires Command','','','',''),(1177,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"The Green Knight\" od Games Workshop. Ten Legendarny owiany tajemnicą rycerz to kluczowa osobistość dla kultury Królestw Bretoni. Uświęcony obrońca samej wielkiej Pani jeziora ma przybyć na swym mistycznym rumaku zawsze kiedy Królestwo będzie znajdować się w okresach najcięższych z prób.','','kingdom-of-bretonnia-the-green-knight','','','','Kingdom of Bretonnia: THE GREEN KNIGHT','','','',''),(1178,1,1,'None','','kingdom-of-bretonnia-transfer-sheet','','','','Kingdom of Bretonnia: Transfer Sheet','','','',''),(1179,1,1,'The chivalrous knights of Bretonnia and their peasant followers march to battle in this set, with 76 plastic Citadel miniatures – 75 of them returning classics, with a brand new Lord of Bretonnia on Royal Pegasus leading them – joined by the core rulebook, a reference sheet, dice, templates, measuring sticks ,and a transfer sheet.','','the-old-world-core-set--kingdom-of-bretonnia','','','','The Old World Core Set – Kingdom of Bretonnia','','','',''),(1180,1,1,'Rozszerz swoją armię poza listę zawartą w książce Forces of Fantasy dzięki Arcane Journal: Dwarfen Mountain Holds - 48-stronicowy dodatek zawierający nowe zasady, tło fabularne i scenariusze. Znajdziesz w nim profile trzech znanych postaci - z których wszystkie trzy były również na wolności podczas Ery Karla Franza - oraz szereg jednostek specjalnych, w tym legendarnego Goblin Hewera i więcej opcji Dogs of War.\n','','arcane-journal-dwarfen-mountain-holds','','','','Arcane Journal: Dwarfen Mountain Holds','','','',''),(1181,1,1,'None','','dwarfen-mountain-holds-anvil-of-doom','','','','Dwarfen Mountain Holds: Anvil of Doom','','','',''),(1182,1,1,'Stwórz podwaliny legendarnej armii z batalionem pełnym brodatych wojowników. Solidna linia bojowa 32 krasnoludzkich wojowników jest wspierana przez kolejnych 32 Quarrelerów, których można również zbudować jako dzierżących broń Thundererów, podczas gdy dwa Gyrocoptery szybują nad głowami.','','dwarfen-mountain-holds-battalion','','','','Dwarfen Mountain Holds: Battalion','','','',''),(1183,1,1,'None','','dwarfen-mountain-holds-bugmans-cart','','','','Dwarfen Mountain Holds: Bugman\'s Cart','','','',''),(1184,1,1,'None','','dwarfen-mountain-holds-doomseekers','','','','Dwarfen Mountain Holds: Doomseekers','','','',''),(1185,1,1,'None','','dwarfen-mountain-holds-dwarf-bolt-thrower','','','','Dwarfen Mountain Holds: Dwarf Bolt Thrower','','','',''),(1186,1,1,'None','','dwarfen-mountain-holds-dwarf-cannon--organ-gun','','','','Dwarfen Mountain Holds: Dwarf Cannon & Organ Gun','','','',''),(1187,1,1,'None','','dwarfen-mountain-holds-dwarf-engineers','','','','Dwarfen Mountain Holds: Dwarf Engineers','','','',''),(1188,1,1,'None','','dwarfen-mountain-holds-dwarf-gyrocopters','','','','Dwarfen Mountain Holds: Dwarf Gyrocopters','','','',''),(1189,1,1,'Ta jednostka ciężko opancerzonych wojowników to doskonały wybór na obsadzenie pierwszychlini frontu. Ciężko opancerzeni i uzbrojneni w bojowe młotybyli szkoleni by móc walczyć nawet pod najcięższym osrzałem.Na zestaw składa się 17potęrznych wojowników, jeden kapitan, jeden bębniarz i wojownik dzierżący sztandar bojowy napawający dumą i determinacją.','','dwarfen-mountain-holds-dwarf-hammerers','','','','Dwarfen Mountain Holds: Dwarf Hammerers','','','',''),(1190,1,1,'Ten ddział krasnoludów uzbrojonych od stóp do głów to potęzne jednostki z którychżelazo wręcz obwisa. uzbrojeni w topory, mloty i tarcze niosą pogrom w pierwzejlini pola bitwy. Auzbrojeni alternatywnie w dziala i armaty mogą zalewać wroga ciężkim żelazem. Te dwa oddzialy po 10 jednostek to obowiązkowy dodatek do potężnej i ciężkiozbrojnej armi krasnoludzkiej. ','','dwarfen-mountain-holds-dwarf-ironbreakers','','','','Dwarfen Mountain Holds: Dwarf Ironbreakers','','','',''),(1191,1,1,'Ci zasłużeni w boju Króle krasnoludzkich frakcji przemierzają przez bitewne pola na bojowych tarczach podkreślających ich status, ale również ułatwiając zadanie ścinania wrogów. Prowadzeni przez swoją zasłużoną straż uzbrojoną w szeroki wachlarz broni wprost z rasnoludzkich kuźni sieją pogrom na polach bitew.','','dwarfen-mountain-holds-dwarf-lords-with-shieldbearers','','','','Dwarfen Mountain Holds: Dwarf Lords with Shieldbearers','','','',''),(1192,1,1,'Ta klasyczna jednostka dystansowa to uzupełnienie twojej armi mężnych wojowników o lżej opancerzonych kuszników lub alternatywnie strzelców wyborowych. Szkoleni ściśle do walki dystansowej, motywowani są na polu bitwy przez bębniarzy do marszu w oddziałach po 16, aby z punktów widokowych zalewać wroga gradem bełtów lub kul.','','dwarfen-mountain-holds-dwarf-quarrellers','','','','Dwarfen Mountain Holds: Dwarf Quarrellers','','','',''),(1193,1,1,'None','','dwarfen-mountain-holds-dwarf-slayers','','','','Dwarfen Mountain Holds: Dwarf Slayers','','','',''),(1194,1,1,'None','','dwarfen-mountain-holds-dwarf-slayers-command','','','','Dwarfen Mountain Holds: Dwarf Slayers Command','','','',''),(1195,1,1,'Ta klasyczna jednostka siepaczy i rębczy to oddzały 16 wojowników wyposarzonych w solidne pancerze i topory bitewne. Ci mężni wojownicy tobaza dla twojej armi krasnoludów którą uzupełnisz pole bitwy i przeciwnika do rozważnego podejmowania decyzji strategicznych.','','dwarfen-mountain-holds-dwarf-warriors','','','','Dwarfen Mountain Holds: Dwarf Warriors','','','',''),(1196,1,1,'None','','dwarfen-mountain-holds-flame-cannon','','','','Dwarfen Mountain Holds: Flame Cannon','','','',''),(1197,1,1,'None','','dwarfen-mountain-holds-goblin-hewer','','','','Dwarfen Mountain Holds: Goblin-hewer','','','',''),(1198,1,1,'None','','dwarfen-mountain-holds-grudge-thrower','','','','Dwarfen Mountain Holds: Grudge Thrower','','','',''),(1199,1,1,'None','','dwarfen-mountain-holds-imperial-dwarf-command','','','','Dwarfen Mountain Holds: Imperial Dwarf Command','','','',''),(1200,1,1,'None','','tomb-kings-of-khemri-dice','','','','Tomb Kings of Khemri Dice','','','',''),(1201,1,1,'Zanurz się w epickim świecie Warhammer The Old World z figurką \"Liche Priest\" od Games Workshop. Ci słudzy Królów Krypt mają kluczową rolę w każdej z krypt, poniewarz to oni odpowiadają za obudzenie swojego króla oraz przygotowanie armi do bitwy. Dzierżą oni równierz najważniejszy z sekretów, czyli tajemnice wiecznego nieżycia. to oni sprowdzają dusze z wymiaru dusz i przypisują je do nowo spreparowanyh ciał.','','tomb-kings-of-khemri-liche-priest','','','','Tomb Kings of Khemri: LICHE PRIEST','','','',''),(1202,1,1,'NECROSPHINX to dziwaczny i przerażający konstrukt, będący połączeniem mitycznych bestii, które prześladują podziemne światy Nehekharan. Dzięki temu plastikowemu zestawowi możesz dodać jednego z tych potworów do swojej armii.','','tomb-kings-of-khemri-necrosphinx','','','','Tomb Kings of Khemri: Necrosphinx','','','',''),(1203,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Necrotect\" od Games Workshop. Ci nieśmiertelni to najcenniejszy element grona nieumarłych rzemieślników. Wyposażeni w narzędzia architektoniczne, bat i wizję samego Nehekhara, zarządzają oni robotnikami i sprawą odbudowy dawnego Królestwa Khemri.','','tomb-kings-of-khemri-necrotect','','','','Tomb Kings of Khemri: NECROTECT','','','',''),(1204,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Prince Apophas\" od Games Workshop. Ten przeklęty książę wraca z grobu w jeszcze bardziej przerażającej postaci niż był za życia. Jego ciała już nie ma, jedyne co po nim zostało to wysuszona czaszka i sztylet który odpowiada za jego zgubę (polecam zainteresować się lore tej postaci). W przeklętym stanie w jakim się znajduje jego ciało stanowi horda skarabeuszy którą może używać do woli żeby dalej siać terror i pożoge w sercach wrogów.','','tomb-kings-of-khemri-prince-apophas','','','','Tomb Kings of Khemri: PRINCE APOPHAS','','','',''),(1205,1,1,'None','','tomb-kings-of-khemri-screaming-skull-catapult-fw','','','','Tomb Kings of Khemri: Screaming Skull Catapult (FW)','','','',''),(1206,1,1,'SEPULCHRAL STALKERS to przerażające konstrukty, które czają się pod piaskami i wyłaniają się, by zabijać tych, którzy zagrażają granicom Nehekhary.','','tomb-kings-of-khemri-sepulchral-stalkers','','','','Tomb Kings of Khemri: Sepulchral Stalkers','','','',''),(1207,1,1,'Zanurz się w epickim świecie Warhammer The old World z figurką \"Settra the Impershable\" od Games Workshop. Ten wieczny tyran ma narzucony sobie jeden cel, podbić i zneiwolić sobie wszystkie istniejące rasy, narody frakcje i królestwa. Jego głód kontroli jest wieczny i nienasycony, za to ziemie które \"jeszcze\" nie należą do niego obszerne. Dla tego ten niespokojny król uzbrojony w najznamienitszy pancerz i Rydwan Bogów pociągany prze cztery konie szkielety wyrusza na wyprawę krwawą i plugawą aby zawładnąć sobie świat.','','tomb-kings-of-khemri-settra-the-imperishable','','','','Tomb Kings of Khemri: Settra The Imperishable','','','',''),(1208,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Tomb King on Chariot\" od Games Workshop. Ci dawno martwi lordowie żywią dalej tą samą chciwość i potrzebę odzyskania dawnego bogactwa i splendoru. Dawna śmierć nie powstrzymuje ich również przed chęcią poszerzania swoim majętności. Dosiadując rydwan osobiście bierze udział w rajdach ku ekspansji swoich ziem przewodząc wielkim armią nieumarłych szkieletów. Zestaw pozwala również na złorzenie wojowników w rydwanie oraz osobno Króla krypty pieszo. ','','tomb-kings-of-khemri-tomb-king-on-chariot','','','','Tomb Kings of Khemri: Tomb King on Chariot','','','',''),(1209,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Tomb King on the Necrolith Bone Dragon\" od Games Workshop. Królowie krypt to od dekad martwi dawni władcy Nehekary. Przywróceni do życia przez ich podwładnych mają możliwość ponownie panować swoimi kryptami i rozszerzać swoje strefy wpływów. Nieliczni i najdumniejsi z nich mają możliwość okiełznać zapał nieumarłych besti jakimi sę nekrotyczne smoki, przerażające i plugawe bestie zdolne do dziesiątkowania armii samą swoją obecnością.','','tomb-kings-of-khemri-tomb-kingliche-priest-on-necrolith-bone-dragon','','','','Tomb Kings of Khemri: Tomb King/Liche Priest on Necrolith Bone Dragon','','','',''),(1210,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Unshabti with Greatbow\" od Games Workshop. Ci strażniy zaklęci w statuy zawsze są gotowi na wezwanie do boju w postaci ożywienia przez kapłanów krypt. Aparycją, przypominający bogów i wyposrzeni w wielkie bojowe łuki prowadzą zatrważajacy ostrzał na wroga którego ciężko uniknąć.','','tomb-kings-of-khemri-ushabti-with-greatbows','','','','Tomb Kings of Khemri: Ushabti with Greatbows','','','',''),(1211,1,1,'Zanurz się w epickim świecie Warhammer The old World \"Ushabti witch Ritual Blades\" od Games Workshop. Ci potężni strażnicy stoją zamrożeni w posągi w korytarzach piramid królewskich, żeby w razie potrzeby Kapłani mogli ich przywrócić do życia i boju. Wyglądem przypominają bogów, a wyposażeni w glewiopodobne ostrza rytualne są niezawodną jednostką obrony królów krypt.','','tomb-kings-of-khemri-ushabti-with-ritual-blades','','','','Tomb Kings of Khemri: Ushabti with Ritual Blades','','','',''),(1212,1,1,'None','','orc--goblin-tribes-badlands-ogre-bulls','','','','Orc & Goblin Tribes: Badlands Ogre Bulls','','','',''),(1213,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Common Trolls\" od Games Workshop. Te silne choć niezbyt inteligentne kreatury stanowią dobry dodatek do armii. Wiecznie głodne przez co również wiecznie rozwścieczone pochłona wszystko co z mięsa aż po kamienie czy drzewa. Ich siła to ich atut, dzięki któremu są niemalże niepowstrzymani.','','orc--goblin-tribes-common-trolls','','','','Orc & Goblin Tribes: Common Trolls','','','',''),(1214,1,1,'None','','orc--goblin-tribes-doom-diver-catapult','','','','Orc & Goblin Tribes: Doom Diver Catapult','','','',''),(1215,1,1,'None','','orc--goblin-tribes-goblin-bolt-throwa','','','','Orc & Goblin Tribes: Goblin Bolt Throwa','','','',''),(1216,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Goblin Bosses\" od Games Workshop. Te gobliny znają słabość swojej postury fizycznej co pozwala im na dostosowanie swojej taktyki tak by pokonać wroga wchodząc z nim w minimalny kontakt. są przebiegli, cwani i wiedza gdzie uderzać żeby zabolało, to śmiertelnie skuteczni liderzy dla oddziałów swoich pobratymców. ','','orc--goblin-tribes-goblin-bosses','','','','Orc & Goblin Tribes: Goblin Bosses','','','',''),(1217,1,1,'None','','orc--goblin-tribes-goblin-nasty-skulkers','','','','Orc & Goblin Tribes: Goblin Nasty Skulkers','','','',''),(1218,1,1,'Zanurz się w epickim świecie Warhammer The Old World z zestawem \"Goblin Rock Lobber\" od Games Workshop. Orkowa maszyneria wojenna jest prowizoryczna, ale spełnia swoje wymagania. Działa, wybija kamienie które rozbijają fortyfikacje przebijając się przez niebiosa a to najważniejsze.','','orc--goblin-tribes-goblin-rock-lobber','','','','Orc & Goblin Tribes: Goblin Rock Lobber','','','',''),(1219,1,1,'None','','orc--goblin-tribes-goblin-shaman','','','','Orc & Goblin Tribes: Goblin Shaman','','','',''),(1220,1,1,'None','','orc--goblin-tribes-goblin-shamans','','','','Orc & Goblin Tribes: Goblin Shamans','','','',''),(1221,1,1,'None','','orc--goblin-tribes-goblin-wolf-chariot','','','','Orc & Goblin Tribes: Goblin Wolf Chariot','','','',''),(1222,1,1,'None','','orc--goblin-tribes-goblin-wolf-rider-bosses','','','','Orc & Goblin Tribes: Goblin Wolf Rider Bosses','','','',''),(1223,1,1,'None','','orc--goblin-tribes-night-goblin-bosses','','','','Orc & Goblin Tribes: Night Goblin Bosses','','','',''),(1224,1,1,'None','','orc--goblin-tribes-night-goblin-shamans','','','','Orc & Goblin Tribes: Night Goblin Shamans','','','',''),(1225,1,1,'None','','orc--goblin-tribes-orc-big-uns','','','','Orc & Goblin Tribes: Orc Big \'Uns','','','',''),(1226,1,1,'None','','orc--goblin-tribes-orc-big-uns-command','','','','Orc & Goblin Tribes: Orc Big ‘Uns Command','','','',''),(1227,1,1,'None','','orc--goblin-tribes-orc-boyz-mob','','','','Orc & Goblin Tribes: Orc Boyz Mob','','','',''),(1228,1,1,'None','','orc--goblin-tribes-orc-shaman','','','','Orc & Goblin Tribes: Orc Shaman','','','',''),(1229,1,1,'None','','orc--goblin-tribes-orc-shamans','','','','Orc & Goblin Tribes: Orc Shamans','','','',''),(1230,1,1,'None','','orc--goblin-tribes-snotling-mobs','','','','Orc & Goblin Tribes: Snotling Mobs','','','',''),(1231,1,1,'None','','orc--goblin-tribes-snotling-pump-wagon','','','','Orc & Goblin Tribes: Snotling Pump Wagon','','','',''),(1232,1,1,'None','','warriors-of-chaos-dice-set','','','','Warriors of Chaos Dice Set','','','',''),(1233,1,1,'None','','warriors-of-chaos-champion-of-chaos','','','','Warriors of Chaos: Champion of Chaos','','','',''),(1234,1,1,'None','','warriors-of-chaos-champion-of-chaos-with-additional-hand-weapon','','','','Warriors of