iors of Chaos: Dragon Ogres','','','',''),(1251,1,1,'None','','warriors-of-chaos-marauder-horsemen','','','','Warriors of Chaos: Marauder Horsemen','','','',''),(1252,1,1,'','','citadel-25mm-x-50mm-rectangular-bases','','','','CITADEL 25MM X 50MM RECTANGULAR BASES','','','',''),(1253,1,1,'','','citadel-40mm-x-60mm-rectangular-bases','','','','CITADEL 40MM X 60MM RECTANGULAR BASES','','','',''),(1254,1,1,'','','citadel-60mm-x-100mm-rectangular-bases','','','','CITADEL 60MM X 100MM RECTANGULAR BASES','','','',''),(1255,1,1,'None','','fortified-manor-of-the-empire','','','','Fortified Manor of the Empire','','','',''),(1256,1,1,'None','','modular-movement-trays','','','','Modular Movement Trays','','','',''),(1257,1,1,'','','the-old-world-dice-set','','','','The Old World Dice Set','','','',''),(1258,1,1,'None','','walls-and-fences','','','','Walls and Fences','','','',''),(1259,1,1,'Ty i twoi przyjaciele wcielacie się w grupę bohaterów poszukujących sławy, skarbów i chwały na ulicach Ulfenkarn. Tylko współpracując ze sobą i równoważąc swoje mocne strony i umiejętności, możesz mieć nadzieję na przetrwanie. Z każdą podróżą dowiesz się więcej o pilnie strzeżonych tajemnicach Przeklętego Miasta i napotkasz więcej morderczych nieumarłych, którzy je nawiedzają .... W tę grę można grać solo lub z maksymalnie 3 znajomymi. Każda podróż do Przeklętego Miasta to wyścig z czasem, ponieważ siły Wilka Radukara rosną w siłę, gdy zapada noc. Pod koniec każdej podróży do Ulfenkarn gracze są zabierani przez sterowiec Adamant, aby leczyć rany, zdobywać doświadczenie i planować przyszłe wyprawy. Tylko doświadczeni bohaterowie z najlepszym uzbrojeniem mogą pokonać Radukara i uwolnić Ulfenkaran od klątwy nieumarłych. Radukar Wilk uratował miasto w jego najczarniejszej godzinie, ale jego dobroć nie trwała długo. Zdobywając Ebonową Cytadelę, otoczył się potworami, nieumarłymi i innymi stworzeniami ciemności, tworząc swój Dwór Pożądania. Przez pewien czas panował pokój. Potem nadeszło Nieśmiałe Trzęsienie Nekro i Wilk został napełniony mroczną mocą. Wypadając ze swojego zamku, Radukar i jego dwór wpadli w morderczy szał. Niektórych uznano za godnych Pocałunku Krwi i sami zostali przemienieni w wampiry - niezliczeni zostali pozostawieni jako zwłoki rozrzucone na ulicach. Miasto stoi teraz na krawędzi całkowitej zagłady. \n\nModele\n60x Plastikowe, wciskane figurki Citadel, w tym:\n- 8x Modeli Bohaterów: Emelda Braskov, Jelsen Darrock, Dagnai Holdenstock, Qulathis the Exile, Glaurio ven Alten III, Octren Glimscry, Cleona Zeitengale i Brutogg Corpse-Eater\n- 42x wrogie modele: Radukar Wilk, Torgillius Szambelan, Kapitan Straży Halgrim, Gorslav Grabarz, Vargskyr, 3x Vyrkos Zrodzony z Krwi, 2x Kosargi Straż Nocna, 10x Deadwalker Zombie, 10x Ulfenwatch, 6x Corpse Rats i 6x Bat Swarms.\n- 10x Tajemnicze przedmioty: 2x Gnawbone Strays, 2x Diregoyles, 2x Gravestones, 2x Crows i 2x Gibbets.\n\nKsiążki\n- 1x 40-stronicowy podręcznik zasad\n- 1x 56-stronicowa księga zadań\n- 1x 16-stronicowa broszura Warhammer Age of Sigmar Warscrolls\n\n\nZawartość gry\nPudełko zawiera wszystko, co potrzebne do przygotowania i rozegrania partii w Cursed City, w tym:\n-138x kart\n- 1x tajną kopertę Ulfenkarn in Peril\n- 180 żetonów, liczników i znaczników\n- 20 kafelków planszy do gry\n- 1x kafelek strefy zrzutu\n- 1x kafelek strefy wydobycia\n- 1x plansza podniebnego statku\n- 28 kości','','cursed-city---warhammer-quest','','','','Cursed City - Warhammer Quest','','','',''),(1260,1,1,'GETTING STARTED WITH WARHAMMER 40.000 to wszystko, czego potrzebujesz, aby zacząć grę w Warhammer 40 000, to czasopismo jest idealnym zakupem dla początkującego, który chciałby zagłębić się w hobby zbierania, budowania, malowania i gry. Podobnie jak Getting Started with Age of Sigmar, ten magazyn jest doskonałym wstępem do Warhammer 40000. Zawiera opis świata, poradnik jak malować, wstęp do zasad do gry. \n','','getting-started-with-warhammer-40000-10-ed','','','','Getting Started with Warhammer 4000