rrain Set','','','',''),(1294,1,1,'\n    Warhammer 40000 - Starter Set to idealny sposób na rozpoczęcie przygody w mrocznym, futurystycznym uniwersum pełnym bitew i intryg. Ten zestaw od Games Workshop zawiera wszystko, czego potrzebujesz, aby zacząć grać w popularną grę bitewną Warhammer 40000.\n  ','','warhammer-40000---starter-set','','','','Warhammer 40000 - Starter Set','','','',''),(1295,1,1,'\n    Warhammer 40000: Introductory Set to idealny zestaw dla początkujących, którzy chcą odkryć świat wojennych zmagań i strategicznej rozgrywki. Ten zestaw od Games Workshop zapewnia wszystko, czego potrzebujesz, aby zanurzyć się w epickim uniwersum Warhammer 40000.\n  ','','warhammer-40000---introductory-set','','','','Warhammer 40000 - Introductory Set','','','',''),(1296,1,1,'\n    Warhammer 40000: Ultimate Starter Set to zdecydowany zestaw dla tych, którzy pragną zanurzyć się w ekscytującym świecie wojennych zmagań i strategicznych bitew. Ten zestaw od Games Workshop zawiera wszystko, czego potrzebujesz, aby rozpocząć epickie przygody w uniwersum Warhammer 40000.\n  ','','warhammer-40000---ultimate-starter-set','','','','Warhammer 40000 - Ultimate Starter Set','','','',''),(1297,1,1,'None','','space-marines-infernus-marines--paint-set','','','','Space Marines: Infernus Marines + Paint Set','','','',''),(1298,1,1,'None','','warhammer-40000-paint-and-tools-set','','','','Warhammer 40,000: Paint and Tools Set','','','',''),(1299,1,1,'None','','warhammer-40000-tyranid-paint-set','','','','Warhammer 40,000: Tyranid Paint Set','','','',''),(1300,1,1,'None','','aos-paints--tools-2021','','','','AoS Paints + Tools 2021','','','',''),(1301,1,1,'Zestaw szesnastu kości o tematyce Grand Alliance.\nCały zestaw zawiera kości K6','','grand-alliance-destruction-dice-set','','','','Grand Alliance Destruction Dice Set','','','',''),(1302,1,1,'None','','shattered-dominion-25mm--32mm-round-bases','','','','Shattered Dominion: 25mm & 32mm Round Bases','','','',''),(1303,1,1,'None','','shattered-dominion-40mm--65mm-round-bases','','','','Shattered Dominion: 40mm & 65mm Round Bases','','','',''),(1304,1,1,'None','','shattered-dominion-large-base-detail-kit','','','','Shattered Dominion: Large Base Detail Kit','','','',''),(1305,1,1,'None','','shattered-dominion-60mm--90mm-oval-bases','','','','Shattered Dominion: 60mm & 90mm Oval Bases','','','',''),(1306,1,1,'Zestaw szesnastu kości o tematyce Grand Alliance.\nCały zestaw zawiera kości K6','','grand-alliance-chaos-dice-set','','','','Grand Alliance Chaos Dice Set','','','',''),(1307,1,1,'None','','warhammer-age-of-sigmar---skaven-paint-set','','','','Warhammer Age of Sigmar - Skaven Paint Set','','','',''),(1308,1,1,'Zestaw szesnastu kości o tematyce Grand Alliance.\nCały zestaw zawiera kości K6','','grand-alliance-death-dice-set','','','','Grand Alliance Death Dice Set','','','',''),(1309,1,1,'Ten Squig to idealna maskotka dla twojej bandy Gloomspite Gitz. Wykonany w 100% z poliestru, ten pluszowy, zębaty i hałaśliwy stwór ma około 18 cm wysokości.','','tomy-gnasha-squig-plush','','','','TOMY: Gnasha-squig Plush','','','',''),(1310,1,1,'Idealna maskotka dla każdego Waaagh!, ten malutki inżynier grot ma około 17 cm wysokości i jest wykonany w 100% z poliestru. ','','tomy-spanna-grot-plush','','','','TOMY: Spanna Grot Plush','','','',''),(1311,1,1,'Ta miękka zabawka jest idealnym pluszowym zwierzakiem dla fanów Stormcast Eternals. Wykonany w 100% z poliestru, ten lojalny i bardzo dobry Gryph-hound jest gotowy do walki, dumnie opancerzony we wspaniały hełm, uprząż i złoty napierśnik.\n\nOkoło 16 cm wysokości.','','tomy-sacrosanct-gryph-hound-plush','','','','TOMY: Sacrosanct Gryph-hound Plush','','','',''),(1312,1,1,'None','','warhammer-age-of-sigmar-paint-and-tools-set','','','','Warhammer Age of Sigmar Paint and Tools Set','','','',''),(1313,1,1,'None','','warhammer-age-of-sigmar---stormcast-eternals-paint-set','','','','Warhammer Age of Sigmar - Stormcast Eternals Paint Set','','','',''),(1314,1,1,'None','','tomy-watcher-in-the-dark-plush','','','','TOMY: Watcher in the Dark Plush','','','',''),(1315,1,1,'None','','tomy-ripper-plush','','','','TOMY: Ripper Plush','','','',''),(1316,1,1,'None','','tomy-servo-skull-plush','','','','TOMY: Servo-skull Plush','','','',''),(1317,1,1,'None','','tomy-purple-sun-plush','','','','TOMY: Purple Sun Plush','','','',''),(1318,1,1,'None','','tomy-sassy-nurgling-plush','','','','TOMY: Sassy Nurgling Plush','','','',''),(1319,1,1,'None','','age-of-sigmar-gaming-book','','','','Age of Sigmar Gaming Book','','','',''),(1320,1,1,'\n\n\n\nArcymag Teclis prowadzi swoje zastępy Luminethów przeciwko Wielkiemu \nNekromancie w bitwie o ocalenie królestw. Nagash zapoczątkował erę nawiedzeń w \nKrainach Śmiertelników. Dopiero teraz, gdy godzina jest najciemniejsza, jaśnieje \nświatło Lumineth. Teclis,bóg magii, opuszcza swoje ukochane królestwo Hysh, aby \nrozpocząć wojnę z Imperium Ossiarch - ale czyniąc to, wywołuje kontratak, który \nmoże doprowadzić do zniszczenia jego suwerennych ziem. Kto wygra ten ostateczny \npojedynek tajemnej mocy?Następna wciągająca część sagi Broken Realms \nprzenosi się z Morathi do Arcymaga Teclisa i jego władców Lumineth Realm, którzy \nrozpoczynają ryzykowną wyprawę przeciwko Wielkiemu Nekromancie. Niszcząca \nhistoria będzie miała ogromne konsekwencje dla kilku frakcji, w tym dla władców \nKrólestwa Lumineth, Maggotkin of Nurgle i sił śmierci - po raz kolejny \nzmieniając równowagę sił w Krainach Śmiertelników. Znajdziesz nowe sposoby gry w \nWarhammer Age of Sigmar, a także zasady dotyczące nowych jednostek, batalionów \nwarscroll i nie tylko.W tej 152-stronicowej książce w twardej oprawie \nznajdziesz:- Ekscytująca opowieść o niebezpiecznej kampanii władców \nKrólestwa Lumineth przeciwko okopanym legionom śmierci - zilustrowana \noszałamiającą nową grafiką.- Nowe zasady dla władców Królestwa Lumineth, w \ntym zbiór jednostek ze Świątyni Hurakan. Ta książka zawiera pełny zestaw zasad i \ntła dla każdej nowo wydanej jednostki, więc może być używana wraz z pierwszym \nwydaniem Battletome: Lumineth Realm-lords.- Zdolności lojalności dla miast \nSigmar i Lumineth Realm-lords, reprezentujących Xintil, Wolne Miasto w Hysh, a \ntakże Wielkie Narody Alumnia i Helon.- Rules for Streets of Death - bitwy w \nciasnych miastach w Krainach Śmierci.- Sześć planów bitewnych i zasad Realms \nof Battle, które pomogą ci odtworzyć wydarzenia i lokalizacje z historii.- \nZestaw batalionów warscroll i zasad ulepszających Twoje Miasta Sigmara, \nMaggotkin of Nurgle, Lumineth Realm-lords, Flesh-eater Courts i Ossiarch \nBonereaper\n','','broken-realms-teclis','','','','Broken Realms: Teclis','','','',''),(1321,1,1,'None','','broken-realms-kragnos','','','','Broken Realms: Kragnos','','','',''),(1322,1,1,'None','','dawnbringers-book-v-shadow-of-the-crone','','','','Dawnbringers: Book V: Shadow of the Crone','','','',''),(1323,1,1,'None','','warhammer-age-of-sigmar--skaventide-hardback','','','','Warhammer Age of Sigmar – Skaventide (Hardback)','','','',''),(1324,1,1,'\n\n\n\n\nTen zestaw zawiera 13 \nnastępujących zaklęć, w tym 17 miniaturek , z których każde ma własną \npodstawę:\n- \n1x Purple Sun of Shyish- \n1x Ravenak’s Gnashing Jaws- \n1x Suffocating Gravetide- \n1x Quicksilver Swords- \n1x Aethervoid Pendulum- \n1x Chronomantic Cogs- \n1x Burning Head- \n1x Malevolent Maelstrom- \n1x Prismatic Palisade- \n1x Emerald Lifeswarm- \n1x Umbral Spellportal (2 miniatures are used to represent this endless \nspell)- \n1x Soulsnare Shackles (3 miniatures are used to represent this endless \nspell)- \n1x Geminids of Uhl-Ghysh (2 miniatures are used to represent this endless \nspell)\n\nZESTAW \nNIE ZAWIERA KSIĄŻKI\n','','malign-sorcery---age-of-sigmar','','','','Malign Sorcery - Age of Sigmar','','','',''),(1325,1,1,'Zawartość zestawu: ','','forbidden-power-spells---age-of-sigmar','','','','Forbidden Power Spells - Age of Sigmar','','','',''),(1326,1,1,'None','','timeworn-ruins---dominion-of-sigmar','','','','Timeworn Ruins - Dominion of Sigmar','','','',''),(1327,1,1,'Spearhead to nowy tryb gry do Warhammer Age of Sigmar, zapewniający błyskawiczne rozgrywki pełne taktycznej głębi. To zgrabne pudełko zawiera wszystko, czego potrzebujesz, aby rozpocząć grę w Spearhead z własnymi kolekcjami. Otrzymujesz wlew z czterema elementami terenu i zatrzaskowymi linijkami zasięgu 3\" i 6\", dwustronną planszę do gry z nadrukowanymi celami obejmującymi Aqshy po jednej stronie i Ghyran po drugiej, a także talię Twist dla każdej strony i dwie identyczne talie taktyk bitewnych dla każdego gracza.\n\nPrzetłumaczono z DeepL.com (wersja darmowa)','','spearhead-fire-and-jade-gaming-pack','','','','Spearhead: Fire and Jade Gaming Pack','','','',''),(1328,1,1,'None','','warhammer-age-of-sigmar--starter-set','','','','Warhammer Age of Sigmar – Starter Set','','','',''),(1329,1,1,'\n\n\n\n\n','','krondspine-incarnate-of-ghur','','','','Krondspine Incarnate of Ghur','','','','');
